INSERT INTO `me_guidline_content` VALUES (1,1,1,1389078875,0,0,'Bet on a sports event but by no means on the odds which can be both too low if an eventâs result is evident or too high in case of a bookmakerâs mistake or bias in the informational realm.'),(2,1,2,1389079062,0,0,'Be ready to lose because itâs impossible both to win and lose constantly. Despondency and disappointment canât be your friends in the betting issue.'),(3,1,3,1389079081,0,0,'The second rule is tightly linked to the third one â you may lose everything in a day but you never can win everything immediately.'),(4,1,4,1389079090,0,0,'Among the events of a gaming day choose only one, of the result of which you are confident most. As the player always knows at least one result, but canât separate it from a series of gaming events, we suggest relying on our advice: place 1 ordinary on a gaming day and one 1 express on everything you like. Thus you get cash from the ordinary and the express lets you have an exciting and interesting viewing of a match: as you have bet on it!'),(5,1,5,1389079099,0,0,'Place only single bets because even two events mean an express. 1 gaming day â 1 ordinary â 1 express.'),(6,1,6,1389079108,0,0,'Any player is inherently a hot-tempered person, thatâs why itâs important to keep your head. You should never bet your last money as you run the risk of losing everything on the first of the gaming days and skip a bet which can bring profit to you on the second gaming day.'),(7,1,7,1389079119,0,0,'The sixth point is linked to the following one: be constrained both in the cases of loss and win. If you keep winning three times in a row you shouldnât be too enthusiastic and bet indiscriminately on everything or do vice versa: a series of loses can make you place ill-judged bets with the only desire to return your money. You shouldnât do it either. Donât fuss, donât hurry to place a bet and control your feelings. Always keep in mind the amount of money you have already brought in, the sum you wish to get and the time period in which you wish to get it.'),(8,1,8,1389079127,0,0,'Bet only in case of being confident of the result. However, we notice that there canât be a 100% confidence. As practice shows, even in the football match Barcelona against Rubin you can be only 95% confident of Barcelonaâs win and set 5% for the âanything can happenâ case. Anyway these 5% give you a chance to analyze all the factors leading to loss. This is the experience you gain gradually and which will ultimately lead you to the positive result in such a difficult issue as betting.'),(9,1,9,1389079138,0,0,'Donât bet for the sake of a bet. Determine the sphere of you interest: the type of sports you are interested most.'),(10,1,10,1389079153,0,0,'You have won money â withdraw it. You should withdraw money in CASH twice a month if you bet frequently and once a month if you bet more seldom. If you donât stick to this rule you may lose everything.'),(11,1,11,1389079224,0,0,'Open an account at the Betfair betting exchange. We assure: itâs very pleasant to withdraw money from Betfair.'),(12,1,12,1389079240,0,0,'Stick to the rules from the very beginning since they make up a system. In other words these are logically bound principles representing an integral composition.'),(13,1,0,1389079759,1389154422,1,'<h3>How and why use BetOnFootball:</h3>\r\n<ul>\r\n	<li>The main rule of  BetOnFootball is nothing extra, but football bets.</li>\r\n	<li>BetOnFootball is a team of football analysts, one for each leading European championship (The UK, Spain, Germany, Italy, France and Holland).</li>\r\n	<li>Paid subscription is effected for all the analysts, but not for each one separately.</li>\r\n	<li>There are different subscription terms: 1 bet (forecast), 1 match day, weekends, a month, 3 months and a season.</li>\r\n	<li>In the userâs personal account, having filled in âE-mailâ and âPhoneâ areas, the subscription for you will look the following way: you receive SMS, which says that the new forecast is added to your personal account and e-mail message is sent to you. You chose yourself the most convenient for you way of making yourself aware of the materials (in your personal account on BOF site or via e-mail).</li>\r\n	<li> For the sake of convenience we have created BOF journal for you, which will be issued on a regular basis on match days and âaccumulateâ all the forecasts of all the BOF analysts.</li>\r\n	<li>Apart from the journal and âearly betsâ not included in the journal, there will be forecasts 30 minutes before the match starts, when the team lists for the game are already known and in some cases during the match itself.</li>\r\n	<li> To get free forecasts, as well as to get an opportunity to buy the forecast, each site visitor is offered an easy sign up procedure.</li>\r\n	<li> Please, do not hesitate to address us any of your questions or concerns using feedback form, e-mail, skype or telephone.</li>\r\n	<li>New forecasts as well as the latest 7 matches statistics are always displayed on the main page of our site.</li>\r\n</ul>\r\n<p>\r\n	You may anytime find Statistics on each BOF analyst as well as the whole project in our Statistics section\r\n</p>\r\n<p>\r\n	Letâs earn together!\r\n</p>\r\n<h3>12 g<span class=\"gold\">olden</span> rules for betting</h3>\r\n<p>\r\n	Basing on the understanding that gaming events have always been accompanying human existence and will continue to in future, one can state with confidence that the desire to bet on the outcome of a certain sports contest, bet on the result, win and, unfortunately, lose will always exist. Thatâs why itâs important to minimize negative consequences of your bets.\r\n</p>\r\n<p>\r\n	<span class=\"q-little\">BetonFootball recommends using services of the Betfair betting exchange created in the UK in 1999. The Betfair has eliminated the traditional bookmaker as an intermediary between bettors and thus made it possible and profitable to place bets skipping the bookmaker office. Since that very moment any player is able to choose himself a person to bet against. Taking into consideration our personal ten-year experience we can well afford to offer a few ideas-rules you always have to keep in mind:</span>\r\n</p>');
