(14,0,1391992993,0,822153301,428,'How ','I live in South Korea. \r\nand How can I purchase subscription?? I can use western union. Can try this?? \r\nand 1month  subscription , all picks I can see? \r\nthx. GL ','KJ','ssa208@naver.com'),(15,0,1392031063,0,2147483647,0,'fgsdfgs','dfgsdfg','sdfgsdf','gsdfgsdfg@mail.ru'),(16,0,1392047609,0,1338206513,0,'Stats-calculating','Hi. I studied your tipster stats and could not understand how the bettors yield is calculated.\r\nMantis, for example, has a monthly yield between +14% and -0,74%. How do you calculate the  overall yield with 68.58% (overall profit 6858) ?\r\nFrank','Frank','f.hide@web.de'),(17,0,1392047812,0,1338206513,0,'Stats calculating','Hi. I studied your tipster stats and could now follow how you calculate them. Mantis, for example, has had a yield between 14% and -0,74% every single month. But in his overall yield, there is a 68.58% yield. How do you calculate that?  ','Frank','f.hide@web.de');
