INSERT INTO `me_reviews` VALUES (1,0,1,0,0,21,'Mantis has been betting as a punter since 1999 and a few year later he started offering his knowledge in several betting services and internet sites. A member of the Betting Advice forum community since 2002. In 2004 he started offering his bets in BA main site taking over from legentary tipster Holonia and this is where everything started. Mantis is the leading tipster in betonfootball.eu since November 2011.'),(2,1,1,0,0,22,'After many years of selecting my own value Dutch football picks I decided to share my knowledge with others, for some years writing previews as Dutch expert for the several websites and since February 2013 my tips are published at BOF.'),(3,2,1,0,0,20,'Oddsmaker was working for more than 20 years in many betting companies setting their odds, managing, consulting and organizing the companies in daily basis. Risk management, consulting on accounting systems, changing the prices if there was a big movement and acceptance of bets, were also included in his duties. Oddsmaker has been part of the BOF project since April 2013.'),(6,3,1,0,0,26,'I have joined betonfootball.eu team recently and I hope for a long and prosperous cooperation. My betting experience around 16 years.  I have been a football enthusiast since I was a kid and in recent years I have been working as a football tipster. I watch too much football and my strategy relies more on what I see on the pitch rather than statistics and numbers. I will be giving picks on Italy Serie A, English Premier League, Italian cup, English cups and European cups. I hope to gain your trust through my work, but I am not  going to promise anything since everyone with betting experience knows that when it comes to betting there are no guarantees. \r\n'),(7,4,1,0,0,24,'BetonFootball is a team of tipsters, which first of all can be characterized with its professional approach to business. The premise of the project is to regularly share our knowledge and experience in football bets with our users. The team includes specialists in both separate championships (Mantis â Spain, De Generaal â Holland, Stevie G â Italy and England) and in betting offices (Oddsmaker was working for a number of betting offices for about 20 years). Besides, the unique feature of BetOnFootball project is that we do not only give recommendations which game results youâd better bet on, but also tell what matches youâd better not bet at all and explain why. \r\nOur motto is âNothing else, but Bet On Football!â \r\nSubscribe and welcome to our team!\r\n');
/*!40000 ALTER TABLE `me_reviews` ENABLE KEYS */;
UNLOCK TABLES;

