ave \'high official friends\' in the association and asuming that the last season game was a fixed up, this may be pay back time. All these could give us a shot in the home win.','','0','-0.50',2.00,'7',51.80,0.00,518,3,'',1518.00,1,NULL,NULL),(173,1,0,0.00,1389629394,1389629394,1376683200,21,'Valladolid','es','Athletic','es',2,'Spain La Liga','','Valladolid can not count on two important players during the latter campaign, forwards Larsson and holding midfielder VÃ­ctor PÃ©rez. JIM is set to field a lineup which is very much the same like last season.\n\nSquad: not announced yet\n\nPossible XI: Jaime or MariÃ±o - Rukavina, Valiente, Rueda, PeÃ±a - Ãlvaro Rubio, Sastre - Omar, Ãscar, Ebert - Javi Guerra.\n\nErnesto Valverde can not count ok striker Aduriz and defender San Jose. Kike Sola will replace Aduriz up frond and this looks pretty nice for Athletic as long as Aduriz had lost his form in the last quarter of the last season. Sola is faster too, so the tough pucela defense will be tested.\n\nPossible XI: Iago HerrerÃ­n - Iraola, Laporte, Gurpegui, Saborit - Iturraspe, BeÃ±at, Herrera â Susaeta, Muniain, Kike Sola\n\nSquad: Iraizoz y HerrerÃ­n y los jugadores de campo Toquero, Laporte, MorÃ¡n, BeÃ±at, Iturraspe, Kike Sola, De Marcos, Ibai, Susaeta, Iraola, Gurpegui, Muniain, Herrera, Saborit, Ekiza y Balenziaga.','','0','0.00',2.01,'6',52.41,0.00,530,2,'',1512.00,1,NULL,NULL),(174,1,0,0.00,1389629394,1389629394,1379448000,21,'Real','es','Betis','es',2,'Spain La Liga','','Real is the favorite to win the league, Ancelotti wants to start without letting any room for surprises, but this is only in theory. The truth is the both teams will play their best in the field in the opening day today. Real made an impressive preparation and their squad is even better than last season. Ancelotti is picking Casillas in the goal, Carvahal in the right back, Isco in the left wing, Modric-Khedira in the middle, CR7-Benzema upfrond.\n\nBetis on the other hand have a completely new team this season. This has to do with some missings as long and with several departures of key players. Of course there are new players in, but they need to adopt the new system. Questions about key striker Ruben Castro FW*** who remains out. Only 45 players of the last team will step in Bernabeu today.','','0','-2.25',2.00,'7',51.71,0.00,517,3,'',1517.06,1,NULL,NULL),(175,1,0,0.00,1389629394,1389629394,1379448000,21,'Osasuna','es','Granada','es',2,'Spain La Liga','','This is a bet favored by the numbers. Osasuna may be the favorite because of the home ground but they do not have more than 50% possibilities to win. Both have missings but Granada have already built their squad and those who are set to leave are not included in the new team while Osasuna are obligated to live with a couple of key missings, especially Silva MD** and Nino FW** (6 months out). The new signing forwards, Nunez and Riera may be better in skills but they are definitely lacking experience. Riera coming from segunda and Nunez of unknown quality.\n\nOn the other hand Granada have some great guys to showoffensively. The 4 guys, El Arabi, Piti, Benitez and Brahimi  up front are of great pace and skills, they can destroy Osasuna\'s defense! Iturra and Yebda secure a solid middle line.','','0','0.50',1.93,'7',52.36,0.00,530,2,'',1510.06,1,NULL,NULL),(176,1,0,0.00,1389629394,1389629394,1379448000,21,'Sevilla','es','Atletico','es',2,'Spain La Liga','','Sevilla produced  impressive results in the preseason, the Europa League game and Progorica included, and getting into the new campaign with their morale sky high. It looks like the departures of Negredo FW*** (25 mils), Navas WG*** (20mils) and Medel MD*** (13mils) didn\'t efect the team but today they are facing Atletico, one the champions league candidates! Sevilla sold players worth of 58 millions (!) who they will be able to compete Atletico who sold Falcao for 60 and bought David Villa just for 2? !!!!!!!!! So both took 58.000.000 cash but Atletico got a reall star in their team while Sevilla some decent but not at the same level players! Atletico is the fav here.','','0','0.00',1.91,'7',52.99,0.00,536,2,'',1516.57,1,NULL,NULL),(177,1,0,0.00,1389629394,1389629394,1376856000,21,'Almeria','es','Villarreal','es',2,'Spain La Liga','','These two played last yeat in Vila-Real in the last day searching for the 2nd place in segunda and the straight promotion in La Liga. Villarreal was ok with a draw, Almeria was asking only for the win. Villarreal won the game and sent Almeria in playoffs where the Andalusians won the promotion. Just like they finished the last season, they start the new one. In a friendly game they played in neutral ground, Almeria won by 1-0 but Marcelino fielded Villarreal with many subtitutes.\n\nVillarreal is a team with a much better squad and as I wrote in the season preview they are here to stay and most probably fight for a EL ticket. On the other hand Almeria will struggle and will play it to individual tough fights in order to win points. Of course they will be based in their ground. Both with a few missings, kind of notable but not important. Both possible Xis looks promising to offer offensive soccer but as long as it is an opening game the two rivals will be careful today avoiding to play open and risk anything. Anyway, Villarreal is my call here the game is 50%-50%.','','0','0.00',1.99,'7',53.69,0.00,544,2,'',1522.94,1,NULL,NULL),(178,1,0,0.00,1389629394,1389629394,1376942400,21,'Lyon','es','Sociedad','es',2,'CL','','This is the first CL game for Sociedad in the last 10 years and it is of double importance because they were eliminated then in the round of \'16\' against Lyon! Prieto was they only one Txuri urdin player who was part of that team as a priomising youngster and now is the star of the team! Socieada won comfortably against Getafe on Saturday without even accelerating and they are fully ready for this game. Montanier who is now in France will definitely said a couple of hints and tips for his former assistant Arrasate who is now in charge. Key winger Griezmann who were rested against Getafe is the nod today. Berkara is also back to reigforce the middle line. Agirretxe FW**, Irfan FW and Mikel Gonzales DF** are out.\n\nLyon is doing a remarkable start in the new season! They won two ligue 1 games and two CL games against Grasshopers. Lyon have yound primising players and their only missings regarding the latter campaign are Lissadro (left), Gomis and Brain. First choice keeper Vercoutre is injured.\n\nLyon are too strong at home but Sociedad are experts in counter attacking. Goals should be scored from both. The Basques will search for at least one and odds on both to score are unexpectedly high.','','0','0.00',2.00,'6',53.09,0.00,531,3,'',1530.87,1,NULL,NULL),(179,1,0,0.00,1389629394,1389629394,1377028800,21,'Atletico','es','Barcelona','es',2,'SuperCup','','This is the first leg of the Spanish Super Cup with cup winners Atletico hosting champions from Barcelona in the Vicenta Calderon. The return leg is following next week at the Camp Nou. Atletico and Barcelona opened the new La Liga season with victories, Barcelona humiliated Levante by 7-0 and Atletico slaped Sevilla away by 1-3. Diego Costa and Messi were the MVPs.\n\nIn Atletico there is David Villa who is searching to prove to his former club his worth. The game will be really important for him, but individual victories are risky for any team. Simeone will give him a starting up role today just like in Sevilla but Leo Baptistao will be waiting to grab the opportunity from the bench. No important missings for Atletico neither for Barcelona who\'s starting XI is a bit more complicated. Martino may field Neymar from the start and leave Xavi out, but it is quite possible to repeat the team that started against Levante with Neymar on the bench.\n\nWho ever plays makes no big difference though. The changes Martino is trying to make in Barcelona\'s style are more important and at last, we can see the team playing in full power and not torturing the ball with eyes suffering tiki-taka small passes. Barcelona is playing more rapid offensively and with more players in the oppsite area, the side backs are getting straight in next to Messi.\n\nAnyway, there is a second leg to be played next week, but odds on Barcelona are really nice today.','','0','-0.75',2.00,'7',52.39,0.00,524,3,'',1523.87,1,NULL,NULL),(180,1,0,0.00,1389629394,1389629394,1377201600,21,'Athletic','es','Osasuna','es',1,'Spain La Liga','','This is a Basque derby and will be played in the Anoeta in San Sebastian because the Nuevo San Mames isn\'t still ready. 20.000 Bilbainos are expected to be in the stands of Real Sociedad\'s home ground to cheers Athletic in their first home win of the season. Athletic won in Valladolid in the opening day while Osasuna suffered a well deserved home defeat against Granada.\n\nAthletic has striker Aduriz back in the team after the last one served his ban while keeper Iraizoz got injured so Herenin is steping in. This change was set to happen in the opening day because Iraizoz spend many days in the preseason injured and it is no secret that he is not the \'keeper\' he were in the past years. So Athletic is in full power. Striker Kike Sola who came from Osasuna said that he will not celebrate a possible goal, but he will definitely have his chances tomorrow.\n\nOsasuna will have a hard task this season in La Liga. They lost some players in the summer and the new signings are not at the same level. The first test wasn\'t positive against Granada and today Mendilibar is obligated to field a team without key attacking midfielder Miguel De las Cuevas  MD*** and winger Cejudo WG*. The good news is that Gato Silva MD** is available to organise the middle line. Miguel FlaÃ±o CB, Eneko SatrÃºstegui DF, Lolo MD* and  Nino FW*, remain out.\n\nAthletic is the favorite here and they should built on the away win in Valladolid.  Osasuna will try to win back the lost home points but there is a quality gap here in Athletic favor and it is up to them to decide the game. The ground is neutral but 20.000 of the fans will be their supporters and bearing in mind last leason\'s performances in San Mames, it sounds better for Athletic not to play there! Of course this had everything to do with Llorente. Now that he left, things will definitely get better in the home ground of Athletic.','','0','-0.75',2.01,'7',53.09,0.00,538,2,'',1516.87,1,NULL,NULL),(181,1,0,0.00,1389629394,1389629394,1377288000,21,'Elche','es','Sociedad','es',2,'Spain La Liga','','Sociedad traveled in Elche without three new missings because of injury, Carlos MartÃ­nez DF*, Antoine Griezmann FW*** and EÃ±aut Zubikarai are out.. Moreover, Agirretxe FW**, Irfan FW and Mikel Gonzales DF** remain out with Enrique Royo GLK, Dani Estrada DF, Sangalli (?) and Markel Bergara MD* coming back in the squad.\nArrasate will mix his team again as he did against Getafe before the trip to Lyon. Ansotegi DF, Elustondo MD, Pardo MD* and Chory Castro  FW* are taking the nod today while new signing Granero MD** is also set to feature. So, despite the noumerous missings, Sociedad is about to be fielded with a quite competitive team today.\n\nBravo - Estrada, IÃ±igo MartÃ­nez, Ansotegi, De la Bella - Bergara, Elustondo, Xabi Prieto - Castro, Vela, Seferovic.\n\nElche on the other hand are newcomers, they are enthousiastic playing in front of their supporters in La Liga for the first time in the last 25 years, but the feelings in the opening day were not positive. They lost easy in Vallecas by 3-0. Today another experienced La Liga player is set to debutize in the starting XI, Javi MÃ¡rquez MD** former Espanyol and Mallorca player. There are some missings and a player back but nothing important.\n\nElche are full of enthousiasm today but Real Sociedad is clearly the better team. Lyon\'s visit in Anoeta in four days obligates Arrasate to rotate but Real will field a quite competitive team. They are the favorite buts odds on Draw No Bet are low at the time being (1,76). Odds adjustments are expected to occurred during the day especially when the missings of Sociedad become known in public. I will take Sociedad (0) at 1,85.','','0','0.00',1.76,'6',0.00,0.00,0,1,'',1524.94,1,NULL,NULL),(182,1,0,0.00,1389629394,1389629394,1377374400,21,'Betis','es','Celta','es',1,'Spain La Liga','','Betis performed really well in the opening day in Bernabeu and could have avoid the dying minutes defeat to Real Madrid, should their strikers were better in finishing in the first part. Betis got an early lead and could have made it 0-2. Their defense was great, their attacks were impressive. Today key striker Ruben Castro returns while Nosa and Jorge Molina got the call in the squad after suffering minor knocks recently.\n\nCelta on the other hand succumped in a home draw to Espanyol. They got the lead by 2-0 but received twice in the second part and could have got another one in injury time. Most worrying is that Espanyol played really bad but instead of that they scored twice against Celta.\n\nBetis in almost full power is the favorite here.','','0','-0.50',2.00,'7',52.39,0.00,524,3,'',1523.94,1,NULL,NULL),(183,1,0,0.00,1389629394,1389629394,1377374400,21,'Levante','es','Sevilla','es',1,'Spain La Liga','','Levante hosts Sevilla in a quite emotional game for Sevilla midfielder Iborra. He played 99 games in Levante, key player in the middle line in recent years, and just a week ago he was transferred to Sevilla! He is playing his No100 game in La Liga today and it is against his ex team! Another interesting fact is that Levante\'s manager Joaquin Caparros he has only won 3 times in 15 games playing against his former team.\n\nHe is set to field Levante with three midfielders in order to destroy Sevilla\'s creativity. Last minute missing of Diop is making his work more difficult. Looking at Levante\'s squad though you can find great offensive minded players such as  RubÃ©n GarcÃ­a, Xumetra, Pedro RÃ­os and Ivanschitz and the key today for Levante will be to play offensively. Anyway, Caparros is set to field three midfielders and the two will be Sergio Pinto and El Adoua and he is searching for the third.\n\nSevilla had an impressive preseason and three great EL games but when they had to play a strong team they suffered a home defeat to Atletico. This is another hard test and the greatest handicap for Sevilla is their poooooor on the road record. They didn\'t win a single away game the last season in La Liga! Cristoforo is a new addition, Iborra as well. Trochowski, Reyes and Pareja remain out.\n\nWhen was the last time we bet on Sevilla away from their home? We regret it, I think it was in Getafe who were playing depleted through missings. Sevilla under Emery cannot win on the road, Levante despite the opening day desaster in Barcelona they were prepared very well and will make a hard rival today.','','0','0.25',2.01,'7',53.10,0.00,535,2,'',1516.94,1,NULL,NULL),(184,1,0,0.00,1389629394,1389629394,1377374400,21,'Atletico','es','Rayo','es',1,'Spain La Liga','','Madrid mini derby with a clear favorite, Atleti. Simeone made it clear \'we are going for Rayo\' leaving the return leg of the super cup out of discussion. Raul Garcia, Adrian and Thiago are back in the squad where there aren\'t any injuries or suspensions. Rayo traveled also in a full squadl. Jose Carlos, Castillo and Rodri are out, nothing important. Rayo won in the opening day against Elche by 3-0, they will lose now, what remains to be solved is the handicap. A two goals victory for Atletico is quite probable. Odds are much better now than yesterday.','','0','-1.25',1.90,'6',53.64,0.00,542,2,'',1525.01,1,NULL,NULL),(185,1,0,0.00,1389629394,1389629394,1377460800,21,'Granada','es','Real Madrid','es',1,'Spain La Liga','','Lucas Alcaraz debutized in Granada with a win over Real Madrid last season and Granada hopes for a repeat today! Granada started with an away win in Osasuna confirming their quality and good state of form. Alcaraz have Riki FW** available while Siquera, who is already on his way out and didn\'t even take part in the preseason, makes no important missing.\n\nOn the other hand, Ancelotti can not count on Xabi Alonso MD***, Asier Illarramendi MD** and Sami Khedira MD* and as you can see there will be a few problems in controling the game in the middle and producing creative football.  Brazilean Casemiro MD from RM Castilla will start and most probably Isco will play behind his natural position.\n\nLadbrokes still offers +1,5 at 1,9 and I will take that bet. Granada is fielding an increadible offensive line composed by Brahimi, Benitez, Piti and El Arabi (or Riki) and have great alternatives coming from the bench, Riki (or El Arabi), Yegda, Buonannote. Real faced many problems in the opening day against Betis and they don\'t seem 100% ready for official start. The missings in middleline are important as well and this means that Real will not be 100% functionable.','','0','1.50',1.90,'6',54.18,0.00,547,2,'',1530.41,1,NULL,NULL),(186,1,0,0.00,1389629394,1389629394,1377806400,21,'Rayo','es','Levante','es',2,'Spain La Liga','','Tough game in Vallecas, Rayo are eager to bounce back after losing by 5-0 in Atletico Madrid while Levante are searching for their first goal even though they are not looking too eager to score one. Levante was demolished in Barcelona in the opening day but didn\'t try enough hosting Sevilla last week. They got the goal-less draw in a game where Sevilla was also seemed ok with that.\n\nIt is not a secret that Joaquin Caparros, Levante\'s new manager, is keen on defensive tactics. Levante was already a tema hard to score against, they will become a tougher rival as time goes by. Of course in Barcelona they just... disappeared. Pape Diop MD** and Baba Diawara FW* debutize in the squad. The first was injured in the last games while Baba is a new signing from Sevilla. The other new signing RÃ©mi Gomis MD remains unavailable.\n\nRayo lost key players in the summer but some new guys look quite promising to cover. They had a great opening game against Elche but Atletico was all over them last week to beat them by 5-0. Seba FW* from Sevilla and Ze Castro CB* from Deportivo are the new signings. Seba will help a lot offensively and he is set to feature today in the list (not announced yet).\n\nI took Levante against Sevilla, I will trust them now as well. They showed good skills in the preseason and they do have quality guys especially upfrond. Odds offered for them are pretty nice to take the shot.','','0','0.50',2.19,'6',54.90,0.00,556,2,'',1535.81,1,NULL,NULL),(187,1,0,0.00,1389629394,1389629394,1377806400,21,'Celta','es','Granada','es',2,'Spain La Liga','','Celta reached 4 points in the first two games while Granada comes one point less in three. Celta drew at home to Espanyol and won in Betis, while Granada won in Pamplona and lost at home to Real Madrid. So according to the stats Celta is the better team here and deserves the favoritism.\n\nI only want to remind you that Celta almost lost the game to Espanyol at home against a team that didn\'t even reach their 30% and they miraculous won in Sevilla against a much better Betis side. In these two games they only created 15 scoring opportunities. On the other hand Granada created 21 scoring opportunities so far and they played against defensive minded Osasuna away and against Real Madrid at home. This is a much better achievement comparing the two rivals and I also want to remind you that Real Madrid won really hard by 0-1, with the players wasting time in the last minutes and Ancelotti going into defensive-minded changes ! More over Granada was denied two possible penalties...\n\nAnyway, Lucas Alcaraz took the same squad as in the opening two games, leaving the new signings out. Recio MD*, Ighalo FW** and Foulquier joined Granada and there is no doubt they will help a lot but at the moment the team enjoys an excellent state of form and mister don\'t want to ruin anything.\n\nCelta have to play without key holding midfielder Borja OubiÃ±a through suspension. The team appealed against his sanction but it was rejected on Friday afternoon (a few minutes ago). Possible substitutes of Oubina are FontÃ¡s, Ãlex LÃ³pez, Levy Madinda and Javi Rey. Well, Fontas is a center back, Javi Rey is too young Alex Lopez is a winger and Madinda played in this position in the b\' team and suffered to play his role. Oubina\'s missing will not be covered in my opinion.','','0','0.25',2.00,'8',55.70,0.00,561,2,'',1540.95,1,NULL,NULL),(188,1,0,0.00,1389629394,1389629394,1377979200,21,'Espanyol','es','Betis','es',2,'Spain La Liga','','Espanyol have won 4 points until now and even though they were disappointed in the opening day against Celta in Vigo they were impressive last week hosting Valencia and beating them by 3-1. Betis on the other hand have lost both their opening games to Madrid against Real and at home to Celta.\n\nI was set to take Betis here but after watching Espanyol performance against Valencia â amazing offensive game with many scoring opportunities mainly through crosses â and reading the news that Beti\'s key striker Ruben Castro FW*** and center back Paulau DF* are out, I am going to the over2.5.\n\nEspanyol have great guys upfront, Pizzi, Sergio Garcia, Stuani and even Simao seems reborn this season, while Betis have also great offensive power â even without Castro â and the most important is that they can not defend properly. This cost them the home defeat to Celta and will most probably cause them huge difficulties in the Cornella El Prat today.','','0','2.50',2.00,'6',55.10,0.00,551,3,'',1550.95,1,NULL,NULL),(189,1,0,0.00,1389629394,1389629394,1378843200,21,'Sabadell','es','Las Palmas','es',1,'Copa','','Saba have a squad full of regulars and only a couple of guys are missing. There will definitely be some changes but the majority of the regular starters are included. On the other hand Las Palmas have a mixed squad and the coach tried a team with 9 changes yesterday in the training session preparing the today cup game. New signed Apono, Aranda, Masoud, Angel Lopez and Raul are set to debutize today and 3-4 of them are expected to start. They are great players no doubt about that but they are not 100% fit.','','0','-0.25',2.00,'6',54.50,0.00,545,3,'',1544.95,1,NULL,NULL),(190,1,0,0.00,1389629394,1389629394,1378843200,21,'Huelva','es','Sporting','es',1,'Copa','','Sporting traveled with numerous and important missings in Huelva who have yet to announce their squad and plans for the cup game. Senor Sergi Barguan only stated that there will be some changes and that he wants his team to go through the next round. Recre are strong at home and their squad is almost equal in quality. Who ever plays makes the same outcome. Recre played a very good game in the midweek and this is encouraging taking them today, while Sporting played an impressive game as well as in their opening three segunda games, but the numerous missings should effect them today.','','0','0.00',1.75,'6',0.00,0.00,0,1,'',1538.95,1,NULL,NULL),(191,1,0,0.00,1389629394,1389629394,1378843200,21,'Cordoba','es','Deportivo','es',1,'Copa','','Cordoba have an almost full squad, only two regulars were left out to take a rest and another one in injured. The rest of the squad is like usuall in the league. Depor on the other hand traveled without 6 of their 18 proffesional players with 5 of them really important. The 2 center backs Kaka, Insua, the playmaker Culio, and the wingers Arizmenti and Rudi are out. Some players from the B\' and one from the C\' team, got the call today.','','0','-0.50',2.00,'6',53.90,0.00,539,3,'',1538.95,1,NULL,NULL),(192,1,0,0.00,1389629394,1389629394,1379102400,21,'Atletico','es','Almeria','es',1,'Spain La Liga','','There is huge difference in quality here and even though Zenit is coming in the midweek Atletico have eyes only for Almeria. Simeone has proven in the past that he thinks every game seperately and this time it is Almeria who traveled without regular left back half  Dubarbier due to suspension. This is the first change for Almeria in the opening three games in La Liga. Atletico without  Cristian RodrÃ­guez y Aranzubia, something that means full squad. Diego Costa is not playing in CL due to suspension so he will give it all today. We can trust the rojiblancos today. Full squad, excellent form and a reason for even higher morale ahead of the CL debut. Against Sociedad last week they were by far the better team in the field, while Almeria is nothing more than a newcomer in the division.','','0','-1.50',1.77,'7',54.43,0.00,550,2,'',1531.95,1,NULL,NULL),(193,1,0,0.00,1389629394,1389629394,1379102400,21,'Levante','es','Sociedad','es',2,'Spain La Liga','','Levante was too lucky in the last game to escape with the three points from Vallecas while even though Sociedad was outplayed by Atletico Madrid they are much better in every aspect to Levante. Moreover, Sociedad have more defenders now available. Two weeks ago they had only two in their disposal!\n\nLevante are without skilfull winger RubÃ©n GarcÃ­a while El Zar and  holidng midfielder Simao are out. Sociedad with Dani Estrada, Mikel GonzÃ¡lez in the squad.  Jagoba Arrasate made it clear: âthere no other game in our mind than Levanteâ. Sociedad hosts Shakhtar on Tuesday.\n\nSociedad have the upper hand here. The worst outcome for them should be the draw.','','0','0.00',1.75,'6',0.00,0.00,0,1,'',1538.34,1,NULL,NULL),(194,1,0,0.00,1389629394,1389629394,1379102400,21,'Barca','es','Sevilla','es',1,'Spain La Liga','','Both have many players on international duties, but Barcelona have huge quality to cover. Neymar is in better shape day by day while  Xavi and Alexis who were rested in Valencia are back in the squad. Sevilla are terrible when traveling away from home. Will they stand up at the Camp Nou? They have more than one year to win on the road. Moreover, the missings in defense remain still, and this was one of the reasons for Malaga outplaying them in fron of their fans in the last game, while key playmaker Rakitic is excausted from the international game with Croacia.','','0','-2.25',2.00,'7',53.73,0.00,537,3,'',1537.34,1,NULL,NULL),(195,1,0,0.00,1389629394,1389629394,1379188800,21,'Granada','es','Espanyol','es',2,'Spain La Liga','','Strange game, tricky one, Granada without Piti FW**, Brahimi FW*** both key players in attack but with new signings of Recio MD*, Ighalo FW** and Perreira WG* (EX Mallorca).\nOn the other hand Espanyol traveled without defenders Moreno CB** and Capdevilla LB*.\n\nEspanyol has excellent forwards and played two very good games against Valencia 3-1 and Betis 0-0, while Granada has pure quality offensively but today there are some missings and the new comers are not sure to play at their 100%. In fact, they will definitely be at their best shape today. Granada comes from a terrible performance and a lucky draw in Celta.\n\nOdds on Espanyol went up and I think it is a nice value to take their +0.25.','','0','0.25',1.90,'7',54.36,0.00,550,2,'',1530.34,1,NULL,NULL),(196,1,0,0.00,1389629394,1389629394,1379188800,21,'Getafe','es','Osasuna','es',2,'Spain La Liga','','Getafe and Osasuna are the worst teams in La Liga in the new season until now and even though Getafe have some quality in their squad they still haven\'t managed to play under their standards, not even close to it. Pedro Leon, Diego Castro, Lafita and Colunga are very good players but beyond them Getafe lacks quality and their biggest headache come when these players are out of form. This is what is happening at the momment. Leon is nowhere, Castro and Colunga are still suffering the summer preparation, only Lafita is trying his best and of course this isn\'t enough. Midfielder Lacen is out but this could be good news for Geta as long as this one was one of the worse in the opening games.\n\nOn the other hand, Osasuna lost important players in the summer and are suffering some important missings through injuries. They are not better than Getafe in quality but unlike Getafe, they are playing better in these opening games. They have lost them all, but at least against Villarreal they performed some attractive football, passes and nice movements in the pitch. Of course they lost, Villarreal was too strong for them, they even deserved to win against Real Madrid yesterday! Now Osasuna have a new coach in command, Javi Gracia, who won promotion in primera division with Almeria last season but didn\'t got the call for the new campaign. Important but out of form, winger, De Las Cuevas is missing. Cejudo is stepping in to replace him.\n\nOsasuna meets the worst team in the campaign, they have a new coach and they shown something positive until now. In the last two season Osasuna didn\'t lost to Getafe, escaping El Coloseum with two draws and winning once at home.','','0','0.25',2.00,'7',53.66,0.00,537,3,'',1536.64,1,NULL,NULL),(197,1,0,0.00,1389629394,1389629394,1379188800,21,'Betis','es','Valencia','es',2,'Spain La Liga','','Betis played a couple good halfs against Real Madrid and Celta but in refference to what they were capable finishing the last season they are far away at the momment. Many changes in the summer and injuries of key players, this time Ruben Castro FW*** stays out again while playmaker Verdu MD*** and winger Jose Carlos FW** are injured as well...! Important missings for Betis who are set to play against full squad Valencia who got a morale boost two weeks ago almost turning the game against Barcelona around (2-3 from 0-3). Postiga FW*** seems to be in the most suitable place after leaving Zaragoza, speedy winger Pabon FW** who played last season in Betis is a new addition in the squad, ready to debutize.\n\nIn a few words, Valencia is the favorite here. Betis will strangle with all these key missings. Jorge Molina is a good striker, but he is not Ruben Garcia. Verdu has been responsible for  creating the game in Betis middle line after the departure of Benat. His missing is important.','','0','0.00',2.00,'8',52.86,0.00,529,3,'',1528.64,1,NULL,NULL),(198,1,0,0.00,1389629394,1389629394,1379275200,21,'Athletic','es','Celta','es',2,'Spain La Liga','','Athletic debutizes in the new San Mames and the crowd in the stands will be more than hot today! 10.000 supporters were in the training session yesterday! Athletic had an easy schedule and won Osasuna and Valladolid only losing to Real Madrid. Kike Sola FW** and Ekiza DF remain out. Balenziaga  LB* and Saborit LB are also out so there is a problem in the left back.\n\nCelta started rather kousy the new season but in their last game they were love to watch against Granada. They were succumbed in a 1-1 home draw but they deserved much more. Luis Enrique has started feeling better as long as the players have started adopting his philosophy. Celta have some great guys, such as Nolito, Augusto, Charles and Rafinha and Oubina! The first four are composing the 4 guys offensive line today, capable of scoring against Athletic who can not defend properly.\n\nIt is a hard call to lay Athletic at home, so I will better take the over2.5 here.','','0','2.50',1.85,'7',53.46,0.00,541,2,'',1521.64,1,NULL,NULL),(199,1,0,0.00,1389629395,1389629395,1379361600,21,'Sociedad','es','Shakhtar','es',2,'CL','','Both teams are in a downtrend regarding their domestic leagues, especially Shakhtar who lays 4th in the table while Sociedad also had two bad games away in Elche and Levante most recently. No important missings for both.  Shakhtar sold their two big guns in the summer but invested a big account of money to buy yound pacy South Americans mostly Brazileans, in their common tactics. Despite their bad form in the Ukranian league, this is the first CL game for  Shakhtar who still can afford a great squad with 8-9 international Ukrainians and foreign players.\n\nShakhtar have shown signs of attractive football all these years in CL, especially during last season when they got a 1-1 draw in Juve deserving even more, a 3-2 narrow defeat in Chelsea, a 2-5 triumph in Norjeland and only in Dortmund they were succumped in a 3-0 \'clear\' defeat.\n\nThe point is that  Shakhtar is able to score at the San Sebastian and of course Real Sociedad will follow or the other way around. The over2.5 is kind of juicy at odds more than 2,0 units especially at the San Sebastian where the Sociedad supporters watched at least 2 goals in every single of their team\'s last 16 games in all competitions!\n','','0','2.50',2.00,'7',52.76,0.00,528,3,'',1527.59,1,NULL,NULL),(200,1,0,0.00,1389629395,1389629395,1379361600,21,'Galata','es','Real Madrid','es',2,'CL','','Galata is in terrible form in Turkey, while Real isn\'t doing any better on their own. Last Sunday Real was saved by their keeper Diego Lopez in Vila-Real and escaped with a 2-2 draw. Ancelotti will change a couple of guys, Khedira instead of Illaramenti and Di Maria replacing Bale and Casillas taking the nod to defend the goalline. Arbeloa, Marcelo and Coentrao are injured, Varane and Xavi Alonso remains out. Galata with some changes as well, Albert Riera is stepping in,  Altidop is doubtful.\n\nWhen was the last time we took Galata to win in their amazing, in refference to their hot supporters, Ali Sami Yen? Last season they failed against Braga (0-2) and Cluz (1-1), before winning 1-0 against the b\' team of Man Utd and beating Real by 3-2 in the return leg of the 3-0 Bernabeu defeat. In fact this result should make a reason for Real to revenge today but the main reason for Real\'s possible win is the difference in quality of the galacticos.','','0','0.75',1.90,'7',53.39,0.00,540,2,'',1520.59,1,NULL,NULL),(201,1,0,0.00,1389629395,1389629395,1379448000,21,'Atletico','es','Zenit','es',1,'CL','','Atletico is a team you simply can not score against them. Simeone has put his sign in this team that is in their best shape ever, at least in the last decade! Unfortunately Diego Costa FW*** is suspended and will lose another one game, and this is the reason I am not as confident as I should have been with the Brazilean in the lineup. Anyway, Adrian may play in high level today, or Baptistao who is an excellent striker signing from Rayo in the summer. No other missing for Atletico while Zenit rested a couple of players at the weekend but will have to do without on great form midfielder Sirokov.','','0','1.00',1.71,'7',53.89,0.00,544,2,'',1526.89,1,NULL,NULL),(202,1,0,0.00,1389629395,1389629395,1379534400,21,'Valencia','es','Swansea','es',2,'EL','','Valencia have been playing like shit in the new season and most emparassing was the performance against Betis â who had key absences â last Sunday in Sevilla. Valencia were humilliated by Betis and in the 1st part the scorelines went up to 3-0. Tragic. On the other hand Laudrup has built up a fine team in Swansea and the team\'s credentials came in surface last Monday against Liverpool in a game where Swansea got the least they deserved to get. Amazing performance and a 2-2 draw against Liverpool! Both will have a couple of rotations today, Laudrup foreseen the Premier league and the UEFA EL competitions and asked for a decent amount of players in the squad. He got them, Swansea are not a push overs, escaping Mestalla with points is nothing impossible.\n','','0','0.75',1.74,'6',54.33,0.00,548,2,'',1532.86,1,NULL,NULL),(203,1,0,0.00,1389629395,1389629395,1379620800,21,'Osasuna','es','Elche','es',2,'Spain La Liga','','Osasuna and Elche are searching for their first win in the season, even though Elche are much more tranquil after getting three draws in the opening 4 games. Osasuna are in a quite complicated situation. They have lost all their games with 2 goals in favor and 9 against and this caused the sacking of coach Mendilibar. Gracia took over but in his debut Osasuna didn\'t do any better performing terrible against Getafe. They only improved in the 2nd part but it was late and they seemed unable to do any damage to Getafe who aren\'t any giants in the division. In fact Getafe have been rather poor so far and only against Osasuna they played like... Barcelona!  I thought last week that Gracia went to defensive choices in Getafe. I was wrong... Osasuna have no options. Low form and missings make things really hard for them.','','0','0.25',2.00,'6',53.73,0.00,537,3,'',1537.30,1,NULL,NULL),(204,1,0,0.00,1389629395,1389629395,1379707200,21,'Sociedad','es','Malaga','es',2,'Spain La Liga','','I don\'t know what it is to blame, the high pressure, the pressure in Arrasate who was Montanier\'s assistant coach and wants to prove himself, the CL shine or the tiredness of the contunous games, but Real Sociedad hasn\'t be doing any good in the season so far. In fact, I lost two bets on them, both to score in Lyon and they won by 0-2 and over2,5 in the midweek against Shakhtar and it was 0-2 again! Two other bets on them went luckily VOID, in Elche they could have received 2 or 3 in the 1st part (1-0 and 1-1FT) while in Levante the hosts deserved much better than the goal-less draw. Sociedad hosts Malaga and in a few days on Wednesday they travel in Barcelona! There is La Liga action in the midweek.\n\nGranada got injured. I saw him making the play in Levante, at least trying, but his loss is important as long as Sociedad went in the hunt for a new center midfielder. Granero will stay 5 months out. Midfielders Markel Bergara and Zurutuza are doubtful today even though latest news from San Sebastian have them ok. Arrasate left out his two side backs to give them a rest, Estrada and De La Bella. Even though Carlos Martinez and Cadamuro return to cover in the right back, De La Bella\'s missing is important and I don\'t know who is stepping in to cover...\n\nMalaga on the other hand is the pleasant surprise of the season! Many players left back Schuster does a fine job and his youngsters plus some experience guys, are doing great as well. Last week against Rayo they played an impressive attacking game and if you harry to say that Rayo sacks â they do â I remind you Malaga\'s great performance in Sevilla two weeks ago! Malaga have no missings. Odds are juicy, and most amazing is that they went up since yesterday.','','0','0.50',2.00,'8',54.53,0.00,553,2,'',1529.30,1,NULL,NULL),(205,1,0,0.00,1389629395,1389629395,1379707200,21,'Valladolid','es','Atletico','es',2,'Spain La Liga','','You know my opinion about Atletico and you know that I am betting on them regularly in recent weeks, with great success! The team is ready, great form, no missings, excellent mentality. Falcao left but in Madrid you have stopped hearing of this name. Diego Costa is the big guy now, but then again, one man does not mean spring time. Atletico has nothing to do with Diego Costa, or Villa. If any of these guys is missing the other takes the job, plus wonderful striker Leo Baptistao who hit Zenit in the heart on Wednesday in his first ball touch in the game!\n\nValladolid is a nice team, a decent team that works fine at home, with nice movements and automatics but they are too weak for Atletico. Their players are just in the average and even Bergdich who looks like the new star in the left wing, is nothing more than pacy and enthousiast. Anyway, Ebert FW*** is back, but, he hasn\'t played for a long time and he will find Atletico\'s defense today with Simeone eager to correct recent mistakes that led to the goals against Almeria and Zenit. Valladolid do have problems though. They are set to play without key defender Marc Valiente CB**, he was MVP of the team once and excellent in the other games until now, Îlvaro Rubio DH**, important in the holding mi position and long term Larsson FW*, Victor PÎ¹rez DH*. More over playmaker Oscar OH*** is extremely doubt.\n','','0','0.75',1.90,'7',55.16,0.00,558,2,'',1538.30,1,NULL,NULL),(206,1,0,0.00,1389629395,1389629395,1379707200,21,'Almeria','es','Levante','es',2,'Spain La Liga','','The attractive offensive game of Almeria will try to defeat the ultra defensive Levante\'s style. Who will win? Almeria is not Barcelona though... They try to play offensively, it is the enthousiasm to blame and the hot blood of their young manager Fransisco, the youngest ever in La Liga only 35yo, but this approach is not always suceesful. In fact, most of the times Almeria pays the price of their enthousiasm, just like the shocking home equalizer they received from Elche in 94\' from offside position, the late penalty succumbed against Getafe on the road (2-2) and the dying minutes collapse in the opening game against Villarreal 2-1 until 83\', 2-3 FT. Left full back Dubarbier served his one day ban but he was left out most probably because of the silly hand ball that led to Elche\'s equalasing 1-1 two weeks ago and the own goal he \'scored\' against Villarreal...\n\nLevante have started playing better and especially defensively they received only one in the last three games leaving the Barcelona opening day demolishion far behind them. Diop CMD***, Baba FW and Nong FW (the last 2 are new signings) are getting in the team and today the first 2 will enjoy starting up roles plus Austrian offensive half, Ivanschitc OH** (played great as a sub in the last two). Ok, Baba is not a striker like the guys Levante had in recent years, but maybe Nong turns to a relevation. Important player back is Crhis Lell the German right back half. This is his debut in the season, and it is important because last week the other right back Pedro Lopez was injured and a usually center back, Hector Rodas, was forced to play in the right back position. He was... terrible and lucky him that Griezmann (Sociedad) didn\'t function...\n\nLevante was good enough against Sociedad. They recovered their solidness in defense, how it could be another way with Joaquin Caparros in the bench and today they have better possibilities to escape with a defeat than offered odds shows.','','0','0.50',2.04,'8',55.99,0.00,568,2,'',1543.60,1,NULL,NULL),(207,1,0,0.00,1389629395,1389629395,1379793600,21,'Valencia','es','Sevilla','es',2,'Spain La Liga','','This is most probably an ultimatum for Djukic. Should Valencia failed to win or performed the same as recently Djukic will get his shoes out of Mestalla. It\'s not only that Valencia have lost key players in the likes of Soldado and Albelda, but they also seem unlikely to play good soccer. It is not a secret that some players don\'t want Djukic in the team. After the two emparrasing defeats to Betis and Swansea, the players and the coach discussed the situation in the team with mister saying \'some of you need to be more humple\' and the players replying \'we don\'t get what you mean\'...\n\nWhat is for granted here is that Valencia had no good signs before the season start and didn\'t get any better while Sevilla, who lays rock bottom since Osasuna won last Friday, started with upside-downs but becoming more solid game by game with the new guys adopting the style of the team.\n\nSevilla had two nice games recently, in Barcelona and Estoril where they played with reserves but were clearly the better side. Now Emery wants revence! He returns in Valencia from where he was sucked 2-3 years ago. Rightly he was sacked, maybe they parted companies, but Emery was not the manager for Valencia â as it seems Djukic isn\'t either. Anyway, Emery is in Sevilla now and is facing his former players.\n\nRami CB** is out for Valencia, Pereira RB* returns, no important missings for Sevilla, Perotti LW, Reyes RW, remain out.\n\nI don\'t know what the Valencia players will do in the Djukic matter but I doubt that a pro players who plays in Valencia will step seeking for his manager\'s sacking... Not even that increadible Dutch Kooman had that fate a few years ago... I won\'t go for Sevilla though, but I will take the over2,75 as long as goals are expecting here. It is a game with great expectations and motivation for both, they just can\'t sit back and defend their lines.','','0','2.75',2.06,'7',56.73,0.00,575,2,'',1552.92,1,NULL,NULL),(208,1,0,0.00,1389629395,1389629395,1379880000,21,'Espanyol','es','Athletic','es',2,'Spain La Liga','','Ernersto Valverde, the former Espanyol player and manager who lead los periquitos in a UEFA cup final against league side Sevilla FC in 2007 losing it on penalties shot out, is visiting the Cornella El Preat as a rival. His Bilbao outfit has a hard task tonigh in Barcelona. Athletic haven\'t won a single game there since 1998 losing 10 games and drawing 5... During the latter campaign Athletic snitched a point and this is the least they are set to get today as long as just like Espanyol - who visiting Vila-Real - Athletic are hosting Betis on Thursday and need to keep their squad fresh and at the weekend they play Betis and Granada respectively. Hard schedule for these two and the rest teams in primera of course.\n\nTwo defenders are back for Espanyol, Moreno who was rested last week and Capdevilla debutizing after a long term injury. No important missings for Espanyol while Athletic will have to do again without their left side backs as long as Balenziaga and Saborit remain out. Kike Sola FW* is also out, Ekiza CB too.\n\nThe numbers and the players\' quality are pointing in a bet on Athletic +0,25 but as long as the tradition and the defensive functionality of the Basques are important factors against this bet, I will take the over2.5 which, actually, is being offered in great prices.\n','','0','2.50',2.04,'6',57.36,0.00,580,2,'',1561.34,1,NULL,NULL),(209,1,0,0.00,1389629395,1389629395,1379966400,21,'Malaga','es','Almeria','es',2,'Spain La Liga','','Almeria have to lay all the blame up to their shoulders for throughing away 9 points in the opening 5 games of the campaign!! In the opening day against Villarreal they went up by 2-1 and lost in the dying minutes by 3-2, in Getafe they went by twice before succumping in a late draw, the same fate they suffered hosting Elche and getting the equalizer in the 94 minutes from offside position of Elche\'s scorer Boakye and last weekend they got a 2-0 lead and right after their 2nd goal their left back Cristian received two yellows in the same dead ball situation, a corner from the right for Levante, and was sent off with Levante shorteting distance with the penalty won...! Levante had another goal scored a few minutes later, but Almeria was the one who deserved much more in the game despite playing for many more than half hour with 10 players...\n\nMalaga impressed in Sevilla and at home to Rayo and they got a deserved point in San Sebastian with Sociedad resting three regulars.\n\nMalaga showed good signs and this is obvious telling by their recent results and performances. Almeria played some great games, wingers Suso and Vidal are amazing players the first joined from Liverpool and the 2nd is a Spanish sub20 international, and the fact that Almeria doesn\'t have the respect they deserve in offered odds makes their +0,75 today a decent option. This is an Andalusian mini derby anyway with Almeria trying to get the best possible as long as at the weekend they are hosting Barcelona.','','0','0.75',2.00,'6',56.76,0.00,568,3,'',1567.58,1,NULL,NULL),(210,1,0,0.00,1389629395,1389629395,1379966400,21,'Atletico','es','Osasuna','es',1,'Spain La Liga','','Atletico enjoys the best form since Simeone came in and with 5 wins in 5 games they are a serious treat for the two giants in the fight for the title. Raul Garcia in great form, Koke is excellent form started as a right side back and is becoming an interion left midfielder, with great assists in his credentials! Even Manquillo was awesome debutizing in the right back position in Vallecas and now Juanfran and Arda who were rested against Valladolid are stepping in. The only minus in taking Atletico here is the upcoming city derby against Real Madrid but then again this derby makes a reason for an emphatic win and a morale boost today. Osasuna won against Elche their first game in the season, but, this doesn\'t make them a team able to stand in the Vicente Calderon. Moreover, besides the noumerous and known misings of Echaide DF, Miguel FlaÃ±o CB, De las Cuevas MD**, Cejudo MD, Nino FW* another blow was added to the list, Roberto Torres who have been their MVP twice recently.','','0','-1.75',2.00,'7',56.06,0.00,561,3,'',1560.58,1,NULL,NULL),(211,1,0,0.00,1389629395,1389629395,1379966400,21,'Levante','es','Valladolid','es',2,'Spain La Liga','','Juan Ignacio Martinez most comonly known as JIM, returns in Valencia this time to play again his big love in primera, Levante UD! JIM was a manger in Levente in recent years with great success but was kind of \'forced\' to leave the club because of the fixing scandal during the latter campaign. Maybe his time was fullfiled in Levante anyway... I was so rergetful for backing Levante in Almeria last weekend. But luckily, I was lucky, as long as old fox Juanfran \'won\' a penalty from Almeria\'s Cristian taking him in two booking in the same dead ball situation after theatrically (mostly) diving to the ground... Levante deserved to lose in Almeria and deserved to lose big.\n\nTheir two strikers Baba and Nong are what I was afraid of. Too soft for Levante who traditionally had great strikers in the likes of Martins, Kone and Caicedo...  El Zhar who had a nice game in Almeria is out, some others remain.\n\nValladolid was of course too weak for Atletico Madrid, but they have shown that against equal teams especial on the roda they can be really tough and hard to beat. In Villarreal they were impressive from times to times and in Elche they got an easy draw  after balancing the game 20 minutes to it. Missings remain in the likes of key playmaker Oscar OH***, Ãlvaro Rubio DH**, Larsson FW* VÃ­ctor PÃ©rez DH* but there is good news for key center back Marc Valiente CB** the ruler in defense. Ebert will find the open space to striker today something impossible against Atletico Madrid.','','0','0.50',1.75,'7',56.58,0.00,571,2,'',1553.58,1,NULL,NULL),(212,1,0,0.00,1389629395,1389629395,1380052800,21,'Sevilla','es','Rayo','es',1,'Spain La Liga','','Sevilla lays rock bottom in the table and the pressure is all on Emery Unai. The coach took some weird decisions against Valencia, for example he took oof Gameiro the score of Sevilla\'s equalizer just after he scored, and he even admitted he was wrong. No new problems for Emery. Rayo is the first team that had more ball posseision than Barcelona since 2008! The 0-4 was a hard result for Rayo who are going into their worst season start ever especially defensively, 5-0 to Atletico, 5-0 in Malaga, 0-4 hosting Barcelona. Lass in back but Tito who is covering all the right side from defence to the attack is out and he will be missed. Its an ultimatum for Sevilla, you can say the same for Rayo who lays 2nd from bottom but the pressure is on the hosts. Sevilla should play just like Valencia played them last weekend.','','0','-1.00',1.78,'6',57.05,0.00,575,2,'',1559.83,1,NULL,NULL),(213,1,0,0.00,1389629395,1389629395,1380052800,21,'Granada','es','Valencia','es',1,'Spain La Liga','','Valencia got waht they wanted badly against Sevilla and things became tranquil untill... today when Rami opened his mouth...! The central defender talked about Djukic and said \'we will see where he will be in the end of the season\'... sending in the surface the problems lie in the Valencia\'s lockerooms. He was called back to apologize from Granada so he is missing, Ricardo Costa is missing too so ...problems in defense which is already vulnerable. Winning against Sevilla doesn\'t makes Valencia any giants. Granada got a 0-0 draw in the region derby against Betis with Lucas Alcaraz rotating his squad big enough! Riki FW** didn\'t playu a minute while Dani Benitezlw***, Brahimi RW*** and Yebda CDM came as substitutes. Now Dani Benitez has been surprisingly dropped as well, but the others are set for a starting up role. Ighalo FW is available as well, defender Foulquier will debutize. Diego Mainz DF*, Piti FW** remain injured. Buonanote and newcomer excellent wingers from Mallorca Pereira, will cover for Piti (already missed 3 games) and Benitez, wile Murillo has taken the nod in defence more than once this season. So Granada are almost in full power and will play a complicated game for Valencia. Real didn\'t manage to play at their level in Granada, will Valencia function?','','0','0.25',2.00,'7',56.35,0.00,564,3,'',1563.51,1,NULL,NULL),(214,1,0,0.00,1389629395,1389629395,1380139200,21,'Villarreal','es','Espanyol','es',1,'Spain La Liga','','Villarreal is the relevation of the new season. A fine team, solid defensively and with plenty of talent up frond. Excellent and rapid attacking players. No missings. Espanyol have their ups and downs. Aguirre introducing changes in the line up. Javi Lopez RB* and David Lopez DH* (rest) are out with Mattioni and Abraham taking their places. In the attack, Stuani FW*, Pizzi FW* and Simao WG are also set to start to the bench with Lanzattore, Thievy and Fernandez stepping in. I was set to skip this one but as long as Espanyol will be fielded with changes I doubt they can keep Villarreal away from the area. In order to escape Madrigal undefeated you need to play in full power and fully concetrated. Real suffered there.','','0','-0.50',1.76,'8',56.96,0.00,576,2,'',1555.51,1,NULL,NULL),(215,1,0,0.00,1389629395,1389629395,1380139200,21,'Getafe','es','Celta','es',2,'Spain La Liga','','Both have missings here. Getafe will have to do without Escudero LB*, Lafita OH**, Valera RB** and MÃ­chel MD* (susp) while Celta is without Hugo Mallo RB** (rest), Nolito MD** and Augusto MD*** (injured). As you can see there are some good names in these missings included, still, the difference is that Celta can cover while Getafe will struggle without Lafita who have been their best player in this early stages of the season. Michel will also be missed in the center and the worst is that Lacen returns from injury... Varela is also important for Getafe covering all the right side of the team. August is a missing for Celta, Nolito as well but Nolito was already been benched ion the last game with Rafinha and Krohn-Dehli coming to cover. Luis Enrique may change his formation to a 5-3-2 one which sounds too tough for Getafe to brake.','','0','0.50',2.00,'6',56.36,0.00,564,3,'',1563.59,1,NULL,NULL),(216,1,0,0.00,1389629395,1389629395,1380139200,21,'Athletic','es','Betis','es',2,'Spain La Liga','','Betis were succumped in a home draw in the region derby against Granada last Sunday, a game help at 12 CET and with a temperature of 32 Celsium degrees. That was a bad game for Betis with Pepe Mel resting Verdu OH*** and Cedric WG** while Ruben Castro FW*** was a late drop through injury. Moreover Nosa CMD** was left out to take a rest. Today Pepe Mel keeps on with his rotation tactics leaving Perquis DF* and Vadillo MD* out while Juan Carlos MD**, RubÃ©n CastroFW*** remain out. Castro is an excellent striker BUT hasn\'t constributed at all in the nes season due to his injury. Moreover Betis has shown that they have great alternatives.\n\nValverde is also set to introduce some changes. Iraizoz retains position in the goal, while Susaeta and Herrera returns after being rested in Espanyol. The problem in the left side in defence remain as long as Saborit and Balenziaga are still injured. Betis have great history stas in Bilbao, 2 wins in the last 2 years and 4-7-4 overall, while Pepe Mel has never lost there winning 3 and drawing 1.\n\nAthletic have been playing a bit better than in the start of the season but have not reached their best level. They struggled against Celta in their recent home game and will suffer once more against solid Betis.','','0','0.50',2.00,'6',55.76,0.00,558,3,'',1557.59,1,NULL,NULL),(217,1,0,0.00,1389629395,1389629395,1380225600,21,'Valladolid','es','Malaga','es',2,'Spain La Liga','','Valladolid got a 1-1 draw in Levante in a game they played like usual on the road, full defense. They were reduced to 10 men a few minutes before half time but luckily Levante wasted the penalty to make it 2-1. One of the relevations of the season, left back half Bergdich was sent off but he is now available to play as long as the appeal committee must have edited his sanction. Key forward Ebert, who have yet to find his good form struggling from injuries, is fit to feature. He was a doubt in last days.\n\nMalaga got a deservedly home win against Almeria who were proved too \'innocent\' to beat a team like Malaga away from home. It was a nice game from Malaga who had mid Portillo their MVP for second game in a row. Schuster has the same squad for 3rd game. Valladolid is strugling to creat danger against well organized defensively sides. On the road, this is their only weapon, to play full defense, but at home they  were competitive only against Getafe and struggled big time against Athletic de Bilbao and of course Atletico last weekend losing easily. Malaga is a tough team, solid in defense no doubt and with great guys up front. They have Duda to serve the ball with his left leg in set pieces, they are the favorite to win in Vallecas, or at least not to lose.','','0','0.00',1.88,'5',0.00,0.00,0,1,'',1552.59,1,NULL,NULL),(218,1,0,0.00,1389629395,1389629395,1380398400,21,'Celta','es','Elche','es',1,'Spain La Liga','','Luis Enrique rotated his squad in Getafe and Celta lost performing one of their worst games in the season by 2-0. Enrique went up to 7 changes, 3 of them obligated. Now Hugo Mallo RB**, Nolito MD** and Augusto MD*** return while Luis Enrique is set to field his best team. Elche comes from Wednesday\'s \'Real Madrid massacre\' a result that raised their morale but left them with their manager Fran Escriba and defensive half Carlos SÃ¡nchez. Moreover Sapunaru RB* remains out for 3rd game. Elche have yet to win a game in La Liga while Celta have only one win away in Betis in 6 games.\n\nBoth will be motivated here but I am going with the hosts who have made some excellent home performances against Sociedad 1-1,  Valladolid 1-1 and Real 1-2, while Elche struggled away in Rayo lost 3-0, Almeria 2-2 and Osasuna lost by 2-1. This game is more than important for Celta who knows that losing against a relegation candidate at home put them in troubles...','','0','0.50',2.00,'7',55.06,0.00,551,3,'',1550.59,1,NULL,NULL),(219,1,0,0.00,1389629395,1389629395,1380398400,21,'Betis','es','Villarreal','es',2,'Spain La Liga','','\nPepe Mel fielded a team full of changes in Bilbao and instead of see his team receiving 3-4 goals in the first part, Betis got an unexpected lead just before half time. It was a miracle, but after the restart justice was done with Betis receivinf two and losing by 2-1. Mel had important missings, fielded his team with subs and still his first changing was a sub replace a so called regular... Today the missings of Ruben Castro FW*** and Jose Carlos WG** remains still, with Mel surprisngly dropping Cedrick WG** out of the call! Villarreal is a solid team and have an almost full squad with the exception of left back Costa. Betis have EL on Thursday and this may cause more rotations from Pepe Mel today while Villarreal have only eyes for La Liga. Villarreal will be too strong for Betis today.','','0','0.00',2.00,'7',54.36,0.00,544,3,'',1543.59,1,NULL,NULL),(220,1,0,0.00,1389629395,1389629395,1380484800,21,'Granada','es','Athletic','es',1,'Spain La Liga','','Granada have yet to win infrond of their supporters in the Los CÃ¡rmenes but they definitely deserved much more out of the three games they played there. Against Real, Espanyol and most recently Valencia, they performed in a decent level and especially the midweek defeat to Valencia was too hursh for them. Lucas Alcaraz have only one missing to cope with as long as Piti remains sidelined. Center back Diego Mainz returns. Some changes were announced but these lead to Granada\'s stronger version. Riki in attack instead of out of form El Arabi, Mainz in defence replacing Diakathe, Yedba and Fran Rico in the center of the field instead of Recio and Ittura. Dani Benitez who was dropped against Valencia may takes a starting up role while Alcaraz didn\'t deny that he may use a formation with two strikers.\n\nAthletic on the other hand are known for their quality and vertical football but they are known for their \'on the road\' instability as well. They won in the opening day in Valladolid against a much weaker rival, they lost without fighting in the Bernabeu and were succumbed in Espanyol by 3-2. No important missings than the known ones in the left back position with Valverde dropping Itturaspe to call another defender in the list (Etxeita). The starting lineup today is a mistery, but the not more than 2 changes regarding the last game are expected.\n\nGranada at home makes a tough rival even against high flying teams. Athletic isn\'t such a team away from home. What have been missing to Granada is the ball going to the opposite nets. If they play at the same level as against Valencia they won\'t lose today. Odds are too generous for Athletic and they keep diving. Yesterday the 0,25 ball on Granada was around 1,75 and the DNB at 2,08. Now odds went up to 1,81 and 2,20 respectively! I guess people takes the table and know barely few things about Granada.','','0','0.25',1.83,'7',54.94,0.00,555,2,'',1536.59,1,NULL,NULL),(221,1,0,0.00,1389629395,1389629395,1380744000,21,'Rijeka','es','Betis','es',1,'EL','','Pepe Mel has been under a strange rotation policy in recent games in order to keep his squad fresh to compete in the European and domestic competitions. This led to some lousy performances with the worst of them in Bilbao against Athletic while Betis didn\'t convince anybody hosting Granada 0-0 and Villarreal 1-0. As a matter of fact, Betis managed to win only this weird Valencia team recently at home with los Valencianos making their rival look like Barcelona in their glorious days! Pepe Mel will introduce changes once again today. RubÎ¹n Castro FW***, Juan Carlos MD**, Paulao CB* are injured, Chica LB, Matilla MD are not registered in EL, while Chuli FW and Vadillo MD** stayed in Sevilla to take a rest. On the contrart Îlex LÎ±zaro and Ignacio Abeledo, two players from the youth team got the call and may enjoy some min utes today!\n\nRijeka on the other hand are not pushovers, despite losing heavily in the opening day of the group stage in Guimaraes. The Croacians were advanced in the group stages by eliminating Stuttard with a 2-1 home win and a 2-2 away draw! They are unbeaten in Croatia with 6 wins and 5 draws. This game is important for another one reason for Rijeka. Just like today 29 years ago they beat Valladolid by 4-1 to get to the UEFA Cup next round and being eliminated by Real after a thrilling 2 games draw, winning in Croacia by 3-1 and losing in Bernabeu by 3-0! No important missings announced.\n\nThis definitely isn\'t as easy as offered odds show for Betis who will play in a mixed squad again. The half ball on the hosts looks pretty tempting to try.','','0','0.50',2.08,'6',55.59,0.00,562,2,'',1543.40,1,NULL,NULL),(222,1,0,0.00,1389629395,1389629395,1380830400,21,'Malaga','es','Osasuna','es',1,'Spain La Liga','','Two teams with completely different routes in La Liga. Osasuna confirms the preseason bleak predictions as long as the summer departures and missing in attack are the reasons for their huge scoring problems. The new arrivals are not high class players and next to the numerous missings the team has been facing it is nothing strange to have such a terrible record to show. Last week they deserved more in the 1st part hosting Levante, but as long as their forwards failed in clear cuts opportunities, Osasuna could not ask for a better fate even though Levante\'s dying minutes winner-penatly was fake. Levante was better in the 2nd part. Today senor Gracia has to cope with the known missings of  Echaide DF, Miguel FlaÃ±o CB, Roberto Torres MD*, Nino FW*, Raoul Loe DH*, plus Cejudo\'s MD due to sanction. Oriol LB is back though with Gracia thinking about fielding three defensive halves just like he did in Atletico.\n\nMalaga on the other hand lost key players in the summer but covered the missings with new guys and manager\'s Schuster philosophy. Malaga plays the South American style, huge pressure and rapid attacks when they got the ball. They give the ball possesion to their rivals and should Osasuna fell in this trap they will lose big tonight. Last week Malaga didn\'t play as good as they played in previous games, but they got a draw in Valladolid. Today Schuster is set to change his midfielders in order to give his team more offensive options. El Hamdaui may start, Pawlowski â who scored an impressive one in Valladolid, will take minutes but most probably will start from the bench again. Osasuna plays in a different way to Rayo and Almeria who recently visited La Rosaleda and left defeated.\n\nOsasuna will set up a defensive wall but their lack of scoring abilities and Malaga\'s pressure will complicate things for them. Odds on the -1 went up, in fact now the -3/4 is the line here and this makes odds on -1 juicier to take.','','0','-1.00',2.00,'7',54.89,0.00,549,3,'',1548.88,1,NULL,NULL),(223,1,0,0.00,1389629395,1389629395,1380916800,21,'Elche','es','Espanyol','es',2,'Spain La Liga','','Elche are coming from two great games, the home one against Real Madrid and the away in Celta which led to their first win in the league. The situation in the team is very good the morale is high  and the frinjiverde are now heading for their first home win! Fran Escriba have important missings in defense though, as long as Botia CB* is suspended and Albacar LB is extremely doubt. Sapunaru, a natural side back half, will p[lay in the center of the defense while Albacar\'s possible missing can be covered by sub Cisma. Escriba has doubts in the middle line as long as Carlos SÃ¡nchez returned from suspension. Elche was fielded on a trivote (3 defensive halves) against Real and did very well, while Javi Marquez and Ruben Perez did also great last week in Vigo. Javi Marquez is a great player (former Espanyol\'s key playmaker) and he has starting giving his fruit to Elche.\n\nNow Carlos returns so Escriba is thinking about fielding a trivote again, but who can really tell? The game is important for ex periquitos Javi Marquez, Corominas and Albacar! Especially Albacar will honor his Espanyol youth teammate Dani Jarque who died a few years ago, in the 21 minute of the game.\n\nEspanyol on the other hand, traveled without Hector Moreno CB* who is supposed to be injured. I don\'t know if he truly is, but he was dropped 3 weeks ago and in the last two games he performed below average. No more missings for Aguirre who is set to field his best team today. I am going into a more aggresive tactic right now taking Espanyol\'s level ball (0 or DNB). Elche have built up a nice team but Espanyol are way more experienced and Aguirre knows that he can\'t lose this one coming from two defeats. Pizi, Stuani, Simao, Garcia and international candidate Victor in the middle line, compose a strong rival for Elche.','','0','0.00',2.00,'7',54.19,0.00,542,3,'',1541.88,1,NULL,NULL),(224,1,0,0.00,1389629395,1389629395,1380916800,21,'Rayo','es','Sociedad','es',1,'Spain La Liga','','Sociedad were succumbed in anopther defeat this time in BayArena despite their good performance. Two goals in the dying minutes of each part left los donostiarras frustrated for not escaping Leverusen with a point. Now Sociedad returns in La Liga visiting Vallecas to play rock bottom Rayo Vallecano. Senor Arrasate has to cope with the known missings of Estrada and key playmaker Xabi Prieto. Moreover, the rotations will take place again with one of Griezmann or Vela starting from the bench.\n\nRayo on the other hand, deserves better fate than table shows. They play at the same level they have been playing during the latter campaign, but their problem is that this season they lack the skills of Baptistao, Chori Dominguez, Piti and Fuego. But they play well enough. They keep the ball possesion and recover wrong balls in the middle line but usually failed by their own defensive mistakes. They did better in Valencia in this matter though and as long as Paco Jemez fix this \'bug\' soon, Rayo will start winning points. Today Paco Jemez has a full squad to choose as long as Tito RB**,  Viera FW* (susp), GÃ¡lvez CB* (susp) return in the list and the missings are not important.\n\nSociedad haven\'t convinced anyone yet and today they are coming from a midweek tough game. The man who usually takes them out of difficult situations, Xabi Prieto OH ***, remains out and the rotation policy will be continued. I expect a much fresher and motivated Rayo today and from what I have seen from them recently I am sure they will play in high level. Will Socieda be able to compete at the same level?\n','','0','0.00',2.16,'7',55.00,0.00,558,2,'',1534.88,1,NULL,NULL),(225,1,0,0.00,1389629395,1389629395,1381003200,21,'Sevilla','es','Almeria','es',1,'Spanish La Liga','','Andalusian derby with Almeria enjoying pretty good history stats in the Sancez Pizjuan even though the last time they visited Sevilla was back in 2010 before they got relegated in segunda. Much have changed since then and now Almeria returned in primera aiming to stay longer than in their last time. Almeria have played some good games until now but wasted numerous poitns because of their incapability to secure their lead and avoid silly mistakes. The problem about Almeria is that besides a couple of great talents, sub internationals Suso and Vidal, and old fox Soriano, they don\'t have more quality to show in their squad. Their manager, Francisco, the youngest in La Liga ever, only 35 yo, is enthousiastic but lacking experience just like the rest of the team. No missings today for Almeria.\n\nSevilla, on the other hand, won comfortably enough against Fraiburg last Thursday with Emery rotating 3-4 players mainly in defense. Sevilla have started recovering confidence and at least at home they can produce nice attractive soccer and put their rivals in high pressure. Almeria is the kind of a team that is set to suffer in Sevilla si ply because they can\'t defend properly. Here we have to be careful about Sevilla\'s defense as well as Almeria will play offensively too. Rakitic and Jairo in excellent form, Trocko is back on track game by game, Marin may step in after starting to the bench in the last two, Gameiro and Bacca are fighting for a place up frond. Navarro is back but as long as wonder boy and recently called in the National Squad and signed a contract extension in Sevilla, Alberto Moreno is fit, Navarro goes to the bench. Cala CB* is out in the only missing for Emery.\n\nOdds on -1 became too juicy to miss this bet.','','0','-1.00',1.99,'7',0.00,0.00,0,1,'',1543.00,1,NULL,NULL),(226,1,0,0.00,1389629395,1389629395,1381003200,21,'Athletic','es','Valencia','es',1,'Spanish La Liga','','Athletic hosts Valencia with Ernesto Valverde gathering all eyes! The Basque manager was in charge of Valencia last season taking over from Pellegrino and despite his successful 2nd round run he failed in the last day to give his team a CL exit. That game was in Sevilla and just before kick off it became known that Valverde is leaving the team. Strange feeling for the players. Anyway, Valencia was struggling two weeks ago but the consecutive wins over Sevilla, Granada, Rayo and Krasnodar made things more tranquil for los Che! You may think that, whao, 4 wins in a row is an amazing achievment, but it\'s not the whole truth. Valencia suffered in the last three games and despite picking up all points they didn\'t convince anyone. Moreover, in the last 5 La Liga games, their keeper Alves was announced the MVP of the team... and this tells enough! Now for today Alves remains injured, lost the Krasnodar game as well while important right side back Pereira remains in the list. Rami is in discipline. Postiga and Guaita return.\n\nAthletic on the other hand, have shown two different faces untill now, very strong at home but below average on the road. Last Monday they lost in Granada, it was expected, now los leones return home where they put their rivals in huge pressure. Ibai Gomez FW* who was in excellent form recently is out, but there is good news for Saborit LB* who returns to fix the bug in the left side back position. Iturraspe, who was surprisingly dropped last week is also back.\n\nValencia had a midweek trip in Krasnodar to cope too. They will be under huge pressure in Bilbao I am expecting a underperforming like in Betis a few weeks ago.','','0','-0.25',2.00,'7',54.30,0.00,543,3,'',1543.00,1,NULL,NULL),(227,1,0,0.00,1389629395,1389629395,1381003200,21,'Getafe','es','Betis','es',1,'Spanish La Liga','','Getafe are stong at home haven\'t lost any game there and they are in great form. Pedro Leon WG*** has started playing better, Lacen was dropped from the middle line with Michel replacing him with great performances, striker Colunga is also in excellent form while new star, young Sarabia has risen! MikuFW left the team, Marica joined, another good move! There is no doubt that Luis Garcia\'s Getafe will start picking up more points from now on. They needed their time.\n\nBetis on the other hand has confused everybody and it is the rotation policy to blame. Firstly, Ruben Garcia\'s FW*** missing is huge and despite the fact that Betis covered in some games, their overall scoring record is really poor. 7 goals in 7 games and last season it was 12 at the same time. Pepe Mel has even admitted, we miss Ruben\'s goals. True, but Betis remain a tough team with strong middle line and defense. Midweek in Rjieka they had the ball, much better than the Croacians, but didn\'t know what to do with it. No real chances to score and Rjieka went up to some nice counters. Today Pepe Mel will rotate again, 6 changes are expected in refference to the Rjieka game. Ofc this means Betis will be fielded with the regulars, but, this isn\'t for granted...\n\nGetafe will be fresher. Getafe have also a tough defense to oppose to Betis\' defense, while Betis will have to cope with the Croatia trip as well. Level ball on Getafe, I doubt they will lose to Betis today.','','0','0.00',1.86,'6',54.82,0.00,553,2,'',1537.00,1,NULL,NULL),(228,1,0,0.00,1389629395,1389629395,1381262400,21,'P Preta','br','Atletico MG','br',1,'Brazil A','','Odds on the home win have gone mad downwards and this is because Atletico MG is set to play with many sub players today.  Striker Jo (15/5) is missing with the Brazil NT, Ronaldinho is out for 2nd game, while 10 more players are facing one game suspension if they get booked today. In a few days Atletico is playing the derby against leaders Cruzeiro and everybody there are talking about this game and not the today with Ponte Preta. The hosts are a buit tired by the continuous games but their motivation to win is huge and they are facing a rival with many changes and their mind in Cruzeiro plus some key missings of Jo, Ronaldinho, most probably cb captain RÃ©ver and more players...\n\nI think we missed some juicy odds here but Ponte Preta\'s draw no bet (0)  at 1,88 lies to the edge of value we can afford for this underdog.','','0','0.00',1.88,'5',55.26,0.00,557,2,'',1543.16,1,NULL,NULL),(229,1,0,0.00,1389629395,1389629395,1381262400,21,'Corinthians','br','Atletico PR','br',2,'Brazil A','','Struglling offensively Corinthians will have to do today without internationals strikers Alexandre Pato (22/7 â Brazil NT) and P. Guerrero (17/5 â Peru NT) who makes 2/3 regulars in attack. 35yo striker Emerson returns to cover up front next to 22yo Romarinho but as it seems Corinthians will lose sparkeness, at least what they can afford until now. They didn\'t perfrome any good in recnt weeks according to the Brazil reports.\n\nAtletico PR on the other hand are doing pretty well and already climbed as high as 3rd in the table seeking for a Libertadores qualification. Atletico PR (45:35) have scored the double plus 1 goals than Corinthians (22:17) but they have also received that much! They do struggle away against solid defenses but the one who struggles more to score is Corinthians and even more today with the missings in attack.','','0','0.50',1.88,'6',55.78,0.00,563,2,'',1546.56,1,NULL,NULL),(230,1,0,0.00,1389629395,1389629395,1381521600,21,'RM Castilla','es','Recreativo','es',2,'Spanish Segunda','','RM Castilla deserved more gainst Zaragoza and Tenerife, but they got what they badly needed against Lugo. What is common in all these games for Castilla is that they play in a decent level creates opportunities but fail to score. They have about 4% scoring efiiciency untill now and how it could be different as long as RM Castilla have lost all their star players in the summer and even manager Garcia Toral admitted that they lack quality to stand in segunda division. They are playing without a real striker and this is why they have only scored 4 goals in 8 games... Keeper Pacheco (WCQ) and important center back Osede (injured) are the most notable missings. Recreativo Huelva on the other hand, are the leaders and the team with the best attack in the league. They are winning games even without playing in high level. Two missings, center back Fernando Vega (8/1) is a new one while winger Jonathan Valle (6/1) remains out. Recreativo haven\'t lost in the two games they played in Madrid. Last season they won by 0-1 and it was about this time, in November. Odds are crazy...!  Recre deserves a shot here!','','0','0.25',1.90,'6',56.32,0.00,569,2,'',1551.84,1,NULL,NULL),(231,1,0,0.00,1389629395,1389629395,1381521600,21,'Sabadell','es','Las Palmas','es',1,'Spanish Segunda','','Sabadell started the season with numerous missings mainly through injuries but game by game new players arrived (Sutil, Idalgho) and the team have started roling. Last week they offered an impressive game in the Catalan derby in Girona but despite shoting 4 times in the posts they saw no win for another away game (1-1). Their strength lies at home and for today they only have long term missings.\n\nLas Palmas on the other hand, have pure quality in their squad but failed to performe in a decent  level until now. Today they have one important missing, former Osasuna midfielder Masud who is on international duty with Iran while striker Delev (5/0) is with the Bulgarian NT. Las Palmas saved by ...their keepr last week hosting Cordoba. Barbosa saved a penatly, Cordoba had a post in the next minute and enjoyed the best scoring opportunities during the game with Las Palmas delivering twice in very few occasions.\n\nThe home factor and the form makes this shot on Sabadell\'s \'draw-no-bet\' interesting.','','0','0.00',1.98,'7',0.00,0.00,0,1,'',1556.24,1,NULL,NULL),(232,1,0,0.00,1389629395,1389629395,1381608000,21,'Barcelona B','es','Deportivo','es',2,'Spanish Segunda','','Barcelona B are coming from three defeats in a row without scoring a single goal in favor. Manager  Sergi is optimist though as long as the Catalans played some nice games recently and hopes that Deportivo\'s visit at the Mini Estadi today will break the bad gust of wind. It will be a pretty hard task though as long as Barcelona B\' will have to do with several players missing on internations duty.\n\nRegular Bagnack CB (5/0), Babunski MD (4/0), Sanabria FW (2/0), Adama TraorÃ© FW (1/0), are missing with their National squads, while regualrs Dongou FW (5/0) and Sergio GÃ³mez CB (6/0) are out injured. Some other players remain long term sidelines.\n\nDeportivo though, is not any segunda division team. They belong in primera and it is quite interesting to say that they have never lost playing against a \'b team\'. In the season 2011-12 when they were playing in segunda again they played against Villarreal B\' and Barcelona B\' and lost all 4 games. Their squad have pure quality and experience and most of the defense and middle line are the same as last season in La Liga. Depor have the best defense in the division and in the last three games they kept a clean sheet.\n\nOnly Insua CB (8/1) is missing, while Arizment FW (7/1) and experienced center back Marchena (1/0) is fit to play.','','0','-0.25',2.06,'6',56.96,0.00,576,2,'',1557.24,1,NULL,NULL),(233,1,0,0.00,1389629395,1389629395,1381953600,21,'Jaen','es','Deportivo','es',1,'Copa Del Ray','','Jaen was awesome in Gijon, was the team who deserved everything. By mistake they received the goal and then they took over. Today 4-5 changes are taking place. Depor had the experience to escape victorious Barcelona B\' last Sunday adding one more away win in their record. Fernando Vasquez made it clear, they want to advance in the next round of the cup but the league is priority so today noumerous changes will take place in the starting XI. Four players from the B\' team are sure to start (this is the max the association allows in a cup game) and many sub players are also taking the nod. Only three professionals are going to start today. Depor played in the same way in the previous cup round and surprisingly eliminated Cordoba in the penalties.\n\nJaen want this game more than Deportivo who have set the league as top priority. Less changes for the hosts and a quite interesting stage of form makes this choice on their \'Draw No Bet\' reasonable.\n','','0','0.00',1.92,'6',57.51,0.00,581,2,'',1563.60,1,NULL,NULL),(234,1,0,0.00,1389629395,1389629395,1382126400,21,'Osasuna','es','Barcelona','es',1,'Spanish La Liga','','Messi recovered in record time while Puyol returns in the blaugrana list 222 days after his last appearance in order to help los cules escaping Pamplona with another one win in the season! Mascherano is also back but the FIFA virous is to blame for Pique and Alexis losing the trip to Navarra. Dani Alves was dropped as well while Jordi Alba is the only missing through injury.\n\nOn the other hand, Osasuna have Roberto Torres, Miguel FlaÃ±o and Jon Echaide back in the squad but Javi Gracia will have to do without one of the 6 players he used in every single game since his arrival, Armenteros. Osasuna have been doing remarkably well in recent games and this shows that Javi Gracia work grows fruits. The performance in Atletico Madrid against one of the best teams in Europe, didn\'t come incidentally with the next games against Levante and Malaga confirming the excellent form of los rojillos. Of course Osasuna lost against Levante but they were at least impressive (mainly in the 1st part) achieving 70% ball possesion and 20 scoring attempts! The Malaga game came right after with Osasuna obtaining a well deserved away win.\n\nNow it\'s Barcelona coming in Pamplona and is set to suffer just like they suffered last year and the year before and before that. In the last 10 years history shows 2 wins for Osasuna, 4 draws and 5 wins for Barcelona who only in 2010 managed to win with more than 2 goals there! Last year it was Messi\'s late double (76\', 80\') to make a hard fought 1-2 win for Barcelona and two years ago guess what, Osasuna won it by 3-2! The FIFA virous from the international games the El Sadar history, the great Osasuna form and their greater need of points, makes this bet takeable. Note that Barcelona will play on Tuesday in Milan against a traditional hard CL rival for them, AC, so they may underestimate Osasuna here.','','0','1.75',2.00,'7',58.21,0.00,589,2,'',1568.12,1,NULL,NULL),(235,1,0,0.00,1389629395,1389629395,1382126400,21,'Valencia','es','Sociedad','es',2,'Spanish La Liga','','Real Sociedad are going to write history in gold letters in today! Should they win in Mestalla they will get into the elite that managed to win there for three times in a row! Is this possible? Well, Sociedad have been underperforming this season and it is obviously has to do with the CL. Real weren\'t used to play in two competitions in high level and the rotation policy â necessary in a situation like this â was one of the reasons for league underperforming. The good about this is that Sociedad showed signs of improvment in their last two games in Leverkusen and Vallecas but still they were succumped in late and hursh defeats. Captain and Javi Prieto is back after losing the last three games on the sidelines but he is expecting to start in the bench while Dani Estrada, Esteban Granero and Diego IfrÃ¡n are long term missings. Zurutuza is fit to take a starting up role in the midlle line.\n\nOn the other hand, Valancia was awesome at last and they did so in Bilbao! Los Che had a winning run but their performances were mostly poor and goalkeeper Alves was their savior and MVP. In their last game they recovered confidence and deserved more than a draw in Bilbao. Who knows. Maybe the players wanted to revenge their former manager Valverde for announcing his decision to leave the club just before the crucial last game of the season in May? Nobody can tell. Well, Rami was forced out. He signed on loan in AC Milan with a purchase option. This sounds like a solid decision from the club to punish the riot ones but it also makes a defender less for Valencia who remain without their savior Alves. Good news about right back Pereira who recovered his injury and return to cover in the right back. Anyway, Sociedad plays on Wednesday in Man Utd, while Valencia host St Gallen on Thursday.\n\nBoth will have an eye on these games but after a two-week break I am not expecting anything less than a hard fight in Mestalla. And I have eyes for both outsiders in the upcoming UEFA games... (St Gallen is a very nice team). What makes this bet possible are the odds and line offered. +0,75 ball or Sociedad is really something we haven\'t seen for  months and we gladly take it.','','0','0.75',1.88,'7',58.83,0.00,594,2,'',1575.12,1,NULL,NULL),(236,1,0,0.00,1389629395,1389629395,1382126400,21,'Recreativo Huelva','es','Lugo','es',2,'Spanish Segunda','','The league leaders Recreativo de Huelva enjoy a tremendous form coming from six wins in a row and today they are eager to repeat the midweek success in the cup against the same team they are meeting now, Lugo. The visitors on the other hand, are aiming for the 2nd place this season which means a straight promotion in primera division. Recre gave us a nice away win in Madrid last week, BUT, they deserved nothing out of that game. Maybe the draw. They got an early lead by a huge keeping mistake from Castilla and during the game their keeper saved a penalty to keep their lead. Castilla got the equalizer before half time, they had a shot in the bar which is still shaking and in a counter Recre scored the 1-2 from offside position. The problem for Recre is that the Castilla game wasn\'t the only one they were lucky. In their last three games Recre deserved very little but got everything, 3 wins, and we had this in mind taking their outstanding odds in Castilla.\n\nOn the contrary, Lugo have been performing very well in the season confirming their goal to chase the 2nd place and the promotion to primera. Their only recent defeat came in Madrid against Castilla in a game they didn\'t even bother getting in the field... Some rumors were surfaced about that game.\n\nAnyway, this is a hot game between the leaders Recre and the team with the best form, Lugo. No important missings for none, odds are amazing high for Lugo. In the midweek Recre won but both played with numerous changes.','','0','0.50',2.02,'7',59.54,0.00,603,2,'',1581.28,1,NULL,NULL),(237,1,0,0.00,1389629395,1389629395,1382126400,21,'PAOK','gr','Asteras','gr',2,'Greek SL','','PAOK are not standing in their feet nowadays and the main reason is the system which is based in the two holding midfielder Tziolis and Lazar. The bad think about PAOK is that these players are exhausted from continous games and international duties while other star players of the team are not in better form, Lucas, Salpi and Stoch.\n\nOn the other hand Asteras have started playing better and deserved much more in their last game which finished in a bitter injury time draw. Asteras greater advantage here is their history stats against PAOK. No matter when Asteras meets PAOK, they play better and usually wins (shouldn\'t count here the last May playoff games when only PAOK had something to play for with Asteras fully inmotivated).\n\nThe best part here are the odds offered on Asteras!','','0','0.75',2.00,'6',58.94,0.00,589,3,'',1589.42,1,NULL,NULL),(238,1,0,0.00,1389629395,1389629395,1382212800,21,'Granada','es','Getafe','es',2,'Spanish La Liga','','Getafe went into the international break in excellent form and even though the two weeks of no action was rather a disadvantage for them very good news came up in this period. Lafita OH**, Valera RB** and Lisandro CB*, three important players of the team have been fully recovered and made it in the squad to Andalusia to play Granada who were in need of the break in order to rally their troops and regain confidence and strength.\n\nGranada have only two wins in the season despite the pure quality of their squad and this means that other teams have learnt how to play them. Probably. In the Los Carmenes they beat Bilbao in their last game and it was really expected but this time Getafe will make a tough rival and odds offered are really tempting. Granada have Pity and Recio back.','','0','0.25',2.06,'7',59.68,0.00,604,2,'',1582.42,1,NULL,NULL),(239,1,0,0.00,1389629395,1389629395,1382212800,21,'Valladolid','es','Sevilla','es',1,'Spanish La Liga','','Valladolid have been facing key missings through injury so far in the season and today makes to exception. New signing FW Osorio got injured, defender Heinz as well while defensive half Sastre hasn\'t been fully recovered and was dropped precautiously. But there are good news as well today as key striker Javi Guerra made it in the squad while long term injured  Manucho FW, Ãlvaro Rubio DH** and Larsson FW* have been fully recovered and made it in the squad.\n\nOn the other hand Sevilla traveled without key missing in Valladolid as long as Marin CMD*, Rakitic CMD***, Trochowski MD*, Fazio CB, Mbia and Cheryshev are out, the first three new missings. Rakitic\'s missing is influentilal as long as the Croacian is Sevilla\'s best player and was announced MVP from Spanish paper marca in 4 out of last 5 games of the team! This bet hasn\'t only to do with missings. Sevilla away from home is one of the poorest sides in La Liga, while Valladolid were in great form just before the two weeks break. It could be better if there wasn\'t any break though, but it served in Valladolid\'s favor too as long as striker Guerra recovered.\n\nValladolid is a tough home side in good form and can even beat poor away from home Sevilla.','','0','0.00',2.07,'7',0.00,0.00,0,1,'',1589.84,1,NULL,NULL),(240,1,0,0.00,1389629395,1389629395,1382299200,21,'Athletic','es','Villarreal','es',2,'Spanish La Liga','','Villarreal is the hottest team in La Liga right now, deserves a bet against struggling and vulnerable in defense Athletic so I will just take them to win today without writting anything more than what the Oddsmaker already written!','','0','0.25',2.00,'7',58.98,0.00,590,3,'',1589.84,1,NULL,NULL),(241,1,0,0.00,1389629395,1389629395,1382299200,21,'Celta','es','Levante','es',2,'Spanish La Liga','','Since Luis Enrique decided to rotate his squad, I am still wondering the reason to do this, Celta started misfire in combustion. Rafinha, Charles and even Augusto, who had an impressive start to the campaign, started underperforming and only Nolito remain to carry the team in his shoulders. This obviously can\'t work and the underperforming of several key players during the latter campaign was the reason for an almost relegation in segunda. Augusto is definitely out, Celta will miss him. Levante on the other hand, have start roling. Baba is doing a much better job here than in Sevilla while Xumerta, Diop and Ruben Garcia are the revelations untill now.\n\nLevante can defend like very few teams in the league and launch their counters with the new man in command,former Elche winger, Xumerta. No new missings for Caparros. Odds on Levante are going up. I think it is another one reason to back them! Note that the weather forecast gives 100% ruin possibility (!) in Balaidos during the game, so the defending side will have another advantage here.','','0','0.50',1.92,'7',59.63,0.00,603,2,'',1582.84,1,NULL,NULL),(242,1,0,0.00,1389629395,1389629395,1382385600,21,'Austria','at','Atletico','es',2,'Chempions league','','Atletico lost their first game in the season in Espanyol and now they are eager to bounch back and make it 3/3 in the Champions League group H. Two wins over minors from Vienna will take los Cholchoneros in the next stage, and yes, Austria are minors in reference to Atletico Madrid. Austria were left without a win for 10 games in all competitions last weekend and they should feel lucky for not losing to Ried. Atletico lost fairly enough to Espanyol in Barcelona and the worst came after the game with Diego Costa\'s injury. The Brazilean striker made it in the squad but he is serious doubt today and most probably won\'t play a minute.\n\nHe served the 4 games ban he was carrying from the last season though. Striker Baptistao is also out injured. Good news for another striker, Adrian, who recovered his injury and returned back, with David Villa starting in the peak of the attack today. Austria have regular midfielders Alexander Gorgon and Alexander GrÃ¼nwald still unavailable. Creative midfielder Stankovic and winger Jun are back in the squad.\n\nThere is a huge gap in quality here and Atletico should take this game seriously enough after the Espanyol defeat. The Ernst Happel is not the natural home ground of Austria but the city stadium where David Villa won the EURO2008 with the Spanish National Team. He should at least be motivated to honor this stadium and return in good performances!','','0','-1.25',1.83,'6',60.13,0.00,606,2,'',1590.28,1,NULL,NULL),(243,1,0,0.00,1389629395,1389629395,1382644800,21,'Malaga','es','Celta','es',1,'Spanish La Liga','','Luis Enrique is playing his head in the next games starting from today in Celta\'s visit in Malaga. Celta have only one win in the season and comes from 5 defeats in the last 6 games a terrible record that moved those from Vigo second from bottom in the table.\n\nStill Celta, doesn\'t deserve that place as long as their performances are not as bad as table ranking shows. Especially last week against Levante at home they fully dominated the game but lost is in the oinly one shot attempt from the visitors. Rafinha OH** (susp) and Krohn-Delhi FW** are missing today, Augusto FW** is back though to cover.\n\nOn the other hand Malaga are also in a bit downtrent, not like Celta, but only one win in the last 5 is not the best possible. Schuster can not count on his two center backs today, Angeleri and Sergio Sanchez, so he will have to mix his defense. Polish offensive midfielder Pawlowski got the call.\n\nI fought a lot about this game. Malaga is also in need of the points and Celta is not quite the opposite Malaga can be afraid off. Celta plays a 4-3-3 mostly with their mind in attack. Luis Enrique has learnt the Barcelona style and this is the style he want to give to Celta. Unfortunately this style is not the most suitable to play Malaga on the road. Almeria and Rayo were thrashed in Rosaleda trying to play offensively, Osasuna on the contrary won. Moreover, Celta is not the best team when traveling away from Vigo and today Rafinha will make a huge missing in the center of the field.\n\nBearing all this in mind and watching odds on Malaga reaching some tempting odds, I am taking the hosts here.','','0','0.00',2.00,'7',59.43,0.00,594,3,'',1594.26,1,NULL,NULL),(244,1,0,0.00,1389629395,1389629395,1382644800,21,'Elche','es','Granada','es',1,'Spanish La Liga','','These two met each other in the promotion play out in segunda in 2011 and Granada was the great winner getting a place among the Spanish elite! Elche are still seeking for revenge since then and today they have their opportunity!\n\nElche is in excellent state of form, something pretty much expected as long as los Ilicitanos have some quality to show in their squad plus experience from players who played big part in primera division in recent years, while Granada are doing worst game by game. Most probably the injury of Dani Benitez and Piti and the low form of El Arabi, Riki and Recio, among others, are the main reason for the poor performances of Granada. Today Benitez remain out while Piti, who recently recovered his injury, is missing again. Piti was the MVP coming from the bench last week but he is missing today.\n\nElche on the other hand, have doubts in the left full back with regular Albacar extremely doubt and Domiongo Cisma missing through suspension. Fran Escriba will cover with one midfielder in case that Albacar doesn\'t make it.\n\nElche\'s greater advantage today is the excellent form of almost all their regulars, especially their midfielders and center back defenders! This means that they will hardly leave any room for counters to Granada while Coro and co in attack, who are in great form as well, will take over the scoring job. Recently Espanyol suffered a 2-1 defeat in Elche while we can forget what Real needed in order to snitch an injury time undeserved win there...','','0','0.00',2.00,'7',58.73,0.00,587,3,'',1587.26,1,NULL,NULL),(245,1,0,0.00,1389629395,1389629395,1382731200,21,'Sevilla','es','Osasuna','es',2,'Spanish La Liga','','Game with great rivalry between these two sides in recent years with Osasuna losing due to bad reffering and late goals in Sevilla and trying to revenge their blood in Pamplona. Great passion and intividual fights composing all these games. Sevilla are in good form in the last month but they still have weaknesses to improve as long as they were pretty lucky against Rayo and Almeria. For this game Emery welcomes back important creative midfielder Rakitic and useful center half Mbia but he can not count on center back Cala and Fazio as well as midfielders Trochowsi and Marin. One further disadvantage for Sevilla is the midweek trip and game in Liberec.\n\nOn the other hand, Osasuna are doing remarkably well in the last month! They won in Malaga, played brilliantly in Atletico, domintated and deserved much more hosting Levante and they even held Barcelona in a goal-less draw. In that game they unfortunately, lost winger Sisi for the rest of the season just three minutes to the game. Armenteros remains out, Cejudo remains suspended. Osasuna always makes a tough rival for Sevilla once more now that they are in better form and finds Sevilla coming from midweek long trip to Checz republic and having key midfielder Rakitic recently recovered.','','0','1.00',2.00,'7',59.43,0.00,601,2,'',1580.26,1,NULL,NULL),(246,1,0,0.00,1389629395,1389629395,1382731200,21,'Sociedad','es','Almeria','es',1,'Spanish La Liga','','Sociedad wasn\'t good in the Old Trafford. They suffered big to Man Utd and most probably deserved to lose with a wider margin. They were definitely afraid of their big rival, and when they decided to go against them in the game they produced some dangerous. This is too little though. Sociedad didn\'t even enter the game in the first part. Anyway, today they are up to their 2nd win in a row in the league for the first time in the new season! De La Bella LB** was left out to get some rest, Jose Angel LB will replace him.\n\nAlmeria have yet to win a single game in La Liga even though they deserved a better fate in the last two games. Francisco, the youngest manager in primera ever, will introduce some changes in the XI although nothing came to surface yet. His greatest concern is the participation of Almeria most dangerous player Sub20 international Suso, who is suffering from gastrenteritis and is in a quite complicated situation to play. If he doesn\'t make it, Almeria is losing big part of their firepower. The biggest disadvantage for Almeria though will be the huge difference in quality to Real Sociedad. Los donostiarras will take their 2nd consecutive win here.','','0','-1.00',1.97,'8',60.20,0.00,610,2,'',1586.26,1,NULL,NULL),(247,1,0,0.00,1389629395,1389629395,1382731200,21,'Villarreal','es','Valencia','es',1,'Spanish La Liga','','Region derby in Valencia with both teams finding themselves in a pretty nice form and what is surely expected here is a spectacular game to watch! Villarreal have been in tremendous form since the start of the campaign especially at home ground where they even deserve to beat Real Madrid. Their only woes come when playing away from home, just like in Betis and Bilbao recently. Manager Marcelino received great news from the appeal committee who took without effect the yellow Bruno received last week in Bilbao. So the influential holding midfielder is available to play against Valencia with Marcelino only facing the known missings of non important at all, side back Jokic and mid Farinos.\n\nOn the other hand Valencia  going into the game with the morale high after the excellent displays against Bilbao and St Gallen. Djukic used a mixed team in the midweek resting most of his regulars ahead of the derby against Villarreal and now he dropped strikers Paco Alcacer and Piatti who did great against St Gallen.Jonas and out of form Postiga will lead the attack. No missings. What is for granted is that Villarreal will play in high level. It is a derby in front of their supporters','','0','0.00',2.01,'7',60.91,0.00,616,2,'',1595.02,1,NULL,NULL),(248,1,0,0.00,1389629395,1389629395,1382817600,21,'Hercules','es','Jaen','es',2,'Spanish Segunda','','Quique Hernandez is playing his place in Hercules\' bench today and should los Alicantinos fail to win he will pack his stuff to find another team to work. Hercules have failed to impress in the league and even against a lousy Numancia last week they received in the 90 minute to succumbed to a well deserved on the road draw. Missings today as long as both regular side backs, Aitor RB (7/0) and PeÃ±a LB (10/0) plus the defensive midfielder HÃ©ctor Yuste DH (10/0) are suspended while offensive half Assulin OH (9/0) is doubtful. Assulin is a key player and when he underperfoms the team struggles.\n\nJean on the other hand are doing remarkably well in the last 2-3 weeks. They deserved to win in Gijon by 1-3 or 1-4 against one of the promotion candidates, Sporting, but \'were held\' in a 1-1 daraw! Last week they deservedly beat Deportivo in the cup, Depor played with many changes though and last weekend they won at home against Alcorcon performing once again very well. No important missings, there are a couple of players missing but they didn\'t play in regulary basis in the starting XI.\n\nThe pressure is on Hercules, the good form on the visitors.','','0','0.50',1.91,'6',61.46,0.00,620,2,'',1603.09,1,NULL,NULL),(249,1,0,0.00,1389629395,1389629395,1382904000,21,'Getafe','es','Athletic','es',1,'Spanish La Liga','','Athletic are eager to move a huge step forwards, a salto arriba, as the Spaniards say but firstly they have to beat their on the road lousy performances and secondly they have to beat Getafe who are in tremendous form nowadays! It was a matter of time for Luis Garcia team to start roling in the league and this become reality when the players recovered their best form. The opening games period for Luis Garcia\'s teams is always a suffering period but this is his strategy and plan and after a while everything start working perfectly. This has been the story for Getafe in the season, but this time there are more advantages and good surprises, like the performances of Masquera, Borja, P Leon who finally found his best form and mainly younger\'s center midfielder Sarabia\'s who is amazing and already people have strarted comparing to Isco! Right back Arroyo, another revelation of the season, is out, but old fox Varela has been fully recovered alread since last week and regains regularity.\n\nAthletic, on the other hand, have been like Dr. Jeckyl and Mr. Hide in the season. They usually play very well at home, usually, but they struggle away from home. Right full back Antoni Iraola is extremely doubt and if he fails De Marcos will occupy his place and this remidns of the terrible games Athletic have been up to during the latter campaign. This missing would be more important than Muniain\'s who is losing this one injured. Ibai Gomez, who was Athletic best player in the opening games, is still nursing his injury.\n\nWhat I am expecting here is Getafe to play in high level following their recent performances and Athletic most probably to underperform like they use to do on the road. More over, Athletic have never won in the Coloseum... never. Today will make no exception.','','0','0.00',2.00,'6',60.86,0.00,609,3,'',1608.55,1,NULL,NULL),(250,1,0,0.00,1389629395,1389629395,1383076800,21,'Valladolid','es','Sociedad','es',1,'Spanish La Liga','','Valladolid are coming from the tremendous away win in Vallecas last Friday by 0-3 recovering confidence and table ranking ahead of the visit of Euro-Sociedad at the Jose Zorilla tonight! That was just their 2nd win in the season but los pucelanos have shown very good signs in the last month performing very well in all their games. Center midfielder Oscar is out again, after temporarely recovering to play part in the last game, but this doesn\'t make any new missings as long as he was a last minute drop against Rayo Vallecano. The one who does make a missing especially as an alternative from the becnh, is striker Manucho, but there are good news as forward Osorio â was awesome in his debut against Malaga recently and then he got injured â and holding mid Sastre have been fully recovered. Moreover, there were great news last week with long term injured around forward Larsson getting into action and performing very well against Rayo! So, Valladolid is reingforced today.\n\nOn the other hand Sociedad are almost in full squad, De La Bella returns, but the \'almost\' goes to the important missing of Inigo in the center of defense. Ansotegi will take his place, not at the same level as Inigo. The problem with Sociedad is that Arrasate is set to rotate today even though the changes didn\'t come in surface. Sociedad is playing the Basque derby against Osauna at the weekend and then are hosting Man Utd in the CL! Valladolid is a nut hard to break and haven\'t lost at home to Sociedad since 2002. Actually they didn\'t win more than once in three games since then, so history stats have no much to do today.\n\nWhat is for granted is that Valladolid is going to play at their 100% something pretty uncertain for Sociedad who have a mountian to climb in the next days.','','0','0.00',2.00,'7',61.56,0.00,623,2,'',1601.55,1,NULL,NULL),(251,1,0,0.00,1389629395,1389629395,1383076800,21,'R Madrid','es','Sevilla','es',1,'Spanish La Liga','','Carlos Ancelotti gave away the first part at the Camp Nou by fielding Sergio Ramos in the middle and Bale in the peak of the attack. Ok Ramos has played in this position but it was a long time ago in his first Sevilla steps. Real did not enter the field in this period and reacted only after Ancelotti went to fix things after the restart placing Benzema upfront and Illara in the middle. Real played very well in the 2nd and deserved more. Anyway, Ancelotti will make things better this time and he has no excuses as long as he has a full squad to chose, Xabi Alonso is finally available!\n\nSevilla beat 10-men Osasuna at home, they were better but when they travel in Madrid they usually lose before kick off. It\'s their mentality and today it will be the urgent need of a convincing win from Real as well. Center back Cala served his ban, good news, but Marin CMD*, Trochowski MD*, Fazio CB, Cheryshev, Rusescu FW (new missing) remain out.\n\nAs mentioned above, Sevilla lose in Madrid easy enough and today Ancelotti undergoes a hard test in from of the Madrid crowd. Blatter apologized for stating that he prefers Messi than Ronaldo so the road is open for Real to win this in an emphatic way.','','0','-2.00',2.02,'7',62.27,0.00,630,2,'',1608.55,1,NULL,NULL),(252,1,0,0.00,1389629395,1389629395,1383163200,21,'Betis','es','Levante','es',2,'Spanish La Liga','','Betis are in deep crisis and thing became more complicated last Tuesday when the ultras visited the training session asking for explanations from manager Pepe Mel and the players. Pepe Mel introduced many changes in the lineup against Atletico Madrid and Betis performed one of their worst games in the season losing by 5-0. The weird thing about the huge rotation was that Betis have already been facing enough obligated missings through injuries but besides that Mel decided to rotate the team. For today Betis are facing more obligated missings through injuries, as long as  Sara GLK*, Lolo Reyes CMD*, Salva Sevilla CMD*, Nosa CMD***, Paulao CB*, RubÎ¹n Castro FW*** (injured), Didac LB (dec tec) are out. There is good news for Amaya CB*, Xavi Torres CMD, VerdÏ OH*** who are back after losing the last one, but the missings remain too many and important. Pepe Mel will be able to compose a decent lineup but he will have no alternatives coming from the bench.\n\nOn the other hand, Levante traveled almost in full power. Crhis Lel RB* has been fully recovered but Ruben MD* failed to be fully fit with Austrian international Ivanschitz MD picking up the nod to replace him.  Levante are in excellent form and haven\'t lost away from home since the opening day in Barcelona. The truth is that Levante have been pretty lucky recently especially picking up points in Celta and Osasuna, but they have also performed some great games as the one against Real Madrid. History stats have mixed results, one time its Betis win then Levante.\n\nAnyway, Levante are in better form and momentum. They should grab one point at least here.','','0','0.50',1.94,'7',62.93,0.00,636,2,'',1615.69,1,NULL,NULL),(253,1,0,0.00,1389629395,1389629395,1383336000,21,'Almeria','es','Valladolid','es',2,'Spanish La Liga','','Valladolid have been doing pretty well recently and the most important is that they leave no game without a fight. In the midweek they played very well against Sociedad and grabbed a deserved draw wasting a huge opportunity to win in the 90 with the wasted penatly of Ebert. Osorio didn\'t manage to recover for the midweek game but he is ready now. Manucho, VÃ­ctor PÃ©rez, Ãscar and Heinz remain out.\n\nAlmeria are doing very well either and this time they were rewarded a huge win in Mestalla! Even though in recent games, Almeria haven\'t been as good as they have been in the opening 10 games of the season they stood up and turned over the game against Valencia winning crucial points and gaining confidence. That was a massive morale boost for their young manager Francisco. The younger coach in primera, only 35 yo, enjoys full respect of his players who dedicated the win to him! Francisco has a full squad in his disposal.\n\nAlmeria is a familly but this barely has to do with facing and winning Valladolid today.  Valencia was just terrible the other day, couldn\'t change two passes in the field, Almeria punished them, well done. This game is complitely different and Valladolid makes a tougher rival especially now that they will play their counter attacking style.','','0','0.25',2.00,'7',62.23,0.00,622,3,'',1622.27,1,NULL,NULL),(254,1,0,0.00,1389629395,1389629395,1383336000,21,'Sociedad','es','Osasuna','es',2,'Spanish La Liga','','Sociedad welcomes Osasuna in a Basque derby where traditionally very few goals are being scored! In the last three meeting of these two in San Sebastian only one goal was scored 3 years ago and that was a 1-0 home win for Real! Of course the \'under\' is the most common outcome in Pamplona as well as in 20 games between these two since 2000,  15 \'u2.5\' were resulted!\n\nNow for the game. Real Sociedad are coming from the cold shower and the close defeat in Valladolid in a game they took a 0-2 lead but were drawn and almost lost it in the end. Their keeper Bravo saved a penalty in the 90 minute to keep the draw for Sociedad who wasn\'t better than Valladolid but had Griezmann and Carlos Vela plus their defense (in most of the game) in very good day. Real have a full squad, Inigo and Elustodo are back. Arrasate will drop two players before kick off and he will introduce some changes not overdo though in order to keep his team fresh ahead of  Man Utd visit in Anoeta on Tuesday.\n\nOsasuna on the other hand, are coming into the derby with the morale sky high.By winning Rayo at home Osasuna got off the danger zone and now they have a full squad to play Real. Since manager Xavi Gracia arrived two months ago he made his tests and picked up the basic core of the team, 6 players. Armenteros MD** and Damia DF** who are back in the team for this game are included in this core. Real will definitely have Man Utd in their minds and Arrasate will introduce a couple of changes in the XI.\n\nOsasuna are in very good form and they will be better prepared and focused for this game. Traditionally they are picking points in San Sebastian so +3/4 at these odds looks nice.','','0','1.00',2.00,'6',61.63,0.00,616,3,'',1616.27,1,NULL,NULL),(255,1,0,0.00,1389629395,1389629395,1383336000,21,'Sevilla','es','Celta','es',2,'Spanish La Liga','','Sevilla and Celta are getting into this game hoping to heal their wounds from the midweek defeats against Real Madrid and Barcelona respectively. Celta lost at home to Barcelona by 3-0 but what Sevilla sustained in the Bernabeu was really humilliated, 7 goals against! They scored three though and this is because of their gardian angel Rakitic who was announced MVP for 6th time in the last 7 games of the team he was fit to play, losing one through injury! Cala CB* is out again,  Iborra DH and Reyes MD are not important missings. CristÃ³foro CMD, Trochowski CMD, Rusescu FW and Pareja CB are back, nothing sticky.\n\nCelta recovered confidence by their stanning win in Malaga and this was the morale boost the team was urgently needed. The team have been playing pretty well in most of thier games but were failing to show results. The game against Barcelona was a parenthesis and now with a full squad, only long term are the missings, Celta are going for their 2nd on the road bombing. Can they?\n\nOf course they can, at least to win the +1 handicap. Celta have nothing to envy of Sevilla, on the contrary they have even better quality players in many positions. Former spanish international Oubina has nothing to envy of Mbia and surely he is much better than Iborra, Nolito and Augusto, Portugal and Argetina internationals are definitely better values against the young Sevilla wingers Jairo and Vitolo! The last season top scorer in segunda Charles is at least at the same level to Bacca and Gameiro. Rafinha and Alex Lopez have giant Rakitic against them while Sevilla looks sharper in the full backs especially with wonder buy Alberto! In the goalie Celta have their guardian angel Yoel to make them feel really secure in the back. No need to mention the huge gap in the managers. Celta\'s Luis Enrique has his Barca style philosophy to show against the long balls attacking style (?) of Emery Unai...\n\nSo all in all, it is going to be a close affair. Odds make this worthy to take.','','0','1.00',1.96,'7',62.30,0.00,630,2,'',1609.27,1,NULL,NULL),(256,1,0,0.00,1389629395,1389629395,1383422400,21,'Getafe','es','Valencia','es',1,'Spanish La Liga','','Valencia are visiting Madrid in a game it could very well be the last one for Djukic in the Che bench. The last three consecutive defeats against Sociedad, Villarreal and most recently rock bottom Almeria put Valencia and their manager in a quite complicated situation and the ghost of Rami is appearing in Mestalla lockerooms. Rami stated among other towards Djukic a few weeks ago âwe \'ll see who will be in the team in Mayâ... Rami was sent out of the club and Valencia surprisingly started picking up points. Now it\'s Djukic time to go and will most probably pack his stuff. Valencia won some games recently but only in Bilbao they deserved more. Justice have been done in the last three with Valencia showing unable to change two passes in the field. Today Djukic will have to do without his two side full backs  (Pereira, Guardado) while left side midfielder Feghouli, who enjoyed regularity in the XI recently, is also missing through injury. Banega OH*** is coming back after serving his ban.\n\nOn the other hand, Getafe are doing pretty well recently. Key players Pedro Leon among them recovered their best version so the team is rolling especially at home. In their last home game they performed brilliantly and only lost to Bilbao in details while they were lucky enough to win in Villarreal in the midweek. Key striker Colunga FW** remains out for 2nd game but there is good news for Arroyo RB* who has been fully recovered after losing the last two. Valencia is struggling and today los Che will have their two full backs plus Feghouli missing. I will not speculate about players\' will to keep or not Djukic in his place, Valencia are playing terrible and under normal circumstances they will get nothing in the Coloseum.','','0','0.00',2.00,'6',61.70,0.00,617,3,'',1616.99,1,NULL,NULL),(257,1,0,0.00,1389629395,1389629395,1383422400,21,'Real Jaen','es','Mirandes','es',1,'Spanish Segunda','','Real Jaen is a team we followed recently and gave us one nice victory in Hercules last week and one win at home against Deportivo in the cup. Just before that Jaen was brilliant in Gijon and deserved more than the 1-1 draw against one of promotion candidates Sporting, while another win recently was achieved for the Andalusians at home against Alcorcorn. This time it is Mirandes visiting \'La Victoria\' with the Basques being the worst team from all the above Jaen have already won recently. More over Mirandes traveled with missings. Ruiz de Galarreta MD (11/1), Muneta MD (4/0) and Koikili DF (7/0) are new missings while Prieto GLK (5/0) and Iriome MD (7/1) remain sidelines. Promising midfielder on loan from Bilbao  Ruiz de Galarreta got injured in the midweek and is losing the rest of the season. Hard blow. Jaen on the other hand have key players back. Captain Fran Machado MD (9/1) served his ban while Kitoko MD (8/0) and top scorer Jonathan MejÃ­a FW (10/7) have been fully recovered.\n\nIts never easy to pick favorites to win in segunda but Jaen here deserves a shot with high stakes.','','0','0.00',2.00,'6',61.10,0.00,611,3,'',1610.99,1,NULL,NULL),(258,1,0,0.00,1389629395,1389629395,1383422400,21,'Alaves','es','Tenerife','es',2,'Spanish Segunda','','Tenerife have been playing really well recently but didn\'t have lady luck in their favor. After deserving much better results against  leaders Recreativo and promotion candidates Mallorca they saw their work grows fruits in Ponferradina and  at home against Deportivo and with two victories they recovered confidence and ranking in the table of Liga Adelante. Tenerife remains into the danger zone but with a win today they will most probably get off sending Alaves occupying a hot place there! Alaves have won some points but just like the opposite to Tenerife they had plenty of luck on their side! Moreover today Alaves have top scorer Borja Viguera FW (11/8) serious doubtful and even though he will manage to be fit for this game he won\'t be 100% ready as long as he lost the last two training session struggling with injury.','','0','0.50',1.93,'6',61.66,0.00,622,2,'',1604.99,1,NULL,NULL),(259,1,0,0.00,1389629395,1389629395,1383595200,21,'Juventus','it','Real Madrid','es',2,'Chempions league','','Ancelotti was back in 2000 in Juve\'s bench and Antonio Conte was his player in that period! These two are crossing their swords today in a game \'without tomorrow\' for Juve while los galacticos feel much safer with 9 points form the opening three games in the group B.\n\nWhen I started gathering the news for this game, I wasn\'t any confident at all, about backing either teams but when I checked the odds, I fell off my chair...!! Real Madrid is the underdog here? Why? Juve are doing pretty well in Serie A\' and have built up a nice team again after their Serie B\' adventure, but this season in the CL they haven\'t convinced anybody. The dropped points in Copenhagen and at home to Galata why are they such a favorite against Madrid?\n\nOk, Real have been struggling in defense and today Carlos Ancelotti introducing changes. Marcelo is taking Coentrao\'s place and Iker Casillas in the posts and moreover Xabi Alonso replacing Illaramenti. What I see from these changes is that Real will be fielded with their stronger version because Marcelo, Alonso and Casillas are better than Coentrao, Illara and Lopez. So what I expect here is a solid Madrid outfit eager to answer the whispering about their defense to play against Juve who\'s manager haven\'t decided yet if he fields up a 3-4-3 or a 4-3-3 formation, with Chiellini CB (10/1 - susp), Lichtsteiner DF (5/0), VuÄiniÄ FW (5/1) missing, and with their top scorer in Serie A\' Carlos TÃ©vez without a single goal in the European competitions since 2009, four and a half years now... And all these with Real Madrid is great odds. I don\'t know. I think this is tempting enough and I am taking the Real\'s level ball.\n\nI really can\'t tell why ppl keep betting in Juve... Odds on Real are going up! Only the motivation thing? Maybe they believe Ancelotti will do any favors? â¦ Amazing.','','0','0.00',2.26,'6',0.00,0.00,0,1,'',1610.57,1,NULL,NULL),(260,1,0,0.00,1389629396,1389629396,1383681600,21,'Atletico','es','Austria','at',1,'Chempions league','','Atletico have never won four games in a row in the Champions League and today their goal next to this one is to get rid of any promotion worries to the next stage. In case of a win today Atleti will get to the next stage and will most probably will get there as group G leaders.\n\nArda and Mario remain out, Simeone may give a rest to David Villa but he may not as long as el Guaje is in excellent form. Austria without their manager who is suspended and some others...\n\nIt isn\'t about the winner of course but about the handicap. As long as Atletico won like walking in the park against Athletic Bilbao recently they will not waste any opportunity here where they are eager to win another record in CL. Simeone\'s mentality confirms that Atletico will beat in a convincing way today against Austria.','','0','-2.25',1.91,'6',62.20,0.00,627,2,'',1610.57,1,NULL,NULL),(261,1,0,0.00,1389629396,1389629396,1383768000,21,'Guimaraes','pt','Betis','es',2,'Europe league','','Betis have numerous missings again and the situation in the team has became really complicated after the 5 winless games in La Liga. The squad is limited, the injuries too many, some decisions of Pepe Mell seems weird, but the conclusion is that the team isn\'t functionable. Mell has his plan to prepare a team able to stand in two competitions but I am afraid the squad isn\'t responding properly. Today Betis are missing their three regullar center backs, plus three midfielders, plus their key striker {Perquis CB*, Amaya CB*, Lolo Reyes CMD*, Salva Sevilla CMD*, Paulao CB*, RubÎ¹n Castro FW*** (injured), Chica, Matilla (last 2 not registered in EL)}\n\nAnyway, the starting XI will be the same who faced Malaga on Sunday plus defender Caro and striker Braian RodrÃ­guez. Jorge Molina FW** will start to the bench, Nosa CMD*** as well because he isn\'t ready yet. Betis plays Barcelona at the weekend but Pepe Mel said it will be a nonsense to rest players to play Barcelona. He will field his best possible lineup.\n\nIn Guimaraes there are a couple of missings in the team but the most important is that Guimaraes is a mediocre team in Portugal and even with those missings Betis can not be considered as the underdog. Betis was n\'t bad at all in the last two games. Against Levante they were much better playing with 10 players for most of the game while in Malaga they played very well and they received the 3-2 in injury time after wasting some good opportunities to get the winner on their own in the last quarter of the game. I doubt Betis will lose today. They can not leave any game without a fight from now on. The team will be almost the same that faced Malaga and odds are fine.','','0','0.00',1.98,'5',62.69,0.00,632,2,'',1617.03,1,NULL,NULL),(262,1,0,0.00,1389629396,1389629396,1383940800,21,'Osasuna','es','Almeria','es',1,'Spanish La Liga','','Almeria are in good mood coming from two wins in a row for the first time this season in La Liga and with their manager Fransisco much more comfortable in the bench. The administration board and the players have been since the opening day in his side and this time the results are in favor as well. Osasuna have Gracia on the bench who was the man who led Almeria in the primera division last season but was sucked right after the end of the cmpaing with Fransisco coming as his replacement! Gracia is seeking for revence, no doubt about that, that most important is to win points for Osasuna who ruined the recent ewll performances by the exit in Anoeta and the 5-0 defeat to Sociedad.\n\nOsasuna at home is a strong team, too strong for every team in La Liga with Barcelona struggling and failing to win  there 2-3 weeks ago (0-0). Key midfielder Armenteros, one of Gracia core-players is back at last while Miguel Flanio will cover for Loties in the center of defence. Almeria traveled with key missings as long as winger Suso and defensive midfielder Verza are suspended. This will be the first game Verza is losing in the season and his missing will be important. Without theses missings, Almeria could well enjoy some decent possibilities to escape El Sadar with point(s). The missings are important though and as long as Osasuna have been really strong at home I am taking their home win today.','','0','0.00',2.00,'8',61.89,0.00,619,3,'',1618.93,1,NULL,NULL),(263,1,0,0.00,1389629396,1389629396,1384027200,21,'Tenerife','es','Eibar','es',2,'Spanish Segunda','','Tenerife have been doing pretty well recently and we took a bet on them last week in Alaves. The islanders wasted the first part and after a fine performace they equalized in the 92\' from the 9 metres. Eibar have been also in excellent form, the team with the best form in the last 5 games and today they traveled in full squad. Tenerife will miss their key striker Aridan (10/2) and will be another handicap for them to score against one of the best defenses of the campaign. Odds on Eibar are decent.','','0','0.50',2.00,'6',61.29,0.00,613,3,'',1612.93,1,NULL,NULL),(264,1,0,0.00,1389629396,1389629396,1384027200,21,'Recreativo','es','Deportivo','es',2,'Spanish Segunda','','Recre are still without key striker Arana and today creative midfielder and set pieces striker Anton is also out. Deportivo traveled in full squad, only Kaka CB is missing but there were bad new in the last training for Juan Dominguez DH*** who got injured and is a doubt. Depor will be fielded with an ultra defensive 4-2-3-1, with two more defenders acting in the middle line which means that they are set to defend today and only snitch a point through counters. Depor are doing better on the road, Recre will have problems without two key players in the creative and offensive part of the team.','','0','0.00',1.93,'6',61.85,0.00,624,2,'',1606.93,1,NULL,NULL),(265,1,0,0.00,1389629396,1389629396,1384545600,21,'Alaves','es','Rec Huelva','es',2,'Spanish Segunda','','Alaves\' manager in playing his head and today he will field an offensive formation with 2 strikers and one defensive half. He usually does the opposite.Recre are the leaders they don\'t play the best soccer in the division but they have the attitude to win games. Last week we bet against them and won backing Deportivo in a game where Depor played ultra defence - as expected - and snitched the win in the 79\' after a corner kick. Today Recre have important playmaker Anton back but they are still missing key striker Arana, plus the two full backs who got injured in the midweek.Despite the missings Recre is the most quality side here and as long as they enjoy +0,25 ball in favor we follow.','','0','0.25',2.05,'6',62.48,0.00,628,2,'',1612.51,1,NULL,NULL),(266,1,0,0.00,1389629396,1389629396,1384545600,21,'Las Palmas','es','Mirandes','es',1,'Spanish Segunda','','As it seems center midfielder Apono is rellay important for Las Palmas who lost both game the Malaguista was missing. Apono is back now and Las Palmas are eager to revenge the lousy performance in Alicante last week where Hercules was the only motivated side in the field.\n\nMirandes were struggling recently and only regain confidence by winning in Jaen and ruining our bet. They returned in deception by losing at home to Girona and now they travel in Las Palmas once more without their key playmaker Galarreta plus regular defender Coral.\n\nIt will be an one side affair here, Las Palmas with Apono back, Mirandes without Galarreta, the host will prevail.','','0','-0.75',1.91,'7',63.12,0.00,638,2,'',1617.81,1,NULL,NULL),(267,1,0,0.00,1389629396,1389629396,1385064000,21,'Valladolid','es','Osasuna','es',2,'Spanish La Liga','','La Liga starts again after a two weeks break for the World Cup Qualifiers and Valladolid hosts Osasuna in the Jose Zorilla. The hosts welcomes back key forward Ebert and useful striker Manucho while the visitors traveled without key striker and one of their best players, Oriol Riera, plus skilful wingers Sis who recently got injured and will most probably lost the rest of the season. Moreover, Chilean midfielder Silva \' Gato\' retunred yesterday from international duties and was dropped of the squad. Valladolid are showing two different faces, the good one when they are playing in front of their home supporters and the pathetic-defenfive minded one when they are traveling away. Today they are playing at home where they had some nice performances recently.\n\nOsasuna on the other hand, traveled with key missings and the worst is that they ruined the good performances of the last two months in the last 2-3 games.Today they are missing their top scorer Riera who netter 5 goals until now and the only good news for them is that they enjoy great history stats in Valladolid where they haven\'t lost in the last 13 years! Moreover, the cold weather will be their ally today as long as the temperature during the game is expected to dive as low as 0 celsium degrees. So, with a teethless Osasuna side who will have their eyes only in defense, the under2,25 looks like the wiser choice.\n','','0','2.25',1.98,'6',63.71,0.00,643,2,'',1625.18,1,NULL,NULL),(268,1,0,0.00,1389629396,1389629396,1385150400,21,'Barcelona B','es','Las Palmas','es',2,'Spanish Segunda','','Barcelona recovered confidence by the away win in the Catanal derby against Girona but they remain in the lower places of the table only one point over the danger zone. They are now hosting Las Palmas aiming for their second win in a row something didn\'t happen since the day 3 of the campaign. In the last nine games the Catalan B team have seven defeats and only two victories. Jean Marie Dongou and winger Adama TraorÃ© are losing the game as long as Tata Martino took them in the first team to face Granada, but midfielder Joan RomÃ¡n is the most notable missing through injury.\n\nLas Palmas on the other hand, traveled in full squad in the Catalan capital as long as Irani international Masoud is available. Key playmaker Apono is also in perfect condition and only center back Deivid is a doubt, so Las Palmas should be considered as \'full squaded\'. Los islanders are in excellent shape and just like the opposite to Barca B\' they have only lost two games in the last nine! In fact they have lost just three in 14 games in the season and players with primera experience like Valeron, Masoud and mainly Apono have everything to do with it.\n\nLas Palmas have good history stats in Barcelona too as long as they have only lost one game in the last three years there and they have 1-1-2 in overall. They are the better team here and quality will prevail.','','0','0.25',1.83,'7',64.29,0.00,649,2,'',1630.06,1,NULL,NULL),(269,1,0,0.00,1389629396,1389629396,1385150400,21,'Almeria','es','Real Madrid','es',2,'Spanish La Liga','','Cristiano and Benzema in excellent form having scored 22 goals so far in the campaign with Real winning the last 3 La Liga games scoring 15 and receiving 6! Almeria are also coming from 3 straight wins, a La Liga record for them, and host  los galacticos in excellent morale and confidence! The 9 points won recently moved Almeria 3 points above the last place, and they are now lay in the edge of the danger zone on equal points with Valladolid, Calta and Rayo! Rodri is the most effective striker of Almeria, even better than Negredo in his opening days with the Andalusians, even better than last season segunda top scorer Charles, who moved in Celta during the summer. Real without  Khedira, CoentrÎ³o, Di Maria, Varane, Marcelo, notable missings and it is the FIFA virus to blame for most of them, while Almeria recovers important Verza DF*** and Suso FW*** with the last one â on loan from Liverpool - being recently linked with Real Madrid.\n\nWe have strikers on fire here and a game that Almeria have only benefits and experience to gain. I wouldn\'t rule out a possible surprise here but with Ronaldo in outstanding form, especially since Blater said he prefers Messi as the best player in the world, a 2 goals win for Real is also probable. This is the reason I am not taking Almeria\'s +1,5 goal and prefer to place my bet on over3,5.','','0','3.50',1.91,'6',64.83,0.00,654,2,'',1636.87,1,NULL,NULL),(270,1,0,0.00,1389629396,1389629396,1385150400,21,'Barcelona','es','Granada','es',2,'Spanish La Liga','','Barcelona wiithout Xavi, Tello, Valdes, Messi, Jordi Alba, Alves, Dos Santos and Afellay, and coming from international duties with most of their players \'tocados\' from the jet lang and the extra fatigue, are some good reason to lay the Catalans even in front of their home fans. Granada have plenty of quality to show at the Camp Nou and they are coming from excellent games recovering their confidence and table p[osition with El Arabi and Brahimi in outstanding form!\n\nMessi\'s missing can be covered, indeed, by Neymar, but Valdes\' missing between the posts is huge. Valdes have been the reason for Barcelona not conceding crucial and silly goals in recent years and has been the man throwing many of my bets against los cules in the recycle bin. Things will be much easier without Valdes in the XI.\n\nA game in the Camp Nou is special for mid-table teams like Granada who have the potential to pull an upset there. Of course pulling an upset in the Camp Nou doesn\'t mean to win there, why not actually, but winning a 2 goals handicap is nothing strange.','','0','2.00',2.00,'6',64.23,0.00,642,3,'',1642.33,1,NULL,NULL),(271,1,0,0.00,1389629396,1389629396,1385236800,21,'Mirandes','es','Cordoba','es',2,'Spanish Segunda','','In the last seven games Mirandes have only won against Real Jaen in a game I personally took a bet against them and lost... Since then they lost two in a row at home to Girona and in Las Palmas in a game we also bet against them and this time we won. Today we have another opportunity to take a bet against our favorite Mirandes side especially as long as we will go in favor of one of the most in formed outfits, Cordoba! The Andalusians are not the best travelers but they are the 6th best in form team in last five games while they have only lost twice (both away) in their last 10 in overall.\n\nMirandes are since some weeks without influential midfielder Ruiz de Galarreta while for today experience mid and one of their key players, IvÃ¡n AgustÃ­n (13/0) is suspended. Corral DF (10/0) and  Muneta MD (4/0) are also missing. Cordoba, on the other hand, have Janse DF (10/0) and Xisco FW (12/4) unavailable, but they recover midfielders Pedro SÃ¡nchez MD (12/1) who served his ban last week and Pelayo MD (7/0) who is totally fit after losing the last three in the sidelines.\n\nIn the penultimum game in the last season, Mirandes visited Cordoba and with the away win by 1-2 they mathematically sealed their permanence in segunda dvision. Cordoba had nothing to fight for.This is defeinitely not a pay back but the form and the missings are pointing towards the visitors!','','0','0.00',2.00,'6',63.63,0.00,636,3,'',1636.33,1,NULL,NULL),(272,1,0,0.00,1389629396,1389629396,1385236800,21,'Levante','es','Villarreal','es',2,'Spanish La Liga','','Region derby in the Valencia province with at least 2000 Villarreal supporters set to occupy the Ciudad de Valencia today! Getting straight to the point, I have to mention that Levante is below average or at least below what we were expected. Joaquin Caparros has built up a defensive wall without any will of creativeness and ottacking football. The numbers away from home are outstanding poor (38% ball posession, 10 attempts av, 3,5 on target av) while their home stats are not any better (40% ball posession, 12,5 attempts av, 4,8 on target av). Against Villarreal they will succumbed to an even lower ball possesion and will allow even more shots on their goal. We keep that in mind.\n\nSecondly, Levante have a problem in the right full back position. Pedro Lopez is suspended, Hector Rodas who played there many times in the season, is injured, and the other option Chris Lell is a complicated situation. Caparros told him late enough that he don\'t need him in the team, and in the midweek Lell put his manager and team under critisism. He wasn\'t receive any discipline though (!) and he is featuring now in the squad. Nobody knows if he starts, but even if he does he won\'t bleed for his manager...\n\nVillarreal without important Giovanni Dos Santos for precautious, but Giovanni was missing just before the break with Villarreal performing brilliandly against Atletico Madrid! Everything\'s pointing towards Villarreal here but I will take the o2,25 instead of the -0,25 why odds around 2,0 are pretty tempting.\n','','0','2.25',2.00,'6',64.23,0.00,648,2,'',1630.33,1,NULL,NULL),(273,1,0,0.00,1389629396,1389629396,1385236800,21,'Sevilla','es','Betis','es',2,'Spanish La Liga','','Big Sevilla derby with two teams in different urgencies and situations in the campaign. Betis are rock bottom and need deadly to win some confidence, where will they find a better opportunity than the derby, while Sevilla seem to recover confidence by their last win in Espanyol. If there wasn\'t any break this will be an even more confident shot on Betis who have started playing much better in their last games excactly the opposite to Sevilla who managed to beat only struggling Espanyol. Celta won three weeks ago in this ground and Real had netted 7 on Sevilla...\n\nOn the contrary Betis was impressive â even with 10 players â against Levante (0-0 H), should have won in Malaga but succumbed in an injury time 3-2 defeat and while you were expected Betis to start scoring against Barcelona in their last game, los Catalans scored 4 instead! Amazing... Betis was excellent in that game too. Now today, Betis recovers many first choice players plus key striker Ruben Castro who will most probably start to the bench and get his opportunity during the game. This is good news of course, Betis will recover confidence only with Castro in the squad and I give them better option today in Sevilla than offer odds represents.','','0','0.75',2.00,'7',63.53,0.00,635,3,'',1635.33,1,NULL,NULL),(274,1,0,0.00,1389629396,1389629396,1385409600,21,'Zenit','es','Atletico','es',1,'Spanish La Liga','','Zenit ruined the good impressions of the second half in Porto with their domestic performances with the last home defeat against Rostov and the away in Spartak following the Porto 1-1 draw. Despite their terrible form in the Russian league they have shown that they can play some nice soccer and today according to their reports, Zenit is playing the greatest game of their recent history! There are some missings but as long as Shirokov (9/5) and Kerzhakov (11/4) have been fully recovered we can assume that there are not important missings.\n\nOn the other hand, Atletico with 4/4 wins in the group G, have nothing to play for and they traveled in St. Petersburg with numerous missings. Diego Simeone decided to go into huge rotations in order to keep his squad fresh so he left in Madrid key players like Godin, Filipe Luis, Tiago, Mario Suarez, Arda Turan, Diego Costa and David Villa. On the contrary, Cebolla made it to catch up with the team in Russia after watching his new born kid yesterday, while some youngsters from B team are included in the squad.\n\nNow, what are we going to bet here? Atletico is by far the better team, BUT, today half of this team will get in the field. It isn\'t only one or two players who are missing, there are too many and important missings. This definitely changes the rules of the game making Atletico a much \'weaker team\' than we know. Plus the fact that Zenit is playing the most important game of their history...\n\nI think that Zenit will take what they need today, but it is a bit scary to bet against Atletico at these odds. Last weekend I didn\'t only skip Atletico -1,5 but I even though about taking Getafe +1,75 and that was because Diego Costa wasn\'t set to start... Atletico served 7... landing my on earth, cause you can not change your mind because of one player missin. Anyway, this is a completely different game and situation. Zenit -0,25 is my call. Game statrs at 17:00 CET, because of the freezy weather in Russia, another disadvantage for Atletico.','','0','-0.25',2.00,'6',0.00,0.00,3,0,'',1629.33,1,NULL,NULL),(275,1,0,0.00,1389629396,1389629396,1385582400,21,'Villarreal','es','Malaga','es',1,'Spanish La Liga','','Villarreal not only have pure quality to show in their squad they have some nice performances and excellent soccer to show as well as they deservedly lay in the 4th place of the table! On the contrary the situation in Malaga has become really complicated and this is serious test for Bernd Schuster who heard the yellings âgoâ from Malaga\'s supporters in the Monday home defeat to Athletic.\n\nThings are getting more difficult for Malaga who have Portillo MD** added in the already missings of El Hamdaoui FW** and Santa Cruz FW**. Portillo has been under some excellent games in the season and he got the nick ânew Iscoâ. He is out, and on the contrary Villarreal has a full squad to chose as long as key forward Giovanni Dos Santos plus Costa are back in the team! Villarreal deserves that handicap.','','0','-1.00',2.00,'8',62.73,0.00,627,3,'',1627.33,1,NULL,NULL),(276,1,0,0.00,1389629396,1389629396,1385582400,21,'Getafe','es','Levante','es',1,'Spanish La Liga','','The 15th day starts with two games in Friday evening, one in Madrid and another in Vila-Real. Getafe and Levante are crossing swords eager to bounce back after the recent humiliating defeats suffered from Atletico and Villarreal respectively. Both are in low form and have only won one game, drawing another and losing three in the last five. The different between Getafe and Levante is that at least Getafe have shown a pretty nice face especially in some home games while Levante is awful in overall with only a couple of exceptions.\n\nOn the road Levante are really poor and have to show only 38% ball possesion and 3,5 shots on target in average while they allow 62% possesion, 17 shots against, 7,5 of them on target. More over, and this is the main reason for this pick, today Levante traveled without their guardian angel Keylor Navas GLK** who is suspended, plus the new injury tied Chris Lell, David Navarro CB*,  Ivanschitz MD* and BabÃ¡ Diawara FW**! Notable missings for already weak on the road Levante. Getafe have Varela RB* suspended but as long as Arroyo is fit there is no problem.','','0','0.00',1.90,'7',62.03,0.00,620,3,'',1620.33,1,NULL,NULL),(277,1,0,0.00,1389629396,1389629396,1385755200,21,'Elche','es','Atletico','es',2,'Spanish La Liga','','Elche welcomes Atletico with the morale sky high after the last week win over Valencia in the same ground the Martinez Valero. Atletico on the other hand, are coming into this game following a midweek long trip to Russia and a draw to Zenit but with the huge motivation of the 1st place in the table as long as los Cholchoneros manage to pick up a win today!\n\nElche recovers key players who lost the last game due to suspension and contract clause\'s, Aaron, Ruben, Gil and only Manu remains out. Atletico on the other hand have GodÃ­n, Filipe, Arda Turan, Tiago, Diego Costa, Villa who didn\'t travel in Russin in order to take a rest, back in the squad so Simeone is able to field his \'once de gala\' , his best XI, as long as only Mario is missing. The quality difference is improtant here.\n\nElche is a fine team to play average teams in La Liga. They are not going to relegate, this was my opinion before season starts as well, but against Atletico is it really difficult to snitch a result. Elche suffered big against Valencia last week and only to Valencia\'s struggling defense they won the game. They suffered big against Villarreal and Granada in the other two recent home games too. Atletico have the chance to move in top of the division today. The numbers are in favor too.','','0','-1.00',1.94,'7',62.69,0.00,633,2,'',1613.33,1,NULL,NULL),(278,1,0,0.00,1389629396,1389629396,1385755200,21,'Espanyol','es','Sociedad','es',2,'Spanish La Liga','','Aftet the CL elimination from the next stage following the 4-0 away defeat in Moscov, Real Sociedad are eager to focus all their attention to La Liga where they are doing remarkably well in the last 6 games. In this period Sociedad has won 4 times games from the Mestalla while they have only lost one game their visit in the Bernabeu. Last week they received a huge morale boost by turning over the 1-3 against Celta in a heroic Vela-win by 4-3 and now they are up to keep their successful run in the league. Vela scored 4 goals last week and he is gathering all the eyes today. Important Markel and Carlos are back in the team, where only Zurutuza, Chori and Angel are missing.\n\nEspanyol broke the bad gust of wind in the last 6 games by a solid win in Vallecano by 1-4. They were favored by the route of the game though as long as Rayo got a red and Espanyol won a penalty and that was all. Thievy who usually comes as a sub but is really helpful and skilfu is out, recently appointed as regular mid Lanzarote missed a midweek training session and is suspended. Sociedad have plenty of quality to deserve the +0,25 ball here. The line and odds are great to take.','','0','0.25',2.06,'7',63.43,0.00,642,2,'',1619.91,1,NULL,NULL),(279,1,0,0.00,1389629396,1389629396,1385841600,21,'Betis','es','Rayo','es',2,'Spanish La Liga','','Rock bottom Betis welcomes second from bottom Rayo Vallecano in a game full of urgencies for both. Both are coming from bad results, but both have faith to their managers, Pepe Mel and Paco Jemez respectively. For Betis, this is the most important of the season, their terrible run can\'t last any longer. The good point is that Betis have key players fit after a very long time and even though there are still missings, these are not that important. Ruben Castro and Jorge Molina will start together in attack for the first time in the season while several regulars were rested in the midweek missing the trip to Lyon. With the exception of the Sevilla derby and the 4-0 hursh defeat to Sevilla FC, Betis played some nice games recently showing signs of improvement.\n\nRayo on the other hand are playing an offensive minded game that some times turns against them just like last week in the 1-4 home defeat to Espanyol. For another one game Rayo is facing important missings in defense as long as Martinez the keeper is a new loss, while CBs Galvez, Rodri and Ze Castro remains out. The good about Rayo is the recent history which has 4 wins to show in the last 2 years against Betis and the bad for Betis is that these game were played with Pepe Mel and Paco Jemez in the benches of the teams meaning that Rayo\'s Paco has taken control over Mel. So, it sounds safer to take the over2.5 here \'trusting\' Betis lousy defense and their need of points, against Rayo\'s need of points as well plus their missings in defense and fearless attack.','','0','2.50',1.80,'6',63.91,0.00,644,2,'',1628.33,1,NULL,NULL),(280,1,0,0.00,1389629396,1389629396,1385841600,21,'Granada','es','Sevilla','es',1,'Spanish La Liga','','Region derby in Andalusia with Sevilla enjoying history stats there after winning one and drawing the other game since Granada promoted to La Liga in 2011. Sevilla had some nice games recently, the big Andalusian derby against Betis included, BUT, they were favored by the circumstances as well in that game. They took an early lead and just before half time Betis were reduced to 10 and right after Sevilla made the 2-0. Reyes was their best player, he does it once a season in the derby against Sevilla... In the midweek Sevilla were succumbed in a home late draw to Estoril. No missings.\n\nGranada is a team I like much especially at home. They can play nice soccer. Today they have only one but notable missing, as suspended Iturra was in great form recently. Anyway, all the others are included. Just before winning in Espanyol, Sevilla had more than one year to win on the road... Why are they such a strong favorite here?','','0','0.00',2.00,'6',63.31,0.00,633,3,'',1633.13,1,NULL,NULL),(281,1,0,0.00,1389629396,1389629396,1385841600,21,'Sabadel','es','Mirandes','es',1,'Spanish Segunda','','Sabadel wasn\'t bad against Hercules but their incapability to score and Hercules\' efficiency led to another defeat for Saba and the sacking of their manager Salamero. Now his assintant Miguel Olmo  took over and he is set to make changes even though he didn\'t reveil his plans. He stated that Di Mateo won the CL with Chelsea taking over as a limited-time manager why he have to fail? Tamudo is the most importatn missing.\n\nMirandes on the other hand, started terrible the game against Cordoba but after getting away with the 0-2 against they took over and turned the game over winning by 3-1. Still, in that game Mirandes lost two more of their regular midfielders, Mujica (14/3) and Pablo Infande (10/3), and with De Galarreta (11/1) missing in the last month, they are set to play with a brant new middle line.\n\nâNuevo entrenador, victory seguroâ a saying goes in Spain which means \'with a new manager the victory is sure\' plus the fact of the new midddle line for Mirandes it makes a shot on the hosts.','','0','-0.25',1.93,'6',63.87,0.00,644,2,'',1627.13,1,NULL,NULL),(282,1,0,0.00,1389629396,1389629396,1385841600,21,'Sporting','es','Alcorcon','es',1,'Spanish Segunda','','Sporting is a promotion candidate and after suffering some injuries recently they recovered players, confidence and table ranking in the last three games. Last week they won in Lugo, deservedly engouh, with manager Sadoval using for the first time a formation with two strikers, the skilful Serbs Scepovic, Lekic. Today he is expecting to do the same. There are some missing in defense, should make no worries, another midfielder was surprisingly dropped but he didn\'t play last week too, most probably he has a think with mister Sadoval. Regulr winger Fraile retrurns and this is good.\n\nOn the other hand, weak on the road Alco traveled in one of the toughest grounds in Spain in Gijon with key missings. Last week Alco was held in a goal-less draw against Murcia but their players saw 3 red cards their manager as well! So today, mister Alvarez will be in the stands while regular right full back Nagore (10/0), influential midfielder Mora (15/0) and defensive half Martinez (6/0) did not travel with the team. Forwards Cristian (14/1) recovered in time but Alco will have to cope with the key missing of their head and sould in the center of the field, Mora.\n','','0','0.00',2.00,'6',63.27,0.00,633,3,'',1632.71,1,NULL,NULL),(283,1,0,0.00,1389629396,1389629396,1386100800,21,'Tenerife','es','Las Palmas','es',1,'Spanish Segunda','','This is the Canaria derby, one of the hottests derbies in Spain most probably the 2nd hottest derby after the Sevilla one between Betis and Sevilla FC! There is great rivarly among the teams and their supporters and today the police will hugely reinforced in order to cope with them. Tenerife is in better shape and they even rested players in Girona in order to have all their squad fresh and ready today! And the do have. Mister Cerveza has a full squad to choose ahead of the derby. Tenerife didn\'t play well in Girona but they managed to got an early lead and then equalize the 2-1 Girona had managed to turn over in the start of the 2nd part. It was pretty much expected, Tenerife had eyes for the derby...On the opther hand, Las Palmas suffered at home and succumbed to a defeat against Zaragoza. They dominated almost the entire game but failed to convert their opportunities to goals proving once again that Apono\'s missing is of vital importance. Apono will be missing another 5 games and today important left midfielder Masoud is suspended as well (his sanction confirmed a few minutes ago). More over, offensive half Tana (11/1) is injured, regular center back D Garcia (11/0) remains out and important center back Deivid is extremely doubt, almost ruled out.The missings and the form pointing out for a win for Tenerife is the derby tonight. I am taking the -0,25 ball though just because it is a derby indeed. Las Palmas haven\'t won there since 2000.','','0','-0.25',1.94,'8',64.02,0.00,648,2,'',1624.71,1,NULL,NULL),(284,1,0,0.00,1389629396,1389629396,1386100800,21,'RM Castilla','es','Girona','es',1,'Spanish Segunda','','RM Castilla have a new coach two weeks now and after the goal-lees draw in Numancia he won his first game in Jaen. Ok, Jaen were better, but Castilla recovered confidence and should built on that to win their 2nd in a row.\n\nGirona are not something spectacular. They struggled against Tenerife to get a 2-2 home draw and in their last away game in Zaragoza they played deep shit. Girona welcomes Getafe on Saturday in the cup (we have cup weekend in Spain!) and even though they say that they are thinking only about Castilla playing against a top division team and advancing to the next stage can bring you nice income. Who knows... Castilla looks better with the new coach while Girona have only won poor Mirandes in the last 6 games,','','0','0.00',2.20,'6',64.74,0.00,655,2,'',1634.23,1,NULL,NULL),(285,1,0,0.00,1389629396,1389629396,1386360000,21,'Celta','es','Athletic','es',2,'Copa','','Copa del Rey first leg. The return legs will be played in about ten days. The La Liga teams are entering the competition. Celta entertains Athletic de Bilbao with both coming from great victories in the league, Celta broke the bad gust of wind at home and Athletic beat Barcelona!\n\nLuis Enrique made it clear that the league is the top priority for Celta so today he is goind to produce several changes in his line up against Athletic. Winger Augusto, key defensive midfielder Fontas and left full back Jon Aurtenetxe, are losing the game injured and the last one for contract clause respectively while Enrique is set to give rest to regulars like right full back Hugo Mallo, offensive mid Rafinha, striker Charles and keeper Yoel.\n\nOn the other hand, Athletic is always interested in this competition as long as they have the most trophies than any other team except Barcelona.  Ernesto Valverde, traveled in BalaÃ­dos with a full squad, Aduriz returned from sanction in the league so Athletic will be fielded just like last Sunday when they beat Barcelona at the San Mames, plus Aduriz! HerrerÃ­n, Iraola, Gurpegi, San JosÃ©, Balenziaga, Iturraspe, BeÃ±at, De Marcos, Susaeta, Aduriz and Muniain.\n\nCelta will field a competitive side but there are going to be about 6-7 changes in the lineup in reference to their stronger version in the league. Athletic are interesting in the cup. Yesterday late at night odds on Athletic Draw No Bet, were over 2,0 euros but between 4:00 and 5:00 there were huge money invested in them so it dived as deep as 1,88 at the time being... 10bet has this line offered at 1,96, I don\'t even know if it real but it is a fine price to take. I will go a step forward though and take SBO\'s -0,25 at 2,28. I think Athletic will win today.','','0','-0.25',2.00,'8',63.94,0.00,639,3,'',1639.43,1,NULL,NULL),(286,1,0,0.00,1389629396,1389629396,1386360000,21,'Flamengo','es','Cruzeiro','es',1,'Brazil A','','Flamengo are the cup winners and Cruzeiro are the champions and as it seems this is a general test for the super cup final! Of course it is a league game the last one of the campaign in Brazil serie A!\n\nBoth have been really unmotivated in the last couple of games, Flamengo with many changes, Cruzeiro as well losing from teams in the bottom of the field like Bahia last week. Today Flamengo have three regualars our, the keepers Felipe (25/0) and Victor (13/0), mid Elias (30/4) and center back Wualas (30/3). On the other hand right back Moura (25/2), Santos (19/2) and forward Paulinho (32/4), center back Shamir (11/0)  and mid Caseres (13/1) are back.\n\nCruzeiro wil be fielded with a whole new line up today just like in the last 1-2 games. Only one players of the first team is present the others are substitues.\n\nThis is the last home game for Flamengo and their manager have signed a new contract it should be an oportunity to celebrate and give their supporters a fiesta. It is a bit risky as long as Flamengo have not a real motivation but I think that Cruzeiro have been in Christmas holidays a couple of weeks now...','','0','-0.50',2.00,'5',63.44,0.00,634,3,'',1634.43,1,NULL,NULL),(287,1,0,0.00,1389629396,1389629396,1386360000,21,'Sant Andreu','es','Atletico','es',2,'Copa','','Sant Andreu from segunda B (3rd division) is running an unbeaten 30 games run at home will play with all their players today in a historic game for them.\nAtletico, the cup holders, traveled without Courtois (precautiously), Juanfran, Miranda (rest), Mario, Baptistao, Cristian RodrÎ½guez (injured), Gabi (susp),  Insua (dec tec) while Diego Costa and Villa will start to the bench. The handi -2,5 looks big but it is Atletico we are talking about, so this will be my choice here.','','0','-2.50',1.97,'6',64.03,0.00,646,2,'',1628.43,1,NULL,NULL),(288,1,0,0.00,1389629396,1389629396,1386446400,21,'Alcorcon','es','Granada','es',2,'Copa','','Alcorcon become known in the cup after beating Real Madrid by 4-0 a few years ago and now they are hosting another team of primera aiming to snitch a good result ahead of the return leg in ten days. Their manager Miguel Ãlvarez stated his frustration for the contuinous games of his team, Sunday, Wednesday and Sunday again and said it it isn;t fair for segunda teams who didn\'t have more days to rest like the teams of the Spanish elite. In the midweek La Liga teams had a break but Alcorcon had to play in Ponfe where they won away by 1-2. It was a great week after the 2-2 in Gijon, Alco won in Ponferadina and reached to a 5 games unbeaten run. Today they will play in a mixed squad, no changes announced or confirmed except of the known ones of center back Nagore (10/0) and  midfielder Sanz (14/0).\n\nGranada deserved more in their last league game against Sevilla at home where it seems that something \'s going wrong. On the road Granada finds better room to launch their counters and today I really can\'t tell why Alcorcon is such a favorite against Granada here as long as the visitors have an almost full squad in their disposal. Only striker El Arabi and center back Diakhate were left our to take some rest the other missings are usuall drops and make no difference to the team. Moreover Iturra who lost the last league game suspended returns in the squad. He is the most inform midfielder Granada can allow nowadays.\n\nGranada Squad:\n\nKarnezis, Roberto - Nyom, Mainz, Murillo, Foulquier, Angulo - Iturra, Yebda, Recio, Piti, Fran Rico, Pereira, Brahimi, Coeff, Buonanotte - Ighalo, Riki.\n\nOUT: Dimitrievski, Fatau, Ãlvaro GarcÃ­a, El Arabi, DiakhatÃ©, Dani Benitez (dec tec), Migue GarcÃ­a, Campos Toro (injured)\n\nLucas Alcaraz made it clear: âWho ever lacks motivation against Alcorcon he will be dropped in the next league game against Rayo Vallecanoâ. Straight and simply! Only Carnezis in the goalie was confirmed and in the rest of the field who ever plays makes no big difference.\n\nThe momentum is calling for Granada here especielly as long as they are the underdog!\n','','0','0.00',2.33,'7',64.96,0.00,659,2,'',1633.25,1,NULL,NULL),(289,1,0,0.00,1389629396,1389629396,1386446400,21,'Jaen','es','Espanyol','es',1,'Copa','','Espanyol didn\'t manage to built on the away win in Vallecas and succumbed into a bitter home win against Real Sociedad despite the fact they got the lead to the game. Sociedad who visited the Cornella right after their midweek trip to Russia, turned the game around in the last half hour.\n\nEspanyol did not only lose the game but they lost their best player, the all around forward Sergio Garcia FW*** and excellent striker  John CÃ³rdoba FW* due to injuries. Moreover regular center back Hector Moreno CB** got injured in the meantime to the cup game and next to them, Javier Aguirre dropped Fuentes and Simao and Javi LÃ³pez RB* who is suspended. The Mexican manager will make some more changes testing the next team against Almeria away and this is the way he tries to motivate the players who will play today.\n\nReal Jaen on the other hand, traveled last Wednesday in Huelva to play leaders Recreativo and were held in a draw! Yes, Recre got the lead in 23\' but two minutes later Jaen equalized and until the end of the game they totally deserved to get the win. Today Manolo Herrero stated that he will make no rotations because he takes the cup seriously as an opportunity to get more respect and honor for his team. The squad is the same as the one that traveled in Huelva four days ago and only regular striker Jona FW** is a doubt.\n\nEspanyol were fielded in a ultra defensive style at the Camp Nou a month ago and they did really well only lost by 1-0. Will they try the same today or Aguirre will test a formation ahead of the Almeria exit next week? Who knows, but what ever comes what is for granted is that Real Jaen will be the more enthousiastic and motivated team in the field. They have easily beaten Deportivo La Coruna in the previous round by 2-0 at home when Depor played with many changes in the XI just like Espanyol will play today.','','0','0.00',2.30,'6',0.00,0.00,0,1,'',1643.56,1,NULL,NULL),(290,1,0,0.00,1389629396,1389629396,1386619200,21,'Olympiakos','es','Anderlecht','es',1,'CL','','Olympiakos need to win no matter what and gets the ticket to the next phase. They will, in my opinion. Benfica needs to win PSG and hope that Olympiakos slip points. PSG traveled without Ibra, Alex and Silva plus suspended De Vil and Veratti. So this makes 5 guaranteed changes in the XI but the players who covers today are not that worst than the missing ones.','','0','-1.50',1.99,'5',65.45,0.00,659,2,'',1644.56,1,NULL,NULL),(291,1,0,0.00,1389629396,1389629396,1386619200,21,'Bayern','es','Man City','es',1,'CL','','Bayern are looking for their 11th win in a row and coming from tremendous games and form! 0-7 in Werder and it could have been even wider! Man City on the other hand traveled with some hopes of getting the 1st place to Bayern but this means that they have to win. Last season Arsenal almost did it there, but now this is rather complicated as long as City are playing Arsenal at the weekend and there might be some changes today... Bayern -1,5 could be an option.','','0','-1.25',2.00,'5',64.95,0.00,650,3,'',1649.51,1,NULL,NULL),(292,1,0,0.00,1389629396,1389629396,1386792000,21,'Betis','es','Riejka','es',1,'Copa','','This is the home debut for new appointed Betis\' manager Juan Garrido after the succesful cup game against 3rd division Lleida in the midweek. A new era starts in Betis who can pick up the top place in the group I today should they win and Lyon lose points in Estoril. Betis have a strong squad to show today as long as there are missings but not as important as there were in recent months while striker Jorge Molina recovered in time and is available. Key striker Castro is also included as set to take some minutes. Betis have a key game coming at the weekend the visit in San Sebastain to play Sociedad.\n\nRiejka on the other hand, traveled in Andalusia with complitely lack of motivation in the ranking of the group I. They are out and today their coach will rotate a bit since the hot game against Haiduk is coming at the weekend.\n\nBetis do have hopes for the top spot but it is also the home debut of their new manager and this makes the shot of them realistic. Betis needs a confidence boost, Garrido and the players as well, they should win against unmotivated Reijka and go in San Sebastian with their morale high.\n','','0','-1.25',2.00,'5',64.45,0.00,645,3,'',1644.51,1,NULL,NULL),(293,1,0,0.00,1389629396,1389629396,1386878400,21,'Levante','es','Elche','es',2,'Spain La Liga','','Region derby in Valencia, Levante hosting Elche with the istory stats in favor of the hosts. Levante are under a negative run in the league though while Elche enjoys maybe their best shape in the season. Both have no really important missings to show today. Levante without center back Navaro and Hector Rodas, but with important keeper Navas, winger Ruben and striker Baba availabe. Elche on the other traveled in Valencia without center back Lomban and already missing forwards Del Moral.\n\nThe form and the numbers are pointing towarsd a bet on Elche here. You can check the form by just looking at the table, Levante are in deep shit recently coming from 5 defeats in a row and with only one home win every sevearal months! The last one was in May, this season they won in October... Moreover, Levante have only 39% ball possesion and 4,2 shot average in their home games while even on the road, Elche\'s numbers are better than this, 49% and 5 shots average.','','0','0.25',2.00,'7',63.75,0.00,638,3,'',1637.51,1,NULL,NULL),(294,1,0,0.00,1389629396,1389629396,1386964800,21,'Osasuna','es','Real Madrid','es',1,'Spain La Liga','','Osasuna returns in El Sadar after 5 weeks full of on the road advendures the last one taken place in the La Rosaleda where los rojillos turned over Malaga\'s early 3-0 lead to grab a confident boost 3-3 cup draw! In the last 13-14 years with Osasuna hosting Real Madrid a record of 4-4-5 wins, draws, defeat was written with Real Madrid having only 2 wins with more than 2 goals to show. El Sadar is a hard ground for the big ones in Spain, Barcelona suffers as well there.\n\nOsasuna had a full week to prepare the game, Real had to travel in Denmark to play Kopenghagen, where all the squad was included so some fatigue may occur and maybe lack of freshness. Don\'t forget that Christmas vacations are coming and the continuous games don\'t give the best motivation to many teams. Anyway, Real traveled in Pamplona in full power, Khedira, Coentrao and Varane are missing Ramos is back while Osasuna have two missings, not really important, 38years old Punal is suspended, out of form mid De La Cuevas is injured. Last week Osasuna got a massive morale boost in Malaga playing with many changes. I doubt that fatigue tied Maadrid will be able to win the -2 goals handicap here.','','0','2.00',1.81,'6',64.24,0.00,647,2,'',1631.51,1,NULL,NULL),(295,1,0,0.00,1389629396,1389629396,1386964800,21,'Rayo','es','Granada','es',2,'Spain La Liga','','Rayo snitched a last second goal in Betis last week escaping Villamarin with a draw and sending Pepe Mel out of Betis\' bench. It was a confident boost as long as Rayo have been under bad results recently especially in front tof their home supporters. Rayo\'s philosophy doesn\'t change it is the offensive-attractive football and some effords of Paco Jemez to give his defense a solidness din\'t grow fruits as expected.\n\nGranada is a team with plenty of quality. They played with changes in Alcorcon last week and they won in style by 0-2. The players who came in don\'t have more to envy to the regulars. Key midfielder Iturra returns in the league and on the contrary Rayo is missing their best player and revelation of the season, defensive mid Saul. In the other game Saul was missing Rayo lost at home to Valladolid by 0-3, it will be a huge loss in the center of the field against solid Granada offensive line today.','','0','0.25',2.01,'7',64.94,0.00,657,2,'',1635.37,1,NULL,NULL),(296,1,0,0.00,1389629396,1389629396,1386964800,21,'Almeria','es','Espanyol','es',1,'Spain La Liga','','After the three consecutive wins Almeria succumbed a home defeat to Real Madrid and an away in Vigo against Celta and finally managed to recove confidence in the midweek when they beat Las Palmas on the road by 1-3. Key striker Rodri remains out, Oscar Diaz did a really good job replacing him, no other missings the players who were rested in the cup, Verza, Suso, Torsiglieri, Nelson, Dubarbier, return in the XI. Espanyol on the other hand, traveled in full squad as long as key forward Sergio Garcia, striker Cordoba and center back Moreno have been recovered after losing the midweek trip to Jaen (2-2 cup draw).\n\nI can not figure out though, how the hell Espanyol is considered as a favorite in Almeria...! Espanyol have only won one in the last 6 games and that was against 10 men Rayo recently. We can see Rayo struggling can\'t we? Odds are going crazy in Almeria\'s favor, even a +0,25 ball was given at 1,8! I will make a step forward though and take the \'draw no bet\' on Almeria at much better odds!\n','','0','0.00',2.15,'6',0.00,0.00,0,1,'',1643.44,1,NULL,NULL),(297,1,0,0.00,1389629396,1389629396,1387051200,21,'Cordoba','es','Tenerife','es',2,'Spain B','','Tenerife have been in excellent form in the last weeks in Liga Adelante and are coming from the morale sky high after the triumph in the Canaria derby against Las Palmas by 3-0! The islanders are the 2nd best in-form team in the campaign and today they are meating struggling Cordoba. Onle left back Camara is out for Tenerife, important midfielder Leon (13/2) is boubtful but expected to play.\n\nCordoba on the other hand, have been struggling recently and it is the huge and key missings to lay all the blame. For today the missings remain still as long as striker Mendi (2/1) who came up to cover the missings is suspended, regular center back Cruz (17 games), mid Pelayo (8 games) and striker Strahman (9/1) are injured while key striker Sisco (12/4) has been finally recovered but is doubtful and even if he plays he won\'t be 100% after losing many games in the sidelines. Right back Yense (11 games) is back, left back Raul Bravo (9 games) is a doubt. As long as Tenerife comes in the game as the underdog we have no problem backing them today.','','0','0.25',2.00,'6',64.34,0.00,643,3,'',1643.44,1,NULL,NULL),(298,1,0,0.00,1389629396,1389629396,1387051200,21,'Sevilla','es','Athletic','es',2,'Spain La Liga','','Sevilla have hit an excellent state of form recently and they deserve to be the favorite here, but Athletic are also in very good form. Los Basques have the win over Barcelona to show last week and the away win in Malaga just before that and they have really make their numbers look much better.\n\nA month ago Athletic was just like Levante one of the worst \'away teams\' in the division but with their performance in Malaga and in the cup against Celta, where they didn\'t play as well as expected, they shown significant signs of improvement. A month ago Athletic had an average 1,33 shots on the opposite target in the last two they didn much better, 6 shots on target in Malaga and 7 in Celta and between these it was the win against Barcelona with another great display. So with a condifence boost they are traveling in Sevilla in almost full squad to play Rakitic-less Sevilla FC...!\n\nLos sevillistas are in good form but today they are missing their best player, Rakitic who has been declared MVP in 6 games so far in the season! Sevilla is the favorite indeed but giving Athletic half ball in such odds is a very well offer we can\'t deny!','','0','0.50',1.95,'7',65.01,0.00,657,2,'',1636.44,1,NULL,NULL),(299,1,0,0.00,1389629396,1389629396,1387137600,21,'Valladolid','es','Celta','es',2,'Spain La Liga','','For the first time in the last months, Valladolid have Ãscar GonzÃ¡lez OH** and VÃ­ctor PÃ©rez DH** totally recovered and most probably they will make it to the squad today. Only two missings, Sastre DH** (susp) and Rama MD (injured). The squad will be announced after the Monday training session but no surprises expected.Celta traveled in full power in Valladolid. Augusto FW**, FontÃ s MD**, OubiÃ±a DH** have been recovered after losing the midweek cup game against Athletic while keeper Yoel GLK** and Charles FW*** are also back after being rested in the cup.44Celta is in better shape, there is no doubt about that, still Valladolid needs this more.\nLast season a few games before the end of the season Celta won too easy in Valladolid by 0-2. I remember we had a bet on Valladolid then but it was like the pucelanos didn\'t even enter the field... It looked fishy at that time, but it could well be the motivation factor which was huge for Celta.\nI decided to take Celta (0) today.\n\nIt\'s unbeliaveble but odds on Valladolid are keep diving and now Celta have reached amazing odds in favor!\nThe last season win wasn\'t the only one Celta have managed in Valladolid. In the last 12-13 years Celta have won 6 times there.\nMoreover they are in a much better shape than Valladolid nowadays. I get understand why ppl are betting on the hosts today... Valladolid\'s squad was announced, no surprises at all.','','0','0.00',2.00,'6',64.41,0.00,644,3,'',1644.09,1,NULL,NULL),(300,1,0,0.00,1389629396,1389629396,1387310400,21,'Almeria','es','Las Palmas','es',1,'Copa','','4-5 changes from Almeria\nhuge rotation from Las Palmas...!','','0','-0.50',2.00,'6',63.81,0.00,638,3,'',1638.09,1,NULL,NULL),(301,1,0,0.00,1389629396,1389629396,1387396800,21,'Athletic','es','Celta','es',1,'Copa','','In the first leg Celta was much more motivated than Athletic and picked up an important win by 1-0. Athletic were fielded with only a couple of changes in the team, Toquero in attack was the big disappointment and keeper Herrera and despite the fact that Celta was set to play with noumerous changes they were fielded with a strong enough team. The problem for Athletic was that Celta looked like they wanted it more and deservedly won the first leg while now things should be excactly the opposite.\n\nAthletic is a \'cup team\' they want to go to the next stage and today they have only one obligated missing, Laporta in defence. Aduriz recovers position in the attacke, De Marcos will start on the becnh after playing impressively well in the right full back replacing master of the right wing, Iraola! De Marcos have played as left back, as right winger as center striker and now as a right full back! Amazing! Anyway, Athletic was brilliant in Sevilla deserved to win but were held in a 1-1 draw. They lost a penalty in the dying minutes of the 1st part. In overall, Athletic have been very much improved in recent games at home and on the road as well. The last team that lost in San Mames was Barcelona!\n\nCelta are also aiming to get the ticket to the next round but they have no presure at all. They traveled without Yoel GLK**, Augusto MD**, OubiÏa MD*** who were dropped to get some rest. Osasuna is coming at the weekend in a crucial league game. The 2nd keeper will start, Sergio, plus Hugo Mallo and striker Charles who are suspedned in the league. Celta will be fielded with a mixture of regular and sub players.\n\nAthletic have a full squad, a packed San Mames and plenty of motivation to win this and moreover to cover the 1-0 first leg defeat. It\'s worth a shot on them to cover the -1 handicap here.','','0','-1.00',1.69,'7',64.29,0.00,648,2,'',1631.09,1,NULL,NULL),(302,1,0,0.00,1389629396,1389629396,1387396800,21,'Espanyol','es','Jaen','es',2,'Copa','','In the first leg we had a draw with Espanyol showing their superiority in the opening minutes and with Jaen taking over with enthousiasm in the rest of the game. Espanyol took the lead by 0-1, Jaen turned in around 2-1 but in the dying minutes a slip in the hosts defense brought the equalizer for Espanyol.\n\nToday Espanyol needs a draw to get to the next round. Sergio GarcÃ­a FW***, Mattioni RB, Fuentes LF*, Torje MD, Lanzatore MD and Tejera MD were dropped for technical decision with Simao and Pizzi taking another opportunity from Aguirre. Still, it isn\'t clear what these two are going to offer today in Espanyol as long as they expressed their will to leave the team in January... Espanyol will be fielded with a mixed team.\n\nJaen is a very nice team in segunda, they are giving us bets regularly and today they are going to play with their best team! They will score in Cornella, I don\'t know how many Espanyol will be able to net. This may means a 1-1 draw, or a 2-1 win for Espanyol even a 1-2 for Jaen or a 2-2 draw! In all these outcomes what is common is Jaen +1,25 to win all bets!','','0','1.25',2.00,'7',63.59,0.00,636,3,'',1635.92,1,NULL,NULL),(303,1,0,0.00,1389629396,1389629396,1387396800,21,'Valencia','es','Tarragona','es',2,'Copa','','Valencia lost in Atletico without even shoting a single once in the opposite goal so Djukic was sacked the other day. Nico EstÃ©vez the manager of Valencia Mestalla the B team of the club took over until further news. San Lorenzo\'s manager Pizzy was Valencia\'s main option to substitue Djukic but he refused the offer and now Ayala asigned with the mission to persuate him to join Valencia! EstÃ©vez can not on important all around forward Jonas, recently appointed as regular center midfielder Oriol Romeu â who sent Banega in the bench - and center back Ricardo Costa. Nobody knows how many changes Estevez will go into this game but he included in the list some players from the B team and he will most probably uses them. He knows them very well of course! One of them is Guaya who has already played with the A\' team.\n\nOn the other hand Nastic Tarragona traveled to pull off an upset. The goal-less draw in the first leg leaves everything on stake and Tarragona was very well prepared last week offering a nice performance. Most of the players will be the regulars, even though it doesn\'t make any difference for a team from 3rd division to play with the substitutes... Nastic remains unbeaten in the last 7 officials games.\n\nValencia needs to get a confidence mood but need to performe a players management ahead of the next games. On Sunday Real Madrid is traveling in Mestalla with the galacticos already winning the first battle: Sergio Ramos who was supposed to lose the game suspended received the clearence from the appeal committee to play! Amazing things can happen in La Liga!\n\nValencia should win, ok, but covering the -2,5 handicap look difficult enough.','','0','2.50',1.85,'6',64.10,0.00,646,2,'',1629.92,1,NULL,NULL),(304,1,0,0.00,1389629396,1389629396,1387483200,21,'Granada','es','Real Sociedad','es',2,'Spain La Liga','','Granada and Real Sociedad are coming from midweek cup games but with completely different feelings. Granada lost at home to 2nd division Alcorcon by 0-2 and was eliminated in  penalties shotout while Sociedad thrased Agleciras in the Anoeta by 4-0 and advanced in the next stage. Both played with many changes in the squad, Granada used more sub players and they paid the price.\n\nSociedad was also fielded with 7 changes in the team but they had no problems to overcome Algeciras. Of course this shows the quality gap between Granada and Sociedad. Despite some excellent individuals Granada lacks too much comparing to Real Sociedad and it is quite interesting to have Granada the favorite here!\n\nOf course it is weird that Sociedad haven\'t won in Granada in three games since the Andalusians were promoted in primera division (one cup game included)!  I remember though the game two years ago when Illaramenti in his first steps in Sociedad got a 40 minute red card with Sociedad dominating most of the game until that minute while last season Granada was lucky enough to pick a goal-less draw against a superior Sociedad team. Anywya, nowadays both are in good shape, Sociedad more than any other time in the campaign and without any new missings they should be the underdog in Granada. Sociedad have the same squad that won Betis by 5-1, while Granada are waiting for the phisical condition of their regular defenders, Murillo and Angulo.','','0','0.00',2.07,'7',64.85,0.00,656,2,'',1634.02,1,NULL,NULL),(305,1,0,0.00,1389629396,1389629396,1387483200,21,'Villarreal','es','Sevilla','es',1,'Spain La Liga','','Villarreal is aming to bounce back in the league after winning only one game in the last four, while Sevilla are in urgent need of a morale boost after the shocking elimination in the cup against 2rd division Racing de Santander... Sevilla have been under pretty good form recently but their weaknesses remain still and this was obvious in the last three games.\n\nSevilla suffered in Granada despite their victory and they suffered even more in the next two games played at home against Athletic Bilbao and Racing... Today they have an even more difficult mission against one of the hottest teams in La Liga, Villarreal, who have key defensive midfielder and captain, Bruno back in the squad. Cani, their offensive wheel remains out but Bruno is way more important and Cani\'s missing can partly be covered. Of course it would have been better if Cani was available, no doubt, but we have Sevilla traveling to Vila-Real without their two regular side backs, Albert Moreno, Spanish sub20 international, a great player way too helpful in offense too and Diogo RB.\n\nMoises from B team got the call to cover the left back, Navarro is set to start though, while Coke who lost his place to Diogo will start in the right. Ok, the missing in the side full backs is never easy to cope with because these players usually constibute too much in attack, just like Alberto Moreno in Sevilla. Anyway, one more problem that may proved more important is Rakitic\'s health. The key Croacian midfielder lost the last game suspended and the midweek cup fiasco due to a heavy flu and even though he is back in the team he might still be effected by the fever suffered all these days. Villarreal is the favorite and will return in winning days against Sevilla who is not to be trusted and won more than they deserved recently.','','0','-0.50',2.00,'7',64.15,0.00,642,3,'',1641.51,1,NULL,NULL),(306,1,0,0.00,1389629396,1389629396,1387569600,21,'Lugo','es','Hercules','es',1,'Spain B','','Lugo didn\'t deserve to lose three out of the last four games as long as they played better than their rivals but some unlucky momments for them and lucky for their opponents outcomed to bad results for Lugo. Hercules on the other hand have been really lucky recently. Today both will be missing their best player in the creative part, their No10s, Seoan for Lugo and Eldin for Hercules and more over Hercules have known missings so 14 players are available in the coach who called some youngsters in the squad.\n','','0','-0.25',2.00,'5',63.65,0.00,637,3,'',1636.51,1,NULL,NULL),(307,1,0,0.00,1389629396,1389629396,1387569600,21,'Tenerife','es','Sabadel','es',1,'Spain B','','Tenerife had a bad game in Corduba losing fair enough by 1-0 and now with a ful squad they are eager to prove the last game as a bad parenthesis. Sabadel disappears when playing away from home, 0-2-7 with 4-17goals their record, they won\'t be able to stand in the \'Eliodoro\' especially without their key center back Quique Hernandez (18/1), Winger Sutil (7/0) is also out.','','0','-0.75',2.00,'5',63.15,0.00,632,3,'',1631.51,1,NULL,NULL),(308,1,0,0.00,1389629396,1389629396,1387569600,21,'Alaves','es','Eibar','es',2,'Spain B','','Alaves won but didn\'t convince. They have new coach. This is a Basques derby the teams have rather bad relations, Eibar is a better and more solid team. More over Eibar has an almost full squad whule Alaves have been struggling with some key missings and the squad hasn\'t been announced yet.','','0','0.25',1.85,'5',63.58,0.00,640,2,'',1626.51,1,NULL,NULL),(309,1,0,0.00,1389629396,1389629396,1387656000,21,'Getafe','es','Barcelona','es',1,'Spain La Liga','','Atletico won yesterday and now Barcelona needs a win in any cost in order to recover the first place in the table. Barcelona is 3 points below Atletico and for the first time in many years a different team than the \'big two\' is very close to win the title of the 1st round champion!\n\nAnd how excactly Barcelona will win in Getafe? Messi, Valdez are long term missings while now Neymar is suspended, already started his Christmas vacations in Brazil and moreover Xavi was a last minute dropp through injury!! Without Messi the Catalans struggled a bit but Neymar took over control winning crucial points for the team! No need to mention that without Xavi, Neymar was pretty much harmless, trying to win the opponents all alone.\n\nGetafe on the other hand, recover confidence by the midweek win in the cup and the last home win against Levante and even though you can\'t compare Girona and Barcelona there is no doubt that they will play they best today. Always when facing a big rival like Barcelona all teams are giving their 110% one more now that Barcelona traveled with key missings and Getafe has a full squad to choose!\n\nI don\'t need to mention that Getafe is always trying to beat the Catalans as long as their relations with the other two Madrid clubs, Atletico and Real are excellent. I am just telling you that Getafe\'s president is one of Real Madrid club members while Getafe has been always taking on loan players from Atletico! Do these facts make an important motivation today? No, but they are facts! Getafe will play their best today for their dignity and pride. With all these Catalan missings they can manage a positive result.','','0','1.25',2.00,'7',62.88,0.00,629,3,'',1628.76,1,NULL,NULL),(310,1,0,0.00,1389629396,1389629396,1387656000,21,'Athletic','es','Rayo','es',2,'Spain La Liga','','Athletic and Rayo recovered confidence by their crucial cup wins in the midweek against Celta and Valladolid respectively and advancing to the next stage. In the round of 16 Athletic will play in Betis on January 8 and Rayo will host Levante the next day. The return legs are being scheduled on January 15. So, both are in high morale but Athletic are in amazing form as well. In the last one and a half month the lions have manage to play the best soccer in the season and they deserve to be such a big favorite today. Athletic have a full squad except Laporte who remains injured.\n\nOn the other hand Rayo have yet to find their form. This game is important for them as well because nobody likes to be in relegation zone in Christmas time. This is not because of the bad taste of the turkey but of the morale coming out of this and the pressure in the team to get results after the break and being reingforced in the transfers. Rayo have key midfielder Saul back, he can play in defense as well while center back Rodri recovered a long time injury, almost a year out. Still defender Arbilla who can play in all positions is out, plus helpful striker Larivey who starts from the bench but his headers are one of a kind! He has already scored 4 goals and had some posts with his head! He could have been helpful today.\n\nI am skipping Athletic\'s -1 handicap and going for the goals here. I doubt that Athletic wins with a 2-0 here. Rayo have to play soccer they are going to score today. Another reason I am skipping the -1 is that Rayo has good history stats in San Mames and this was with their current manager Paco Jemez. He may have found the winning formula to face Athletic... So, lets hope for as many goals possible to be scored tonight!','','0','2.75',1.91,'6',63.42,0.00,637,2,'',1622.76,1,NULL,NULL),(311,1,0,0.00,1389629397,1389629397,1387656000,21,'Valencia','es','Real Madrid','es',2,'Spain La Liga','','Valencia are too close to sign Pizzi from San Lorenzo in replacement of Djukic who was sacked last Monday. The manager of the B team Nico EstÃ©vez took over in command this week and led to a kind of expecting nerv pressuring win over Alcoyano in the cup and now prepares the team to meat Real Madrid. No missings for Valencia, no cards opened from Estevez he has taken his job seriously enough!\n\nOf course, it is a great honor to lead the profesional team than the youth or the B\' one! Alcacer is set to take the starting up role in attack, Jonas right behind him, these will be the two forwards no other places are confirmed in the middle line. Estevez tried a team like the one Djukic was using in the early stages of the campaign but this was most probably because he wanted to rest some of the players who are going to play today.\n\nReal, on the other hand, traveled without Bale but with Sergio Ramos included in the list! Ramos was sent off last week in Osasuna but he got the clearence to play today from the appeal committee who saw no \'tention\' on Ramos elbowing  the Osasuna player! Anyway, no other missings for Real who have no room to let more points slip away from them. They are 8 points below Atletico Madrid and even though this doesn\'t make any betting argument, ofc, it guarentees that the Madridistas will play their 100% today! Estevez trying to beat Ancelotti is another advandage for Real, no doubt about it.','','0','-1.00',2.02,'6',0.00,0.00,0,1,'',1628.22,1,NULL,NULL),(312,1,0,0.00,1389629397,1389629397,1375300800,20,'Fc Minsk','','St Johnstone','',2,'EL','','','','0','0.25',1.90,'7',0.63,0.00,13,2,'',993.00,1,NULL,NULL),(313,1,0,0.00,1389629397,1389629397,1375387200,20,'Ajax','','Roda','',1,'Holland','','','','0','-2.25',1.91,'6',1.18,0.00,17,2,'',1000.30,1,NULL,NULL),(314,1,0,0.00,1389629397,1389629397,1375473600,20,'Paris SG','','Bordeuax','',1,'French LC','','','','0','-1.00',2.00,'6',0.00,0.00,0,1,'',1005.76,1,NULL,NULL),(315,1,0,0.00,1389629397,1389629397,1375473600,20,'Dc United','','Montreal','',2,'MLS','','','','0','0.00',2.00,'5',0.68,0.00,7,3,'',1006.76,1,NULL,NULL),(316,1,0,0.00,1389629397,1389629397,1375560000,20,'Tromso','','Valerenga','',2,'Norway','','','','0','0.50',2.07,'7',1.43,0.00,22,2,'',999.76,1,NULL,NULL),(317,1,0,0.00,1389629397,1389629397,1375732800,20,'Valencia','','Everton','',2,'Friendly','','','','0','0.25',2.00,'6',0.83,0.00,8,3,'',1008.25,1,NULL,NULL),(318,1,0,0.00,1389629397,1389629397,1375732800,20,'Maribor','','Apoel','',2,'CL','','','','0','0.25',1.90,'7',1.46,0.00,18,2,'',1001.25,1,NULL,NULL),(319,1,0,0.00,1389629397,1389629397,1375819200,20,'Santos','','Corinthians','',2,'Brazil A','','','','0','0.00',1.00,'5',0.00,0.00,0,1,'',1009.55,1,NULL,NULL),(320,1,0,0.00,1389629397,1389629397,1375819200,20,'Criciuma','','Cruzeiro','',2,'Brazil A','','','','0','-0.25',1.87,'7',2.06,0.00,27,2,'',1007.55,1,NULL,NULL),(321,1,0,0.00,1389629397,1389629397,1375905600,20,'Quilmes','','Godoy Cruz','',2,'Argentina','','','','0','0.00',2.00,'6',1.46,0.00,15,3,'',1014.64,1,NULL,NULL),(322,1,0,0.00,1389629397,138