ay from home when they can play on the counter with fast players like Lukaku and Miralas. With that in mind, I\'m happy to side with them in the draw-no-bet market at 1.80. Everton\'s record suggests the chance of losing money is slim, while they have the form to win this game, Gareth Barry and James McCarthy are players who are good in  protecting their back four and the main reason why Everton have lost just that single game. Everton have James McCarthy back available On-loan Barcelona forward Gerard Deulofeu who has been impressive has been ruled out with the hamstring injury he sustained against Fulham, Fellow defender Leighton Baines is continuing to work his way back from a broken toe,\nSwansea, who have failed to score against Everton in all four of their Premier League meetings, have not performed to the high standards they have set themselves and they arrive here with just two wins from their last 12 games in all competitions and quite often look toothless in attack . Injuries have not helped their cause. Forward Michu is a doubt for Sunday\'s clash.while Nathan Dyer is facing a long spell on the sidelines after suffering ankle ligament damage at Norwich and Michel Vorm has undergone ankle surgery.Garry Monk continues to be ruled out with a knee problem, but Leon Britton and Chico Flores should return from a toe injury and suspension respectively but Rangel is suspended.','','0','0.00',1.80,'8',48.71,0.00,494,2,'',1472.72,1,NULL,NULL),(634,1,0,0.00,1389629402,1389629402,1387656000,20,'Espanyol','es','Valladolid','es',2,'Spain A','','Espanyol adopted a wait-and-see approach in Elche, hoping to steal a goal but not risking anything. The result was stalemate, with the home side unable to seriously threaten, other than a missed penalty Midweek a mixed B side beat Jaen,2-0.\n\nEspanyol have rback Javi Lopez Reg/Impt back after suspension. They are full strength here.\n\n \n\nIt was all looking fairly even on a freezing night between Valladolid and Celta until the freak red card for Charles. Up against 10, Valladolid soon took the lead through a nicely taken goal from Guerra who cleaned up against the exposed away side.\n\nValladolid put out a fairly decent XI in Rayo midweek but found themselves a man down with Javi Guerra sent off at the start of the 2nd half and were easily beaten in the end.\n\nHaving welcomed back No 10 Oscar Impt/Key as a sub last weekend it looks as though he may still not be ready to start. Meanwhile cmf Victor Perez Impt is also likely to be on the bench as he recovers from LT injury.No other notable problems.\n\n \n\n2 very modest and limited sides here, neither of which inspires a huge amount of confidence. Though at the prices, the 1.89 +3/4/ away win bettable Espaniol of 3 wins at home cannot be giving such a handicap. I mean, Espanyol just hoof it up the field to Cordoba and hope. A lot of teams, including Valladolid, can deal with that.\n\n \n\nEspanyol: Kiko Casilla; Javi LÃ³pez, HÃ©ctor Moreno, Colotto, Fuentes; VÃ­ctor SÃ¡nchez, David LÃ³pez; Stuani, Sergio GarcÃ­a, Torje; CÃ³rdoba.\n\n \n\nValladolid: MariÃ±o; Rukavina, Valiente, Rueda, PeÃ±a; Rubio, Rossi; Ebert, Larsson, Bergdich; Javi Guerra.','','0','0.25',2.00,'7',48.01,0.00,480,3,'',1480.12,1,NULL,NULL),(635,1,0,0.00,1389629402,1389629402,1387656000,20,'Getafe','es','Barcelona','es',1,'Spain A','',' Getafe only sat back in Malaga, hoping to hang on for the 0-0. They survived until quite late on when Santa Cruz punished their lack of ambition. Dismal stuff and they deserved nothing.In true flat-track style, Getafe bounced back to eliminate a weak Girona side midweek.Full strength here, so it only remains to be seen what tactical variance Luis Garcia opts for. Expect the usual counter attack style, and heavy dependence on Pedro Leon\'s set pieces.\nBarcelona dominated most of the game against Villarreal but could still only translate that into a narrow win, as they continue to look vulnerable at the back, conceding from another set piece.\nThey were struggling to break Villarreal down and made the initial breakthrough with a handball penalty. Fortuitous, though it did come as a result of their territorial domination. At least Neymar showed up again to make the decisive contribution.\nMidweek a non-event at home to Cartagena saw Barca sleepwalk their way to a 3-0 win that left more questions than answers, with the away side hitting the woodwork twice and generally causing a lot more problems than one would reasonably expect.\nMessi blew a fuse in unprecedented fashion, going very public on a top news program to vent at the nobody in the Rosell junta who had stated there will be no contract upgrade. The nobody was probably speaking on behalf of somebody, of course, and therefore warranted a real blast of Messi media power. Rosell is certainly clumsy, very probably foolish, and capable of anything.\nGk Valdes Impt and rback Alves Impt remain out.\nThey are joined by Xavi reg/impt and of course Messi and the suspended Neymar.\nSergi Roberto could play in the Xavi slot, with Cesc in attack. I can have a go at Cesc again and he\'ll no doubt score if I do. Or will he? Suffice to say he is not a false 9, he is not a Xavi, and his play is irredeemably narcissistic, burdened by the weight of ego and neediness.\nOf course, Martino should travel light: play Alexis in the centre and leave Cesc on the bench or let him stew in midfield.\nJust in case I am wrong, Cesc can be found at 25/1 for the hat-trick in all disreputable bookmakers.\nGetafe are pretty dreadful, almost entirely reliant on Pedro Leon, but have occasionally been capable of a performance and result beyond their means. Set pieces will be their main hope here and they have good reason to be optimistic in that regard.\nBarca without all the glitter and glamour of their 2 real game-changers here. Also, while Xavi is surely fading these days,he is still an important miss. Sergi Roberto looks very good, is improving fast but is\nInexperienced.All adds up to oppose Barca ; starless in attack, feckless in defence.\nGetafe should not be receiving +1 Â½\nGetafe: MoyÃ¡; Valera, Alexis, Rafa, R Lago; Borja, Mosquera; Pedro LeÃ³n, Sarabia, Diego Castro; Colunga.\nBarcelona: Pinto; Alves, PiquÃ©, Mascherano, Alba; Busquets; Sergi Roberto, Iniesta; Alexis, Cesc, Pedro','','0','1.50',2.00,'7',47.31,0.00,473,3,'',1473.12,1,NULL,NULL),(636,1,0,0.00,1389629402,1389629402,1387656000,20,'Athletic','es','Rayo','es',1,'Spain A','','Ath . Bilbao are in very good form and especially at home the pressure that they apply on their opponents cracks them even if they fall behind they come back and win they have done it a few times this year so much the better that their opponents are weak defensively Vallecano\n2nd choice cdefs Ekiza and San Jose stand by if the Gurpegi miss out.\nThe overs seems a good option as well but i very rarely take unders/overs\nAthletic: Iraizoz; Iraola, San JosÃ©, Ekiza, Balenziaga; Iturraspe; Rico, Muniain; Susaeta, Aduriz, Ibai\nRayo Vallecano: RubÃ©n; Tito, GÃ¡lvez, ZÃ© Castro, Mojica; Trashorras, Baena; Lass, AdriÃ¡n, Jonathan Viera; Bueno','','0','-1.00',1.86,'5',0.00,0.00,0,1,'',1468.12,1,NULL,NULL),(637,1,0,0.00,1389629402,1389629402,1387656000,20,'Verona','it','Lazio','it',1,'Italy A','','Winless away from home Lazio cannot be giving a handicap to Verona with home record of 7-0-1  15-7.Ok they won last week but that was against weak Livorno and Klose is back but there are other important missings.If this was not Italian game the confidence would be 10 but with Italian games you always have in the back of your mind that something crooked could be going on.','','0','0.25',1.83,'7',47.89,0.00,485,2,'',1466.12,1,NULL,NULL),(638,1,0,0.00,1389629402,1389629403,1387656000,20,'Gent','be','Club Brugge','be',2,'Belgium','','Gent is not yet ready to face the big teams as it was proved last week loosing at home to Anderlecht so it cannot be really giving a handicap to an inform Club Brugge unbeaten in 5 games'