n the midfield, alongside Bruno, who has dropped his level\r\nsomewhat of late.  </p><p><strong>Cani </strong>remains out til Feb. <strong>Moi Gomez</strong> did a good job on Monday night in the creative\r\nattacking/dribbling role.  </p><p><strong>Sociedad</strong> were happy enough to let Athletic dominate the\r\nplay in the derby. Xabi Prieto and Pardo are the high-quality passers, Vela and\r\nthe incredible Griezmann are the hares. It\'s been working a dream for some time\r\nnow. Sociedad have at least 1 top class fwd for this style of game. If not 2. </p><p>Sociedad rested Pardo,\r\n Vela and Xabi Prieto in Copa midweek, improving once they came off the\r\nbench. </p><p>Some talk of Pardo benched,\r\nwhich would indicate a more defensive approach. </p><p>They should pose a greater\r\noverall threat in attack with Vela and Prieto back.</p><p>These sides meet again in\r\nCopa midweek, of course. Both sides prioritise Liga.  </p><p>Villa are pretty good of\r\ncourse. But they have gone 4 homes without a win. And the teams they have\r\nbeaten in the Madrigal have been mostly rubbish. 4-3-2 at home is nothing to\r\ntalk about  </p><p>Here they are up against one\r\nof the finest counter-sides in Liga, who have Griezmann and are on a 5-game win\r\nstreak during which they scored 16 goals.</p><p>Of course, win/lose streaks\r\nand Griezmann scoring streaks will be broken, eventually. </p><p>But I simply don\'t get this\r\n1.97 -1/2. An outbreak of collective madness. Or maybe I am very wrong.\r\n Plus for me. I see it as big value it should have been same price\r\n-0,-1/2</p><p>Villarreal: Sergio Asenjo;\r\nMario Gaspar, Musacchio, Chechu Dorado, Jaume Costa; Aquino, Bruno Soriano,\r\nTrigueros, Moi GÃ³mez; Uche, Dos Santos.</p><p>Real Sociedad: Bravo; Carlos MartÃ­nez, IÃ±igo\r\nMartÃ­nez, Ansotegi, JosÃ© Ãngel; Bergara, Pardo/Elustondo; Vela, Xabi Prieto,\r\nGriezmann; Agirretxe.</p>','52d5041bcbd94.jpg','Real Sociedad','0.50',1.97,'9',72.22,-9.00,722,3,'5:1',1722.24,1,NULL,NULL),(892,1,0,0.00,1389694642,1390388903,1389470460,20,'Getafe','es','Rayo Vallecano','es',2,'BBVA Liga','Pretty disgraceful non-try from Getafe in Sevilla.','<p>Pretty disgraceful non-try\r\nfrom Getafe in Sevilla. Out-fought, out-passed, out-jumped. Getafe</p><p>offered absolutely nothing\r\nof merit here. 3-0 was a good result in the circumstances. The difference</p><p>between the sides was\r\ngreater.</p><p>Getafe showed little\r\nimprovement as they were beaten 4-0 by Barca in Copa.</p><p>They are likely to be\r\nunchanged at the back. Yes, Alexis and Valera keep their places.</p><p><strong>Cmf\r\nMosquera Reg is a doubt, so is cmf Michel</strong>, so squad man Lacen may well play alongside Borja.</p><p>Sarabia is slight favourite\r\nover Lafita to play behind either Colunga or Marica.</p><p>They made a number of\r\nchanges to the side against Barcelona and didn\'t exactly sweat blood</p><p>anyway. So tiredness\r\nshouldn\'t really be a problem.</p><p>It went pretty much\r\naccording to script for Rayo at home to Villarreal. Dominant in possession, the</p><p>home side were mostly\r\nuseless in attack. 74-something % possession saw them go 0-5 down to 7</p><p>shots on target. Paco\'s\r\nsystem is admirable but without strikers it all ads up to disaster.</p><p>Crock <strong>cdef Ze\r\nCastro, lback Arbilla Reg, semireg/sub fwd Larrivey</strong> remain out as\r\nusual along with</p><p>some other deadwood. Paco is\r\nmercifully set to play Ruben in goal instead of Cobeno.</p><p>Galeano comes in for Rodri\r\nin central defence. Up front, Castillo, who bounces off defenders, is likely</p><p>to start instead of Bueno.</p><p>Getafe are in one of their\r\napathetic/pathetic phases. Once in a while they spark back to life, often</p><p>courtesy of a Pedro Leon set\r\npiece. When he feels like it. I don\'t know if he is a morning person.Their\r\nrecent  home record of 1-1-3 epitomizes this</p><p>Rayo have a pretty decent\r\nspine in gk Ruben, the decent Galvez, the excellent Trashorras,</p><p>and....well, we can stop\r\nthere. They will likely play well <a href=\"http://here.as/\">here.as</a> they did recently especially away from\r\nhome  2-1-2</p><p>So. I bet Rayo play well and\r\nat the price i will bet them as well but they could turn and embarrass me</p><p>Getafe: MoyÃ¡; Valera,\r\nLisandro, Alexis, Escudero; Borja, Lacen; Pedro LeÃ³n, Sarabia, Diego Castro;</p><p>Colunga.</p><p>Rayo Vallecano: RubÃ©n; Tito,\r\nGÃ¡lvez, Galeano, Nacho; SaÃºl, Trashorras; Lass, AdriÃ¡n GonzÃ¡lez,</p><p>Jonathan Viera; Nery.</p>','52d50b0a3507e.jpg','Rayo Vallecano','0.50',1.91,'6',73.67,5.46,737,2,'0:1',1725.24,1,NULL,NULL),(893,1,0,0.00,1389695411,1390388903,1389470520,20,'Torino','it','Fiorentina','it',2,'Seria A','Fiorentina misses their top scorer Rossi and are left without a striker but they have fast players who can play as false no 9 ie Joaquim ,Ilicic who can do damage to any team especially to a team like Torino who will try to attack and they also miss their top scorer Immobile.','<p>Fiorentina misses their top\r\nscorer Rossi and are left without a striker but they have fast players who can\r\nplay as false no 9 ie Joaquim ,Ilicic who can do damage to any team especially\r\nto a team like Torino who will try to attack and they also miss their top\r\nscorer Immobile .I believe Fiorentina will sit back and hit them on counter and\r\nsneak a win at a very good price as a result of overreaction over Rossi</p>','52d50fe7eb018.jpg','Fiorentina','0.00',1.88,'7',72.42,-7.00,724,3,'0:0',1724.24,1,NULL,NULL),(894,1,0,0.00,1389696101,1390388903,1389470580,20,'Benfica','pt','Porto','pt',1,'Portugal Liga Sagres','Good value bet on Benfica which is a better team than Porto at the moment are at home and they have the special occasion the death of Eusembio to win.','<p>Good\r\nvalue bet on Benfica which is a better team than Porto at the moment are at\r\nhome and they have the special occasion the death of Eusembio to win.</p>','52d513fe40966.jpg','Benfica','0.00',1.98,'7',73.81,6.86,738,2,'2:0',1724.24,1,NULL,NULL),(895,1,0,0.00,1389696691,1390388903,1389470700,20,'National','pt','Gil Vicente','pt',1,'Portugal Liga Sagres','National should take advantage of the bad form of Gil Vicente 5 games without a win 4 matches without scoring and take a narrow win.','<p>National\r\nshould take advantage of the bad form of Gil Vicente 5 games without a win 4\r\nmatches without scoring and take a narrow win.</p>','52d51635b4caa.jpg','National','0.00',1.83,'6',73.62,4.98,736,2,'2:0',1725.24,1,NULL,NULL),(897,1,0,0.00,1389699164,1389709150,1389470520,20,'Newcastle','gb','Man City','gb',2,'England Premier League','Good Luck!','<p>Good Luck!</p>','52d52012eeb32.jpg','Man City','-1.00',2.03,'8',73.62,0.00,744,2,'0:2',1719.99,1,NULL,NULL),(898,1,0,0.00,1389699783,1390388903,1389384120,20,'AtlÃ©tico Madrid','es','Barcelona','es',1,'BBVA Liga','Atleti were forced to sweat blood for the win in Malaga.','<p><strong>Atleti</strong> were forced to sweat blood for the win in\r\nMalaga. Schuster set 3 cdefs on the beast Costa, and Villa was largely\r\nineffective until Adrian and Cebolla came on to add some guile and aggression.\r\nA rare counter attack led by Villa and  Adrian saw  Costa\'s shot\r\nfired home by Koke in the late 70s. A real grind, this. But  job done.</p><p>In the 1<sup>st</sup> leg\r\nof Copa at Valencia, without the imperative to win, Atleti seemed to settle for\r\na draw and hope to sneak a lucky break. They got their lucky break but were\r\ncomprehensively outplayed and probably should have lost. </p><p>Somewhat surprisingly, rback\r\nJuanfran is <strong>able to play</strong> after he had his suspension lifted.</p><p> Tiago and Arda Turan\r\nwere subs midweek,  Godin and Villa didn\'t feature. For the rest, it was a\r\nstrong XI. </p><p>We will see the usual 1<sup>st</sup> choice\r\nXI here.</p><p><strong>Barca</strong> were allowed to run rampant against a passive\r\nElche. A high line with no pressing/ the away midfield bypassed meant that Cesc\r\ncould pick out the runners at leisure. This week\'s hat trick man was Alexis.\r\nSo, Tata has the enviable task of deciding which of Messi, Neymar, Pedro,\r\nAlexis or Cesc goes to the bench in Atletico.</p><p>Another session of 2-touch\r\nfor Barca as they comfortably dispatched a weak Getafe. Ok, they were a bit\r\nslow about getting through the massed defence. But against a bad side,\r\ninevitably the breakthrough comes.</p><p>Messi came on at 2-0 to put\r\nthe finishing touch. Striking the effortlessness with which he achieved his 2\r\ngoals, in contrast to a desperate, anxious Cristiano in the Osasuna\r\ngame. </p><p>Defence and midfield are\r\nfull strength with the return of Alves. Replacement Montoya is not bad \r\nbut lacks the technique to be a genuine top level player for Barca.</p><p>The rest is a bit of a\r\nmusical chairs depending on whether Messi starts or not.  Very possibly\r\nthe old guard of Xavi and Iniesta get to start in mf, by default.</p><p>Tata is <strong>not sure yet\r\nwhether to risk starting</strong> <strong>Messi</strong> against Atletico. It will\r\ndepend on the player to an extent. 20 minutes against Getafe doesn\'t seem\r\nadequate preparation for a game of this difficulty.  Neymar missed the\r\nmidweek game through a stomach bug and Tata says that he is fit to play but the\r\nBrazilian is favorite to go on the bench. The good form of Alexis, Pedro and\r\nCesc means there is no emergency up front.</p><p>This will not be fun for\r\nBarcelona.</p><p>Also, while Messi is\r\nofficially back, he is a real doubt to start. 20 minutes in Copa against beaten\r\ndogs Getafe (and their Varela)  is not adequate preparation for a game of\r\nthis magnitude. And they are probably worried about a relapse.</p><p>Atleti will try to be their\r\nusual selves. Anti-possession v possession. Selective, aggressive pressing as\r\nBarca try to bring out the ball. This caused serious problems in the Supercopa.\r\nDefensive phases are characterised by a wall of players deployed centrally.\r\nThere is no way through. Barca\'s offensive passing, which is usually central,\r\nis negated. If Barca subsequently play the ball wide, the press becomes\r\nkamikaze against the ball-carrier hemmed in by the sideline. Familiar stuff by\r\nnow. It definitely works. Against everyone. </p><p>Barca\'s high line can, in\r\nturn, be extremely vulnerable after a turnover. It is not pretty when they come\r\nup against a decent side. And who can stop Diego when he gets a run. Get a run\r\nhe will. </p><p>After reading it, you might\r\nbe inclined to agree that Atleti may well murder Barca. If there is a worry\r\nabout Atleti, it is the last few games where they have looked somewhat robotic,\r\nlacking in real physical sharpness. In Valencia they were plain bad, though\r\npresumably the weekend game was on their minds. </p><p>All things considered, the\r\n1.98 +1/4 looks a very decent offer about the home. </p><p>Atletico: Courtois;\r\nJuanfran, Miranda, GodÃ­n, Filipe; Arda, Gabi, Tiago, Koke; Diego Costa, Villa.</p><p>Barcelona: ValdÃ©s; Alves, PiquÃ©, Mascherano, Alba;\r\nBusquets; Xavi, Cesc/Iniesta; Alexis, Cesc/Messi, Pedro.</p>','52d522465b1e7.jpg','AtlÃ©tico Madrid','0.00',1.98,'8',72.32,-8.00,723,3,'0:0',1723.24,1,NULL,NULL),(899,1,0,0.00,1389700272,1390388903,1389384180,20,'Elche','es','Sevilla','es',2,'BBVA Liga','Elche never had a chance in the Nou Camp.','<p><strong>Elche</strong> never had a chance in the Nou Camp. Boakye hit\r\nthe post with a rare chance. But the midfield was easily bypassed by Barca\'s\r\nsuperior passing, and the high line of 4 defenders was left exposed. Time to\r\nforget this and move on. Only losing 4-0 was a good result.</p><p><strong>Fwd Manu del\r\nMoral R/I and cdef Botia Impt </strong>are <strong>out here on a chicken clause</strong>, as is useless non\r\nplaying <strong>rmf Stevanovic.</strong></p><p><strong>Gk Manu Herrera</strong> is out. <strong>Tono </strong>starts,\r\na declining force I would say.</p><p>They do get Damian Suarez\r\nand Corominas back, with the former going into the defence while Corominas is\r\nbehind Boakye in attack.</p><p>Cmf Ruben Perez Impt is\r\na <strong>doubt.</strong> If he doesn\'t play then Javi Marquez is likely to\r\ncome in, while a less attacking replacement would be Alberto Rivera. Rivera is\r\ntoo small and old for the kind of physical combat demanded by Sevilla. Marquez\r\nis gifted but also a flaky player with glass ankles. </p><p><strong>Sevilla</strong> rolled over an uninterested Getafe. A bit of\r\nRakitic, a bit of aerial power, a bit of M Bia destroying in midfield. A bit of\r\nBacca. It all proved far too much  for cowardly opposition. </p><p>Sevilla are looking\r\npowerful. Emery has settled on a steady XI, really building up a head of steam\r\nthese days.</p><p>Sevilla have <strong>Iborra</strong> back\r\nfrom suspension, he is likely to be in a physically imposing midfield alongside\r\nMBia.</p><p>They are still without\r\nrback <strong>Diogo Figueiras</strong> R/I so <strong>Coke</strong> continues. <strong>Lback Alberto Moreno</strong> R/I\r\nreturns from injury but it is possible that F Navarro will keep his place on\r\nthe left. While Cala has been left out of the squad <strong>Pareja</strong>returns\r\nafter injury.</p><p>Rakitic can play here. He\r\nwill likely go in his best no 10 role.</p><p>Elche have lost and failed\r\nto score in 4 of their last 5 homes. There have been few-to-zero mitigating\r\ncircumstances of late. They have been bad. </p><p>Sevilla have been building\r\nup a momentum. The imposing Iborra and M\'Bia are destroyers  in midfield,\r\nRakitic is the magician, while Bacca is a powerful forward with a finish.</p><p>It is kind of obvious, but\r\nSevilla really should win this.</p><p>Elche: ToÃ±o; DamiÃ¡n,\r\nPelegrÃ­n, LombÃ¡n, Edu Albacar; Carlos SÃ¡nchez, RubÃ©n PÃ©rez, Carles Gil,\r\nCorominas, Fidel; Boakye.</p><p>Sevilla: Beto; Coke, Fazio,\r\nCarriÃ§o, Fernando Navarro; M\'Bia, Iborra; Reyes, Rakitic, VÃ­ctor MachÃ­n; Bacca.</p>','52d5240f00346.jpg','Sevilla','-0.25',1.90,'8',72.32,-8.00,723,3,'1:1',1723.24,1,NULL,NULL),(900,1,0,0.00,1389700588,1389709279,1389384240,20,'Livorno','it','Parma','it',2,'Seria A','Parma last week show what a good team they are when they play to their abilities by coming from behind to beat in form Torino i expect them to beat Livorno with only 1 point out of last 7 games.','<p>Parma\r\nlast week show what a good team they are when they play to their abilities by\r\ncoming from behind to beat in form Torino i expect them to beat Livorno with\r\nonly 1 point out of last 7 games.</p>','52d525765fc1e.jpg','Parma','0.00',1.74,'8',0.00,0.00,6,0,'0:3',1728.23,1,NULL,NULL),(901,1,0,0.00,1389701234,1390388903,1389211200,20,'R Madrid','es','Osasuna','es',1,'COPA DEL REY 2013-2014','Xabi Alonso has been left out as a precaution for Madrid who should start a strong XI featuring Bale and Cristiano. Madrid have been playing poorly so cannot take any chances. Jese may start in place of the moribund Benzine.','<p>Xabi Alonso has\r\nbeen left out as a precaution for Madrid who should start a strong XI featuring\r\nBale and Cristiano. Madrid have been playing poorly so cannot take any chances.\r\nJese may start in place of the moribund Benzine.</p><p>Osasuna are\r\nwithout the injured Armenteros. Only 1 No 9 available, Oriol, so they may or\r\nmay not pick him. Liga being the thing. </p><p>For the rest\r\nGracia will shuffle a few men around but they are mostly of the same level,\r\nroutine stuff. 16 year old kid Garcia might start.</p><p>Madrid were\r\nmostly awful against Celta but if Jese starts they may have a bit more spark up\r\nfront. A good night for the Madrid to show off. Against a mostly disserentested\r\nand low quality Osasuna </p><p>Real Madrid:\r\nCasillas; Arbeloa, Nacho, Sergio Ramos, Marcelo; Illarramendi, Modric; Bale,\r\nIsco, Cristiano Ronaldo; JesÃ©.</p><p>Diego\