isappearing, but\r\nstill doing well in 2B. Almeria\r\ndon\'t want to be here. </p><p>Racing eliminated Sevilla so\r\ncan be taken seriously. The plus 0,1/2 looks the more attractive option at 1.91</p><p>Racing: Sotres; Orfila, Oriol, Barrio, SaÃºl; Ander,\r\nSoria, Granero, IÃ±aki; DurÃ¡n y Mariano.</p><p>AlmerÃ­a: Ustari; Antonio MarÃ­n, Hans MartÃ­nez,\r\nMarcelo Silva, ManÃ©; Marcos TÃ©bar, Corona; Suso, Hicham, RaÃºl GarcÃ­a;Jonathan.</p>','52d52bb302234.jpg','Racing','0.25',1.91,'5',73.35,2.28,734,4,'1:1',1726.24,1,NULL,NULL),(904,1,0,0.00,1389703312,1390388903,1389125040,20,'Barcelona','es','Getafe','es',1,'COPA DEL REY 2013-2014','Barca are without Alves, Neymar, Bartra.  Messi should start.','<p>Barca are without Alves,\r\nNeymar, Bartra.  Messi should start.</p><p><br>\r\nGetafe are without cmf Michel and cmf Mosquera.<br>\r\n<br>\r\nGetafe look to keep the score down after a couple of appalling performances.\r\n Barca will win comfortably enough but they have Atleti at the weekend so\r\nmay well choose to stay in 2nd gear at 3 or 4 -0. But still with Messi in\r\nthe team they must be backed</p><p><br>\r\nBarcelona: Pinto; Montoya, PiquÃ©, Mascherano/Puyol, Adriano;\r\nBusquets/Song; Sergi Roberto, Iniesta/Cesc; Pedro, Mesi, Alexis.</p><p>Getafe: Codina; Valera, Rafa, Lisandro,\r\nRoberto Lago; Borja, Lacen; Pedro LeÃ³n, Lafita(Sarabia), GavilÃ¡n (D. Castro);\r\nMarica (Colunga)</p>','52d5305ad78f1.jpg','Barcelona','-2.75',1.95,'7',73.79,6.65,738,2,'4:0',1724.24,1,NULL,NULL),(905,1,0,0.00,1389703586,1390388903,1389125160,20,'Man City','uk','West Ham','uk',1,'ENGLAND CARLING CUP 2013-2014','Very strong line up for Man City.','<p>Very strong line\r\nup for Man City</p><p>Man City:\r\nPantilimon, Zabaleta, Kompany, Lescott, Clichy, Nasri, Toure, Javi Garcia,\r\nSilva, Negredo, Dzeko</p><p>Subs: Hart,\r\nMilner, Kolarov, Fernandinho, Demichelis, Nastasic, Lopes</p><p>West Ham:\r\nAdrian, Demel, Johnson, McCartney, O\'Brien, Joe Cole, Noble, Diame, Taylor,\r\nDowning, Maiga</p><p>Subs: Jarvis,\r\nRat, Collison, Morrison, Diarra, Jaaskelainen, Carlton Cole</p>','52d5319936590.jpg','Man City','-2.50',1.97,'6',73.71,5.82,737,2,'6:0',1725.24,1,NULL,NULL),(906,1,0,0.00,1389708160,1390388903,1388952060,20,'Parma','it','Torino','it',2,'Seria A','Parma has only 1 win in the last 5 games 1-4-0  and their last 5 at home they are 1-3-1 not won in the last 4.','<p>Parma has only 1 win in the\r\nlast 5 games 1-4-0  and their last 5 at home they are 1-3-1 not won in the\r\nlast 4.They seem to find it difficult in breaking down teams at home against\r\nweaker opposition their best results and games are against the top teams.</p><p>Torino are in the form of\r\ntheir life and have the highest position in the league for the last 22 years\r\nand in their last 5 games are 4-1-0 .</p><p>With the current form of\r\nTorino and the inconsistency of Parma and inability to break down team at home\r\nshown in their home record of 3-4-2 this game should be -0,-1/2 2.05 -1.90 not\r\na -1/2 goal game</p>','52d5432e6c3d1.jpg','Torino','0.50',1.86,'7',72.42,-7.00,724,3,'3:1',1724.24,1,NULL,NULL),(907,1,0,0.00,1389708393,1390388903,1388952120,20,'Lazio','it','Inter','it',2,'Seria A','Ithink the prices are wrong and there is an over reaction to the change of manager at Lazio a team that has only won 1 in the last 5 and in their last game were humiliated by Verona cannot be such a favourite against Inter who have only 1 defeat in the away games and that was against Napoli in their last away game','<p>Ithink the prices are wrong\r\nand there is an over reaction to the change of manager at Lazio a team that has\r\nonly won 1 in the last 5 and in their last game were humiliated by Verona\r\ncannot be such a favourite against Inter who have only 1 defeat in the away\r\ngames and that was against Napoli in their last away game</p>','52d54421dda93.jpg','Inter','0.25',1.97,'8',72.32,-8.00,723,3,'1:0',1723.24,1,NULL,NULL),(908,1,0,0.00,1389708714,1390388903,1388952180,20,'Real Madrid','es','Celta','es',1,'BBVA Liga','Madrid were vulnerable to Valencia\'s pacy little men (Piatti), to their aerially invincible little men\r\n(Piatti), not to mention to their big men (Mathieu). Fairly shambolic, shapeless stuff this from Madrid\r\nwith Arbeloa losing his trousers on the way. ','<p>Madrid were vulnerable to Valencia\'s\r\npacy little men (Piatti), to their aerially invincible little men</p><p>(Piatti), not to mention to\r\ntheir big men (Mathieu). Fairly shambolic, shapeless stuff this from Madrid</p><p>with Arbeloa losing his\r\ntrousers on the way. The win came thanks to an offside set piece and a flukey</p><p>late goal from sub Jese.\r\nRamos was once again flabbergastingly cavalier with his elbows and should have\r\ntaken another red. Pretty lame stuff, overall.</p><p>Madrid flew to Qatar on\r\nTuesday, played PSG on Wednesday evening and flew straight back. All</p><p>part of the compensation\r\ndeal for Ancelotti they say, though of course construction junkie FloP will</p><p>do anything to be in the\r\nsheikhs good books.</p><p>Carvajal will likely start\r\nin place of the struggling Arbeloa.Should be a 1st choice cmf of Modric and\r\nXabi Alonso, with Illarra on the bench.<strong>Bale </strong>is in the squad. Not\r\nready yet after 3 weeks out. If he starts, it would be a corporate decision\r\nrather than a sporting one. There is an outside chance that in form Jese could\r\nstart.</p><p>Celta were too soft in\r\ndefence as Oriol bullied the centre backs, while the plodding midfield was</p><p>easily bypassed by the away\r\nruns from deep. The result was a bit of a shambles early on with Celta</p><p>extremely lucky to survive.\r\nA fortuitous deflected header undeservedly got them back in the game</p><p>and the match levelled out\r\nat 1-1.</p><p>Celta are without cdef\r\nFontas Impt, so Costas and Cabral could start in the centre with\r\nAurtenetxe</p><p>on the left and Roberto\r\nMallo returning on the right. Assuming it is 4-3-3. LE has been known to go 5-</p><p>3-2 and this is one of those\r\ntype of games.</p><p>Alex Lopez is set to return\r\nin midfield which would probably mean there is no place for Krohn Dehli.</p><p>Madrid didn\'t seem all that\r\nhappy to have their Xmas (from 24 Dec til 6 Jan in Spain) disrupted by</p><p>the Doha trip. Plenty of\r\ndoubts remain, exacerbated by the unstoppable momentum of their 2</p><p>huge rivals. If there is any\r\nconsolation, the 2 rivals meet next week.</p><p>LE returns to the Bernabeu\r\nwhere he is a genuine hate figure, having abandoned the club after 5</p><p>years as a player and\r\nreturned with Barcelona to gleefully rub their noses in it. He clearly hates</p><p>Madrid, too.</p><p>Celta are weak defensively\r\nand are a soft touch and toothless in attack you cant go to Bernabeou and try\r\nto outplay them  Madrid will win  and beat the handicap</p><p>Real Madrid: Diego LÃ³pez;\r\nCarvajal, Pepe, S Ramos, Marcelo; Xabi Alonso, Modric; Di MarÃ­a, Isco,</p><p>Ronaldo; Benzema.</p><p>Celta de Vigo: Yoel; Hugo\r\nMallo, Costas, Cabral, Aurtenetxe; OubiÃ±a, Alex LÃ³pez, Augusto</p><p>FernÃ¡ndez; Rafinha, Charles, Nolito</p>','52d5452f7de8d.jpg','Real Madrid','-2.50',1.82,'7',73.70,5.74,737,2,'3:0',1724.24,1,NULL,NULL),(909,1,0,0.00,1389709495,1390388903,1388952360,20,'Rayo Vallecano','es','Villarreal','es',2,'BBVA Liga','Rayo never quite built up a head of steam in Bilbao but admirably managed to stay in the game\r\nthroughout.\r\n','<p>Rayo never quite built up a\r\nhead of steam in Bilbao but admirably managed to stay in the game</p><p>throughout. The away never\r\nquite impressed but were not outplayed either. The usual lack of</p><p>scoring threat ultimately\r\nsaw them lose again.</p><p>Rayo are without <strong>lback\r\nArbilla Reg, cdef Ze Castro R/I,</strong> <strong>fwd Larrivey semireg</strong>,\r\nand <strong>Lt. Jose</strong></p><p><strong>Carlos, Seba\r\nFernandez.</strong>With Ze Castro out yet again, they can go with either\r\nthe <strong>erratic Galeano or Rodri</strong> who\r\nis available after LT injury.</p><p>Tarsiers missed the last\r\ngame but should return, though as Saul and Adrian both did pretty well may</p><p>even start on the bench.</p><p>Villarreal, minus Cani, are\r\nmissing a limb. They lack the the alchemy hitherto provided by a man in</p><p>the form of his life.\r\nMeanwhile they are looking weak in the air and Sevilla\'s precision bombardment,</p><p>courtesy of Rakitic, saw\r\nthem bullied by Bacca and Cala. Villa looked lightweight and uninspired.</p><p><strong>Cani </strong>remains out. Neither Herman Perez nor Aquino offer the\r\nsame threat on the wings but both</p><p>are set to play this\r\nweekend.No other problems</p><p>No reinforcements for Rayo\r\nso they remain a team in search of a forward. They can play all the nice</p><p>football and run around all\r\nday but it gets a bit futile at times as another shot fizzes harmlessly wide.</p><p>Villa are not the same\r\nwithout Cani, have looked a bit jaded in any case. Though they have a nice</p><p>line in rope-a-dope and can\r\nsit back before launching rapid counters in response to Ray\'s mostly</p><p>harmless attacks. That is\r\nthe likely script for this game and i expect Villareal to succeed in scoring\r\nand winning the game</p><p>Rayo: RubÃ©n; Tito, Galeano,\r\nGÃ¡mez, Monica; SaÃºl, Adrian/Trashorras; Lass, Viera, Perea; Bueno.</p><p>Villarreal: Asenjo; Mario\r\nGaspar, Musacchio, Chechu Dorado, Jaume Costa; Aquino, Bruno,</p><p>Trigueros, HernÃ¡n PÃ©rez; Gio, Uche</p>','52d547abd5d9c.jpg','Villarreal','-0.25',1.97,'7',73.80,6.79,738,2,'2:5',1724.24,1,NULL,NULL),(910,1,0,0.00,1389709761,1390388903,1388866020,20,'Barcelona','es','Elche','es',1,'BBVA Liga','Barcelona were on the ropes as Getafe landed 2 heavy blows early on. It looked like one of those\r\ndays for the Catalans, when their frailties came to the fore. But they kept calm and wriggled free,\r\nwith Pedro brilliant and Cesc instrumental.\r\n','<p>Barcelona were on the ropes\r\nas Getafe landed 2 heavy blows early on. It looked like one of those</p><p>days for the Catalans, when\r\ntheir frailties came to the fore. But they kept calm and wriggled free,</p><p>with Pedro brilliant and\r\nCesc instrumental. They were aided by a horrible showing from Varela who</p><p>gifted them 3-4 goals. So,\r\ngreat comeback, great hat trick, with Cesc restricted to a mere 2 as Tata</p><p>subbed him off. But those\r\nwarning lights are still flashing.</p><p><strong>Messi</strong> will skip the Elche game and get some midweek\r\nCopa minutes against Getafe, with the Atleti</p><p>game the priority.<strong>Valdes </strong>is\r\nback and starts.<strong>Dani Alves</strong> has flu and is out. <strong>Montoya.in</strong></p><p><strong>Cmf Serge\r\nBuckets Impt</strong> is suspended. Song,\r\nXavi, Iniesta in midfield.</p><p>Cesc as false 9. <strong>Neymar</strong> returns\r\nfrom suspension. And Alexis.</p><p>Elche fell behind to a set\r\npiece and couldn\'t make any real impact against a disciplined Malaga.</p><p>This was a horrible, sterile\r\nencounter, rendered impossible when Suarez took a red on the hour.</p><p>Elche are without <strong>gk\r\nManu Herrera Reg</strong> injured, so <strong>old\r\ndog Tono</strong> starts. <strong>Rback Damian Suarez</strong> Reg is</p><p>suspended. He would normally\r\nbe replaced by the not entirely convincing Sapunaru, though the</p><p>Romanian has flu so may not\r\nstart.Ex Barca <strong>B cdef Lomban</strong> returns and may get the start\r\nahead of squad man Pelegrin.</p><p><strong>Fwd Corominas</strong> is suspended. So Carles Gil is likely to step\r\ninside to play behind the 9 (Boakye/Manu</p><p>del Moral), with Aaron\r\ncoming in on the right.</p><p>Barca are refreshed and\r\nprobably looking forward to stretching their legs here.</p><p>Elche have no business being\r\nin this company.</p><p>If Messi was available, it\r\nwould be 7.</p><p>Barca might have to settle\r\nfor 4.</p><p>Barcelona: ValdÃ©s; Montoya,\r\nPiquÃ©, Mascherano, Jordi Alba; Song; Xavi, Iniesta; Alexis, Cesc,</p><p>Neymar.</p><p>Elche: ToÃ±o; Sapunaru,\r\nBotÃ­a, Lomban/PelegrÃ­n, Edu Albacar; AarÃ³n, Carlos SÃ¡nchez, RubÃ©n PÃ©rez,</p><p>Fidel; Carles Gil; Manu del\r\nMoral.</p>','52d54981a5798.jpg','Barcelona','-2.75',1.99,'8',0.00,0.00,0,0,'4:0',1723.24,1,NULL,NULL),(911,1,0,0.00,1389710247,1390388903,1388866140,20,'Real Sociedad','es','Athletic Bilbao','es',1,'BBVA Liga','Sociedad were happy to let Granada charge at them.','<p>Sociedad were happy to let\r\nGranada charge at them. The home side were easily repelled, and the</p><p>classy Basque attackers had\r\na field day. Griezmann and Vela were once again sensational. More</p><p>PL fodder. Griezmann is a\r\nmere 30m Euros in case you are interested in a summer bargain. Vela? A</p><p>very long-running puzzle how\r\nArsenal could ever let him go/the entire PL could have been so blind</p><p>to his merits for so long.\r\nArsene works in mysterious ways, indeed.</p><p><strong>Rback\r\nC Martinez Impt</strong> is in the squad. He\r\ndidnt train for most of the week, a small doubt. No</p><p>Estrada, so at worst they\r\nmay field cdef Mikel out of position. But I guess CM starts.</p><p>Likewise <strong>Xabi Prieto Impt/Key,</strong> another fitness\r\ndoubt during the week but should be ok.</p><p>A rather uninspired Athletic\r\nhad to work hard at home to Rayo. The away were a bit more</p><p>disciplined than usual and\r\nat one point the game was in the balance at 1-1. San Jose and Mikel</p><p>Rico are leading the scoring\r\ncharts at San Mames and duly bundled home 2 rudimentary efforts to</p><p>take the 3 points. Rather\r\nuninspired, and rather hard work, all told.</p><p>Athletic are full strength\r\nhere. Valverde has hinted that Ibai Gomez will play on the left wing with</p><p>Muniain central as\r\n2nd strike/No 10. This would mean that Ander Herrera is on the bench.</p><p>Toquero (A primera striker\r\n!!!!) is in line to start up front again, Aduriz benched.</p><p>Sociedad are building some\r\nmomentum now that they no longer have that CL nonsense to worry</p><p>about. CL is for superteams\r\nwith supersquads.</p><p>Athletic are flying on 33\r\npoints though it hasn\'t been a smooth ride by any means as they alternate</p><p>defensive worries with\r\nscoring problems.</p><p>2 evenly matched sides in\r\nmany respects. But the away form of Atletic and their defense is not good\r\nenough to withstand</p><p>the fantastic attacking\r\ntalent in Griezmann and Vela.</p><p>I mean, that is better than\r\nToquero, surely?</p><p>Real Sociedad: Bravo; Carlos\r\nMartÃ­nez, Mikel, IÃ±igo MartÃ­nez, JosÃ© Ãngel; Bergara, Pardo; Xabi</p><p>Prieto, Vela, Griezmann;\r\nAgirretxe.</p><p>Athletic: Iraizoz; Iraola,\r\nGurpegui, Laporte, Balenziaga; Iturraspe, Rico; Susaeta, Muniain, Ibai;</p><p>Toquero</p>','52d54b6d8db25.jpg','Real Sociedad','-0.25',1.93,'7',73.78,6.51,738,2,'2:0',1724.24,1,NULL,NULL),(912,1,0,0.00,1389710647,1390388903,1388779200,21,'Valladolid','es','Betis','es',2,'Spanish BBVA Liga','In the last game of the 2013 for Betis we witnessed something we had never seen in La Liga. Betis lost hosting Almeria and after the game was finished, new appointed manager Garrido took the players in the center of the field to oppose the supporters of the team.','<p>In the last game of the 2013 for Betis we witnessed something we had\r\nnever seen in La Liga. Betis lost hosting Almeria and after the game was\r\nfinished, new appointed manager Garrido took the players in the center of the\r\nfield to oppose the supporters of the team. The booes and disaprovals towards\r\nthe players gave their place to the hymn of the team and the standing ovation\r\nwith the shout âyes, you canâ! Some players blasted into cries, experienced\r\nSalva Sevilla one of them, but this was a clear message for Betis\'\r\n players, their supporters are on their side! Betis didn\'t play bad! They\r\ndeserved much more out of the game. They created and wasted many opportunities\r\nand unfortunately wasting cleat cut opportunities seperates the good from the\r\nbad form... Almeria had their own though and could have scored another one in\r\nthe final minutes. Betis wasn\'t bad in Sociedad either. Despite the 5-1 defeat\r\nthey stood up brilliandly in the first part and after being down by 1-0 they\r\nequalized and had opportunities, a post included, to make it 1-2!</p><p>\r\nUnfortunately Vadillo got injured, he is a great\r\noffensive player was excellent against Almeria, thankfully center back Amaya\r\nreturns. In the last game Betis was fielded with only 2 center backs, now they\r\nare in better position. Garrido made it clear yesterday: âwe need 30 points in\r\nthe rest of the seasonâ.  In 17 games just 10 gathered... 21 games to go.<br>\r\n<br>\r\nI still don\'t have late news from Valladolid but\r\nit already known that key forward Ebert is losing the next two games injured.\r\nEbi got injured in the 20\' against Espanyol and maybe that was a reason for the\r\n4-2 defeat in the last game of the 2013. Oscar is a doubt suffering from a\r\ngripal, and will most probably not make it to the squad.<br>\r\n<br>\r\nValladolid at home is like Dr Jekyl and Mr Hide\r\nbut my impression is that they do their game only when the rivals allows it to\r\nhappen. Recently they deservedly lost to Osasuna and before netting 3 goals\r\nagainst Celta they were saved by the bell in several opportunities from the\r\nvisitors. Now Betis can not allow any possible miss-fire and a lousy aproach to\r\nthe game. The urgent need of points from Betis\' leading me to bet on their\r\nlevel ball and not just in the +0,25.</p>','52d54cefeb387.jpg','Betis','0.00',2.24,'6',0.00,0.00,0,1,'0:0',1633.86,1,NULL,NULL),(913,1,0,0.00,1389710797,1389710936,1388866260,20,'Chievo','it','Cagliari','it',2,'Seria A','Caglari continues with thie unbeaten series of 6 matches 2-4-0 that includes away draws against Roma and Parma and a home draw against Napoli.','<p>Caglari continues with thie\r\nunbeaten series of 6 matches 2-4-0 that includes away draws against Roma and\r\nParma and a home draw against Napoli.The have no absentees and should get a\r\nresult against Chievo who after 3 wins in a row with the change of trainer thay\r\nare back to their old ways and lost the last 2.With only 2 wins at home 2-1-5\r\nthey cannot be giving a handicap to tough to beat Cagliari</p>','52d54d51dcc2a.jpg','Cagliari','0.25',1.86,'7',73.92,0.00,739,4,'0:0',1729.23,1,NULL,NULL),(914,1,0,0.00,1389711054,1390388903,1388865600,21,'Sevilla','es','Getafe','es',NULL,'Spanish BBVA liga','Sevilla seems to be in a very good state of form as long as they have 4 wins and one draw in the last 5 games and the only bad recent result was the cup fiasco against 3rd division Racing de Santander.','<p>Sevilla seems to be in a very good state of form as long as they have 4\r\nwins and one draw in the last 5 games and the only bad recent result was the\r\ncup fiasco against 3rd division Racing de Santander. Getafe on the other hand,\r\ngoes into this game with 4 defeats, one draw and only a lousy win over Levante\r\nin the last 6 games.</p><p>\r\nThe advantage for Getafe today is that they\r\ntraveled in full squad as long as right back Arroyo returns and there no\r\ninjuries or suspensions. On the other hand Sevilla is obligated to play\r\ndefensively deplete through missings.<br>\r\n<br>\r\nCenter back Cala and right back Diogo are\r\nsuspded (Diogo was missing in Villarreal too), while the key left full back\r\ninternational Alberto Moreno remains sidelined. Moreover tough defensive\r\nmidfielder Iborra was was rated Sevilla\'s MVP in Santander and Fraiburg\r\nrecently is suspended as well! This makes 4 important missings in the defensive\r\npart of the team. Marin MD* is back after spending 3 months in the sidelines so\r\nthere are some options in the creative part, maybe Rakitic will play back and\r\nMarin as No10 but most probably is Marin to start on the bench, Rakitic to\r\ncreate and M\'Bia and Caricco to cut the opponents.<br>\r\n<br>\r\nSevilla on the road sucks. They play tough\r\ndefense, with two lines, 3 defensive midfielders and through long balls they\r\nare searching for counters. This wasy they beat Villarreal before the break. At\r\nhome they play better, usually attack through waves and if this works they are\r\nforbitable! Getafe are full but can they take any advantage of Sevilla\'s\r\ndefensively missings? Hard call but then again, why not? They should be\r\nimproved after the two weeks break, but I won\'t trust them to win in Sevilla. I\r\nonly wish them to score a goal, ok maybe two!</p>','52d54e37c7753.jpg','Over','2.75',2.01,'5',64.24,2.53,642,4,'3:0',1634.86,1,NULL,NULL),(915,1,0,0.00,1389711216,1390388903,1388865600,21,'Osasuna','es','Espanyol','es',1,'Spanish BBVA liga','Both Espanyol and Osasuna have been doing excellent recently  and even though the league results don\'t confirm they deserved more than what they got and had some nice cup games recently as well. ','<p>Both Espanyol and Osasuna have been doing excellent recently  and\r\neven though the league results don\'t confirm they deserved more than what they\r\ngot and had some nice cup games recently as well. Osasuna is a tough home team\r\nand even Real Madrid and Barcelona didn\'t manage to pick up all points in the\r\nEl Sadar. Osasuna have key players back such as center back Arribas and\r\nmidfielder Silva and they are only missing both sides back Damia. Yes, this is\r\na missing, but Espanyol is facing more important missings that this mainly\r\nbecause of a heavy flue effected the squad in the midweek.</p><p>\r\n7 players were affected, 5 of them were left in\r\nBarcelona VÃ­ctor Ãlvarez MD, Tejera MD, Torje MD (gripe), Fuentes LF*\r\n(gripe& susp), VÃ­ctor SÃ¡nchez DH*** (gripe& susp & injured) and two\r\nof them traveled in Pamplona but are doubtful for today. And these two are key\r\nplayers in the team, the influential all around forward Sergio Garcia*** and\r\nthe \'in excellent form\' forward Stuani FW**. Should one of them fails it will\r\nbe another blow for the team. This is going to be an one side affair, Osasuna\r\nwill dominate but what matters is to send the ball in. Espanyol can defend,\r\nyes, but  even if they score one they will hardly avoid the defeat. Still\r\nthe draw is a possibility and this is why I am taking the -0,25 which actually\r\nis being offered in great odds.</p>','52d54f3ba9d31.jpg','Osasuna','-0.25',2.08,'8',64.85,8.64,649,2,'1:0',1631.86,1,NULL,NULL),(916,1,0,0.00,1389711222,1390388903,1388866560,20,'Osasuna','es','Espanyol','es',1,'BBVA Liga','Osasuna\'s big No 9 Oriol Riera dominated the opening half as he held off the weak home defence\r\nto set up the midfielders running from deep.\r\n','<p>Osasuna\'s big No 9 Oriol\r\nRiera dominated the opening half as he held off the weak home defence</p><p>to set up the midfielders\r\nrunning from deep. The away side could have had a 2 or 3 goal lead on the</p><p>half hour. Instead they\r\nconceded a flukey deflected goal and the game evened up. Coulda</p><p>shoulda. Oriol failed to\r\nscore and remains 1 goal behind Messi in the pichichi race.</p><p>Osasuna get main <strong>cdef\r\nArribas Impt</strong> back after suspension, as is the case for <strong>cmf\r\nGato Silva.</strong></p><p><strong>Lback Damia Reg</strong> is suspended so Oier is set to start.</p><p>Espanyol aggressively set\r\nabout Valladolid from the start and their fierce pressing yielded all 4 goals</p><p>as they rolled over a\r\nharmless, vulnerable Valladolid. This time, Espanyol had no need to hoof the</p><p>ball long â they kept\r\nwinning it up the field. 4-2 and ultimately no real contest with Valladolid\r\nscoring</p><p>very late.</p><p>The team has been hit with\r\nflu which sees <strong>lback Fuentes R/I, cmf Sanchez Impt</strong> (also\r\nsuspended),</p><p>replacement <strong>lback\r\nVictor Alvarez</strong> and squad <strong>rmf Torje</strong> all missing.</p><p><strong>Fwd\r\nSergio Garcia i/K and rmf Stuani Impt</strong> are also doubts with the flu. Stuani is being linked to a</p><p>move to Lazio. I presume\r\nEspanyol are short of cash to pay players, as usual.</p><p>Osasuna coach Javi Gracia\r\nhas it pretty clear. The words \'tall\', \'set pieces\', \'long ball\'and\r\n\'counterattack\'</p><p>were mentioned as he talked\r\nabout the opponents.</p><p>Espanyol\'s flu may prove the\r\ndeciding factor in what would normally be a tight affair with the absentees and\r\ndoubtfulls weakening Espanyol.</p><p>Osasuna: AndrÃ©s FernÃ¡ndez;\r\nMarc BertrÃ¡n, Arribas, Loties, Oier; Silva, Lolo; Cejudo, Torres,</p><p>Armenteros; Oriol Riera.</p><p>Espanyol: Kiko Casilla; Javi\r\nLÃ³pez, Colotto, HÃ©ctor Moreno, Capdevila; Stuani?, David LÃ³pez, RaÃºl</p><p>RodrÃ­guez, Simao; Sergio GarcÃ­a?, Jhon CÃ³rdoba.</p>','52d54f2113c33.jpg','Osasuna','-0.25',2.11,'7',73.90,7.77,739,2,'1:0',1724.24,1,NULL,NULL),(917,1,0,0.00,1389711412,1390388903,1388865600,21,'Sociedad ','es','Athletic','es',NULL,'Spanish BBVA liga','The greatest Basque derby of all is taking place today in the Anoeta arena of the San Sebastian with Real Sociedad hosting Athletic de Bilbao!','<p>The greatest Basque derby of all is taking place today in the Anoeta\r\narena of the San Sebastian with Real Sociedad hosting Athletic de Bilbao! There\r\nis no need to day that the outcome of it has nothing to do with the recent form\r\nof the teams. When its come to derby the 22 players are giving all they have on\r\nthe field! By the way, both are in very well form. Sociedad recovered\r\nconfidence playing with their facorite style the counter attacking one on the\r\nroad while at home the teams who can resist them are not many. Ah, I would like\r\nto mention here that Sociedad isn\'t any super team, with any super duper squad\r\njust like the \'oddsmaker\' wrote in his preview, and whoever saw their game\r\nagainst Atletico Madrid could figure this out very well. Atletico was at least\r\ntwo clashes better. Anyway, Sociedad are young and furious just like Athletic\r\nhave been two years ago.</p><p>\r\nTalking about Athletic, they are improved indeed\r\nand the most important is that they became better on the road where they have\r\nbeen pathetic until now. In their first 6 away games they had an average of\r\njust 1,5 shots on target but they had 6 shots in Malaga, 7 in Celta in the cup\r\nand 4 in Sevilla, allowing in the same games only 1,5 and 2 shots respectively!\r\nImpressive performance that is! But talking about Sociedad furious attacks at\r\nhome you can\'t keep a clean sheat so what I expect today is many goals to be\r\nscored. This is why I am taking the o2,75 here and not backing any of these\r\ntwo. There will be changes in Athletic yes, Muniain behind Toquero who is a\r\nterrible forward BUT a fast one, maybe he suits better today. Plus Ibai in the\r\nleft wing as pacy player as well. Velverde is going to strike on counters\r\ntoday, he is fielding a motor-pacy team!</p>','52d54ff5d420d.jpg','Over','2.75',2.00,'5',63.49,-5.00,635,3,'2:0',1634.86,1,NULL,NULL),(918,1,0,0.00,1389711549,1390388903,1388866500,20,'Panetolikos','gr','Panathinaikos','gr',1,'GREECE SUPER LEAGUE 2013-2014','I do not understand how Panetolikos who is unbeaten at home 5-3-0 13-1  imagine only 1 goal conceded and has defeated Paok 2-0 and inflicted to Olympiakos their only loss of points 0-0 can be receiving +1/2 from Panathinaikos that has improved recently but the price reflects the name and not the current team','<p>I do\r\nnot understand how Panetolikos who is unbeaten at home 5-3-0 13-1  imagine\r\nonly 1 goal conceded and has defeated Paok 2-0 and inflicted to Olympiakos\r\ntheir only loss of points 0-0 can be receiving +1/2 from Panathinaikos that has\r\nimproved recently but the price reflects the name and not the current team</p>','52d55070766b8.jpg','Panetolikos','0.50',1.85,'7',0.00,0.00,0,0,'1:0',1724.24,1,NULL,NULL),(919,1,0,0.00,1389711582,1390388903,1388952000,21,'Real Madrid','es','Celta','es',1,'Spanish BBVA liga','Cristiano Ronaldo returns in the Bernabeu after almost two months!','<p>Cristiano Ronaldo returns in the Bernabeu after almost two months! His\r\nlast game in frond of Madrid\'s supporters was against Real Sociedad when CR7\r\nhad scored a hat trick leading his team into a trioumph! Barcelona and Atletico\r\nhave gone 8 points clear in the the first place so  Real Madrid have no\r\nluxury of slipping any points. Bale and Casillas are back in the squad\r\nCoentrao, Varane, Khedira remains in the sidelines.</p><p>\r\nOn the other hand Celta is visiting the Bernabeu\r\nwith an important missing, midfielder\'s Fontas who can play in defence too.\r\nFontas is one of their best players coming from Barcelona just like legentary\r\ndefender Luis Enrique their manager. Moreover Celta is pretty much copying\r\nBarcelona\'s offensive style, and Enrique would loved to make a present to his\r\nformer team... Of course, Real would also love to punish the Catalans who step their\r\nfoot in the Bernabeu and this is the most likely to happen.</p>','52d550b0b33f6.jpg','Real Madrid','-2.50',1.82,'6',64.48,4.92,645,2,'3:0',1633.86,1,NULL,NULL),(920,1,0,0.00,1389711754,1390388903,1389384000,21,'Athletic','es','Almeria','es',1,'Spanish BBVA liga','Athletic hosts Almeria aiming to defend the 4th place they occupy at the time being','<p>Athletic hosts Almeria aiming to defend the 4th place they occupy at the\r\ntime being. Almeria are in need of points laying only 3 points clear of the\r\ndrop zone. Both had midweek cup games Athletic lost in Betis Almeria drew in\r\nSantander where they stayed and today they traveled in nearby Bilbao to play\r\nAthletic.</p><p>\r\nThe weird about Athletic is that they lost their\r\nlast two games but they deserved much more out of these games. In Sociedad,\r\nAthletic were the better side in the field but wasted everything they created\r\nwhile despite the 7 changes in the XI, Athletic deserved even more in Betis in\r\nthe midweek but lost due to a single goal from Ruben Castro. Kike Sola\r\nreappeared after fully recovering his 4,5 month injury, he is an excellent,\r\npacy striker will be helpful.<br>\r\n<br>\r\nAlmeria won in style against Granada last week\r\nbut failed in Santander from where they traveled in Bilbao. They didn\'t return\r\nback home these days which means a further mental and physical overload. They\r\nare still missing regular right full back Nelson and key striker Rodri.\r\nAthletic have won all the last 5 meating against Almeria. This should be\r\nanother win for the Basques who enjoy the best form in the season and have an\r\nalmost full squad to choose.</p>','52d55148768dd.jpg','Athletic','-1.25',1.91,'7',64.62,6.37,646,2,'6:1',1632.86,1,NULL,NULL),(921,1,0,0.00,1389711840,1390388903,1388779200,20,'Almeria','es','Granada','es',2,'BBVA Liga','Almeria weren\'t good in Betis. But like everyone else, they could smell blood.','<p>Almeria weren\'t good in\r\nBetis. But like everyone else, they could smell blood. A fortuitous deflected</p><p>goal gave them something to\r\ncling on to. They didn\'t do a whole lot more, merely surviving against</p><p>a panicked home side.</p><p>They are without <strong>rback\r\nNelson R/I</strong>, no phenomenon but replacement Rafinha can\'t defend. On the</p><p>other side, new signing\r\nMane, an ex from the glory days under Emery, is likely to come in for\r\nDurbarbier.</p><p>They remain without\r\ntopscorer <strong>fwd Rodri I/K</strong> so\r\nOscar Diaz continues.</p><p>23 goal attempts from\r\nGranada but in truth they produced very little attacking quality in the 1-3</p><p>home defeat to Sociedad.\r\nPiti\'s long range strike proved the highlight for a side that was repeatedly</p><p>exposed by Sociedad\'s\r\ncounter-attacks. Granada like to play rapid end-to-end football with no real</p><p>control. A poor man\'s version\r\nof Mourinho\'s Madrid. Maybe they weren\'t all bad but with that style,</p><p>a side like Sociedad, who\r\nare quicker and technically superior, can kill them. Roberto saved them</p><p>from a worse fate.</p><p>Granada are without\r\ninjured <strong>gk Roberto R/I </strong>so it means a league debut for former\r\nPanathinaikos <strong>gk</strong></p><p><strong>Karnezis.</strong></p><p>Also injured is <strong>cdef\r\nMurillo R/</strong>I, so it means that Diakhate will play. It is between Foulquier\r\nand Nyom</p><p>for the right back position\r\nwith the former favourite.</p><p>Almeria sneaked their ugly\r\nwin last week but that was up against about the only side in worse shape</p><p>than them. They have been\r\npretty poor overall and without topscorer Rodri they may struggle.</p><p>Their home record of 1-3-4\r\nspeaks for itself</p><p>Granada are ordinary but\r\ntheir rapid transition direct style suits away games. They are 4-2-0 away to</p><p>sides in their Liga 4-2-2\r\noverall their only 2 defeats coming against Villareal and Barcelona. They have\r\nPiti.Plus is the only option here.</p><p>AlmerÃ­a: Esteban; Rafita,\r\nTrujillo, Torsiglieri, ManÃ©; RamÃ³n Azeez, Verza; Aleix Vidal, Soriano, Suso;</p><p>Ãscar DÃ­az.</p><p>Granada: Karnezis; Foulquier, Mainz, DiakhatÃ©,\r\nAngulo; Iturra; Piti, Yebda, Fran Rico, Brahimi; El Arabi</p>','52d551a03b626.jpg','Granada','0.25',1.83,'7',72.42,-7.00,724,3,'3:0',1724.24,1,NULL,NULL),(922,1,0,0.00,1389711926,1390388903,1389384000,21,'Atletico','es','Barcelona','es',1,'Spanish BBVA liga','Big game in the top of the Spanish elite with Simeone\'s Atletico outfit hosting Martino\'s new Barcelona side.','<p>Big game in the top of the Spanish elite with Simeone\'s Atletico outfit\r\nhosting Martino\'s new Barcelona side. Both teams are going into this clash in\r\nfull power as long as Messi and Valdez have been fully recovered while Gabi and\r\nRaul Garcia fullfilled their suspensions. Only Mario remains out for Atleti so\r\nno prob at all. So, this is a clash of titans everyone have an opinion about\r\nthese two giants, with Atletico extra motivated to keep their hopes as a title\r\nchallenger alive, but I will base my bet only on the numbers.</p><p>\r\nAtletico is a team based in tough defense and\r\nthis starts from the center of the field. It was not a random fact that Falcao\r\nhad 4 yellows in 5 games under Simeone and only 1 in 15 games under his\r\nprocessor... Atletico defend their territory massively as a team and especially\r\nin their home league games they allow only 1,4  shots on target average to\r\ntheir rivals!! Don\'t harry to say that they are playing Barcelona now, the\r\nCatalans were only allowed to shot 4 times on target in the last visit in\r\nVicente Calderon in the super cup in August in a game where Atletico fully\r\ndominated (1-1). No matter that Barcelona have a full squad, they will\r\ndefinitely going to struggle today in Madrid and this makes the quarter ball on\r\nthem a nice shot.</p>','52d55204e6f40.jpg','Atletico','0.25',1.98,'7',64.33,3.43,643,4,'0:0',1632.86,1,NULL,NULL),(923,1,0,0.00,1389712073,1390388904,1389470400,21,'Getafe','es','Rayo','es',2,'Spanish BBVA liga','âMini Madrid derby between two teams with completely different targets in the league.','<p>Mini Madrid derby between two teams with completely different targets in\r\nthe league. Getafe are laying in the middle of the table despite their recent\r\nbad run while Rayo are 2nd from bottom and only Betis is below them. Moreover\r\nRayo have to show the worst defense not just in Spain but in all European\r\ncompetitions...!</p><p>\r\nPaco Jemez was a \'hammer\' agaist some of his\r\nplayers and as a matter of fact they are to lay all the blame for the pathetic\r\nin most of the games. The 2nd part of the midweek cup game against Levante was\r\nanother example, Paco dropped some players for their attitude in the field.\r\nAnyway, the players admitt that and as a matter of fact Rayo have the potential\r\nto escape the complicated situation they have been into. The team isn\'t playing\r\nbad though, against Villarreal they created noumerous opportunities but their\r\nrivals were the ones to send the ball in! ZÃ© Castro CB*, Arbilla DF*, Larrivey\r\nFW* remains out, without them Rayo played recently, mid Perea is a new missing.\r\nPaco Jemez included two young players from the B team again in the squad.<br>\r\n<br>\r\nGetafe are laying in the middle of the table and\r\nhave an eye looking in Europe. But they are playing pretty lousy recently\r\nhaving key players in terrible form. Only Mosquera MD** is missing from the\r\nsquad which hasn\'t been announced until Sunday morning. So we have Rayo who\'s\r\ntrying and today will play with the knife between the teeth, Getafe\'s manager\r\nsaid that, and Getafe who feels pretty secure in the table and playing really\r\nreally bad. Moreover, Rayo enjoying some excellent history stats against Getafe\r\nwinning all 4 games against them in the last 2 years when they promoted in\r\nprimera division! This looks like a nice call on the visitors.</p>','52d552acaf2df.jpg','Rayo','0.25',2.21,'7',64.83,8.47,648,2,'0:1',1632.86,1,NULL,NULL),(924,1,0,0.00,1389712105,1390388904,1388261160,20,'Chelsea','gb','Liverpool','gb',1,'ENGLAND PREMIER LEAGUE 2013-2014','Chelsea has been under performing but against the top  teams the experience of Mourinho in setting teams up counts a lot and they have performed very well.In this case he faces inexperienced Rogers who has players missing and a small squad so he cant refresh look at the facts lower down showing the  ammunition of each manager at their disposal today .','<p><strong>Chelsea has been under performing but against the top\r\n teams the experience of Mourinho in setting teams up counts a lot and\r\nthey have performed very well.In this case he faces inexperienced Rogers who\r\nhas players missing and a small squad so he cant refresh look at the facts\r\nlower down showing the  ammunition of each manager at their disposal today\r\n.Add to that a tough match against Man City 72 hours ago and you will\r\nunderstand why I am taking Chelsea despite I do not like them as a team</strong></p><p><strong> Out :\r\nRamires (17/1)</strong></p><p><strong>(</strong><strong>4-2-3-1 : Cech,- Ivanovic, Cahill, Terry, Azpilicueta-Lampard, Mikel,- Willian, Oscar,\r\nHazard,-Torres,</strong></p><p><strong> Available for bench : Schwarzer ,Cole, Luiz, ,\r\nBertrand, Essien, Mata, Schurrle, De Bruyne, Ba, Eto\'o </strong></p><p><strong>Out : Flanagan\r\n(7/1). Sturridge  (12/9) Enrique (8/0). Moses 12/1 Dbt /Out : Gerard (15/3,\r\n6 assists).</strong></p><p><strong>4-3-3 : Mignolet, -Johnson,\r\nSkrtel, Sakho, Cissokho, -Lucas, Henderson, Allen, Sterling, Coutinho, Suarez,</strong></p><p><strong>Subs  : </strong><strong>Jones, Agger, Kelly, Smith,Toure, Alberto, Aspas,</strong></p><p><strong><u>In red fresh\r\nplayers coming in</u></strong></p><p><strong>A.  Chelsea 5 new regulars\r\ncoming in plus internationals like Essien, Schurle ,De Bruyne who are also\r\nfresh having not started in the previous games plus the regulars  ones who\r\nplayed and can come in at any time.The difference with Chelsea rotating and\r\nother teams doing it is that Chelsea âs players coming in are not worst than\r\nthe ones who are left on the bench if not better and are regulars as well so\r\nthe team cohesion is not broken</strong></p><p><strong>B  Liverpool not even one and on the bench a\r\nGk, 4 defenders Agger ,Toure,Smith(19 year old),Kelly and the 2 worst signings\r\nLivepool ever made Aspas for 9 million and Alberto 8 million they must have\r\nseen them coming .So unless Gerard recovers they have no players to refresh\r\nmaybe he can bring Agger in for Sako or Sissoko.</strong></p>','52d5528b0fcc8.jpg','Chelsea','-0.25',1.88,'8',0.00,0.00,0,0,'2:1',1723.24,1,NULL,NULL),(925,1,0,0.00,1389712285,1390388904,1389470400,21,'Espanyol','es','Real Madrid','es',2,'Spanish BBVA liga','âThe yesterday draw in Vicente Calderon was the best result possible for Real Madrid who have an \'opportunitiy of oro\' to reduce the margin to the top of the table to just a victory.','<p>The yesterday draw in Vicente Calderon was the best result possible for\r\nReal Madrid who have an \'opportunitiy of oro\' to reduce the margin to the top\r\nof the table to just a victory. Barcelona and Atletico are co-leading the\r\nleague on 50 points with Real coming  on 44 with a game less the today in\r\nthe Cornella El Prat.</p><p>\r\n<br>\r\nAncelotti took everybody in the squad, only long\r\nterm and Jese are out. Di Maria isn\'t sure to start after his controversial\r\nwith the fans in the last home game where he is set to have gone into an\r\nimpolite gesture grabbing his balls...! Bale will start instead but who knows,\r\nAncelotti said yesterday that Di Maria is in great phisical shape.<br>\r\n<br>\r\nSo, Real have every reason to win this game and\r\nwill find Espanyol without their best forward Sergio Garcia who is suspended.\r\nMoreover David Lopez is out as well while manager Javier Aguirre will be on the\r\nstands after beign suspended with 4 games for cursing against the ref in\r\nBernabeu. The third striker Thievy is also injured, so only Corduba has left in\r\nattack and Stuani who is an around the box forward. Real should not let this\r\nopportunity slip away and the point is to beat the -1,5 gaol handicap. Having\r\nlearnt the Mestalla lesson where they were saved by the bell, aka Jese, they\r\nshould be better prepared now.</p>','52d5538d1ffc4.jpg','Real Madrid','-1.50',2.10,'7',63.29,-7.00,633,3,'0:1',1632.86,1,NULL,NULL),(926,1,0,0.00,1389712400,1390388904,1388175180,20,'Cardiff','gb','Sunderland','gb',2,'ENGLAND PREMIER LEAGUE 2013-2014','Cardiff in their last game showed the turmoil with the manager affected them badly they were down and out by the 25th minute losing 3-0.','<p>Cardiff in their last game\r\nshowed the turmoil with the manager affected them badly they were down and out\r\nby the 25<sup>th</sup> minute losing 3-0.The situation is not better\r\ndespite the manager has been sucked because i expect  a very bad reaction\r\nto this sucking by the fans who wanted him to stay and the owner to go.Not\r\nideal going into a relagation dogfight with a team coming from a confidence\r\nboosting win against highflying Everton a series of 3 games unbeaten away and a\r\nwin over Chelsea in the league cup</p>','52d553a3a9ca4.jpg','Sunderland','0.25',1.83,'8',73.46,3.32,735,4,'2:2',1723.24,1,NULL,NULL),(927,1,0,0.00,1389712482,1390388904,1389470400,21,'Newcastle','gb','Man City','gb',2,'England Premier League','Newcastle are on a three-match losing streak, including last weekend\'s FA Cup dissappointing defeat by Cardiff in a competition which was among their targets.','<p>Newcastle\r\nare on a three-match losing streak, including last weekend\'s FA Cup\r\ndissappointing defeat by Cardiff in a competition which was among their\r\ntargets. The Magpies are without a Premier League goal in 190 minutes since\r\nPapiss Cisse\'s 80th-minute penalty in the 5-1 Boxing Day win over Stoke.\r\nManchester City are unbeaten in their last nine Premier League matches, winning\r\neight of them.</p><p>\r\nNewcastle are still without important center\r\nback Fabricio Coloccini (16/0) while right back Mathieu Debuchy (19/1) is\r\nbanned. Tim Krul is expected to return in goal and influential midfielder Yohan\r\nCabaye (17/5) looks to have overcome a recent Achilles injury but he isn\'t 100%\r\nready yet. Manchester City have Yaya Toure, Jesus Navas and Micah Richards all\r\navailable after recent injuries.<br>\r\n<br>\r\nManchester City are unbeaten in their last 14\r\nPremier League matches against Newcastle, winning the last eight. Newcastle have not beaten City since September 2005.</p>','52d5545287806.jpg','Man City','0.00',1.62,'7',64.42,4.34,644,2,'0:2',1632.86,1,NULL,NULL),(928,1,0,0.00,1389712647,1390388904,1388175420,20,'Norwich','gb','Man Utd','gb',2,'England Premier League','Man Utd is coming into form and is regaining the stamp of a big team winning without being the best team on the pitch like against Hull i do not see mediocre Norwich giving them much trouble and they have a few players missing as well','<p>Man\r\nUtd is coming into form and is regaining the stamp of a big team winning\r\nwithout being the best team on the pitch like against Hull i do not see\r\nmediocre Norwich giving them much trouble and they have a few players missing\r\nas well</p>','52d554b754b4d.jpg','Man Utd','-0.75',1.90,'8',73.84,7.20,738,2,'0:1',1723.24,1,NULL,NULL),(929,1,0,0.00,1389712667,1390388904,1389556800,21,'Villarreal','es','Sociedad','es',2,'Spanish BBVA liga','Big game for the places 4-6 that lead into a European exit!','<p>Big game for the\r\nplaces 4-6 that lead into a European exit! Sociedad are hoping to win another\r\nCL ticket this season while new comers Villarreal will get a nice income and a\r\nmassive morale boost if they achieve a EL qualification! These two are going to\r\nplay each other two more times in the upcoming days and they have already\r\ncrossed their swords last Thursday in the goal-less cup draw in Anoeta.</p><p>Sociedad\r\ntraveled in Vila-Real where they will stay the whole week as long as the return\r\nleg will be played next Thursday and from there they will travel by train in\r\nMadrid to play Getafe next weekend. Arrasate took all his players in the squad,\r\nZurutuza is ok, De La Bella must be still injured. No important problems.\r\nArrasate is introducing about 5 changes in refference to the cup game of the\r\nlast Thursday and this means that and the good guys are stepping in, the keeper\r\nBravo, Carlos Martinez, RubÃ©n Pardo, Carlos Vela and Xabi Prieto! Villarreal\r\nwas also fielded with some changes in Anoeta, the regulars return, still\r\nimportant offensive midfielder Cani remains out and Hernan Perez another\r\nskilful midfielder was a new loss throught injury.</p><p>Now, what are\r\nthese odds on Sociedad who are close to equalize their winning record (6 wins\r\nin a row in 80\'s) with another win in Madrigal? Sociedad enjoys the best form\r\nin the season while Villarreal haven\'t won in the last 4 games in front of\r\ntheir fans! Its really unbelievable to have Sociedad +0,5 in such great odds\r\nhere...!</p>','52d55501c650f.jpg','Sociedad','0.50',2.00,'8',63.19,-8.00,632,3,'5:1',1631.86,1,NULL,NULL),(930,1,0,0.00,1389712945,1390388904,1388175600,20,'Hull','ad','Fulham','ad',2,'England Premier League','Fulham is coming into form since the new management took over and proved that by an away win against Norwich after givining Man City a hard time .','<p>Fulham is coming into form\r\nsince the new management took over and proved that by an away win against\r\nNorwich after givining Man City a hard time .Hull in the meantime had a hard\r\ngame against Man Utd which brought injuries to important players and within 48\r\nhours they are forced to play in a relegation dogfight their small squad and\r\ninjuries will make that tough and the handicap should have been less steep</p>','52d556179e05e.jpg','Fulham','0.50',1.79,'6',72.52,-6.00,725,3,'6:0',1725.24,1,NULL,NULL),(931,1,0,0.00,1389712976,1389776041,1389713400,21,'Almeria','es','Racing','es',2,'Copa del Rey','Almeria have the 1-1 of the first leg and today they are through the next phase with a win and even a goal-less draw.','<p>Almeria have the\r\n1-1 of the first leg and today they are through the next phase with a win and\r\neven a goal-less draw. Fransiscan has injury concerns over Nelson RB*, Rodri\r\nFW*** and newcomer Hans MartÃ­nez, he can\'t use newly appointed as proffesional\r\nin the men team, Jonathan FW (susp), while he dropped Rafita RB, Torsiglieri\r\nCB*, Dubarbier LFB**, Soriano MD***, Verza MD*** (rest)  to give them some rest. Fran VÃ©lez CB, Kiu WG\r\nand Hicham FW from the B team got the call today, so the lineup will be\r\ncomposed by many subs and youngsters.</p><p>Racing have a\r\nnew missing, center back Soria, while regulars Francis, Ander and Ayina remain\r\nout. David Concha and Fede San Emeterio from the youth team got the call and\r\nshould feature today while top scorer Kone may not start. Racing have a suberb\r\nsquad to play in segunda B\', actually the 3rd Spanish division and they are in\r\nexcellent form. They have been used to play with rotations from game to game,\r\nthese few changes they have today is not something strange to them. They have\r\nbeaten Sevilla 0-2 away in the previous round to turn over the 0-1 defeat of\r\nthe first leg. They are meating Almeria who will be fielded with many reserve\r\nplayers and losing by 2 goals is unlikely to happen.</p>','52d5564318b77.jpg','Racing','1.00',1.94,'6',63.99,0.00,640,2,'0:2',1628.22,1,NULL,NULL),(932,1,0,0.00,1389713694,1390388904,1389471420,20,'Cagliari','it','Juventus','it',2,'ITALY SERIE A 2013-2014','Good Luck!','<p>Good Luck!</p>','52d5590f2a016.jpg','Juventus','-1.00',1.86,'8',73.81,6.88,738,2,'1:4',1723.24,1,NULL,NULL),(933,1,0,0.00,1389714036,1390388904,1389385740,20,'Livorno','it','Parma','it',2,'Seria A','Parma last week show what a good team they are when they play to their abilities by coming from behind to beat in form Torino i expect them to beat Livorno with only 1 point out of last 7 games','<p>Parma\r\nlast week show what a good team they are when they play to their abilities by\r\ncoming from behind to beat in form Torino i expect them to beat Livorno with\r\nonly 1 point out of last 7 games</p>','52d55a6c976a7.jpg','Parma','0.00',1.74,'8',73.72,5.92,737,2,'0:3',1723.24,1,NULL,NULL),(934,1,0,0.00,1389714364,1389776265,1389643620,20,'Lazio','it','Parma','it',2,'ITALY COPPA ITALIA 2013-2014','âParma are in great form they are unbeaten for 8 games and by beating Livorno 3-0 away for the first time this year they had 2 consecutive wins .','<p>Parma are in great form they are unbeaten for 8 games and by beating Livorno 3-0 away for the first time this year they had 2 consecutive wins .The expected line up 7-8 of their regular starters.</p><p>Lazio after beating Inter 1-0 played Bologna drawing 0-0 in a very bad game.They go into this game 3 enforced important absentees Hernanes,Marketti and Chana and only 2-3 regulars are started.</p><p>An in form Parma with mainly most of their top players against a mediocre Lazio and receiving + i think is good value&nbsp;</p>','52d55b7678efc.jpg','Parma','0.25',1.92,'8',73.12,0.00,731,3,'2:1',1731.24,1,NULL,NULL),(936,1,0,0.00,1389877159,1390223593,1389805200,21,'Athletic','es','Betis','es',1,'Copa del Rey','I was mistaken yesterday, maybe it was too late and was already sleeping.','<p>I was mistaken yesterday, maybe it was too late and was already sleeping.<br>Valverde cannot count on Munian and Susaeta but will field De Marcos and Ibai to replace them.</p><p>So the last two will start in the XI and not in the bench as I wrote yesterday.<br>This makes a stronger version for Athletic than what I had in mind and I doubt about Betis\' motivation today. Moreover some sources for Betis have a mixed line up others a stronger one, nobody knows, but I doubt that Garrido will field his best players. I have to mention again that there are already some possible substitues for Garrido came to surface these days! He is on the edge today and as it seems his methods aren\'t so pupolar among the players as well {obligates them to stay in the center of the field after the end of some games to \'hear\' the wrath of the supporters}. He also made some complain about the no transfer activity so far.<br>Odds went up for Athletic this is good cause now the -1 is a bit better than yesterday at 1.68, still low enough so i will try the -1.25. Athletic deserves this anyway.</p>','52d7d7980718a.jpg','Athletic','-1.25',1.97,'7',64.67,6.79,647,2,'2:0',1632.86,1,NULL,NULL),(943,1,1,0.00,1390215400,1390388904,1389799800,21,'Athletic','es','Betis','es',1,'Copa del Rey','I was mistaken yesterday, maybe it was too late and was already sleeping.','<p>Valverde cannot count on Munian and Susaeta but will field De Marcos and Ibai to replace them.</p><p>So the last two will start in the XI and not in the bench as I wrote yesterday.<br><br>This makes a stronger version for Athletic than what I had in mind and I doubt about Betis\' motivation today. Moreover some sources for Betis have a mixed line up others a stronger one, nobody knows, but I doubt that Garrido will field his best players. I have to mention again that there are already some possible substitues for Garrido came to surface these days! He is on the edge today and as it seems his methods aren\'t so pupolar among the players as well {obligates them to stay in the center of the field after the end of some games to \'hear\' the wrath of the supporters}. He also made some complain about the no transfer activity so far.<br><br>Odds went up for Athletic this is good cause now the -1 is a bit better than yesterday at 1.68, still low enough so i will try the -1.25. Athletic deserves this anyway.<br><br>Pick: Athletic -1.25, Odds: 1.97 @ Pinnacle, Stakes: 7/10</p>','52dd00c9b9b59.jpg','Athletic','-1.25',1.97,'7',64.67,6.79,647,2,'2:0',1632.86,1,NULL,NULL),(944,1,1,0.00,1390215946,1390388904,1389970800,21,'Malaga','es','Valencia','es',NULL,'Spanish BBVA liga','Malaga deserved much more out from their last trip in Levante.','<p>Malaga deserved much more out from their last trip in Levante. The Costa del Sol outfit dominated the game producing a 65% ball possesion and firing 22 shots, 5 of them on target, but all failed to pass thourgh Keylor Navas and Levante defense. Valencia on the other hand started brilliandly in Vigo but the second part was a disaster which led to being defeated 2-1 by Celta. Schuster has only one missing to cope with, Weligton is out but Angeleri is coming to fill the gap in the center of the defense.</p><p>Pizzi, on the other hand, has a full squad as well as Malaga, only Ruiz is out. Canales was dropped again after watching the midweek cup game in Atletico from the stands and this feeding up the rumors about a possible departure in the transfer window. Well, Valencia have been very much improved under Antonio Pizzi there is no doubt about that and moreover they have taken a lesson last weekend in Vigo.<br>Losing in Malaga will make a step backwards but the hosts will also be really motivated to win this and we have seen them how dangerous they can be when attacking massivelly. Valencia have some pacy counter attacking players like Piatti and Feghuli and the game may suits them fine but I think I will better try the over 2,25 (whao!) than Valencia\'s Draw No Bet, going for a half win with a pretty probable 1-1 draw.<br></p>','52dd0295737af.jpg','Over','2.25',1.85,'6',63.39,-6.00,634,3,'0:0',1633.86,1,NULL,NULL),(945,1,1,0.00,1390216476,1390388904,1390060800,21,'Elche','es','Rayo','es',2,'Spanish BBVA liga','Elche are in really bad form and this game against Rayo has been rated as top priority for los ilicitanos.','<p>Elche are in really bad form and this game against Rayo has been rated as top priority for los ilicitanos. Fran EscribÃ¡ has in his disposal BotÃ­a and Manu del Moral, who didn\'t feature against Sevilla because of a contract clause but he could retain PelegrÃ­n in the center of defense. Only keeper Manu Herrera remains out.</p><p>On the other hand Rayo traveled with the known missings of ZÃ© Castro CB*, Arbilla DF*, JosÃ© Carlos MD, Perea MD, Seba, most of them long term, but in refference to the Getafe win they have excellent head-killer striker Larrivey back. In the opening day of the campaign Rayo beat Elche by 3-0 and despite the bad h2h stats they have against Elche they didn\'t lose in their last two visits in the MartÃ­nez Valero.<br>Two brothers are crossing swords here, Aaron in Elche and Saul in Rayo the revelation of the season and their best player! Last week Elche suffered at home against Sevilla and snitch a point due to Sevilla\'s striker Baba terrible finishings. Rayo were all over Getafe and deservedly won by 0-1 it could have been a wider margin. This was a reward for their recent performances and this might be the story today. Rayo fielded with numerous  changes in the cup defeat-elimination to Levante in the midweek, so the regulars are fresh.<br></p>','52dd045405438.jpg','Rayo','0.25',1.93,'6',63.39,-6.00,634,3,'2:0',1633.86,1,NULL,NULL),(946,1,1,0.00,1390216931,1390388904,1390060800,21,'Granada ','es','Osasuna','es',NULL,'Spanish BBVA liga','Well, sometimes you get caught by the market and take a bet odds are leading you to.','<p>Well, sometimes you get caught by the market and take a bet odds are leading you to. Most of these times you fail and the point here is to find out what really happened and you lost your bet. In this game in the Los Carmenes between Granadad and Osasuna if you are set to bet on total goals, you must be crazy to take the overish options. This is what the stats and offered odds \'tell you\'.</p><p>But, taking under consideration the fact that Granada fired 71 shots against their rivals in the last 4 home games with 38 of these shots on target (!) you realize that taking the over2,25 you have much better possibilities to win than offered odds show. Moreover, Granada have five \'over2,5\' in their last five home games and Osasuna, who are in excellent form and will constribute in a high scoring game today, have resulted four times with more than 2,5 goals in their last six away games.<br>Not important missings fom both. DiakhatÃ© CB,  Ighalo FW* and Yebda MD remain on the sidelines for Granada, keeper Andres is the most important missing for Osasuna who have some long term absences which don\'t effect the team any more. Riesgo will defend his goal, he is an excellent keeper, hope he won\'t play that impressive Caballero and Diego Alves performed yesterday in Malaga keeping the game goal-less... Nine impressive savings from these two guys yesterday nailing our over2,25 bet in the ground...<br><br>Punal MD* and Armenteros MD** are back in Osasuna who faced Madrid in the midweek be fielded with many reserve players.<br></p>','52dd06c85e9ef.jpg','Over','2.25',2.09,'6',63.39,-6.00,634,3,'0:0',1633.86,1,NULL,NULL),(947,1,1,0.00,1390217338,1390388904,1390143600,21,'Villarreal','es','Almeria','es',1,'Spanish BBVA liga','Villarreal and Almeria are eager to forget the midweek cup fiaskos at the hands of Sociedad and Racing respectively and return in winning days in the league.','<p>Villarreal and Almeria are eager to forget the midweek cup fiaskos at the hands of Sociedad and Racing respectively and return in winning days in the league. Villarreal performed one of their best home games in the season last Monday and the trashing of Sociedad came without any rush while Almeria suffered a humiliating defeat in Bilbao by 6-1. Last season in segunda division, these two played in the last day with the 2nd spot on stake and Villarreal let no room for inconviniance to Almeria winning the game. Almeria went to play off to win the promotion. There is a huge gap in quality between these two. Villarreal recovers Giovani FW*** who lost the cup game due a gastrenteritis, Almeria remains without key striker Rodri FW***. Both played with changes in the midweek, all the regulars return. And here comes the numbers to confirm this bet, Almeria away from home allows 56,4% of the ball possesion and 17,5 shots average to their rivals, so Villarreal will have better options than their usual 52% of ball possesion and the 14 shots average.</p>','52dd084305601.jpg','Villarreal','-1.50',1.98,'6',64.57,5.88,646,2,'2:0',1633.86,1,NULL,NULL),(948,1,1,0.00,1390218232,1390388904,1389711600,20,'âAlmeria','es','Racing','es',2,'Copa del Rey','B players Kiu, Hicham and Velez should feature for Almeria in what is expected to be a mostly B/squad XI. Suso probably starts, having lost his place lately.','<p>B players Kiu, Hicham and Velez should feature for Almeria in what is expected to be a mostly B/squad XI. Suso probably starts, having lost his place lately.</p><p>Racing likewise field a mixed XI. They can start topscorer Kone this time. A useful outlet for their counter-attacking set-up. They drove down on the bus yesterday, it seems. 900km. </p><p>Almeria don\'t particularly want to be here. Of course, try they must. Fulfil obligations and all that. But the home look unbettable at -1 against a solid and occasionally dangerous Racing that eliminated a much stronger Sevilla.  </p><p>So Almeria reserves v Racing mixed. The +1 or even \"2\" ARE THE ONLY CHOICES</p><p>AlmerÃ­a: Ustari; Mane, M Silva, Fran VÃ©lez, R Garcia; TÃ©bar, Corona; Suso, Kiu, Barbosa; Hicham.</p><p>Racing: Mario; Orfila, Oriol, Juanpe/Barrio, SaÃºl; Granero, Andreu; Saul, DurÃ¡n, Mariano; Kone</p>','52dd0be19d00d.jpg','Racing','1.00',1.91,'5',73.58,4.55,736,2,'0:2',1726.24,1,NULL,NULL),(949,1,1,0.00,1390218523,1390388904,1389801600,20,'âMan City','gb','Blackburn','gb',1,'England Premier League','Man City Strong line up Rhodes top scorer and best player of Blackburn not even on bench 25/15/2225','<p>Man City Strong line up Rhodes top scorer and best player of Blackburn not even on bench 25/15/2225</p><p>Man City: Pantilimon, Richards, Nastasic, Lescott, Clichy, Jesus Navas, Fernandinho, Javi Garcia, Milner, Negredo, Dzeko</p><p>Subs: Hart, Zabaleta, Kolarov, Aguero, Demichelis, Huws, Lopes</p><p>Blackburn: Robinson, Henley, Kilgallon, Grant Hanley, Spurr, Cairney, Taylor, Lowe, Williamson, Marshall, Campbell</p><p>Subs: Gestede, King, Dunn, Eastwood, Olsson, Rochina, Mahoney</p><p>Referee: Craig Pawson (South Yorkshire)</p>','52dd0d04a14f0.jpg','âMan City','-2.00',1.81,'8',73.77,6.48,738,2,'5:0',1723.24,1,NULL,NULL),(950,1,1,0.00,1390218957,1390388904,1390068000,20,'Betis','es','Real Madrid','es',2,'Spanish BBVA liga','Another shocker from Betis at home to Osasuna, all nerves and indiscipline. ','<p>Another shocker from <strong>Betis</strong> at home to Osasuna, all nerves and indiscipline. Osasuna scored within 2 minutes as Juanfran failed to mark his man. The rest was running uphill while having a nervous breakdown, with Reyes and Nono struggling in cmf,  the latter getting sent off before HT.</p><p>The most effective player was debutant Baptistao with 8 shots though little real danger. Ruben Castro remains a depressed figure and missed a penalty. He looks like he has had a few too many beers. Garrido\'s tactic of bringing on former Bruges legend Jordi and playing 3 at the back didn\'t work with Jordi making several mistakes including an own-goal.</p><p>The coach again made his players stay on the pitch to experience the anger of the fans. Surely a counter-productive measure.</p><p>Meanwhile it was reported that Garrido\'s player agency business received a hefty commission for the expensive Baptistao loan deal.</p><p>He has stated  \'I am making no difference to this side\'. Wrong again. Making it a lot worse.</p><p>Meanwhile he claims that the club is in total chaos, having worked with 3 different bosses (Stosic, Bosch â himself under investigation for graft -  the President)so far. Seems he is upset there have been no further transfers. Maybe people on the board have been blocking his players and his commissions? Maybe?</p><p>Away to  Athletic in Copa, they rested several players including Ruben Castro as sub and Vadillo. They created little even with new 2m loan signing Baptistao.</p><p>They are without the suspended <strong>cmf Nono Reg/Impt</strong>, so Matilla is probably partnered by Salva Sevilla in mf. Not exactly the most athletic or physically imposing pair. </p><p>Modric ran the show for <strong>Madrid</strong> in Espanyol.15 minutes of  resistance was offered by the home side, for the rest it was a monologue from Madrid. Several missed chances, with Cristiano the main culprit again. Bale was poor as was Di Maria, while Benzema who looked sluggish and short on ideas (surprise surprise).  Madrid for all their domination had to rely on a solitary set piece goal.</p><p>Madrid had a comfortable win away to Osasuna in Copa, using an experimental formation with Isco leading the line, Jese playing on the wing with Illarramendi handed the midfield</p><p>Modric is set to return here with Bale on the right and Benzema leading the line. It is likely to be Isco (or less likely, DiM) for the problem Ozil place in attack behind Benzema.</p><p>Betis are now seven points from safety and there is little room for optimism. Every week that goes by without signings see them drop further into the red zone. There is even talk of a return for Lopera.</p><p>Madrid don\'t impress but get results by the sheer weight of all that money and all those signings. Somebody usually sorts out the game for them, somehow.</p><p>Madrid away has been a litany of near-disasters at small, struggling clubs. Betis are bigger than any of them, but unlike most of the minnows, are designed to attack and have no midfield at all.</p><p>That suits Madrid and I expect them to beat the handicap  </p><p> Betis are just so bad and it is hard to have any faith in them under Garrido s.</p><p>Real Betis: Andersen; Juanfran, Paulao, Amaya, Nacho; Matilla, Salva Sevilla; Vadillo, Baptistao, J Carlos; R Castro.</p><p>Real Madrid: Diego LÃ³pez; Carvajal, Pepe, Sergio Ramos, Marcelo; Xabi Alonso, Modric; Bale, Isco, Cristiano Ronaldo; Benzine.</p>','52dd0ec13b16f.jpg','Real Madrid','-1.50',1.80,'8',73.76,6.40,738,2,'0:5',1723.24,1,NULL,NULL),(951,1,1,0.00,1390219662,1390388904,1390143600,20,'âGetafe','es','Real Sociedad','es',2,'Spanish BBVA liga','Another desperately anaemic showing from Getafe as they went down tamely at home to Rayo on a cold foggy morning.','<p>Another desperately anaemic showing from <strong>Getafe</strong> as they went down tamely at home to Rayo on a cold foggy morning.  They managed a late, late siege of sorts, but in the preceding 90 minutes their attacking play was practically null, while they were at the mercy of Rayo\'s counters with Lass destroying Escudero.</p><p>Getafe tamely lost their Copa 2<sup>nd</sup> leg against Barcelona. They made a number of changes to their regular team and the game was pretty much a training exercise, so tiredness shouldnât be a problem.</p><p>Cmf Mosquera was a doubt but finally he is able to play and starts alongside Lacen or Michel.</p><p>They are <strong>missing</strong> <strong>cdef Alexis Reg</strong> with a painful injury, so the capable <strong>Rafa</strong> steps in. </p><p>Useless rback <strong>Valera Reg</strong> is out too, no problem.</p><p>Half fwd/playmaker <strong>Lafita SemiReg</strong> is out, so <strong>Sarabia</strong> starts.</p><p>Benchwarmers lmf <strong>Gavilan cmf Juan Rodriguez</strong> are doubts.</p><p><strong>Sociedad</strong> had a real shocker in Villarreal, were absolutely blitzed by the electric home side. Sociedad couldn\'t put 3 passes together in midfield and were continually outnumbered and overrun down the flanks, with Jose Angel thoroughly exposed. Ok, their tactics in general may be a bit simplistic, usually involving hitting the ball up quickly for Vela and Griezmann. But Sociedad played at nothing here and took a fully deserved hammering. </p><p>Sociedad were far more diligent and disciplined in the Copa 2<sup>nd</sup> leg at Villarreal. They survived a badly awarded + badly missed pen, and a luckily disallowed goal, but overall this close match, even with mixed Xis,  was far more reflective of the 2 sides\' relative merits than the Monday night debacle.</p><p>The team should be fairly fresh for the game and <strong>Mikel c</strong>omes into the defence for the <strong>suspended</strong> Inigo<strong>Martinez Reg/Impt</strong>.</p><p>In midfield it is likely to be between Zurutuza or Pardo for the slot alongside Elustondo, with <strong>cmf Markel Bergara Reg injured.</strong></p><p>Up front, Vela and Griezmann will be fresh.</p><p>Getafe had a good, if somewhat unreal and unbelievable, start to the season. Since then they seem to have found their true level.</p><p>Sociedad recovered well in Copa after last week\'s disaster. On all recent evidence, Sociedad with their deadly strike force WE well take this.</p><p>Getafe: MoyÃ¡; Arroyo, Rafa, Lisandro, Escudero; Lacen, Mosquera; Pedro LeÃ³n, Sarabia, Diego Castro; Ciprian.</p><p>Real Sociedad: Bravo; Carlos MartÃ­nez, Mikel, Ansotegi, JosÃ© Ãngel; Elustondo, Pardo/Zurutuza; Prieto, Griezmann, Vela; Agirretxe.</p>','52dd117d10c6d.jpg','Real Sociedad','0.00',1.74,'8',0.00,0.00,0,1,'2:2',1723.24,1,NULL,NULL),(952,1,1,0.00,1390219823,1390388904,1390143600,20,'âVillarreal','es','Almeria','es',1,'Spanish BBVA liga','High-voltage stuff from Villarreal as they blitzed a weak and complacent Sociedad.','<p>High-voltage stuff  from <strong>Villarreal</strong> as they blitzed a weak and complacent Sociedad. Marcelino, having had time to study his opponents in the Copa, clearly won the tactical battle against a stunned Arrasate.  On the wings Aquino and Moi Gomez were constant threats with the fullbacks doubling up against their exposed, solitary, Sociedad counterparts. Moi in particular seems to have catalysed the side, which until last week had looked a bit uninspired in Cani\'s absence.</p><p>Villarreal\'s mixed XI faltered at home in Copa and were eliminated. Painful in the short term, but a useful exit if they have any ambitions in Liga. Mixed Xis on both sides, but It was a return to normal levels after the incredible Monday night showing.</p><p><strong>Giovani</strong> was a late dropout midweek with stomach problems, and is back fit here. <strong>Cani Impt remains out.</strong></p><p>Trigueros likely plays alongside Bruno in midfield with Pina on the bench.</p><p><strong>Almeria</strong> seemed to approach the San Mames visit with a deal of naivete\', thinking they can go, play their normal football and win. They were severely punished for their temerity. The game lasted barely 6 minutes. They couldnât cope with Athletic with rback Rafita struggling once again defensively while Trujillo in the centre also had a poor game. Azeez was chasing shadows for much of the time as Almeria\'s reliance on wingers saw them outnumbered in midfield. </p><p>Almeria with much-changed XI showed a poor attitude midweek in Copa and were comfortably beaten 0-2 by 2B side Racing.</p><p>After last week\'s tonking they will likely switch to a back 5 with cdef Marcelo Silva coming in.</p><p>It would mean that Barbosa would lead the line in attack and behind him it is likely to be Aleix Vidal and either Soriano or Tebar that plays.</p><p>Rback Nelson Impt and fwd Rodri Impt/Key<strong> remain out.</strong></p><p>Villa with a devastating strike-rate in their last 2 Liga games that has yielded 10 goals from 28 shots.</p><p>Before that they had seemed to be slowing down somewhat.</p><p>Almeria, meanwhile took 6, in Bilbao before taking a dive in Copa.</p><p>Almeria will likely take a far more cautious approach here. Villa do not like closed, defensive sides. But Ameria  is so weak defensively and toothless in attack that once the first one comes the handicap will be achieved easily</p><p>Villarreal: Asenjo; Mario, Musacchio, Chechu Dorado, Jaume Costa; Aquino, Bruno, Trigueros Moi GÃ³mez; Gio, Uche.</p><p>AlmerÃ­a: Esteban; Rafita, Trujillo, Marcelo Silva, Torsiglieri, Dubarbier; Verza, RamÃ³n Azeez; Aleix Vidal, Soriano;  Barbosa.</p>','52dd121ad7dbd.jpg','âVillarreal','-1.50',1.90,'7',73.75,6.30,738,2,'2:0',1724.24,1,NULL,NULL),(953,1,1,0.00,1390219986,1390388904,1390150800,20,'âLevante','es','Barcelona','es',2,'Spanish BBVA liga','Levante were lucky enough to take a 1-0 win over Malaga. Again, they defended deeply, had very little possession and sneaked a goal from a set piece. Getting away with it again, mostly. But in this bad Liga, it is enough, it seems.','<p><strong>Levante</strong> were lucky enough to take a 1-0 win over Malaga. Again, they defended deeply, had very little possession and sneaked a goal from a set piece. Getting away with it again, mostly. But in this bad Liga, it is enough, it seems.</p><p>In the continuing absence of <strong>Baba</strong>, <strong>Barral Impt</strong> has emerged as their main attacking threat but he is<strong>suspended</strong> here.</p><p>They are set to play their usual counter-attacking football and El Zhar could be the No 9, not really his role but he is quick. The other option, 3<sup>rd</sup> choice fwd  Angel, is a lively, busy little fellow with a good pedigree in 2nda, but doesn\'t score much at this level. </p><p>A mature, calculated approach from Tata\'s <strong>Barca</strong> away to Atletico. They protected themselves well against Atletico\'s strong points and conceded almost no chances of note. Barca were content enough to take possession, but not take risks. Stalemate ensued. Pique was excellent at the back, a reminder of what he is capable of when he is concentrating. They even kept out Atleti\'s set pieces.</p><p>Messi and Neymar started on the bench. The starters, Alexis and Pedro, like to run into space. There was, of course, none of that. All told, Barca will be satisfied with the somewhat uncharacteristic solidity they showed, and with a very decent result from the dragon\'s cave. They had the self-awareness to play sensibly, rationally, rather than pretend they are the invincible side of 3 years ago. A lot of credit to Tata, I think.</p><p>Barca cruised past Getafe in the Copa dead rubber, in which Messi showed he is in good shape. <strong>Neymar</strong>lasted little more than 20 minutes with an ankle injury which will keep him out for several weeks.</p><p><strong>Rback Alves Reg/Impt</strong> is <strong>out</strong> so Montoya starts.</p><p><strong>Iniesta SemiReg</strong> is still missing. Pedro and Alexis should start in attack with Messi.</p><p>Levante can\'t put 3 passes together at the best of times, and lately their possession figures have been hovering in the high 20s early 30s. God help them here, then.</p><p>Barca with Messi should get 3 or more, Levante should get 0 or less.</p><p>Levante: Keylor Navas; Pedro LÃ³pez, Navarro, Juanfran, Nikos; Diop, Simao, Xumetra, Ruben, Ivanschitz; Ãngel.</p><p>Barcelona: ValdÃ©s; Montoya, PiquÃ©, Mascherano, Alba; Busquets; S Roberto/Xavi, Cesc; Alexis, Messi, Pedro.</p>','52dd12bd2463b.jpg','Barcelona','-2.00',1.80,'8',72.32,-8.00,723,3,'1:1',1723.24,1,NULL,NULL),(954,1,1,0.00,1390220265,1390388904,1390132800,20,'âChievo','it','Parma','it',2,'Seria A','Parma were unlucky to lose in the 91st minute in the cup they were the better team and should have won.','<p>Parma were unlucky to lose in the 91<sup>st</sup> minute in the cup they were the better team and should have won. In the league they are in very good form and are unbeaten for 8 games 3-5-0  last 4 away 2-2-0 they have no important players missing.Chievo managed to draw away to Inter last week they have not won in 4 games 0-2-2 and only 1 win in the last 7 home 1-2-4 and that against very weak away Livorno</p>','52dd13de2a2e3.jpg','Parma','0.00',1.75,'7',73.65,5.25,736,2,'1:2',1724.24,1,NULL,NULL),(955,1,1,0.00,1390220534,1390388904,1390125600,26,'Udinese','it','Lazio','it',1,'Seria A','Udinese was not good against Sampdoria and thatâs why they lost 3-0.','<p>Serie A â Udinese vs. Lazio</p><p>Udinese was not good against Sampdoria and thatâs why they lost 3-0. Allanâs red card played a part but really Udinese players have only their selves to blame. But when it comes to Friuli games, they transform their selves into a better team. In the last home game against Inter for Coppa Italia, Guidolinâs men fought really hard like playing for their lives and I expect them to do the same today since the team is going through a rough time lately. Allan and Silva are out suspended but Udinese has the depth to cover their absence. Home side is also boosted by the return of the talented forward Luis Muriel who was out for about two months. Of course he will be starting on the bench.</p><p>Lazio keeps performing in very low standards from the beginning of the season. Rejaâs appointment did not change many things in terms of performance but have really changed the luck factor. Lazio was Inferior to both Inter and Parma in their last two home games but somehow they found a way to win both of them. Of course this cannot go on and soon they will be getting what they deserve. Lazio have zero wins on away games in Serie A this season and I donât see them winning in such a hard to visit venue as Friuli. They have a few absences as well. Right back Konko, left back Radu and midfielders Gonzalez and Ledesma are all out.</p><p>Pick: Udinese (0 AH), Odds: 1,87 @ Pinnacle, Stakes: 8/10</p>','52dd14e5cd29c.jpg','Udinese','0.00',1.87,'8',-0.80,-8.00,-8,3,'2:3',992.00,1,NULL,NULL),(956,1,1,0.00,1390220823,1390388904,1390059900,26,'Liverpool','gb','Aston Villa','gb',NULL,'England Premier League','Liverpool is flying offensively having Suarez in tremendous form, Sturridge back from injury and Coutinho creating chances out of nothing. ','<p>Liverpool is flying offensively having Suarez in tremendous form, Sturridge back from injury and Coutinho creating chances out of nothing. The problem with Liverpool is the defensive mistakes that keep happening over and over again. Last week against Stoke they were horrible at the back and got a bid lucky to pick up all three points. Agger is injured, Skrtel is addicted to mistakes, Cissokho is not top class defender and Johnson is better on the offensive rather than the defensive part.</p><p>Aston Villa has scored on 10 of the last 13 visits to Anfield. They have all their attacking options available, except Kozak of course who will sit out for a long period. Benteke returned to scoring against Arsenal and I sense that his return back to top form is not far away and Agbonlahorâs pace will not be easy to handle for the reds. âThe Villansâ feel better on this kind of games because they have the space to hit on the counter attack. I believe they will find a few chances today. We only need them to convert one of them.</p><p>Pick: Both teams to score, Odds: 2,00 @ BetVictor, Stakes: 6/10</p>','52dd160ac8cf1.jpg','BTS','0.00',2.00,'6',-0.20,6.00,-2,2,'2:2',986.00,1,NULL,NULL),(957,1,1,0.00,1390221095,1390388904,1390143600,26,'Chievo','it','Parma','it',2,'Seria A','Parma failed to qualify in Coppa Italia on Tuesday night, losing 2-1 to Lazio in Olimpico.','<p>Parma failed to qualify in Coppa Italia on Tuesday night, losing 2-1 to Lazio in Olimpico. Donadoniâs team deserved much more on that game but Sansone missed a huge opportunity in front of an open goal and Lazio managed to score a lucky goal at the last minutes of the game so now Parma has to focus totally on Seria A. The team is performing really well in the last few weeks; the squad is deep and strong with players like Antonio Cassano sitting on the bench sometimes.</p><p>Chievo managed to get a point in San Siro against Inter being a bid lucky with Inter having a clear goal disallowed. Coriniâs team is a strong physically side but they definitely lack technique and this is the main reason why Chievo counts only two wins in nine home games.<br>The odds are really close here but the quality of the two teams is not close at all. Parmensi are the stronger side and I believe they will have the upper hand in âBentegodiâ on Sunday afternoon.<br></p>','52dd170a27a70.jpg','Parma','0.00',1.95,'8',0.56,7.60,6,2,'1:2',990.00,1,NULL,NULL),(958,1,0,0.00,1390222833,1390223465,1390057200,22,'AZ Alkmaar','nl','NAC Breda','nl',2,'Netherlands Eredivisie','AZ suffered a major blow now their best player, creative midfielder Martens, moved to PAOK Saloniki. He will be replaced in the line-up by more defensive Viktor Elm.','<p>AZ suffered a major blow now their best player, creative midfielder Martens, moved to PAOK Saloniki. He will be replaced in the line-up by more defensive Viktor Elm.</p><p>At NAC the main news is that good old winger Anthony Lurling is sidelined by the coach now NAC has signed technical winger Tighadouni. As all the other attackers, Verbeek, Perica, Poepon, Sarpong and Hooi are also fit, there is no place for Lurling in the squad. He said he will look for a transfer.<br>AZ has been struggling in the Eredivisie in the last weeks of 2013. They have trouble creating and only strik,er Johansson is a regular goalscorer. This particular game has a bit of history, in the last 7 encounters AZ only managed to win one of their home games (1-0 in 2009), NAC won 4 times ! Last season it ended 0-1 for NAC.<br>The odds for an AZ win are dropping, which makes the NAC +1.25 handicap a really interesting offer.<br><br>Pick: NAC +1.25, Odds: 1.91 @ Pinnacle , Stakes 5/10.</p>','52dd1dad87575.jpg','NAC Breda','1.25',1.91,'5',11.11,-5.00,111,3,'3:0',1111.13,1,NULL,NULL),(959,1,0,0.00,1390223192,1390223403,1390143600,22,'NEC Nijmegen','nl','ADO Den Haag','nl',1,'Netherlands Eredivisie','NEC Nijmegen has had a terrible start of the season, but under the new coach they are slowly improving their game. ','<p>NEC Nijmegen has had a terrible start of the season, but under the new coach they are slowly improving their game. NEC managed to win three of their last four home games, only expectedly losing to Ajax (0-3).  In the past weeks NEC played well in friendlies against Mainz (2-3 loss) and Werder Bremen (1-0 victory), which can be used as confidence boost for the second half of the season.</p><p>On Friday they managed to sign striker Castillion and defender Gravenberch from Ajax, only Castillion is eligible to play. In the last game of 2013 NEC missed a lot of players, but four of them return, amongst them regulars striker Higdon and defensive midfielder Mulder. Still injured is regular Palsson and now also winger Jahanbakhsh.<br>ADO Den Haag is  also in the relegation zone, in away matches they didnât impress much this season, winning two and losing seven. In the last match they lost their most creative player, attacking midfielder Gehrt with a broken collarbone, add to that the missing of suspended goalkeeper Countinho and striker Kramer. Back in the squad is captain Holla, who instantly received a red card for spitting in the first friendly of 2014 against Preussen Munster (0-1 loss).<br>NEC Nijmegen will put up a fight before their own fans to keep their hopes alive in this very important relegation match. With winger Rieks in good form and the power of striker Higdon and possibly Castillion coming from the bench, I expect ADO Den Haag (with their second goalie) faces a very difficult afternoon. Taking a small handicap on the home team.</p>','52dd1ee259d56.jpg','NEC Nijmegen','-0.25',1.88,'7',12.23,6.16,128,2,'3:1',1109.13,1,NULL,NULL),(960,1,0,0.00,1390223817,1390223906,1390150800,22,' Ajax','nl','PSV Eindhoven','nl',1,'Netherlands Eredivisie','Unlike the last three seasons, Ajax went into the break as leader of the Eredivisie.','<p>Unlike the last three seasons, Ajax went into the break as leader of the Eredivisie. They are now the clear favorites to win the title, also because Ajax is known for improving their performance during the season. Ajax set up camp in Turkey, were they played friendlies against Galatasaray (2-1 loss) and Trabzonspor (1-1 draw). In both games Ajax was very dominant and wasted a lot of chances, but they also gave away two goals in a childish way. Ajax has to make a change now Siemde Jong (10/5) has pulled out of the game with the same muscle injury as he suffered from 1 month ago, Sigthorsson (15/6) will probably be the central attacker, attacking midfielder Klaassen (10/7) can stay in the team. Leftback Boilesen (11/1) is back from injury, so Blind (14/0) can play as central midfielder, which is a big benefit for the way Ajax is playing.</p><p>The major news this week is PSVâs signing of attacker Bryan Ruiz, on loan from Fulham. The team from Eindhoven needed some good news after their dramatic first half of the season, already trailing Ajax  and Vitesse by 11 points. On the Canary Islands they played two friendlies, an easy 3-0 victory over Lokomotiv Plovdiv but with their strongest team they lost 0-1 against Augsburg. Long term injured midfielder Wijnaldum (6/4) and striker Matavz (9/2) are on their way back, but they still canât play. Attacking midfielder Toivonen (14/1) is redundant and looking for a new team, he wonât be available also.<br>Compared to their previous friendlies in January, Ajax will be a lot more focused on finishing their opportunities in this very important match. PSV is boosted by the arrival of Ruiz, but we canât expect miracles in his first match for the club. PSV is still very vulnerable and inexperienced at the back, I donât expect they can withstand the pressure Ajax will put them under. The 0.75 handicap is the best possible pick without a doubt.</p>','52dd21bdbf5ae.jpg',' Ajax','-0.75',1.83,'8',11.95,3.32,123,4,'1:0',1108.13,1,NULL,NULL),(961,1,0,0.00,1390224147,1390227568,1390147200,22,'Cambuur Leeuwarden','nl','GA Eagles','nl',2,'Netherlands Eredivisie','In their first Eredivisie season Cambuur Leeuwarden is playing a reasonable game, but they are slipping down the ranking into the relegation zone. Cambuur misses topscorer Hemmen, winger Feldballe and suspended regular rightback Droste. On loan Manu from Feyenoord will make his debut on rightwing.','<p>In their first Eredivisie season Cambuur Leeuwarden is playing a reasonable game, but they are slipping down the ranking into the relegation zone. Cambuur misses topscorer Hemmen, winger Feldballe and suspended regular rightback Droste. On loan Manu from Feyenoord will make his debut on rightwing.</p><p>Promoted Go Ahead performance can be compared to Cambuur, but they are in mid-table, collecting 7 points more. They seem to have a little more striking power compared to their opponents, now even more striker Kolder is back in the team after injury. His successfull replacement in the last matches, Falkenburg, will move to attacking midfield.<br>There is not much between these teams, Cambuur miss two important players, while Go Ahead is on full strength. There is value in picking the away team with a handicap.</p>','52dd2309035f3.jpg','GA Eagles','0.75',1.74,'8',10.81,-8.00,108,3,'2:0',1108.13,1,NULL,NULL),(963,1,1,0.00,1390292889,1390388904,1390233600,26,'West Brom','gb','Everton','gb',1,'England Premier League','Well, to tell you the truth I was planning just to send a report on this one to inform you on the team news but odds have changed in the past few hours and that leaves me no choice.','<p>Well, to tell you the truth I was planning just to send a report on this one to inform you on the team news but odds have changed in the past few hours and that leaves me no choice.</p><p>Ex Betis head coach Pepe Mel will be debuting tonight for West Brom and âThe Hawthornsâ will most probably give him a really worm welcome. âMaybe itâs still early but our fans will see a lot of changes in our game style against Evertonâ the Spaniard mentioned. Shane Long was sold to Hull City for around 9 million euro and Sessegnon as well as Anichebe are doubts for tonightâs game. Even in the case that both will be out, the home side has more than a few options for their front line. Anelka, Berahino, Amalfitano, Vydra and Sinclair can make thing happen for The Baggies.</p><p>Everton is really thriving under Martinez this season playing a very offensive and modern style of football. Today they miss two very promising youngsters who can really upset any defensive line. Barkley and Deulofeu will be out with Leon Osman starting in that creating midfield position. Ex Spartak Moscow wide man, Aiden McGeady may get his debut. Although Everton has just one defeat on away games so far, they have drawn five and they have scored just three goals more than those they conceded.</p><p>Yes, Everton is the better side between these two but betting has to do with evaluating the odds and not with betting always on the better side. I believe 2.05 for Evertonâs win is too low especially in such a special evening for West Brom and I am willing to pay to find out if I am right or wrong. Of course, WBA will try to apply new things in their game and that might come back as a boomerang against a very steady team like Everton so I place just a medium stake.</p><p> Pick: West Brom +0.5, Odds: 1,89 @ SBO, Stakes: 5/10</p>','52de2f8691697.jpg','West Brom','0.50',1.89,'5',0.25,4.45,2,2,'1:1',993.00,1,NULL,NULL),(969,1,0,0.00,1390299798,1390384418,1390334400,21,'Espanyol ','es','Real Madrid','es',1,'Copa del Rey','âFirst quarter final in the Cornella El Prat in Barcelona with the return leg being scheduled next Tuesday in Madrid.','<p>First quarter final in the Cornella El Prat in Barcelona with the return leg being scheduled next Tuesday in Madrid.</p><p>These two have recently met each other in the same ground in a game where Real won by the minimum having Cristiano Ronaldo not in his best evenings wasting clear cut opportunities to give a wider margin to the victory. From that game though, Espanyol had to play without key forward and their best player, Sergio GarcÃ­a due to suspension, while important midfielder David LÃ³pez and sub striker Thievy were out nursing their respactive injuries. Ronaldo won the \'Ballon d\' Oro\' award right the next, if this\' giving any excuse to him for wasting that clear opportunities. Maybe he was anxious.<br>Now for today, none of these two will make use of the rotation policy. Both managers included in the squad their all the available players, Ancelotti left in Madrid only Coentrao (susp) and long term ancentes Khedira, while Varane Javier Aguirre who served his 4 days ban for cursing against the ref and returns to the bench, dropped Simao MD and Fuentes LB* and he still cannot count on David LÃ³pez MD**. Sergio Garcia is there though and he enjoys the best season in his footballing career and most probably his best period in his personal life as long as he recently became a father to a wonderful daughter. Ah, our boss and the man behind the BOF project, Mikhail, also became a father recently to a lovely son! Well done both! :)<br>So, this is a quarter final, motiavtion on top for both, Espanyol in very good state of form and with their morale sky high after their latest dying minutes win over Celta, with Sergio Garcia, who else, scoring the winner! Real didn\'t face any tough rival recently, mixed Osasuna team in two cup games, struggling Betis, and Espanyol who put some pressure on Real especially in the opening minutes even without key forward Sergio Garcia who\'s now available.<br>Now, what is strange enough here is that in the league game the handicap was given to Real Madrid was -1.5 goal and surprisingly now the handicap went up to -1.75...<br>We took Real -1,5 two weeks ago at 2,10 and now at the price of 2,10 we have Real -1,75...<br>Bearing in mind that Espanyol knows very well how to defend properly against the big two, only lost 1-0 in the Camp Nou against Barcelona, and taking under consideration the cup factor and the return leg, I found value on taking the +1.75 of Espanyol today.</p>','52de4a85c34d2.jpg','Espanyol ','1.75',1.85,'6',64.50,5.10,645,2,'0:1',1633.86,1,NULL,NULL),(977,1,0,0.00,1390462889,1390462907,1390406400,22,'NEC Nijmegen','nl','Utrecht','nl',1,'KNVB Beker','NEC had a great start of the second half of the season with a convincing 3-1 over ADO Den Haag, now winning four of their last five home matches. Remarkably all three goals were scored by defenders, which is a sign of their attacking way of play.','<p>NEC had a great start of the second half of the season with a convincing 3-1 over ADO Den Haag, now winning four of their last five home matches. Remarkably all three goals were scored by defenders, which is a sign of their attacking way of play. With newly signed Castillion from Ajax they have an extra possibility in attack. NEC will still be without winger Jahanbakhsh and central defender Palsson.<br><br>In contrary to NEC, Utrecht is in terrible shape. Last weekend they were completely outplayed by Feyenoord, the 2-5 loss at home could have been even higher if Feyenoord was a bit sharper, attempting 23 shots at goal. Itâs their second big home loss in a row after previously being beaten by PSV 1-5. Utrechtâs away form this season is also very weak, losing seven out of nine matches. In attack Utrecht are without long term injured Mulenga and van der Gun.<br><br>The two major reasons for the small NEC handicap are the current form and home advantage.<br>The second pick is a rare opportunity, as 9 of 10 NECâs home games ended over 3 goals, the 10th game (against Ajax 0-3) exactly on 3 goals. NEC is scoring a lot of goals recently in home and away matches, Utrechtâs defence is giving away lots of opportunities.<br><br>Pick: NEC Nijmegen -0.25, Odds: 1.90 @ 12Bet , Stakes 8/10.</p>','52e0c79ddbcdc.jpg','NEC Nijmegen','-0.25',1.90,'8',12.33,7.20,123,2,'1:0',1108.13,1,NULL,NULL),(978,1,0,0.00,1390463084,1390466954,1390406400,22,'Ajax','nl','Feyenoord','nl',1,'KNVB Beker','After a difficult first half against PSV in which they werenât playing aggressive enough, Ajax managed to improve their performance and earned a small victory (1-0). The impressive second half, with former leftback Blind as an inspiring defensive midfielder, will be a boost for their confidence.','<p>After a difficult first half against PSV in which they werenât playing aggressive enough, Ajax managed to improve their performance and earned a small victory (1-0). The impressive second half, with former leftback Blind as an inspiring defensive midfielder, will be a boost for their confidence. Attacking midfielder de Jong (who was supposed to play in attack) missed the game and will be sidelined for several weeks, his replacement Icelandic international Sigthorsson scored the only goal, just before he was about to be substituted. Ajax will probably start with the same squad as Sunday.</p><p>Feyenoord also displayed a fine performance at Utrecht (2-5 win). It must be said Utrecht didnât put up their usual fight, giving Feyenoord a lot of room to create big chances, against Ajax that will be complete different. Winger BoÃ«tius had to be substituted with a light injury, he is doubtful for this match.<br><br>Itâs a long time Feyenoord won a game in Amsterdam, we have to go back to 2005. Since then seven Ajax wins and only one draw. Another negative aspect for Feyenoord: all games between these teams are played without away fans, due to the intense rivalry. Ajax is warned after their bad start of the game against PSV last Sunday, they will try to dominate the game from the very first minute. Attractive odds for a home win.</p>','52e0c85d99ba5.jpg','Ajax','-0.50',1.83,'6',12.83,4.98,128,2,'3:1',1117.33,1,NULL,NULL),(980,1,1,5.00,1390483225,1390577155,1390507140,21,'Atletico Madrid','es','Athletic','es',2,'Copa Del Rey','The most exciting Copa Del Rey quarter final is taking place today in the Vicente Calderon with Atletico Madrid hosting Athletic de Bilbao. The two teams are getting into this game with mixed feelings, definitely Athletic have their morale sky high after another one astonished performance against Valladolid while Atletico should lay on the blame to themselves only for succumping in a home draw against Sevilla FC last Sunday.','<p>The most exciting Copa Del Rey quarter final is taking place today in the Vicente Calderon with Atletico Madrid hosting Athletic de Bilbao. The two teams are getting into this game with mixed feelings, definitely Athletic have their morale sky high after another one astonished performance against Valladolid while Atletico should lay on the blame to themselves only for succumping in a home draw against Sevilla FC last Sunday.</p><p>The rojiblancos didn\'t play as usual against Sevilla allowing their rivals to shot more times than they allowed Barcelona last week...! They had their chances to kill their rival though but they plaid the price for their lousy defensive approach to the game. Simeone will introduce 2 or 3 changes the most today, most probaly giving entrance to Alderweireld, RaÃºl GarcÃ­a and maybe Cebolla. Los \'leones\' on the other hand, are doing remarkably well recently and there is no doubt that they enjoy their best form in the season. Key midfielder and top scorer (!) Mikel Rico is back after losing the last game in suspension, while defender San JosÃ© also served is ban. Muniain is the only first choice player who remains out, sub striker Toquerro is nursing an injury as well.</p><p>Odds have been adjusted pretty much in last hours. The line opened in -1.5 goals, a huge handicap for Atletico, and now it went down to -1.25. Still, I can\'t figure out why Atletico enjoys that big favoritism against a high flying CL candidate. Yes, it is a cup quarter final but Athletic\'s form leaves much room for optiomism taking the +1.25 here.</p><p>---------------</p><p>Atletico Madrid</p><p>Squad:<br>Aranzubia, Courtois - GodÃ­n, Filipe, Alderweireld, Juanfran, Insua, Miranda - Koke, RaÃºl GarcÃ­a, Arda Turan, Cebolla, Gabi, Guilavogui, Torres - AdriÃ¡n, Villa, Diego Costa</p><p>Out:<br>Tiago MD**, Mario MD (injured), GimÃ©nez, Insua,Sosa, Manquillo (dec tec)</p><p>---------------<br>Athletic Bilbao</p><p>Squad:<br>HerrerÃ­n e Iraizoz, Iraola, Gurpegi, Laporte, Balenziaga, Iturraspe, Susaeta, Herrera, Ibai, Aduriz, BeÃ±at, Sola, De Marcos, Etxeita, Saborit, San JosÃ©, Rico</p><p>Out:<br>Muniain FW***, Toquero FW (injured), Albizua (long term)</p><p>Back:<br>Mikel Rico MD***, San JosÃ© DF*</p>','52e116d9748b9.jpg','Athletic','1.25',2.00,'6',0.00,0.00,0,4,'1:0',1633.86,1,NULL,NULL),(981,1,0,0.00,1390484632,1390484712,1390419900,26,'AC Milan','it','Udinese','it',NULL,'Coppa Italia','Milan enjoyed a winning start under the management of Clarence Seedorf with a 1-0 win over Verona on Sunday night. Truth is that Milan was not that impressive and if it wasnât that stupid penalty given away by Gonzalez, things could have been much worse for Rossoneri.','<p>Milan enjoyed a winning start under the management of Clarence Seedorf with a 1-0 win over Verona on Sunday night. Truth is that Milan was not that impressive and if it wasnât that stupid penalty given away by Gonzalez, things could have been much worse for Rossoneri. Now Milan have won, Seedorf praised Balotelli (who in my opinion performed very poor and destroyed half of Milanâs attacking plays) and today their win against Udinese pays as much as 1.40. For me they do not deserve this kind of odds, even if I see them responding in the second round of Serie A and even if I believe that Seedorf is the right man for the job. Many absences as well for Rossoneri tonight. Pazzini, El Shaarawy, Montolivo, Constant, Mexes, Muntari, Bonera and Saponara are all out with Abate returning from injury. The international right back is expected to be on the bench though with Adil Rami reported to be starting on that right back position in what seems to be a very strange decision from Seedorf.</p><p>Udinese keeps disappointing and they might even find themselves in a relegation battle if they donât respond immediately. The fans had a long talk with the team captains Di Natale and Domizzi asking for bigger effort and more passion from all players. The teamâs defensive behavior against Lazio was horrible and that is the only reason I am not betting on them today even with this very inviting odds. Guidolin has a full squad but he will make a few changes. Di Natale will stay on the bench with Muriel and Nico Lopez starting up front.</p><p>1.40 is too low for Milanâs win but Udineseâs defending against Lazio does not let me bet on them. What I will bet is on both teams to score because I believe that 2,15 is too high. Udinese scored in 11 out of the last 12 visits to San Siro against Milan. They will have two fast and talented forwards like Muriel and Di Natale and I believe they can cause problems to Milanâs defense.</p>','52e11c92e3356.jpg','BTS','0.00',2.10,'5',0.90,5.50,9,2,'1:2',998.50,1,NULL,NULL),(982,1,1,5.00,1390496201,1390755148,1390737600,26,'Parma','it','Udinese','it',NULL,'Serie A','Both teams produce chances. Both teams will play for the win here and I expect a nice game in Ennio Tardini.','<p>Serie A â Parma vs. Udinese</p><p>Parma completed a very strange exchange with Sassuolo this week. Sansone, Mendez and Rossi moved to Sassuolo, the first two with co-ownership and the third one on loan and Schelotto with Rossini took the opposite way. This exchange is so much in Sassuoloâs favor that is really hard to believe. Sansone, Mendez and Rossi are all great talents that have too much to offer in the future while Rossini and Schelotto are low level players that played as substitutions for Sassuolo and there is no way they can make a real impact in a technical team like Parma. Of course Donadoni has a big squad and since they got out of Coppa Italia they possibly just want to cut down the salary expenses.</p><p>Parma has been performing on top level lately. They got really unlucky against Lazio in the cup conceding in the last minute but luck was on their side on Sunday when a last minute mistake by Chievoâs keeper Pugioni gave to Gialloblu all three points. Against Udinese the defensive leader and captain of the team Lucarelli will be out suspended.</p><p>Udineseâs colors are black and white and so are the performances of the team this season. They had all the three points in their pocket being in front against Lazio and playing with an extra man and they really managed to make some horrible defensive mistakes and lose the game. After that they went on to beat Milan in Giuseppe Meazza for Coppa Italia showing great determination and playing beautiful football. Udinese will have midfield maestro Allan back from suspension.</p><p>In last seven games between the two we have seen five over 2.5 and the rest two games finished 2-0 in Parmaâs favor. Both teams produce chances. Both teams will play for the win here and I expect a nice game in Ennio Tardini. I bet early on this one because after Udineseâs massive performance in San Siro and also because of Lucarelli\'s suspension I believe the odds on over 2.5 goals will go down as we get closer to the match.</p><p>Pick: Over 2.5, Odds: 2,11 @ Pinnacle, Stakes: 6/10</p><p>--</p><p>BetOnFootball.eu</p>','52e149c0bc8da.jpg','Over ','2.50',2.11,'6',14.55,-6.00,146,3,'1:0',1145.50,1,NULL,NULL),(983,1,1,5.00,1390550002,1390722037,1390675500,22,'ADO Den Haag','nl','Feyenoord','nl',2,'Dutch Eredivisie','Depleted bottom team versus title contenders\r\n\r\n','<p>ADO Den Haag is performing very poorly, losing the\r\nvery important away match at NEC Nijmegen without a chance. They are now at the\r\nbottom of the Eredivisie. ADO Den Haag are missing some key and regular players\r\nlike midfielder Gehrt, striker Kramer, and probably also central defender Wormgoor (concussion). Replacement in defence Bakker is also doubtful.</p><p>Feyenoord played a good game at Utrecht (2-5 win) and\r\nin midweek also a good performance in the first half at Ajax. Eventually they\r\nlost 3-1, mainly due to the classy Ajax play. The only regular that is missing\r\nis Vilhena (suspended), will be replaced by Goossens who is a good passing\r\nplayer and has a powerful free-kick.</p><p>Very valuable to step in early on a 0.75 handicap for\r\nthe away team, lots of difference in form and quality between these teams. In\r\nform Feyenoord striker Pelle can cause a lot of trouble for ADO Den Haag\'s experimental central defence.</p>','52e21be6b976d.jpg','Feyenoord','-0.75',1.74,'9',0.00,0.00,0,3,'3:2',1119.31,1,NULL,NULL),(984,1,0,0.00,1390561748,1390755175,1390739400,22,'Vitesse','nl','NEC Nijmegen','nl',2,'Dutch Eredivisie','Heavy contested derby on the Rhine','<p>Vitesse managed to\r\nwin their first game of 2014, but it was far from convincing. They needed an\r\ninjury time winner from leftback van Aanholt to beat PEC Zwolle 1-2. Vitesse\'s last\r\ntwo matches of 2013 also showed some cracks in their performance, which cost\r\nthem the first place in the league (2-2 at Heracles) and elimination in the cup\r\n(3-1 loss at Roda JC). New striker Durdevic will probably on the bench, new\r\nattacking midfielder TraorÃ© (on loan from Chelsea) is still not permitted to\r\nplay. A big\r\nloss is the suspension of captain and central defender Kashia, he will be\r\nreplace by Mori, who has little experience</p><p>NEC started the new\r\nyear in great style, with a convincing win against ADO Den Haag (3-1) and a cup\r\nvictory over Utrecht (1-0). A small bit of criticism, the last win should have\r\nbeen a lot bigger, NEC refused to put the game beyond doubt in the first half.\r\nWinger Jahanbakhsh is still out, but newly signed Castillion is close to\r\nstarting, in away games he might be preferred above more static Scottish\r\nstriker Higdon.</p><p>This is a derby match\r\nwith very heavy rivalry amongst fans and also players. it will be a lot tighter\r\nthan the odds present us, especially with NEC in a rising form and Vitesse\r\nperforming less convincing than before. </p>','52e3af5549aed.jpg','NEC Nijmegen','1.75',1.98,'6',0.00,0.00,0,2,'1:1',1122.31,1,NULL,NULL),(1001,1,1,5.00,1390580523,1390600812,1390597200,21,'Celta','es','Betis','es',2,'BBVA Liga','âLast week in Espanyol, Celta deserved a better fate but a last minutes winner from Espanyol best in form man, Sergio Garcia denied them even the one point. Not that Celta was much better, but Espanyol seemed unable to produce any danger.','<p>Last week in Espanyol, Celta deserved a better fate but a last minutes winner from Espanyol best in form man, Sergio Garcia denied them even the one point. Not that Celta was much better, but Espanyol seemed unable to produce any danger.</p><p>Betis was humiliated at home to Real, star striker Diego Castro is playing really awful and wahat was really impressive last week was that when he was substituted he didn\'t stay in the bench he left the stadioum something that reveals the chaos in the team! Some other players are playing lousy too and Garrido paid the price in the 2nd change in the bench for Betis! Garrido made many mistakes and his policy didn\'t make anything to easy things, on the contrary. He was booed byt the fans against Real, Pepe Mel was cheered off and Garrido was sacked in the next days.</p><p>Now, former player Gabriel Calderon took over. Calderon has been working in Saudi Arabia club in recent years after winning their NT a world cup ticket in 2006!<br>He is fighter, he has 18 finals to play, but what I liked more form his statements is that he is eager to restore Ruban Castro, Verdy and Centrick! These three players should be the back bone and I was really curious watching Pepe Mel and Garrido not to be gving them a key role. Today Calderon is set to use Castro and Leo Baptistao together in the attack another great movement. Leo has been Betis best player in the 2-3 games he belongs in the team coming on loan from Atletico.</p><p>Celta can not count on key winger Augusto but they have key striker Charles back after losing the last one due to stomach problems. No new missings for Betis.</p><p>I will take Betis straight from the first day with Calderon in charge. He said the magic word, Verdu, Cendrick and two strikers Leo, Ruben! This is enough from me and shows an attacking formation for Betis who haven\'t got any luxuries of settling down in a draw in Vigo.</p>','52e29321465ee.jpg','Betis','0.50',1.90,'6',63.39,-6.00,634,3,'4-2',1633.86,1,NULL,NULL),(1002,1,1,5.00,1390640406,1390722214,1390680000,21,'Valladolid','es','Villarreal','es',2,'BBVA Liga','âStruggling Valladolid welcomes high flying Vila-Real outfit with their manager Juan Ignazio Martinez towards the exit door. JIM has failed to produce decent results since his arrival in Valladolid but he didn\'t had much help either. The terrible financials of the club didn\'t allow him to built up the squad he had in mind...','<p>Struggling Valladolid welcomes high flying Vila-Real outfit with their manager Juan Ignazio Martinez towards the exit door. JIM has failed to produce decent results since his arrival in Valladolid but he didn\'t had much help either. The terrible financials of the club didn\'t allow him to built up the squad he had in mind but the same situation turns in his favor now because the club can\'t afford the money to pay him in case of a contract divorsion.</p><p>Anyway, soccerly speaking, JIM is playing his head today. Key center back Valiente is out, but the most annoying is that most of the players underperforme recently. Only striker Guerra is doing his best... Villarreal is a team of the top4 there is no doubt about that. They have no new missings, only Cani remains out. The quality gap is enough to see Villarreal winning all three points in Vallecas.</p>','52e37d0855953.jpg','Villarreal','-0.50',1.96,'7',0.00,0.00,0,3,'1:0',1626.86,1,NULL,NULL),(1003,1,1,5.00,1390640531,1390722278,1390687200,21,'Sevilla','es','Levante','es',2,'','âCaparros returns \'home\' where he hasn\'t won since 2005 when he left Sevilla FC. His unique victory came at the same year with Deportivo La Coruna but since then the Sevillian manager has failed to pick up the three points in the Sanchez Pizjuan. Last season in the cup he did win 1-2 though with struggling and later relegaten Malllorca side, but he got a 0-5 trashing at home a week later...','<p>Caparros returns \'home\' where he hasn\'t won since 2005 when he left Sevilla FC. His unique victory came at the same year with Deportivo La Coruna but since then the Sevillian manager has failed to pick up the three points in the Sanchez Pizjuan. Last season in the cup he did win 1-2 though with struggling and later relegaten Malllorca side, but he got a 0-5 trashing at home a week later.</p><p><br>Levante are without midfielder Sergio and Rodas who are injured while he can\'t count on key striker Baba who recovered his injury but can not feature against Sevilla because of a contract clause. In the midweek Levante played again against Barcelona with Caparros resting many of his regulars. All of them returned in the squad today. Sevilla looks like enjoying an excellent state of form especially after the 1-1 against Atletico last week. M\'Bia MD** and Diogo RB* are back, Alberto Moreno LB* is out.<br><br>Caparros\' favorite tactic the \'defensive wall\' has finally started growing fruits but offensively he hasn\'t got much to offer.  Hard call but the handicap is enormous I could expect this line to Atletico Madrid maybe, not Sevilla, thus I am taking Levante +1,25 here.</p>','52e37d52a283b.png','Levante','1.25',2.08,'5',63.33,5.40,633,2,'2:3',1622.86,1,NULL,NULL),(1004,1,1,5.00,1390646290,1390721980,1390665600,21,'Wigan','gb','Crystal Palace','gb',2,'FA Cup','âPalace is a nut hard to crack under Toni Pulis playing solid in defense and organized in ever line. Even bigger and much better sides than Wigan failed to beat Toni Pulis\' lads why Wigan is the favorite here who belongs to a lower division?','<p>Palace is a nut hard to crack under Toni Pulis playing solid in defense and organized in ever line. Even bigger and much better sides than Wigan failed to beat Toni Pulis\' lads why Wigan is the favorite here who belongs to a lower division? Palace will have changes, ok, Wigan won\'t have some?</p>','52e393dd26e55.jpg','Crystal Palace','0.00',3.52,'3',62.79,-3.00,628,3,'2:1',1627.86,1,NULL,NULL),(1005,1,1,5.00,1390646448,1390721900,1390665600,21,'Birmigham','gb','Swansea','gb',1,'FA Cup','âBirmigham has been under an impressive 10 games unbeated run before losing the last two games in Championship and Laudrup made it crystal clear that the league and the upcoming games against Fulham is the priority for Swansea who are still facing many injury concerns. ','<p>Birmigham has been under an impressive 10 games unbeated run before losing the last two games in Championship and Laudrup made it crystal clear that the league and the upcoming games against Fulham is the priority for Swansea who are still facing many injury concerns. Swansea showed two different faces last Sunday noon against Totenham, a very good one in the first part with some defensive weakenesses though and a completely lousy in the 2nd when their rivals had already taken the lead. This shows a lack of motivation and today that Laudrup set the FA Cup game in the back of their priorities, I doubt that Swansea will be able to compete properly.</p>','52e3946a26a15.jpg','Birmigham','0.00',4.02,'3',63.09,-3.00,631,3,'1:2',1630.86,1,NULL,NULL),(1006,1,1,5.00,1390646704,1390721847,1390665600,21,'Bolton','gb','Cardiff','gb',2,'FA Cup','âBolton are in terrible situation and form of course and their Scottish manager Dougie Freedman did crucify most of them after the7-1 demolition by Reading last weekend...','<p>Bolton are in terrible situation and form of course and their Scottish manager Dougie Freedman did crucify most of them after the7-1 demolition by Reading last weekend! Freedman said: âMost of the players are not of that level. We need reinforcments unless... I am training them properly but they simply can\'t get what I am saying themâ... Well, Bolton will not get reinforcments but they will even lose their striker and 2nd best scorer N\'Gog to Swansea! N\'Gog may lose today game as well... Cardiff have been doing  much better in the new year after the adventures with their Malaisian president and their former manager. Moreover, with Ole Gunnar Solskjaer in charge they became even better and even though their squad is nothing spectacular it is a much better one than Bolton\'s. Cardiff played decent in Man City losing by 4-2 and remind you that in Solskjaer\'s debut they conquered Newcastle\'s St James\' Park in the previous round of the FA Cup by 1-2!</p>','52e3957e0745d.jpg','Cardiff','0.00',2.85,'5',0.00,0.00,0,2,'0:1',1628.86,1,NULL,NULL),(1007,1,0,0.00,1390654019,1390722158,1390679100,22,'NAC Breda','nl','PEC Zwolle','nl',1,'Dutch Eredivisie','NAC Breda is unbeaten for six games in their own stadium, with five wins and only Groningen managed an injury time draw.','<p>NAC Breda is unbeaten for six games in their own \r\nstadium,\r\nwith five wins and only Groningen managed an injury time draw. It\'s a \r\nbig\r\ncontrast with NAC\'s performance away from home, losing last seven, with a\r\n small\r\nexcuse they met some big teams in last four away encounters (Ajax, \r\nVitesse,\r\nTwente and AZ). Apart from suspended midfielder Seuntjens everyone is \r\nready to\r\nplay, which could mean good old Lurling is again not in the squad. NAC \r\nalready\r\nstated his ending contract won\'t be renewed. The coach has decided to \r\nput central defender Kwakman on the bench, defending midfielder Buijs \r\nwill play in his place. Gillissen and Suk will complete the starting \r\neleven.</p><p>An Eredivisie losing streak of four games and nine\r\nwithout a win is a major concern for PEC Zwolle. In away matches their last win\r\nwas over five months ago. Last week at home against Vitesse they probably\r\ndeserved a point, but Vitesse scored an injury time winner (1-2). In the Cup\r\nZwolle managed to reach the last four, but it must be said they were a bit\r\nlucky to draw amateurs Cuijk at home (5-1 win). For Zwolle this win is the only\r\npositive thing to cling on to, losing at NAC should mean they rapidly will be\r\nin the relegation zone. Defender Lachman is still an important missing.</p><p>Last season NAC easily managed to defeat Zwolle (3-0).\r\nAll the signs are pointing the same way, NAC\'s great home form and Zwolle\r\ncompletely losing their August momentum when they were top of the league.</p>','52e3b38630471.jpg','NAC Breda','0.00',1.73,'8',0.00,0.00,0,3,'1:2',1120.31,1,NULL,NULL),(1008,1,1,5.00,1390661819,1390722085,1390679100,22,'PSV','nl','AZ Alkmaar','nl',1,'Dutch Eredivisie','Coach Advocaat visits former team.','<p>Last week PSV surprised Ajax with some fresh\r\ncombinational play, especially in the first half where PSV should have taken\r\nthe lead. Maybe it had also to do with the fitness of new signing Bryan Ruiz,\r\nwho clearly missed game practise, but in the second half PSV wasn\'t able to\r\nmaintain the high level and Ajax won 1-0. With the arrival of Ruiz and with\r\nPark and Schaars in midfield the team\'s balance between young and old players\r\nis back. PSV is still without long term injured Matavz and Wijnaldum, both are\r\nclose to a return.</p><p>AZ finally managed to win a game after two draws and\r\nfour losses. Opponent NAC Breda didn\'t put up much of a fight, a convincing 3-0\r\nvictory the result. In midweek AZ had to travel to Roda JC for the Cup and they\r\nwere a bit lucky to walk away with 0-2 win. Roda JC had to be awarded a penalty\r\nkick at a 0-1 score, Roda JC player was shown a red card after pushing the\r\nreferee when appealing. In the following attack, AZ scored the 2nd goal. AZ\r\nwill play in the same formation, with only winger Berghuis (two time goalscorer\r\nagainst NAC) being doubtful.</p><p>Although AZ won and PSV lost last week, I believe PSV\r\nis in better shape. The home team must be able to convert some of the many\r\nchances they create each game. This season AZ has a lot of difficulty to play\r\ntwo consecutive games in a week. Adding the home advantage into the equation,\r\npicking PSV -0.75 is most logical.</p>','52e3d4ed5f62a.jpg','PSV','-0.75',1.79,'8',0.00,0.00,0,4,'1:0',1120.31,1,NULL,NULL),(1009,1,0,5.00,1390728065,1390896760,1390752000,20,'CAGLIARI','it','MILAN','ie',1,'ITALY','Now it defies any logic of oddsmaking how a team with an away record of 1-4-5 18-21 there only win coming against bottom of the league Catania can give away +1/2 to a steady team like Cagliari','<p>Milan showed no signs of improvement they were bad and\r\nvery lucky to win at home against Verona but midweek they were outplayed and\r\nlost at home against Udinese who was struggling as well before that game\r\ndespite the fact they lead 1-0.Now it defies any logic of oddsmaking how a team\r\nwith an away record of 1-4-5 18-21 there only win coming against bottom of the\r\nleague Catania can give away +1/2 to a steady team like Cagliari</p>','','CAGLIARI','1.00',1.82,'7',0.00,0.00,0,1,'1:2',1791.74,1,NULL,NULL),(1012,1,1,5.00,1390732126,1390896716,1390761000,20,'Hamburg','de','Schalke','de',2,'GERMANY','âI expect Schalke this round to begin their usual late rally for European positions they are suited by playing away on the counter ','<p>I expect Schalke this round to begin their usual late\r\nrally for European positions they are suited by playing away on the counter and\r\nwho the best opponent for this than the weak defensively Hamburg who also has a\r\nbad home record 2-1-5 13-17 their 2 wins coming against bottom of the league Braunschweig\r\nand worst away team Hannover they also miss important players like Beister and\r\nGk Adler .Schalke also misses star Draxler</p>','','Schalke','0.00',1.94,'7',80.42,6.58,804,2,'0:3',1790.58,1,NULL,NULL),(1013,1,1,5.00,1390732430,1390755120,1390734000,21,'Almeria','es','Getafe','es',NULL,'BBVA Liga','âAlmeria had a really impressive approach in Vila-Real last week where they deserved much more than a 2-0 defeat at the hands of the yellow submarines. They return back home where they smashed Granada by 3-0 in their last game. Getafe, on the other hand, were born again last Sunday noon against Real Sosiedad...','<p>They wend 0-2 down in the opening 15 minutes, received the booes of their fans, but after that they fully dominated the game, they equalized and even deserv to win. In the last half hour they played with 10 players where they could receive one, but in overall they didn\'t feel much danger.</p><p><br>Almeria have the same squad as in the last days, only long term missings plus Ustari who left the club. Getafe have right full back Varela, not important as long as Arroyo is fit, and skilful attacking mid Lafita back. Borja is a key missing in the center of the field and Alexis who broke his \'ball\' last week in the cup.<br><br>Well, there is no clear favorite here, Almeria should be the one but odds have been set correctly. Where I feel we can find value is in the total goals and in the over2,25 in particular where odds lies at 1,86. Almeria usually give the ball at home and goin into counters and Getafe does the same. Still their defenses allows many shots to their rivals and as long as their is great confidence and some more expectations in both camps I believe that we will see a nice game with at least 2 goals scored.</p>','52e4e46a15262.jpg','Over','2.25',1.86,'6',62.73,-6.00,627,3,'1:0',1627.26,1,NULL,NULL),(1014,1,1,5.00,1390733824,1390896734,1390759200,20,'BORDEAUX','fr','ST ETIENNE','fr',2,'FRANCE','These are misses that cannot be covered.So facing an inform team like St Etienne winners of 4 out of the last 5 the other being a draw I expect them to lose and they should be outsiders not favourites','<p>Bordeaux started 2014 in bad form and the 2 defeats in\r\nthe league were followed with the degrading elimination in the cup by a 5th\r\ndivision team .An important reason for this is that they scored a meagre 27\r\ngoals  in 21 games and for these games\r\ntheir two top scorers JussiÃª (15/5) Diabate  (15/7) scorers of 12 out of the 27 are out.In\r\naddition  Hoarau, 3/0 who was signed to\r\ncover is injured as these was not enough the very important  Obraniak (21/4),is out for this game as well\r\nas  Faubert (11/1).These are misses that\r\ncannot be covered.So facing an inform team like St Etienne winners of 4 out of\r\nthe last 5 the other being a draw I expect them to lose and they should be\r\noutsiders not favourites</p><p><strong></strong></p>','','ST ETIENNE','0.00',2.02,'9',79.76,-9.00,798,3,'2:0',1797.58,1,NULL,NULL),(1016,1,0,0.00,1390736601,1391097227,1358467200,24,'BetFair','gb','Mikhail','il',2,'Multiples betting league','First multiples bet. Let\'s start!','<p style=\"margin-left: 40px;\">\r\n<a href=\"http://hostingkartinok.com\" title=\"ÑÐ¾ÑÑÐ¸Ð½Ð³ ÑÐºÑÐ¸Ð½ÑÐ¾ÑÐ¾Ð²\"><img src=\"http://s4.hostingkartinok.com/uploads/images/2014/01/06985a09ce7ab6ff4baa2104899de776.jpg\"></a></p><p style=\"margin-left: 40px;\"></p><p style=\"margin-left: 40px;\">Good Luck!</p>','52e8e90f7806c.jpg','Mikhail','-0.50',43.45,'66',0.00,0.00,0,3,'1:4',934.00,1,NULL,NULL),(1017,1,0,0.00,1390768190,1390768404,1390739400,22,'Cambuur Leeuwarden','nl','Heerenveen','nl',NULL,'Dutch Eredivisie','High tension Frisian derby  ','<p>There is a lot at stake in this derby, the tension will\r\nbe high as the attention for this match has been very high in the local media.</p><p>Cambuur has managed to sign a new striker, former\r\nNigerian international Bartholomew Ogbeche, he might be able to start after\r\nscoring five goals in a test match in Cambuur\'s B squad. Another new signing,\r\nManu on loan from Feyenoord, already proved to be a real addition to the team\r\nin the convincing 2-0 victory over Go Ahead Eagles. </p><p>Rightback Droste is back after suspension.</p><p>Heerenveen started the year with a 2-2 draw at home\r\nagainst Roda JC, they again didn\'t look solid in defence but their stars\r\nFinnbogason and young Ziyech again saved the day. Heerenveen welcome back\r\ndefenders Dijks and Kruiswijk after injury.</p><p>Due to the tension of the match, I expect a lot of mistakes\r\nby both teams, which means many scoring opportunities. The rainy weather\r\ndoesn\'t affect the match much as Cambuur is playing on an artificial pitch.\r\nThis match could go either way, but goals are assured.</p>','52e570350c29c.jpg','Over','2.75',1.84,'9',13.59,7.56,136,2,'3-1',1119.31,1,NULL,NULL),(1018,1,0,0.00,1390774742,1390895662,1390856400,21,'Sociedad','es','Elche','es',1,'','âReal Sociedad welocomes Elche in the closing game of the 21st round of the BBVA Liga. Sociedad were succumbed to two winless results recently one of which really painful in Vila-Real were they were trashed by 5-1 but the last week 2-2 in Getafe should also left them with a biter taste in the mouth. Sociedad took an early lead by 2 but fell under surprise when Getafe counterattacked to snitch a 2-2 draw...','<p>Real Sociedad welocomes Elche in the closing game of the 21st round of the BBVA Liga. Sociedad were succumbed to two winless results recently one of which really painful in Vila-Real were they were trashed by 5-1 but the last week 2-2 in Getafe should also left them with a biter taste in the mouth. Sociedad took an early lead by 2 but fell under surprise when Getafe counterattacked to snitch a 2-2 draw.</p><p><br>Elche, on the other hand, won comfortably enough at home against Rayo by 2-0 and just before that they held Sevilla on draw in another home game. Still, Rayo was left with 10 players from the 17\' and this outcomed to zero scoring attempts in the entire game while Sevilla should lay all the blame for not escaping Elche with the three points to their striker Bacca who wasted clear cut opportunities...<br><br>Sociedad have a full squad, only long term De La Bella is out. Key players who got a rest in the midweek cup game against Racing are back. Elche traveled without two pretty useful players of their squad, Javi Marquez who usually comes as a sub but also enjoyed regularity recently winning the MVP title of the team, plus young and dangerous striker Herrera. Both dropped due to a gripe.<br><br>In 14 games in the Anoeta, Elche has lost 12 times and only drew twice without winning a single game. Real are in excellent state of form. The defeat in Vila-Real was a parenthesis, they are put their rivals in huge pressure in the Anoeta and are also capable of turning over results who are not in their favor. Odds on Real went a bit down in the last half hour. I think there is no need to wait any further to take this bet.</p>','52e589a6ce91d.png','Sociedad','-1.00',1.94,'8',63.48,7.52,635,2,'4:0',1619.26,1,NULL,NULL),(1020,1,1,5.00,1390839099,1390896614,1390863600,20,'Real Sociedad','es','Elche','es',1,'Spain','Sociedad of course have all the class and the firepower while Elche plodding along, scoring occasional results, enough to keep their head above water, but never being able to surpass a certain mediocrity.','<p><strong>Real Sociedad - Elche</strong></p><p><strong style=\"font-size: 15px;\">Sociedad&nbsp;</strong>seemed to start\r\nbrightly in Getafe as they scored 2 quick goals. But it was an illusion. I\'m\r\nnot entirely sure how many goals are scored with 12-yard headers from\r\nlazy/hopeful 30-35 yards-out crosses. I can\'t imagine many. But Sociedad\r\nmanaged the feat twice here. They then sat back and were utterly embarassing.\r\nThey could not put 3 passes together. Hoofball up to a willing-but-isolated\r\nVela, with an exhausted Griezmann AWOL again. But the worst of all was Jose\r\nAngel, an atrocity at left back.</p><p>Against\r\nRacing, they again got off to a flying start only to slow down significantly as\r\nthe game wore on, lucky at the end to keep a 2-goal lead as the away pressed\r\nhard.</p><p>The\r\nusual LTs here, namely Estrada, the badly missed <strong>De la Bella,\r\nElustondo and Granero</strong>.</p><p>Hard\r\nto seriously judge<strong>Elche</strong>on their win\r\nover Rayo as it was achieved on the back of a wrong penalty/red decision early\r\nin the game. But they efficiently took advantage of the fortuitous\r\ncircumstances, and overall, for all their evident mediocrity, seem to be\r\nfinding some positive momentum again.</p><p>Here,\r\nElche<strong>will miss</strong><strong>cmf playmaker/10 Marquez Reg/Impt and fwd Cristian\r\nHerrera Reg</strong>,\r\nwho was likely to start ahead of Boakye. Both with flu.</p><p>Escriba\r\nwas planning, it seems, to go with Carlos Sanchez in a midfield trivot. But\r\nlosing Marquez upsets his plans.</p><p>Herrera\r\nwas favourite to play in attack. Manu del Moral may be the pick, useful for his\r\npace and mobility, with Boakye another option but best used as a goalpoacher\r\noff the bench.</p><p>Sociedad\r\nof course have all the class and the firepower and should be able to beat\r\nan  Elche  plodding  along, scoring occasional results, enough to\r\nkeep their head above water, but never being able to surpass a certain\r\nmediocrity.Their away record of 2-3-4 does not look bad until you analyse it\r\nthey won against Celta 15<sup>th</sup>,Betis 20<sup>th</sup> they drew Almeria\r\n16<sup>th</sup> Getafe 8<sup>th</sup> Bilbao 4<sup>th</sup> and lost Vallecano\r\n19<sup>th</sup>,Osasuna 18<sup>th</sup>,Levante 13<sup>th</sup> and Barcelona 1<sup>st</sup>.So\r\nwith the exception to Bilbao where they took a fluke lead of 0-2 and peeged\r\nback to 2-2 and were lucky to escape with a draw and the 4-0 drapping by\r\nBarcelona they have not faced anybody of note</p><p>4-2-3-1: Bravo; C MartÃ­nez, Mikel, IÃ±igo MartÃ­nez, JosÃ©\r\nÃngel; Bergara, Zurutuza; Xabi Prieto, Vela, Griezmann; Agirretxe.</p><p>Subs : Zubikarai-Ansotegi,- Ros, GaztaÃ±aga,Pardo-Seferovic,\r\nChory Castro</p><p>4-3-2-1: ToÃ±o; DamiÃ¡n SuÃ¡rez, LombÃ¡n, BotÃ­a, Edu Albacar;\r\nCarlos SÃ¡nchez, RubÃ©n PÃ©rez, Aaron; Carlos Gil, Coro; Manu</p><p>Subs : Manu Herrera.- PelegrÃ­n, Cisma- MantecÃ³n, Rivera, Fidel, -Boakye</p><p>.&nbsp;</p>','','Real Sociedad','-1.00',1.92,'7',80.90,0.00,809,2,'4:0',1809.02,1,NULL,NULL),(1021,1,1,5.00,1390841692,1390896668,1390858200,20,'CROTONE','it','SIENA','it',1,'ITALY B','âSiena is being weakened this transfer window and the following players have been left out from tonights game 2 of them are very important Gianetti and Paolucci.','<p>Siena is being weakened this transfer window and the\r\nfollowing players have been left out fr