896687,1390858200,20,'AUXERRE','fr','LENS','fr',2,'FRANCE A','The prices should be a lot closer maybe slight favourite Auxerre because of the home record','<p>Auxerre  have only won\r\nonce in the last 5 games 1-2-2  and are\r\ncoming from 120 minutes in the cup.Lens have only lost once away in the last 5\r\n2-2-1 their wins coming in the last 2 aways they are coming from the 2-1 win\r\nafter 120 minutes against 1<sup>st</sup> division Bastia but in contrast with\r\nAuxerre who played with regulars they played with a lot of reserves. The prices\r\nshould be a lot closer maybe slight favourite Auxerre because of the home\r\nrecord</p>','','LENS','0.00',1.81,'6',80.90,4.86,809,2,'1:2',1798.16,1,NULL,NULL),(1023,1,0,0.00,1390896062,1390896117,1390755600,20,'APOLLON','cy','DOXA','cy',1,'CYPRUS','Apollon has come back into form and should have any problem defeating Doxa who since the departure of important players Kingston 10/0 and Fernantes 14/5,Charalambous 13/2 due to economic difficulties lost 2 games 5-1 and 6-1 and their manager was sacked.In addition for this they miss top scorer Lobo 15/8','<p>Apollon has come back into form and should have any problem defeating Doxa who since the departure of important players Kingston 10/0 and Fernantes 14/5,Charalambous 13/2 due to economic difficulties lost 2 games 5-1 and 6-1 and their manager was sacked.In addition for this they miss top scorer Lobo 15/8</p>','52e763ad9fd77.jpg','APOLLON','-1.00',1.65,'8',0.00,0.00,0,1,'2:1',1801.02,1,NULL,NULL),(1024,1,1,5.00,1390910273,1390987355,1390938300,26,'Man Utd','gb','Cardiff City','gb',2,'Premier League','The big return of the \"baby faced assassin\"','<p>Premier League â Man Utd vs. Cardiff City</p><p>Man Utd had to do something in order to begin a comeback\r\nto what has been a disappointing season so far so they bought Juan Mata for the\r\nclub record fee of 37 million pounds. What I wonder is, where will Mata play?\r\nThe Spaniard was introduced to European football as a left winger playing for\r\nValencia but over the years he established himself as a central attacking\r\nmidfielder, and when you pay so much money for a player you should use him in\r\nhis natural position, but then where will Rooney play? All these are major\r\nquestions for Utd and Moyes has to provide the answers. In my opinion Juan Mata\r\nis a great footballer, a great professional and a great character but he is not\r\nwhat Man Utd needed at this moment. Utd needs not one but two central\r\nmidfielders. Besides Carrick, who is 32 and now gets injured very often, nobody\r\nis capable to dominate the midfield ground which results to Red Devils having\r\nmassive problems at the back. Today Carrick will be out and Fletcher with Cleverley\r\nor Giggs will be handed that role.  </p><p>Cardiff may have lost in Etihad but they showed a\r\ngreat spirit and after the FA cup win against Bolton they travel to Theatre Of\r\nDreams with high morale and with nothing to lose. Nobody expects them to win\r\nbut if they manage to get something out of this one it will be a huge boost for\r\nthem in their fight to stay up. Fabio from Man Utd and Jones from Stoke are the\r\nnew arrivals following the signings of the three Norwegians. Solskjaer returns\r\nto Old Trafford but as an opponent this time and a really warm welcome is\r\nexpected for the âbaby faced assassinâ. </p><p> Utd have done nothing to deserve this kind of\r\nodds and Cardiff showed good signs in the last two games. </p><p> Probable lineups:</p><p>Man Utd: De Gea, Rafael, Smalling, Evans, Evra,\r\nFletcher, Cleverley (Giggs), Valencia, Rooney, Januzaj (Mata), Welbeck</p><p>Cardiff: \r\nMarshall, Catherine, Caulker, Turner, McNaughton, Medel, Wittingham,\r\nKim, Noone, Mutch, Campell</p><p>Pick: Cardiff +1.75, Odds: 1.99 @ SBO Stakes: 5/10</p><p>--</p><p>BetOnFootball.eu</p>','52e79b28dedb7.jpg','Cardiff City','1.75',1.99,'4',14.15,-4.00,142,3,'2:0',1141.50,1,NULL,NULL),(1025,1,1,7.00,1390933641,1391185935,1390945500,20,'Southampton','gb','Arsenal','gb',2,'English Premier','Their defense looks very suspect when put under pressure ','<p>Arsenal are top of the\r\nleague both in total points as well in terms of away form, with a record of\r\n8-1-2 their only 2 defeats coming against the Manchester teams. Since the\r\ndefeat by Man city they have not conceded a goal thats 700 minutes of football .\r\nSouthampton have built a very strong record at St Mary\'s this season but\r\nChelsea and Tottenham both won here while Manchester City drew at a time when found\r\nwinning on the road difficult.Their defense looks very suspect when put under\r\npressure and that will be more obvious without Louvren I think that if either\r\nChelsea or Man City were playing here will be well odds on and I cant\r\nunderstand why Arsenal with a much better away record and more overall points is\r\n-1/2 2.00. Arsenal are a better side than Southampton and I\'d fancy to win this\r\nfixture lot  more often than they\'d fail\r\nto, so -1/2 2.00 is good value</p>','52e7fb9836838.jpg','Arsenal','-1.00',2.00,'9',0.00,0.00,0,3,'2:2',1800.02,1,NULL,NULL),(1026,1,1,7.00,1390951052,1391185935,1391024700,26,'Tottenham','gb','Manchester City','gb',NULL,'Premier League','Chance for City to go top of the table','<p>Premier League â Tottenham vs. Manchester City</p><p>We have seen 24 goals in the last 5 premier league games\r\nbetween these two sides. Man City is unstoppable up front with Negredo and\r\nAguero as top guns. Tottenham is scoring more than two goals per game under\r\nSharewood. Man City will miss Nasri, Milner and Garcia so Pellegrini is forced\r\nto choose a very attacking lineup with Aguero, Negredo, Silva, Navas all\r\nstarting. Tottenham has also a few doubts. Defensive midfielders Sandro and\r\nPaulinho will be checked as well as Vertonghen. I expect another stunning game\r\nbetween this couple with lots of chances.  </p><p>Pick: Over 3, Odds: 1.98 @ SBO Stakes: 9/10</p><p> --</p><p> BetOnFootball.eu</p>','52e83a418fb10.jpg','Over ','3.00',1.98,'9',0.00,0.00,0,2,'1:5',1136.50,1,NULL,NULL),(1027,1,1,5.00,1390991313,1391185935,1391024700,26,'Aston Villa','gb','West Brom','gb',NULL,'Premier League','West Midlands derby at Villa Park','<p>Premier League â Aston Villa vs. West Brom</p><p>Aston Villa comes from a magnificent performance in\r\nAnfield against Liverpool and a great result. Of course Villa prefers to play\r\ncounter attack and thatâs why at home they find it very difficult to score\r\ngoals and more importantly to create chances. Tonight they have to play without\r\ntheir most dangerous man Gabby Agbonlahor who will sit out injured.</p><p>West Brom took a valuable point against Everton at\r\nhome on Pepe Melâs debut. The team showed much more energy and spirit than\r\nprevious games. The new manager highlighted Villaâs capability to hit on\r\ncounter attacks so I expect him to be very cautious tonight.</p><p>7 games ended under 2.5 for Villa at home this season\r\nand 4 over 2.5 but is important to consider that all games that ended over 2.5\r\nwere against big opponents (Man City, Arsenal, Man Utd, Necastle).  </p><p>Pick: Under 2.5, Odds: 1.93 @ Pinnacle Stakes: 5/10</p><p> --</p><p> BetOnFootball.eu</p>','52e8d77fa9a91.jpg','Under','2.50',1.93,'5',0.00,0.00,0,3,'4:3',1136.50,1,NULL,NULL),(1028,1,1,6.00,1391002391,1391185935,1391029200,21,'Barcelona','es','Levante','es',1,'Copa Del Rey','The first game ended with an emphatic victory for the Catalans at the Ciudat de Levante so there is nothing on stake regarding who\'s going to the next round in this return leg at the Camp Nou. Both teams will be fielded with noumerous changes in their lineups and it was just a few minutes confirmed that Messi will start on the bench...','<p>The first game ended with an emphatic victory for the Catalans at the Ciudat de Levante so there is nothing on stake regarding who\'s going to the next round in this return leg at the Camp Nou. Both teams will be fielded