the rest, it should be their\r\nbest XI, and a near sell-out crowd. </p><p>No away fans yet in new San Mames.  </p><p>For Atletico, <strong>cmf Tiago Reg/Impt</strong> is out, <strong>cmf Guillavogi</strong> is out, <strong>cmf\r\nMario Suarez</strong> isn\'t ready to start yet. So it means that Koke <strong>will play in\r\nthe centre. </strong>Capable, certainly, though Cholo admits that the player is\r\nnot nearly as effective in the centre.  </p><p><strong>Lmf Arda Impt/Key</strong> is also out <strong>injured.</strong> Possible\r\n<strong>replacement/sub Oliver is also out. </strong></p><p><strong></strong></p><p>So,the 2 wide providers, Koke and Arda, are replaced by R Garcia and\r\nCebolla. </p><p>Atletico need to replace their creative wide men may see them without\r\nany attacking outlet other than long balls to DC.They face a red hot Bilbao\r\nwith the very good home record of 9-2-0 27-11</p><p>Atletico have largely been getting away with it in Copa in 2014, making\r\nfull use of the fact they are up against dodgy 2nd choice keepers.The value for\r\nsure lies with the home </p><p>Athletic: Iago Herrerin; Iraola, Gurpegui, Laporte, Balenziaga;\r\nIturraspe, Rico; Susaeta, Herrera, Muniain; Aduriz.</p><p>AtlÃ©tico Madrid: Courtois; Juanfran, Miranda, GodÃ­n, Filipe; RaÃºl\r\nGarcÃ­a, Gabi, Koke, Cebolla; Villa, Diego Costa.</p>','52e925d427d63.jpg','Athletico Bilbao','0.00',1.83,'8',80.10,-8.00,801,3,'1:2',1801.02,1,NULL,NULL),(1030,1,1,7.00,1391012341,1391185935,1391031900,20,'Tottenham','gb','Man City','gb',2,'Premier','I cant forget the way that Man City','<p>I cant forget the way that Man City sliced through the\r\ndefense of Tottenham in the 1<sup>st</sup> match and i did not see much\r\nimprovement defensively in the game against Swansea .Tottenham âs attacking\r\nsystem will play in the hands of the classy midfield and forwards of Man City\r\n,I make Man City a much shorter price around the -1/2,-1  2.00</p>','52e929ea25f92.jpg','Man City','-1.00',1.