mg src=\"/images/tips/52ea7489a4ff9.jpg\" style=\"font-size: 15px;\"></p><p>Good Luck!</p>','52ea746625634.jpg','Mikhail','-0.50',9.92,'50',36.30,-50.00,363,3,'3:2',1363.00,1,NULL,NULL),(1057,1,1,7.00,1391173887,1391238700,1391198400,21,'Granada','es','Celta','es',2,'BBVA Liga','Granada received upset news in the midweek about Yebda and most probably Diakhate leaving the team to join metropolis club Udinese! These news surfaced the need of reinforcments in the winter transfers to fill in the gaps so Celta was kind of left in backstages. ','<p>Granada received upset news in the midweek about Yebda and most probably Diakhate leaving the team to join metropolis club Udinese! These news surfaced the need of reinforcments in the winter transfers to fill in the gaps so Celta was kind of left in backstages. Bearing in mind that Celta are looking to revenge the 2011 La Liga promotion playoff defeat and the current situation of these teams, we can figure out that this game is too important for both.</p><p>Granada are without these two players who left, while strikers Ighalo and Riki are injured. Important midfielder Rico is back. Celta traveled in ful squad. A couple of bench players left the team a couple more were dropped. Important winger Augusto returned, new signing center back Inigo Lopez debutizes. Granada is an excellent midtable team able to cause an upset in any team except the first 3 in their home ground. Their weakenesses lie in stopping the counter attacks of a team that has skilful players and break tough defenses.</p><p>Well, Celta cannot defend properly especially on the road, but they do have lethal offensive and pacy players in the likes of Orellana, Rafinha, Charles who also enjoy an amazing form and youngster and recently linked to Manchester City, Santi Mina. Moreover, Celta deserved much more out of their last four exits instead of losing all of them.</p>','52eba0f066cc0.jpg','Celta','0.25',2.06,'7',64.22,7.42,642,2,'1:2',1627.78,1,NULL,NULL),(1058,1,1,7.00,1391181535,1391363425,1391349600,26,'Roma','it','Parma','it',NULL,'Serie A','Big game in Olimpico. Four straight wins for both Roma and Parma','<p>Roma is scoring a lot lately but the truth is that in the\r\nprevious games they faced a lot of soft and out of form opponents like Livorno,\r\nGenoa, Verona. Now they face Parma, a very strong team that is also in great\r\nform. Parmensi have four wins in a row and they are unbeaten in the last ten\r\nleague games.</p><p>I believe Parma will go very defensively here and Roma\r\nwill be very careful also. In the last game against Udinese, Donadoni left\r\nBiabiany on the bench and played 3-5-2 instead of 4-3-3 with Casano and Amauri\r\nin front. This makes his team slower but much more solid in the midfield area.\r\nProbably he is going to repeat it in order to try to block Roma.</p><p>This is a very crucial game for Roma, if they win they\r\nwill put Juve under pressure on Sunday night against Inter and thatâs why I expect\r\nthem to be very careful on their approach.</p><p>Naingolan is suspended for Roma</p><p>Felipe is suspended for Parma</p>','52ebbed8bfe4b.jpg','Under','2.75',1.95,'8',0.00,0.00,0,1,'Postp.',1129.08,1,NULL,NULL),(1059,1,1,7.00,1391181911,1391357261,1391351400,22,'NEC Nijmegen','nl','Go Ahead Eagles','nl',1,'Dutch Eredivisie','A very important relegation battle.....','<p>NEC Nijmegen is the team of the moment, starting 2014 with two wins (in League and Cup) and a draw at strong Vitesse. The last result may even have been better, Vitesse had most of the ball but didn\'t manage to come into their game. NEC will play in the same formation, newly signed defender Anders Nielsen (Aalborg) is on the bench, just like winger Jahanbakhsh, who isn\'t fully fit.</p><p>Go Ahead started the second half of the season very badly. A deserved 2-0 loss at Cambuur was followed by a 0-1 loss at home against Ajax. It was concerning to see that Go Ahead didn\'t manage to create a real chance in both games, only some long distance efforts. On top of that they saw on loan goalkeeper Room go back to his team Vitesse, which means they had to search for a new goalie and finally ended up with Danish Stephan Andersen, who will make his debut right away. Attacking midfielder Falkenburg returns after suspension.</p><p>With NEC in such good form, creating a lot of chances and Go Ahead performing very badly, especially in away games, this is a perfect opportunity betting on the home team. </p>','52ebc8602cc63.jpg','NEC Nijmegen','-0.5',1.76,'9',12.50,-9.00,125,3,'1:1',1125.03,1,NULL,NULL),(1060,1,0,0.00,1391185550,1391356130,1391344200,22,'Utrecht','nl','Ajax','nl',2,'Dutch Eredivisie','Can depleted Utrecht be a match for high flying Ajax ?','<p>Utrecht is in very poor shape, four losses in a row now (including Cup). Their attack is pretty harmless, which is a major concern.<br>Utrecht is very active on the transfermarket, the whole season they are suffering from players picking up injuries. New signings in defence Delpierre (Hoffenheim), Dorda (Heracles), midfielder Quesada (Barcelona) and striker Koevermans (no club). Only Quesada is ready to play. Missing list (only the possible regulars): defence Bulthuis, Heerings, midfielders Martensson, Janssen, strikers Duplan, Mulenga, van der Gun. It will be very difficult to field four adequate defenders, some youngsters will come in.<br><br>The situation at Ajax is the complete opposite, winning last six official matches, no loss in three months. Another bonus is that there are no injuries, attacking midfielder de Jong is back and will play in central attack. <br><br>With Utrecht in such a bad state and still being without three new signings and seven regulars, it is no doubt Ajax will take control of the match. I expect a large away win.</p>','52ebd0784ac45.jpg','Ajax','-1',1.79,'7',13.40,-7.00,134,3,'1:1',1134.03,1,NULL,NULL),(1062,1,0,0.00,1391210322,1391363248,1391349600,26,'Chievo','it','Lazio','it',1,'','Hernanes a big loss for Lazio','<p>Chievo performed better than I was expecting against\r\nNapoli showing great concentration and persistence. They had also a bid of luck\r\nsince Napoli players hit the bar twice and Higuain missed a clear chance without\r\na goalkeeper but generally Coriniâs side showed really good signs. Chievo\r\nsigned goalkeeper Agazzi from Cagliari, and Defenders Canini from Atalanta and Rubin\r\nfrom Siena, both on loan. Marcelo Estigarribia left the club to join Atalanta.</p><p>Lazio did not manage to take advantage of the extra\r\nplayer against Juventus and they just got a point from what seemed like a game\r\nthat could lift their season. But the worst were about to come for\r\nBiancocelesti. President Lotito decided that it was the time to cash in on\r\nHernanes and he sold the Brazilian star to Inter for 18 million euro. Lazio\r\nbrought Helder Postiga on loan from Valencia and Kakuta on loan from Chelsea. Also\r\nFloccari was given to Sassuolo. The sale of Hernanes and the quality, or maybe\r\nwe should say the lack of quality, of the new arrivals shows that the team has\r\nno vision and no targets for the running season. They are far away from European\r\nspots, they are out of coppa Italia after losing midweek to Napoli and they\r\nlost their star man to Inter. All these could have a really negative impact on\r\nthe team not just for tomorrow but as well as for the games to follow.</p><p>Chievo has the full squad available.</p><p>Lazio misses Radu and Ederson. </p><p>After\r\nthe confirmation of Hernanes sale the odds may change so I am not waiting until\r\nSunday and I place my bet today.</p>','52ec2f1d1003a.jpg','Chievo','+0',2.31,'7',13.71,-7.00,137,3,'0:2',1137.08,1,NULL,NULL),(1063,1,1,6.00,1391245659,1391274955,1391266800,21,'Barcelona','es','Valencia','es',NULL,'','Barcelona was fielded with many changes in the lineup but this didn\'t produce any difficulties to beat Levante B\' in the midweek...','<p>Barcelona was fielded with many changes in the lineup but this didn\'t produce any difficulties to beat Levante B\' in the midweek. Xavi, Busquets, Alves return in the squad, Messi return in the starting XI after watching the cup game from the bench.Barcelona should feel some pressure since Real cought them in the top places of the table and Atletico keep on their impressive run.</p><p>On the other hand, Valencia went through massige changes in their squad during the week.Canales signed in Sociedad, PabÃ³n went on loan to Sao Paulo, Postiga on loan to Lazio and Guardado in Bayer 04 Leverkusen. Banega is on the exit door most probably returns in Argentina. Former Barcelona FC midfielder Seydou Keita has joined Valencia CF on a 6 months deal following  Eduardo Vargas loan deal from Napoli earlier in the week. Chilean striker Vargas and center back Ruben Vezo, both new signings, made it in the squad and most probably Vargas will feature today. I don\'t know about Pabon, Postiga, Canales and even Banega, the players haven\'t been playing at high level but Guardado\'s departure might have been for financial reasons.</p><p>Anyway, all these movements were planned by new coach Pizzi who is set to put his mark in the team. His work grew some fruits in recent weeks and now with the reinforcments he brought in we should expecte more starting from today maybe. Personaly, what I expect is Valencia to bring in a motivated and inspiring display just like against Real and Atletic Madrid and score a goal. The rest will take care Messi, Pedro and co!</p>','52ecb90f0a516.jpg','Over','3.5',1.81,'6',63.91,4.86,639,2,'2:3',1628.20,1,NULL,NULL),(1064,1,1,7.00,1391247386,1391317744,1391274000,20,'Barcelona','es','Valencia','es',1,'Spain A','Barca had a comfortable evening at home to Malaga, ','<p><strong>Barca</strong> had a comfortable evening at home to\r\nMalaga, dominating throughout, and only were only in danger at set pieces.  Messi still lacks pace and sharpness\r\nfollowing his injury so has stepped back into midfield where he is equally\r\ndeadly with his assists for Alexis and Pedro.</p><p>Barca\r\nfollowed on with a therapeutic 5-1 thrashing of Levante in Copa under a\r\ndownpour. The pitch held up pretty well, considering. Only 24.000 turned up,\r\nstray tourists to a man. </p><p>Messi\r\nwas left on the bench.</p><p><strong>Neymar </strong>remains\r\nthe only player out here as they revert to the normal XI with the main choice\r\nbetween Iniesta and Cesc for a place in midfield.</p><p>An\r\nopen 1<sup>st</sup> half in the 2-2 between <strong>Valencia</strong> and Espanyol, with\r\nthe home side earnestly attacking, and Aguirre\'s men responding with their\r\neffective brand of inter-continental ballistics. </p><p>The\r\nhome defence, especially Mathieu, could not deal with the pace and aggression\r\nof Cordoba. Parejo had a good game but alongside him Romeu failed to make an\r\nimpact. Banega in particular was disappointing and offered little. taken off\r\nafter an hour. Piatti was in and out of the game while Alcacer battled hard but\r\ndespite going close on a couple of occasions Valencia couldn\'t seriously\r\ndominate a solid Espanyol in the 2<sup>nd</sup> half.  </p><p>Valencia\r\nhave 2 points from 3 games and Pizzi has struggled to make a noticeable\r\nimprovement to the team since he replaced Djukic, coming under strong criticism\r\nfor his erratic decision-making. </p><p><strong>Pabon, Postiga, Canales and Guardado</strong> all left\r\nthe club this week and they are trying to shift Banega too. Not entirely sure\r\nwho is deciding the exits.  </p><p>Banega\r\nto Newells. Talented player, though you can\'t blame them for giving up and\r\nmoving on. From wank-gate, to the drunk training sessions, to the self-running\r\nover (his exploits exceed the limits of language), to the carbonised\r\nFerrari,  to those horrific turnovers on\r\nthe pitch.</p><p>Potentially\r\nuseful Chile <strong>intnl fwd Vargas</strong> and, mysteriously,  34 yr old ex Sevilla/Barca legend mf Keita\r\nhave both arrived. Vargas has trained all week so has a chance to start, while\r\nKeita has been in Qatar/UAE and will not be involved. Essentially retired. </p><p>They\r\nsigned Senderos. Which is pretty insane. He won\'t be near this game, at\r\nleast.  What next, Cygan?</p><p>Valencia\r\nreportedly signed fwd Vinicius Araujo from Cruzeiro for 3.5m, but he has not\r\narrived yet. </p><p><strong>Rback\r\nPereira R/I</strong> is suspended replaced by <strong>Barragan.</strong></p><p>They\r\nare likely to go with a cmf trivot of Fuego, Romeu and Parejo, with, assuming\r\nVargas is on the bench, a somewhat underwhelming front line of Feghouli,\r\nAlcacer and Piatti. </p><p>Valencia\r\naren\'t all that good. New coach, but no real backbone, game plan, or team yet.\r\nA lot of distractions and activity in the transfer window, too.</p><p>Barcelona\r\nup against a fragile away side, and with Messi \r\njust can\'t help but win by 3. The main danger to them is Diego Alves. </p><p>Barcelona:\r\nValdÃ©s; Alves, PiquÃ©, Mascherano, Alba; Busquets; Xavi, Cesc; Alexis, Pedro,\r\nMessi.</p><p>Valencia:\r\nD Alves; BarragÃ¡n, Ricardo Costa, Mathieu, Bernat; Parejo, Oriol, Javi Fuego;\r\nPiatti, Alcacer, Feghouli</p>','52ecc0041cbcd.jpg','Barcelona','-2.25',1.88,'8',80.36,-8.00,804,3,'2:3',1803.63,1,NULL,NULL),(1065,1,0,0.00,1391247477,1391317832,1391274000,21,'Levante','es','Rayo Vallecano','es',NULL,'BBVA Liga','If this game is important for Levante, it is crucial for Rayo Vallecano...','<p>Striker VÃ­ctor CasadesÃºs from Mallorca and former Valencia, Juventus, Fiorentina and PSG midfielder Momo Sissoko joined Levante. Nong on loan to Recreativo and Lell left the club, both between the bench and the stands in the first ground, so no prob for Caparros. Levante have started playing a bit more aggresive recently and this has a lot to do with Ivanschitz enjoying regularity and his passing and crossing abilities.</p><p>In the last 5 league games the Austrian became a starter and his crosses produced too much danger in the opposite defenses. That\'s something, plus the defensive stability Caparros managed to bring off to his players. Their recent achievments, the home league draw against Barcelona and the away win in Sevilla, had a huge impact to the morale of the players. The midweek cup game in Barcelona should leave no wounds at all as long as Levante was massively rotated by Caparros. Key striker Baba has been fully fit to start today and in the next games he will have new signing Victor in his side.</p><p>If this game is important for Levante, it is crucial for Rayo Vallecano. Rayo have been playing well in recent games but they have only won 3 points out of 15 maximum. Reinforcments arrived but not what expected... Rayo was supposed to take Leo Baptistao a month ago, but Leo went to Betis and they brought Longo instead. The Italian striker didn\'t make any impact in Espanyol last season, ok he is tall, but not really skilful player. Hmmm, in second thought, striker Larrivey, who recently recovered regularity in Rayo, is a great head goalscorer, I think 4 headers succeed and a couple more hit the posts! So, what is obvious here is that Paco Jemez is going for crosses towards his high tall strikers. We\'ll see.</p><p>For today, Longo made in it the squad, Adrian and Ze Castro, both useful maybe coming from the bench, center back Galvez remains out. What I expecte today is a morale boosted Levante trying to win ball possesion to Rayo, a team that even won Barcelona in this aspect! Rayo enjoys 64% of the ball at home and 54% on the road! It will be really interesting watching them defending against pressuring Levante here. The over is offerd in some awesome prices, its worth to bet on taking under consideration the motive and the form of these two teams.</p>','52ecc05d6d5fe.jpg','Over','2.5',2.08,'7',63.21,-7.00,632,3,'0:0',1632.06,1,NULL,NULL),(1066,1,1,7.00,1391247622,1391356130,1391295600,20,'Malaga','es','Seville','es',2,'Spain','âA respectable defensive performance from Malaga away to Barcelona ','<p>A\r\nrespectable defensive performance from <strong>Malaga</strong> away to Barcelona was\r\nundermined by Sergio Sanchez who made basic mistakes.  Mr 30 Minutes, Santa Cruz, went off injured\r\nwith Pawlowski coming on and he was typically erratic in his decision-making.\r\nDuda was the main threat, from set pieces.</p><p>Malaga\r\nhoped to sign big No 9 Rascaldani from Velez, no news yet. </p><p><strong>Rback\r\nGamez R/I, cdef Weligton R/I</strong> are <strong>both out </strong>again. Angeleri plays\r\nrback, erratic. Flavio in cdef again, looks ok, though Sanchez remains the weak\r\nlink there. </p><p>New\r\nsigning wide <strong>mf Nordin Amrabat</strong> could be involved but he\r\nis unlikely to start.</p><p>El\r\nHamdaoui may even make the bench. is expected to be on the bench. Juanmi leads\r\nthe line. <strong>Santa\r\nCruz</strong>, is out again. They still need a new striker.  </p><p>Semireg\r\nmf Portillo was the subject of some outlandish transfer speculation. Talented,\r\nbut surely not yet 16m worth of ready-made player. </p><p><strong>Sevilla</strong> went behind against Levante but\r\nbuilt up a real head of steam to turn the game around. The relief was palpable\r\nand it looked a matter of time before they got a 3<sup>rd</sup>.</p><p>But\r\nFazio reared his ugly head again. He has been dormant in recent times but was\r\ndreadful overall as Levante scored 3 times, 1 from a Fazio-pen and 2 from\r\ncorners.  There is something about that\r\nFazio-Pareja pairing that simply does not work. Sevilla are far more solid with\r\nCarrico in the defence, but he had been called out to play in midfield\r\nagain.  </p><p>All\r\ntold, a freakish defeat, with 28 shots, twice hitting the woodwork. It took an\r\nold-fashioned Fazio eruption to bring them down. </p><p><strong>Lback/lmf\r\nMoreno</strong>\r\nR/I <strong>returns</strong> after suspension, may well start in the half fwd line.  </p><p>They\r\nare again <strong>without</strong> <strong>cmf Mbia Impt</strong>. At least <strong>cmf Iborra</strong> is set to <strong>return</strong>.\r\n<strong>Cdef/cmf Carrico</strong>\r\nImpt is <strong>out</strong>. </p><p>So\r\ninstead of a 4-2-3-1 with Rakitic as 10, they may well put Rakitic in cmf in a\r\n4-4-2 with Gameiro and Bacca. But the 2 fwds don\'t work that well together,\r\nboth are too individualistic, so Emery may come up with another solution, ie\r\nCristoforo-Iborra in cmf.  </p><p>Malaga\r\nhave just 1 point since Christmas having finished 2013 on a reasonable run with\r\nseven points from nine. The main problem is still in attack, as they havenât\r\nscored in the last 4 matches. </p><p>The\r\n1st defeat in 9 games for Sevilla last week, and it was a bit of a freak\r\nresult. Sevilla who are  unbeaten in lat\r\n5 away 3-2-0 look to have too much quality to lose this against a toothless\r\nMalaga.  </p><p>MÃ¡laga:\r\nCaballero; Angeleri, Sergio SÃ¡nchez, Flavio Ferreira, Antunes; Tissone,\r\nCamacho; Eliseu, Pablo PÃ©rez, Duda; Juanmi.</p><p>Sevilla:\r\nBeto; Coke, Pareja, Fazio, Fernando Navarro; Cristoforo, Iborra; Reyes,\r\nRakitic, Alberto Moreno; Bacca</p>','','Seville','dnb',1.83,'8',79.56,-8.00,796,3,'3:2',1795.63,1,NULL,NULL),(1067,1,1,7.00,1391250509,1391356130,1391288400,26,'Malaga','es','Seville','es',2,'Primera','New players arriving at Malaga','<p>Malaga is underperforming the whole season so now they\r\nare in relegation troubles and thatâs why they bought many players recently.\r\nThe one who can make an impact is ex Galata Nordin Amrabat who is available\r\ntoday. But all the new players need time to get going so regarding tonightâs\r\ngame I cannot see Malaga performing better than they did the last few weeks.\r\nWeligton and Santa Cruz are both out. What is also worthy of mentioning is the\r\nfact that Schuster is not using as a regular the young winger Portillo. For me\r\nPortillo is by far the most quality player of the team and the lineup should be\r\nstarting from him. Malagaâs last home game was a 0-0 draw against Valencia in a\r\ngame that the home side deserved zero points. Valencia lost many more chances\r\nthan Malaga.</p><p>Seville lost to Levante at home but they have the\r\nsquad and the quality to response. Also Seville has really good away\r\nperformances lately, they draw to Atletico and they won in El Madrigal. Mbia,\r\nCaricco and Marin are out but Emery has more than a few capable players.\r\nProbably it would be Cristoforo who will go next to Iborra. There is also the\r\noption of Trochowski in a more attacking plan.&nbsp;</p>','52eccc1e237df.jpg','Seville','-0.25',2.19,'7',14.24,-7.00,142,3,'3:2',1142.42,1,NULL,NULL),(1068,1,1,7.00,1391251402,1391274754,1391265900,20,'Newcastle','gb','Sunderland','gb',2,'Premier ','This is a derby of hate ','<p>Sunderland are unbeaten in their last 5 away matches 2-3-0\r\nand are for the 1<sup>st</sup> time out of the relegation zone they have added\r\nScoco and Bridcutt who will help .Newcastle despite playing well are 1-1-5 in\r\ntheir last 5 games and except the vital loss of mvp Cabaye to Psg they have to\r\ndeal with the absences of Remi 21/11 top scorer and Coloccini 16/0.</p><p>This is a derby of hate and with Sunderland in such good and\r\nconfidence should not be +1/2</p>','52eccfbdafbdf.jpg','Sunderland','+1/2',1.92,'7',81.96,6.44,820,2,'0:3',1806.19,1,NULL,NULL),(1069,1,1,8.00,1391251589,1391274912,1391266800,21,'Stoke City','gb','Man Utd','gb',2,'English Premier League','âThe arrival of Juan Mata has really given Manchester United a lift, but most importand is the return in action of Rooney and Van Persie...','<p>The arrival of Juan Mata has really given Manchester United a lift as long as the Oviedo born player was the steering wheel in the attack of the red devils against Cardiff in the midweek. Van Persie returned from a long time in the sidelines to score after six minutes in the pitch while Wayne Rooney reappeard again and today could start next to Mata and Van Persie. This means that all three may start today giving the red devils the boost to pick up all three points from their trip at the Britannia Stadium. Stoke City last won there against Chelsea and Aston Villa early in December but they didn\'t show anything spectaculer since then, losing 5 home and away games and drawing one. Recently they failed against Pulis\' Palace solid defense and they lost again in the Stadium of light against a really soft Sunderland side.</p><p>Man Utd are in the turning point today. A lot of things were told about their limited squad and the need of reinforcments since the Christmas period adding more pressure to the team, but these talks were right! Man Utd do not have the squad to properly compete in EPL and Europe this season. Juan Mata\'s arrival was crucial he just have to keep on playing at the same level he played against Cardiff and I think the red devils should not have the Cardiff win effect wasted today. With the likes of Rooney, Mata and Van Persie in the lineup Manchester United should win in Stoke City.</p>','52ecd037ade08.jpg','Man Utd','-1',1.97,'8',63.42,-8.00,634,3,'2:1',1634.20,1,NULL,NULL),(1070,1,1,7.00,1391252776,1391274787,1391266800,26,'Fulham','uk','Southampton','uk',2,'Premier League','A lot of coming and going in Craven Cottage','<p>For me Fulham is the number one favorite for\r\nrelegation. They lost the last three, two of them by direct opponents such as\r\nSunderland and Swansea. They let Berbatov, Ruiz, Tarrabt and Cenderos go and\r\nthey brought in guys without premier league experience such as the Greek\r\nforward Kostas Mitroglou for the huge amount of 15 millions, the Norwegian\r\nWilliam Kvist and the German Luis Holtby on loan from Tottenham. Heitinga is a\r\ngood addition with a lot of experience but he will also need time since its\r\nbeen a long time since the last time he played for Everton. But the key here is\r\nthe exchange of a very classy and experienced striker like Berbatov with a\r\nyoung guy who has only played in Greece and a few games in champions league.\r\nFirst of all I believe that the money Fulham have spend to buy Mitroglou are\r\nmuch more than the real value of the player but that is yet to be proven,\r\nthough what is of great importance is the fact that most of the strikers that\r\ngo to premier league, even the most experienced once like Etoo, Dzeko, Soldado,\r\nthey need time to adjust to Premier and for a couple of months they are kind of\r\nlost in the game. Now imagine if those guys had troubles to adjust what will\r\nhappen to an inexperienced guy who has also yet to prove his value. Of course\r\nFulham also has the option of Darren Bent until Mitroglou gets going but I insist\r\nthat letting Berbatov go will probably proved to be a huge mistake for the\r\nCottagers in the relegation fight. Anyway Mitroglou is not available today with\r\nBent leading the attack.</p><p>Southampton performed very well for another game but\r\nagain they did not win. Same happened against Sunderland and it really smells\r\nlike the time for the Saints to get back to wins. Pochetino welcomes back two\r\nvery important members of his squad, Rickie Lambert and Victor Wanyama who will\r\nmake his comeback from a long injury. Italian striker Osvaldo was given on loan\r\nto Juventus. Ex Roma player caused many troubles to Southampton so far and I\r\ndonât really believe that his absence will damage the Saints.&nbsp;</p>','52ecd50e86053.jpg','Southampton','-0.25',1.88,'9',14.94,7.92,149,2,'0:3',1132.50,1,NULL,NULL),(1071,1,1,6.00,1391253232,1391275042,1391274000,20,'Everton','gb','Aston Villa','gb',2,'Premier','âEverton had their worst performance for the season ','<p>Everton had their worst performance for the season losing to\r\nLiverpool very easily 4-0 and their injuries problems got even worse by losing top\r\nscorer Lukaku 21/9 in addition to Distin 20/0,Coleman 21/5 Delofeou 10/2,Oviedo\r\n9/1.</p><p>Aston Villa beat West Brom 4-3 despite being behind 0-2 and\r\nthey are better playing away on the counter .The +1 for them is good value\r\nconsidering Everton absentees</p>','52ecd6ebe4841.jpg','Aston Villa','+1',1.95,'6',0.00,0.00,0,1,'2:1',1805.63,1,NULL,NULL),(1072,1,1,7.00,1391253390,1391275011,1391274000,20,'Stoke','gb','Man utd','gb',2,'Premier','âMan Utd with Van Persie and Rooney','<p>Man Utd with Van Persie and Rooney back from injury and the\r\naddition of Mata are a different team and I expect them to easily beat very\r\nmediocre  team Stoke who are not build to\r\nplay possession football but their useless manager has not realised it yet .In\r\naddition they have their best defensive midfielder Nzogi 23/1 out</p>','','Man utd','-1',1.96,'8',81.16,-8.00,0,3,'2:1',1811.63,1,NULL,NULL),(1073,1,1,5.00,1391253768,1391356131,1391281200,26,'Getafe','es','Valladolid','es',1,'Primera','Getafe wants to get back to wins while Valladolid wants to build on last week\'s great result against Villareal','<p>Getafe deserved so much more in the last game against\r\nAlmeria and they also showed good signs in the previous one against Sociedad at\r\nhome. It is time for Getafe to get a win and Valladolid does not seem like the\r\nteam to stop them. They got all three points against Villareal at home but the\r\nYellow Submarine played maybe the worst game of the season and Valladolid did\r\nnot really create many chances. Valladolid travels again withous Oscar and\r\nwithout Ebert. For Getafe Borja returns from suspension. I see Getafe getting\r\nback to good results in the upcoming games and today can be the start of a\r\ncomeback for the Madrid team. The odds are not ideal so I keep a medium stake.</p>','52ecd90251102.jpg','Getafe','-0.5',2.00,'5',14.41,-5.00,144,3,'0:0',1144.08,1,NULL,NULL),(1074,1,1,5.00,1391255916,1391356130,1391283900,26,'Milan','it','Torino','it',2,'Serie A','Essien and Taarabt in for Milan. Balotelli out.','<p>The odds here are completely wrong so no matter if we\r\nwill win or lose we have to bet.</p><p>Milan keeps winning without performing. They found a\r\nway to come back last week at Sardinia and they got all three points against\r\nCagliari but the truth is that Milan has a long way to go until they become a\r\nreal team again. Today they have to play without Balotelli and Pazzini will\r\nfill his place. Milanâs new signings Essien and Taarabt will probably be on the\r\nbench.</p><p>I have spoken about Torino before so I will not do it\r\nagain today. Great team, great manager, very dangerous team on the counter\r\nattack. I expect them to defend deep today and try to hit on the brake with\r\nCerci and Immobile. Whether they will succeed or not I cannot know but their\r\nchances are definitely more than what the bookies say.</p>','52ece16737ed9.jpg','Torino','+0.75',2.11,'6',14.91,6.66,149,2,'1:1',1136.42,1,NULL,NULL),(1075,1,0,0.00,1391264145,1391317744,1391280300,22,'Heerenveen','nl','ADO Den Haag','nl',1,'Dutch Eredivisie','Heerenveen looking for rehabilitation after poor start of 2014','<p>A turbulent week for Heerenveen. First they lost the important derby \r\nat Cambuur (3-1), then coach van Basten announced he will leave the club\r\n at the end of the year. In a press conference he wasn\'t willing to \r\nexplain his decision, he said the focus must be on the game against ADO \r\nDen Haag. New signing good old Anthony Lurling, who played at Heerenveen\r\n before some 11 years ago, will probably start rightaway. Defender \r\nKruiswijk is still injured.</p><p>ADO Den Haag very surprisingly won at home against Feyenoord \r\n(3-2), making the most of their few chances on the counterattack. Den \r\nHaag signed winger Wildschut from Heerenveen, but the clubs agreed he \r\nwon\'t play in this encounter. Striker Kramer is back after his 3 game \r\nsuspension.</p><p>Heerenveen is very keen on winning their first game of 2014, the spark \r\nthat winger Lurling will bring into the squad might just be the missing \r\nlink. ADO Den Haag will again play on the counter attack, but this \r\nseason their results in away games are below average. The home advantage\r\n and quality difference justify the handicap of 1 for the home team.</p>','52ed06ba28bb5.jpg','Heerenveen','-1',1.86,'6',14.10,5.16,141,2,'3:0',1129.87,1,NULL,NULL),(1078,1,1,7.00,1391276783,1391356130,1391291100,20,'Milan','it','Torino','it',2,'Italy A','Milan is without top scorer Balotelli  16/9 but Seedorf continues with an attacking formation ','<p>Another lucky win by Milan turning a lost match in the last\r\n5 minutes to win 2-1 against Cagliari.Milan is without top scorer\r\nBalotelli  16/9 but Seedorf continues\r\nwith an attacking formation but they find it difficult against closed defences and\r\nthey will play in the hands of Torino who play well on the counter and they\r\nhave Immobile 18/10  and Terci 21/10 0 in\r\ntop form  .It seems to be very much like\r\nthe game against Verona when they were very lucky to win with a penalty in the\r\n87 minute.This is a  -1/2  1.80-1.85 game not a -1</p>','52ed329bdca6d.jpg','Torino','+1',1.81,'7',80.13,5.67,801,2,'1:1',1788.63,1,NULL,NULL),(1079,1,1,6.00,1391297466,1391367076,1391356800,21,'Betis','es','Espanyol','es',NULL,'BBVA Liga','âBetis have received the most goals in La Liga and still, they didn\'t sing a defender in the January transfer window...','<p>Betis have received the most goals in La Liga and still, they didn\'t sing a defender in the January transfer window! They brought in keeper Adan from Real and midfielder N\'Diaye from Sunderland and they are both set to start today! Leo Baptistao will also start after fully recovering his minor injury and this makes three new faces in the team if we can say that as long as Leo has been one of Betis best players a month now coming from Atletico! But these new faces won\'t be the only changes in the team.</p><p><br>Calderon is changing the system as well trying a formation with 5 defenders. New comer N\'diaye will play in a free role next to the two center backs. He is a midfielder but he will play in defense. This has some risks as you can imagine, he won\'t be able to defend properly but has the advantage of the rapid switch of the formation from the 5-3-2 to anything Calderon likes regarding the process to the game. Another weak point of this formation is Juankar in the left back position. Juan Carlos (aka Kuankar) is a winger and because of that he is brilliant offensively but lacks defensive abilities. This means that center back Figueras will have to cover the left side of defense, actually in a common movement in football, but in this way he will leave unable to defend properly in the center N\'diaye, exposed to counter attacks.<br><br>The last weak spot of the new formation of Betis is that Lolo Reyes will act as a lone defensive midfielder most probably asking for help from N\'diaye who is acutally a center midfielder! And when exactly N\'diaye will play in his debut? Espanyol have a full squad and enjoy an excellent state of form. Sergio Garcia and Cordoba are strikers that can make a party if things in Betis defense go to the wrong direction today.<br><br>Now, all these are details but lead to a possible outcome, Espanyol but there are some more facts to take under consideration as the home ground and the huge motivation for Betis. Actually Espanyol have a strong motivation on their own and this barelly makes an real arguement in football but sometimes you have to reconsider about it. So, I decided to skip Espanyol, actually I may have thought it all wrongly in first place, but I will take the over2,5 instead which is offered in pretty nice odds!</p>','52ed83ab1c62a.png','Over','2.5',2.13,'6',62.61,-6.00,626,3,'2:0',1626.06,1,NULL,NULL),(1080,1,1,7.00,1391297757,1391405779,1391371200,21,'Athletic','es','Real Madrid','es',1,'BBVA Liga','âAthletic miraculously failed against Atletico in the midweek cup quarter-final and today they are looking to revenge their blood against the other Madrid based giants, Real...','<p>Athletic miraculously failed against Atletico in the midweek cup quarter-final and today they are looking to revenge their blood against the other Madrid based giants, Real.</p><p><br>There is no doubt that Athletic are playing the best soccer at the time being in La Liga so los Madrilenos are in big trouble visiting the San Mames! Only Toquero is out for Athletic. Real, on the other hand, traveled without Bale and with Varane back in the squad after a long time on the sidelines. Real are playing the cup semifinal on Wednesday hosting Atletico in the Madrid derby, but they should not let the Valencia gift slip away.<br><br>Winning in the San Mames will be an important step towards the battle for the title but just like mentioned above, Atletico suffered in this stadium last Wednesday, what can \'out of form\' Real Madrid expect there?</p>','52ed849e7f0b7.jpg','Athletic','0.75',2.09,'7',63.37,7.63,634,2,'1:1',1619.06,1,NULL,NULL),(1081,1,1,7.00,1391330071,1391367127,1391364000,20,'Betis','es','Espanyol','es',2,'Spain','Espanyol kept it simple again at Valencia, ','<p><strong>Betis</strong> were very poor and\r\ndisorganised at the back again as they conceded 4 at Celta. They werenât helped\r\nwith Paulao picking up an injury early on, replaced at HT, but he was not the\r\nonly culprit, with Amaya looking very cumbersome again. The fullbacks Juanfran\r\nand Nacho were also outnumbered regularly and the midfield were again\r\nnon-existent. Ruben Castro is showing signs of life with 2 goals here, but\r\nexpensive loan signing Baptistao again looked lost out on the wing.</p><p>They\r\nhave \'reinforced\' in the transfer window by signing ex Madrid gk Adan, he of\r\nMourinho\'s âBetter Than Casillasâ/nervous breakdown fame. </p><p>They\r\nare without <strong>cdef\r\nPaulao R/I</strong> and replacement <strong>cdef Perquis,</strong> so the struggling Amaya and weak\r\nJordi Figueras are set to start again. </p><p>Another\r\nsomewhat eccentric addition seems to <strong>be N\'Diaye</strong>, he of\r\nSunderland fame. </p><p>But\r\nwith no recognisable midfield, anyone will do. With the far from brilliant <strong>Nono R/I</strong>\r\nsuspended, N\'Diaye probably must start.  </p><p><strong>Espanyol</strong> kept it simple again at\r\nValencia, aggressively pressing at opportune moments, though more often happy\r\nto retreat and launch missiles for Jhonny Cordoba and Sergio to chase. Cordoba\r\nhad a brilliant game and could have had a hat trick. Looking really useful\r\nthese days, the Colombian kid. Sergio Garcia as usual, was mobile, and linked\r\nup effectively. In top form. After an open 1<sup>st</sup> half finished 2-2,\r\nthe game was more of a battle in the 2<sup>nd</sup> half and Espanyol held on\r\nwithout too much difficulty. </p><p>In\r\nmidweek, a mixed side played without real conviction and were happy to lose 1-0\r\nat Madrid in Copa. </p><p>Compared\r\nto last weekend they are set to be unchanged, \r\nwith <strong>cmf\r\nDavid Lopez R/I</strong> in the squad after injury but not ready to start.</p><p>Betis\r\nare now 10 points adrift of safety and there are no signs of any improvement,\r\nconceding 9 goals in their last two games and their last victory came at the\r\nend of September. At home their last 7 are 0-2-5 and overall at home are 2-3-5\r\n.Espanyol in the meantime are playing well and their away record is not that\r\nbad 2-3-5</p><p>Betis\r\nmay be miraculously transformed, some day.. This 1.93 +1/4 is a very good price\r\non a superior Espanyol it should be dnb 1.96 -1.96</p><p>Real\r\nBetis: AdÃ¡n; Chica, Amaya, Jordi Figueras, Nacho; Matilla, Lolo Reyes/N\'iaye,\r\nSalva Sevilla/ VerdÃº; Baptistao, Jorge Molina, RubÃ©n Castro.</p><p>Espanyol:\r\nKiko Casilla; Javi LÃ³pez, Colotto, HÃ©ctor Moreno, Fuentes; VÃ­ctor SÃ¡nchez,\r\nAbraham; Stuani, Sergio GarcÃ­a, Simao; CÃ³rdoba.</p><p><strong></strong></p><p><strong></strong></p>','52ee03055ffd2.jpg','Espanyol','+0.25',1.94,'9',79.19,-9.00,792,3,'2:0',1791.88,1,NULL,NULL),(1082,1,1,7.00,1391330441,1391405824,1391378400,20,'Athletico Bilbao','es','Real','es',1,'Spain','Madrid clearly dominated against a competent but harmless Granada but it took them an hour to make the breakthrough.','<p><strong>Athletic</strong> made their own luck in\r\nsome ways as they forced an error from Loties for the opening goal in Pamplona.\r\nAt 1-1 they got another free pass from Osasuna\'s defence and gk Andres, which\r\nallowed them to pick off their local rivals on the counter attack. At 1-3\r\nagainst 10 men, it was more than over and they cleaned up.</p><p>Athletic\r\nput in a decent effort at home to Atletico but at 1-1 were effectively buried\r\nby the away goals rule.  </p><p>They\r\nplayed with a strong XI midweek and will do so again here. It is set to be the\r\nsame side as faced  Atletico. Sub fwd\r\nToquero is out. </p><p><strong>Madrid</strong> clearly dominated against\r\na competent but harmless Granada but it took them an hour to make the\r\nbreakthrough.  Ronaldo was his usual\r\noverly-individualistic, self-obsessed self. Amusing enough to watch, and he\r\nscores enough, of course. Though it gets comical when you see his wannabe-clone\r\nBalegate doing exactly the same thing on the other side. All those ridiculous\r\ndribbles and wasted 30 yard shots.</p><p>They\r\ntook a 1-0 over Espanyol in Copa midweek, with another good goal from Jese. At\r\n1-0, the game practically ended, nothing happened. </p><p><strong>Varane</strong> is in the squad but\r\nunlikely to play after a long injury absence. </p><p>At\r\nthe back <strong>rback Carvajal Reg</strong> is a doubt and so Arbeloa\r\nis set to start. </p><p>Bale\r\n is still out with one of his mystery\r\ninjuries, much to Ancelotti\'s relief. Jese gets the start. </p><p>Athletic\r\nof course are yet to lose at home in Liga and are looking strong especially in\r\nattack at the moment having scored 15 goals in the last 3 Liga games. The Copa\r\nhome defeat midweek was in large part due to the demoralising effect the away\r\ngoals rule had on them at 1-1. </p><p>Madrid\r\nare on a long run of clean sheets but have rarely if ever impressed on their\r\nrecent run. Lots of blabbing in the garbage press about a record of clean\r\nsheets. Celta H, Osasuna Copa x 2, Espanyol A, Betis A, Espanyol Copa x 2,\r\nGranada make up their list of opponents on that historic run.  </p><p>1.80\r\n+1 is a good price for an unbeaten at home team and it  will do nicely. </p><p>Athletic\r\nClub: Iraizoz; Iraola, Gurpegui, Laporte, Balenziaga; Iturraspe, Rico; Susaeta,\r\nHerrera, Munain; Aduriz.</p><p>Real\r\nMadrid: Diego LÃ³pez; Arbeloa, Pepe, Sergio Ramos, Marcelo; Xabi Alonso, Modric;\r\nJesÃ©, Di MarÃ­a, Cristiano Ronaldo; Benzema.</p>','52ee047e26326.jpg','Athletico Bilbao','+1',1.80,'7',79.75,5.60,797,2,'1:1',1784.88,1,NULL,NULL),(1083,1,1,6.00,1391335482,1391356130,1391346000,20,'Mallorca','es','Sporting Gijon','es',2,'sPAIN b','Mallorca are on an unbeaten run of 5 games 2-3-0 ','<p>Mallorca despite their unbeaten run of 5 games 2-3-0 still\r\nhave a bad defense that costs them points conceded more than they scored .They\r\nalso lost Caesudus 23/5 who has been their regular goalscorer for years.Sp\r\nGijon  continues to be very hard to beat\r\nless defeats in the league 4  and are\r\nrunning an unbeaten away record of 7 \r\n3-4-0 and they have a full squad to chose from .The draw is a big factor\r\nin the game and it should be Mallorca dnb 1.85</p>','52ee182fa8301.jpg','Sporting Gijon','+0.25',1.94,'7',80.79,6.58,808,2,'1:3',1794.30,1,NULL,NULL),(1084,1,1,7.00,1391337136,1391367220,1391371200,24,'Mikhail','gb','BetFair','gb',1,'Multiples betting league','Multiples bet. The 25th edition.','<p><img src=\"/images/tips/52ee1fa33e8e3.jpg\" style=\"font-size: 15px;\"></p><p>Good Luck!</p>','52ee1e80539d8.jpg','Mikhail','win',11.29,'50',84.20,-50.00,842,3,'1:3',1842.00,1,NULL,NULL),(1085,1,1,6.00,1391338049,1391367099,1391364000,20,'Rennes','fr','Lyon','fr',2,'France','Rennes has done some good transfers and all of them are in the squad','<p>Lyon are in tremendous form and has won the last 3 games\r\nwithout conceding last 13 games are 6-4-1 only defeat came away to Psg  only drawback is that important Gourcuff\r\n(13/3) is out.Rennes has done some good transfers and all of them are in\r\nthe squad but you cannot expect them to have an immediate effect and their\r\nrecent winning record is abysmal last 11 matches are 1-5-5 and last 8  home are 1-5-2 .I expect Lyon not to lose and\r\ntake advantage of the enthusiasm at Rennes and hit them on the counter</p>','52ee223986d86.jpg','Lyon','dnb',1.83,'7',80.09,-7.00,801,3,'2:0',1800.88,1,NULL,NULL),(1086,1,1,7.00,1391356247,1391405800,1391374800,26,'Ath Bilbao','es','Real Madrid','es',1,'Primera','Los Leones against Los Blancos in San Mames','<p>Real Madrid has a good recent tradition against the Basques\r\nbut 1.63 to win in new San Mames is just wrong. Bilbao has many young, fast and\r\nenthusiastic players that will most probably make life difficult for Real.\r\nBilbao has a full squad available. Just Toquero  is out but with Sola available Toquero would\r\nbe out of the squad anyway. Real misses Bale and Khedira with young Jese\r\npossibly starting on the right.</p>','52ee69423b930.jpg','Ath Bilbao','+1',1.85,'8',14.39,6.80,144,2,'1:1',1129.08,1,NULL,NULL),(1087,1,1,6.00,1391383554,1391492627,1391461200,21,'Villarreal','es','Osasuna','es',2,'BBVA Liga','âRuling the thrashing of Real Sociedad by 5-1, we can hardly find a game that Villarreal played according to their level recently in the El Madrigal...','<p>Ruling the thrashing of Real Sociedad by 5-1, we can hardly find a game that Villarreal played according to their level recently in the El Madrigal. The worst arrived last week in Valladolid when the yellow submarines fired their first shot in the injury time a really pathetic performance while they had to suffer two weeks ago to beat Almeria in front of their supporters.</p><p>Today, the submarines will be obligated to do without their best player Bruno Soriano their \'coach\' in the center of the field and recently appointed as regular attacking midfielder Hernan Perez, who moved to Greek champions Olympiakos. Joan RomÃ¡n arrived from Barca B\' to cover. Cani remains out, he is important of course always knows what to do with the ball in the final metres, but Villarreal have learnt to play without him. Or they didn\'t? So there are two starters in the middle missing today. New comer from Atletico, Oliver is injured.</p><p>Osasuna traveled without center back Arribas and midfielder Silva, both suspended and both regulars. The rojillos are coming from the home thrashing to Athletic Bilbao by 1-5 in a game they where totally outplayed by the leones, and they are eager to bounce back in Vila-Real. A hard mission isn\'t it? Most probably yes, but Osasuna do have some improvment to show in recent games and they enjoy excellent history stat in the El Madrigal losing only once, winning another and drawing three times in this ground since 2007.</p><p>The icing on the cake here comes from the market. +1,25 for Osasuna is a line from outer space. Villarreal could win, yes, but a narrow defeat will suit us just fine and of course Osasuna with crucial games upcoming (Getafe, Elche) will not get there to lose \'narrowly\'...</p>','52eed3fb3f51b.png','Osasuna','1.25',2.02,'6',62.77,-6.00,628,3,'3:1',1627.69,1,NULL,NULL),(1088,1,1,6.00,1391426145,1391492714,1391468400,20,'Villareal','es','Osasuna','es',2,'Spain','Osasuna are not good but can, on their day, defend deeply in numbers , hack and frustrate','<p><strong>Villarreal</strong> never got going in Valladolid. They went behind to a set piece and\r\nstruggled in an attritional game with very few spaces available. Bruno was not\r\nhis usual commanding self in midfield, and Pina contributed little.  Both\r\nAquino and Moi Gomez worked hard but had the kind of off days that tricky\r\nlittle wingers often have. 1-0, Villa created nothing, and can have no\r\ncomplaints from a very bad game.</p><p>They have lost Hernan Perez 9/1/686  who has joined Olimpiakos. </p><p>Oliver Torres, the miniature prodigy with the giant ego, arrived on loan\r\nfrom Atletico. Joan Roman Olle, the ex Espanyol, Manchester City and Barcelona\r\nB winger, arrives on loan. </p><p>They are without cmf Bruno 20/4/1647  Impt/Key injured, as well as lmf Cani  15/2/1295 Impt LT.  </p><p>The only expected change this weekend is for Trigueros play alongside\r\nPina in midfield, while Uche continues with Giovani in attack.</p><p>Playing Athletic was tough enough for<strong> Osasuna</strong> without\r\nLoties and Andres giving goals away. The French cdef had an absolute nightmare.\r\nThey were always on the back foot with Lolo and Silva  out-numbered in midfield. After going 1-3 down\r\nand down to 10 men, they ended up taking a bit of a hammering.  </p><p>Here they miss best cdef Arribas 20/0/1757 Impt and cmf Silva 18/0/1384 Reg/Impt,\r\nsignificant losses. It means that Flano 4/0/227 is likely to come into the back\r\nline, while  veteran Punal 18/1/1013 takes\r\nthe place of Silva. </p><p>Villarreal are a chameleonic side. Sometimes pressing, sometimes\r\ncountering. Sometimes hot, sometimes cold. </p><p>Osasuna are very mediocre, just about scraping by under Javi Gracia.\r\nLast week\'s disaster should at least serve to concentrate minds.  </p><p>Villa, minus their 2 best midfielders here, the 2 leaders. Admittedly\r\nCani has been out for a while but it is a hard task to replace both of their\r\ntop men. </p><p>Osasuna are rubbish but can, on their day, defend, hack and frustrate\r\nand they have only 1 defeat in their last 5 games away to Valencia when they\r\nwere down to 10 men from the 17<sup>th</sup> minute with the score 0-0 . Big\r\nOriol is a significant threat for a Villarreal side who get bullied in the air:\r\njust look at the Villa-Sevilla game. </p><p>This handicap for this game taking into account everything is steep it\r\nshould be -1  </p><p>4-4-2: Asenjo; Mario, Musacchio, Dorado, Jaume\r\nCosta; Aquino, Pina, Trigueros, Moi GÃ³mez; Uche, Gio dos Santos.</p><p>Subs :Juan Carlos- Jokic, Gabriel-Joan RomÃ¡n , Edu\r\nRamos- Perbet,Jonathan Pereira.</p><p>Osasuna: FernÃ¡ndez; BertrÃ¡n, FlaÃ±o, Loties, DamiÃ¡; PuÃ±al, Lolo; Cejudo,\r\nDe las Cuevas, Armenteros; Oriol Riera  </p><p>Subs :Riesgo-Oriol,Oier, Lobato,R. Torres ,\r\nLoÃ©-AcuÃ±a</p>','52ef7a5528056.jpg','Osasuna','+1.25',1.93,'6',80.11,-6.00,801,3,'3:1',1801.06,1,NULL,NULL),(1089,1,1,5.00,1391426406,1391492591,1391456700,26,'Genoa','it','Sampdoria','it',NULL,'','Luigi Ferraris in flames. Who will be the boss of the city tonight?','<p>The game was scheduled for yesterday midday 12:30\r\n(Italy time) but the fans threatened to boycott the match because of the\r\nunpopular time and they finally succeeded to achieve their purpose. The excuse and\r\nthe official reason for the rescheduling was the presence of the Santâ Agata\r\nmarket which takes place close to the stadium so police announced that for\r\nsafety reasons itâs better to move the game. Anyway, the game now will be\r\nplayed at night, with no other games in Italy so all the lights will be turned\r\non the derby della Lanterna and the atmosphere in Luigi Ferraris will be fiery.</p><p>Both teams are doing well in the season, especially\r\nGenoa who has 27 points, 10 more than Bologna and the relegation zone.\r\nSampdoria did not start the campaign very well but since the arrival of Sinisa\r\nMihajlovic the team appears to be very strong with a much more attacking\r\nmentality and I donât believe there is any chance for Sampdoria to get\r\nrelegated. </p><p>So as long as none of the teams is in relegation zone I\r\ndonât see a reason for them to play defensively and safe to get one point. I\r\nbelieve both will go for the win tonight, on a very special night for the city Genoa\r\nto make their fans happy. </p><p>In the last five years they met nine times. Four games\r\nended under 2.5 and five over 2.5 </p><p>Both teams have almost a full squad available. Nobody\r\nimportant is missing.</p>','52ef7b6136694.jpg','Over ','2.5',2.42,'5',13.89,-5.00,139,3,'0:1',1138.88,1,NULL,NULL),(1090,1,1,6.00,1391436948,1391492654,1391463000,20,'Empoli','it','Palermo','it',2,'Italy B','Their overall home record is 5-5-1','<p>Empoli\r\ncome into this game not in good winning form last 7 are 2-3-2 and last 5 home\r\nare 1-3-1</p><p>Their\r\noverall home record is 5-5-1 have not even won half of their home games.</p><p>Palermo\r\non the other hand are in better winning form their  last 7 are 4-2-1 last 5 away are 3-1-1  </p><p>They\r\nhave 2 regulars out but they get Lafferty \r\n19/6 and Bolzoni 18/0 back.Palermo has succeded not losing in all the\r\nbig matches .Empoli is suited in playing on the counter away from home but will\r\nnot be able to do that against experienced Palermo.</p><p>This\r\ngame is A Dnb game if I have ever seen one 1.92 -2.00 so taking +0,+1/2 Palermo\r\ngives us an an edge&nbsp;</p>','52efa48f8e7c7.jpg','Palermo','+0.25',1.86,'6',80.01,2.58,800,4,'1:1',1791.48,1,NULL,NULL),(1091,1,1,7.00,1391438320,1391492691,1391464800,20,'Man City','gb','Chelsea','gb',2,'English Premier','âThe two teams with the best squads in the league ','<p>The\r\ntwo teams with the best squads in the league .This as a tight a game as they\r\ncome and knowing Mourinho he will make it tighter with his tactics.I believe\r\nthat Man City are the better team if they have full squad but for this game\r\nthey miss the mvp Aquero 17/15.He is the kind of quick feet turning striker who\r\nwould have given Terry and Cahill a lot of trouble .The two Chelsea central\r\ndefenders are better equipped to deal with the Negredo ,Djeko combination.In\r\naddition they miss Nasri 21/4 who can help brake down a tight defense with his\r\ndribbling and passing.Chelsea go here with all their best players available\r\n.Only Torres is missing and you cannot call him a good player any more he has\r\nthe occasional run but that is.</p><p>In\r\na game as tight as this to win everything with a draw is good value .I make the\r\ngame a -0,-1/2 game</p>','52efa9e92b497.jpg','Chelsea','+1/2',2.00,'7',80.71,7.00,807,2,'0:1',1793.06,1,NULL,NULL),(1092,1,1,7.00,1391454693,1391594191,1391543100,22,'ADO Den Haag','nl','Heracles','nl',NULL,'Dutch Eredivisie','Bottom ADO Den Haag looking to close gap on rival.','<p>After a good 3-2 win at home against strong Feyenoord, ADO Den Haag disappointingly lost 3-0 at Heerenveen. The loss was a bit unfortunate, both teams having the same amount of scoring opportunities. Heerenveen\'s first goal was heavily contested, goalkeeper Coutinho claimed the ball was kicked out of his hands.</p><p>Heracles also suffered a loss at home against NAC Breda (1-2), which was against the run of play. Heracles had 21 goal attempts, NAC only four.</p><p>Both teams are looking for a result after a disappointing weekend with lots of missed chances, both also playing with three strikers. In the six home games of Den Haag this season on their artificial pitch only one finished with two goals, the other five with 3 or more goals. Heracles has simular statistics in away games: only two matches with two goals, the other eight 3 or more. The winter may have influenced the amount of goals in the Eredivisie, but this isn\'t the case for matches on artificial pitches. I expect lots of scoring opportunites in this important encounter for both teams.</p>','52f11909c100c.jpg','Over','2.75',1.75,'7',12.77,2.63,128,4,'0:3',1118.03,1,NULL,NULL),(1093,1,1,7.00,1391455746,1391762458,1391719500,22,'Ajax','nl','Groningen','nl',1,'Dutch Eredivisie','Can Ajax convert possession into goals ?','<p>After a long run of wins Ajax was a bit disappointed to draw at Utrecht (1-1). Ajax was in control like always, having 71% of the ball, but their strikers created not enough chances to make the difference. After Siem de Jong entered the pitch in the last 25 minutes, chances mounted (SchÃ¶ne hitting the post), but the score didn\'t change. De Jong is expected to start from the first minute, which is a big bonus. Goalkeeper Cillessen is injured, replace by Vermeer who previously lost his spot in the first team.</p><p>Groningen suffered a loss at AZ Alkmaar, the 2-0 score was already on the scoreboard after 17 minutes. Groningen was a bit powerless after that, they didn\'t manage to score in away matches against the bigger teams (Twente, Feyenoord, AZ) this season, only against Vitesse they were successfull on the counterattack (2-2 draw). Important attacking midfielder van der Velden is still not ready to play.</p><p>In each Ajax game it is the question if they can express their dominance into the score. With de Jong back in the squad, the home advantage and Groningen not in a particular good form Ajax should be able to net some goals.</p>','52f11d9782ac4.jpg','Ajax','-1.75',1.87,'8',11.37,-8.00,114,3,'2:1',1113.66,1,NULL,NULL),(1094,1,0,0.00,1391535667,1391762439,1391712300,22,'Utrecht','nl','PEC Zwolle','nl',1,'Dutch Eredivisie','\"New\" Utrecht face winning PEC Zwolle','<p>On Sunday Utrecht fought themselves to a 1-1 draw against very strong Ajax. With two new players in the starting eleven, central defender Delpierre from Hoffenheim and strong striker Agudelo, Utrecht surprised with a very strong performance. Striker de Ridder was a constant threat for the Ajax defence. New leftback Dorda will probably play his first match against Zwolle and replaces youth player van der Winden. Experienced new striker Koevermans will be on the bench.</p><p>Zwolle booked their second win in a row at home against Roda JC (3-1), after several months without a win. Zwolle scored the third in injury time, after Roda JC pushed for the equaliser. They saw two important players drop out for this game, defender Lachman and defending midfielder Mokotjo are injured. Central defender van der Werff is doubtful.</p><p>The fanatic Utrecht crowd has found new hope after the good game against Ajax. The new players really look like a valuable addition. Utrecht is the clear favorite in my eyes, their strength lies in home games and in their great fighting power. Zwolle is without two of their strongest players this season.</p>','52f12771c0e64.jpg','Utrecht','-0.25',1.99,'6',12.17,-6.00,122,3,'1:2',1121.66,1,NULL,NULL),(1095,1,1,7.00,1391540890,1391893928,1391881500,22,'PSV','nl','Twente','nl',2,'Dutch Eredivisie','PSV fighting for Europa League football against title contenders Twente','<p>In midweek PSV came back from an early goal to beat Cambuur 1-2. The fortunate win was very welcome after an earlier loss at RKC. Troubled coach Cocu has asked former coach Guus Hiddink for advice, Hiddink will support the coaching staff once a week. Earlier Cocu decided to drop expensive signing and attacking midfielder Maher who was replaced by more defensive Hiljemark. PSV will still be without Wijnaldum, who will play with the reserves on Monday, also suspended central defender Rekik is out. Striker Matavz is set to be transferred to Rubin Kazan.</p><p>Twente was the big winner of last weeks double round with two convincing wins over Cambuur (3-1) and at Heerenveen (0-2). Especially the away win was impressive as Twente never looked in trouble against the usual very strong home side Heerenveen. Winger Tadic looks to be back in great form. Twente has no injury worries, with new signing Borven on the bench the attacking options have even increased.</p><p>In my eyes Twente is the favorite in this game, the bookies only favour PSV because of their history. This season the home team is a struggling young mid-table squad, which can\'t compete with one of the best teams in the league. A strong recommendation for picking a small handicap on the away team.</p>','52f13a977f8da.jpg','Twente','+0.25',1.88,'8',9.87,-8.00,99,3,'3:2',1098.66,1,NULL,NULL),(1096,1,1,7.00,1391542396,1391844916,1391799600,22,'Vitesse','nl','ADO Den Haag','nl',1,'Dutch Eredivisie','Vitesse in title race against a relegation troubled ADO Den Haag','<p>Vitesse surprisingly lost at home against AZ (0-2) and will be looking for revenge tonight. Vitesse had most of the ball but AZ was dangerous in the counter attack. The first goal was an unfortunate own goal by rightback van Aanholt. In this game van der Struijk will replace suspended rightback Leerdam. No other changes expected.</p><p>After another big defeat coach Steijn was sacked at ADO Den Haag this week, assistant Fraser will be in charge now. It was very painful to see Den Haag play without any confidence at home against Heracles. The score of 0-3 should have even been higher. Interim coach Fraser announced some changes. Van Duinen will play in centre attack, Wormgoor in central defence, in midfield 3 defensive players.This means striker Kramer is on the bench just like midfielder van Haaren.</p><p>Vitesse can\'t afford another mistake and will not be surprised by counter attacks of their opponent, which is a far weaker team than AZ. The away team faces a very hard struggle to stay in the Eredivisie, I don\'t expect the shock effect of sacking the coach will have any effect. Recommended to pick the odds of a&nbsp;big Vitesse win.</p>','52f1401b0ac2c.jpg','Vitesse','-1.75',1.92,'7',10.67,-7.00,107,3,'0:0',1106.66,1,NULL,NULL),(1097,1,0,0.00,1391544672,1391962523,1391952600,22,'PEC Zwolle','nl','Ajax','nl',2,'Dutch Eredivisie','Injury hit Zwolle face defending champions Ajax','<p>PEC Zwolle managed to win last three matches after a long run of games without victory. The last victory away at Utrecht was very fortunate, Utrecht dominated and was 1-0 in front when the referee decided to show Utrecht a red card for a challenge which was only worth yellow. Zwolle coach Jans brought on two fresh strikers, who both scored a goal against ten men Utrecht: result 1-2 win. This result was also surprising seeing Zwolle missing four regular influancial players, midfielders Mokotjo, Thomas, defenders Lachman and van der Werff. Against Ajax also new signing central defender Sainzbury is out and winger Karagounis is doubtful. The back row and midfield has to be shuffeled around to field a decent defence.</p><p>In midweek Ajax dominated the first half against a very defensive Groningen, scored from a penaltykick but again forgot to finish their chances. Groningen equalised from long range just before halftime. In the second half Groningen was more compatible, but Ajax scored the winner in the dying minutes, after hitting the woodwork three times in the match. Goalkeeper Cillessen and leftback Boilesen are injured.</p><p>The expectation for this game is that Ajax will have most of the ball, but Zwolle is not a team that can depend on their depleted defensive midfield and defence. Ajax will create most chances, like last season when they managed to win 2-4 after being 0-4 in front. Zwolle never were able to get a result against Ajax since returning on the highest level, I don\'t expect that this time.</p>','52f14920ebbc4.jpg','Ajax','-0.75',1.88,'8',9.07,-8.00,91,3,'1:1',1090.66,1,NULL,NULL),(1098,1,1,7.00,1391615870,1391635989,1391634000,20,'Real Madrid','es','Atletico Madrid','es',2,'Spai Cup','Atletico  are experts on shutting down the space,','<p>Madrid\r\nofficially have Bale back from injury. Presumably he starts unless there are\r\nstill overriding physical/psychological issues. Ancelotti prefers Jese but is\r\nunder strict instructions to play Bale.</p><p>Casillas,\r\nArbeloa and Coentrao are likely to come into the side for Copa. LT Khedira is\r\nthe only injury.</p><p>CR7\r\nshould of course be available to play, barring strange decisions. </p><p>Atletico\r\nare without lback <strong>Felipe Luis</strong> Impt so Insua continues.. Meanwhile\r\nthe absence of <strong>Villa</strong>\r\nis easily covered by Raul Garcia or the returning hero Diego . <strong>Cmf Tiago Reg</strong> is a doubt, probably out. Mario Suarez stands\r\nby.</p><p>In my\r\nview the Madrid 1.92 -1/2 price underestimates Atletico and overrates Madrid.\r\nNot an accurate reflection of the relative strengths of the sides. Atletico\r\nis more of a team than Real who have not conviced at all recently despite their\r\nunbeaten run </p><p>The\r\nteams, and the game, are much closer than that price would indicate.I think is\r\na good value bet  on the plus. </p><p>As for\r\ntotal goals, Atleti are experts on shutting down the space, while Madrid are an\r\nunspectacular bunch of late, and will be wary of the away goal. So a small\r\npreference for 1.84 Under 2.75.</p><p>Casillas;\r\nArbeloa, Ramos, Pepe, Coentrao; Xabi Alonso, Modric, Di MarÃ­a; JesÃ©, Benzema,\r\nRonaldo</p><p>Courtois;\r\nJuanfran, Miranda, GodÃ­n, InsÃºa; Koke, Gabi, Mario SuÃ¡rez, Arda; RaÃºl GarcÃ­a,\r\nDiego Costa.</p>','52f25f6d09ca7.jpg','Atlletico Madrid','+1/2',2.00,'7',79.41,-7.00,794,3,'3:0',1794.06,1,NULL,NULL),(1099,1,1,7.00,1391616118,1392046496,1391641200,20,'Barcelona','es','Real Sociedad','ad',1,'Spai CUP','Sociedad are a footballing side who are ','<p>Barca\r\nwill have Pinto in goal, with Neymar the only notable official injury.</p><p>Montoya\r\nmay start at rback, with Alves benched.</p><p>Sociedad\r\nwill have Zubikarai in goal. They have new signing Sergio Canales in the squad\r\nand he is likely to be on the bench. Injured cmf Markel Reg is missing, but cmf\r\nElustondo, is in the squad after an injury-hit season. They may go with a 3 man\r\nmf with the more mobile Vela starting as 9 in place of Agirretxe.  </p><p>Barca\r\nhave Messi still not at his best. But Sociedad are a footballing side who are\r\nnot designed to defend  thats why they  getting hammered away to the good sides.thats\r\nwhy I will take Barca to recover  from\r\ntheir weekend defeat at  2.00 -2.5, </p><p>Pinto;\r\nMontoya Mascherano Puyol Alba; Xavi Busquets Iniesta; Messi; Pedro Alexis</p><p>Zubikarai;\r\nCarlos MartÃ­nez, Mikel, Ansotegi, JosÃ© Ãngel; Ros, Zurutuza, GaztaÃ±aga; Prieto,\r\nVela, Griezmann.</p>','52f2607029794.jpg','Barcelona','-2.25',1.82,'7',73.61,0.00,736,5,'2:0',1732.55,1,NULL,NULL),(1100,1,1,7.00,1391647698,1391970831,1391959800,22,'Groningen','nl','Heerenveen','nl',1,'Dutch Eredivisie','Battle of the North','<p>On Thursday Groningen made a very good impression at Ajax, but left with no points when Ajax scored late in the game (2-1). For today the same eleven players will start in the controversial derby against the other team from the North of the Netherlands: Heerenveen.</p><p>Heerenveen is still waiting for their first good performance in 2014. At home against ADO Den Haag the win looked convincing (3-0), but Den Haag was at least equal in that game. The only away game in January was lost without a chance, also in a derby game against Cambuur: 3-1. In that game Heerenveen was beaten on the most important aspect of the game, team and fighting spirit, which was also the case in the recent home loss against Twente (0-2). Heerenveen has injury worries in defence, leftback Dijks and central defenders Kruijswijk and Zomer can\'t participate, so young Marzo will come in as leftback and on the bench some second team defenders.</p><p>Groningen only lost one game at home this season so far, they are dying to play their first home game of 2014 (the match against Twente two weeks ago was postponed). Last season Groningen beat Heerenveen 3-1, it always seems Groningen can perform that little bit extra at home, especially against Heerenveen. I expect a heavy battle in which the physically strong home team has the advantage.</p>','52f2dbbd2db05.jpg','Groningen','-0.25',1.93,'8',8.27,-8.00,83,3,'1:3',1082.66,1,NULL,NULL),(1102,1,0,0.00,1391769533,1391844968,1391803200,21,'Espanyol','es','Granada','es',1,'BBVA Liga','âEspanyol didn\'t shot more than once on target last week in a pathetic performance which led to the inevitable defeat against rock bottom Betis...','<p>Espanyol didn\'t shot more than once on target last week in a pathetic performance which led to the inevitable defeat against rock bottom Betis. At the Cornella El Prat, los periquitos are looking to bounch back and Aguirre has a full squad to chose.</p><p>On the other hand, Granada are coming from the home defeat to Celta in a game were the draw should have been the fairest outcome. Los Andalusians, who won last year in this ground and looking to revenge the first round home defeat to Espanyol by 0-1. Problems in the center of defense for Alcaraz, as long as Mainz got injured and DiakhatÎ¹ left the club to join Turkish bottom club Kayseri Erciyesspor (!!!)... This means that next to Murillo is will be either yound France Sub21 international Alexandre Coeff, who hasn\'t been given a starting up role until now, or 20yo Portuguese defender Tiago Ilori who recently joined the club.</p><p>Bearing in mind the boost Espanyol receives when they play in front of their fans and the recent lousy Granada performances, especially the 3-0 defeat in Almeria last month, I am giving a vote of confidence to Espanyol. Even more, I am willing to take their -3/4 handicap cause Espanyol can be really hammering at home plus the fact that they can come from behind if they receive first. Of course in that case it will be hard to win the handicap but odds here are much better and a half win should be achived at least.</p><p>Moreover, Granada is surely better away from home but their numbers do no confirm. They barrelly had more than 3 shots on target when playing away from home and one of these times was against struggling Levante. On the contrary they allow an average of 15,7 shots against them, 7 of these goes on target so against a strong home team they are expected to struggle.</p>','52f4b7ba74105.jpg','Espanyol','-0.75',2.23,'6',63.14,3.69,631,4,'1:0',1621.69,1,NULL,NULL),(1103,1,1,7.00,1391770513,1391879000,1391871600,26,'Sunderland','gb','Hull City','gb',2,'Premier League','A six pointer for the relegation fight in the Stadium Of Light','<p>Sunderland is coming from a massive win in the derby\r\nagainst Newcastle with 3-0. Gustavo Poyet is doing a good job and he is a guy\r\nthat I liked from the beginning when he was hired and Sunderland was in deep\r\ntrouble. The reason I liked him is because he was saying things very raw, exactly\r\nthe way they were. He was saying âwe are in a very difficult position, I cannot\r\npromise anythingâ. After the first couple loses came along, he kept saying âthis\r\nis the position we are now, we have to take it, there is no place to hideâ. But\r\nwith a great work in the training and a couple of transfers he managed to turn\r\nthings around for the Black Cats so thumbs up for the ex Chelsea player. Now\r\nletâs go to the game.</p><p>Sunderland maintains a good run but what I see in this\r\nteam is that they are much more comfortable playing away instead of home. They\r\nprefer to defend, to close the spaces for the opponents and to try find a goal\r\non the counter. But when it comes to home games where they have to dominate the\r\ngame and play attacking football they have a problem. In the last two home\r\ngames Sunderland was a bid lucky, both against Southampton and against Stoke\r\nwhere they had an extra player on the field for 40 minutes. Sunderlandâs home appearances\r\nare not impressive enough to justify these odds.</p><p>Steve Bruce is also a manager that does great job this\r\nseason. His team plays good football and I believe they deserved to have more\r\npoints by now. After a few bad results they showed a really good spirit last\r\nweek against Tottenham. They were the best team, the newly arrived strikers\r\nLong and Jelavic seem to have an instant connection creating too many troubles\r\nfor the Spurs and now they also welcome back Jake Livermore, a crucial member\r\nof the Tigers who was not allowed to play in the last match since he is on loan\r\nfrom Tottenham.</p><p>I see Hull as the better team here but the odds say\r\nsomething else so I am going with the Tigers.</p>','52f4bb81576be.jpg','Hull City','+0.25',2.13,'8',15.75,9.04,158,2,'0:2',1140.48,1,NULL,NULL),(1104,1,1,7.00,1391788654,1391845033,1391808600,20,'Virtus Lanciano','it','Cesena ','it',2,'Italy B','Lanciano is holding a high position','<p>Lanciano is holding a high position due to its good start in\r\nthe last 3 months their form is relegation record last 12  3-2-7 and last 6 home 3-2-2.Their coming with\r\nan away defeat against lowly Reggina  i1\r\nregular missing 2 return.</p><p>Cesena continues with their good form and 2 wins since the\r\nrestart push them into 4<sup>th</sup> position they have only 1 defeat in the\r\nlast 19  7-10-1 and they are 3-5-1 in\r\ntheir last 9 away.They have 2 regulars out.</p><p>Based on their records and current form I make it a clear\r\ndnb game slight fav Lanciano 1.92 -2.00 the draw is a big factor so the value\r\nlies with Cesena</p>','52f50031c2dc1.jpg','Cesena ','+0.25',1.95,'9',79.83,4.28,798,4,'1:1',1785.06,1,NULL,NULL),(1105,1,1,7.00,1391803973,1391885810,1391878800,21,'Rayo Vallecano','es','Malaga','es',1,'BBVA Liga','Second bottom club Rayo Vallecano is playing with a gun in the head today against Malaga...','<p>Second bottom club Rayo Vallecano is playing with a gun in the head today against Malaga. The Madrid based outfit can not rise head and after some notable performances but unlucky results they returned in mediocrity losing against Elche and Atletico before drawing goal-less in Levante. The game against Malaga is a crucial game for Rayo as a team and for their manager Paco Jemez who feels the pressure on his shoulders heavier game by game. Rayo are without important forward Viera, plus the already known missings of  Galvez, JosÃ© Carlos and Perea. Striker Castillo was dropped again, defender Mojica returned after being sent to the stands from Paco Jemez in the last 4 games.</p><p>There are some good news though. The players are going to die for their manager and they couldn\'t have asked for a better rival as long as Malaga is the 3rd worst away team in La Liga and they traveled in Madrid injury depleted...! Firstly, manager Schuster is suspended for two games and next to him their best midfielder, left footed specialist Duda, is suspended as well! Lets take a look in the injury list now! Important left back half Eliseu got a knock in the midweek and didn\'t make it in the squad, regular holding midfielder Tissone and right full back Gamez are new missings too. Moreover, striker Santa Cruz usually coming from the bench to offer crucial goals remains for 2nd game injured while regular, and one of Malaga\'s best center backs, Welington, remains on the sidelines. On the contrary, two new reinforcments forwards Rescaldani and Iakovenko, got the call in the squad.</p><p>Even though I give barelly a few possibilities to Rayo to avoid relegation I am giving them some posibilities to win today against Malaga who may have taken a massive morale boost against Sevilla last week but will be unable to handle Rayo\'s motivation with all these missings they traveled in Vallecas.</p>','52f53e3f697f7.jpg','Rayo Vallecano','-0.25',2.06,'7',63.88,7.42,639,2,'4:1',1624.38,1,NULL,NULL),(1106,1,1,7.00,1391848622,1391878962,1391871600,26,'Crystal Palace','gb','West Brom','gb',1,'','Another relegation dogfight in Selhurst Park with Palace looking very good lately and West Brom trying to find  a new identity under Pepe Mel','<p>Crystal Pallace under Tony Pulis is a different team,\r\na much better team. It really seems like the ex Stoke manager gave a purpose to\r\nthese players and he managed to get the best out of them. Chamakh could not\r\nscore a single goal before Pullis, Bolasie was very naÃ¯ve and generally they\r\nseemed more like a Championship team rather than a Premier League one. Lately\r\nthey donât only get good results but they maintain a level of performance. Even\r\nlast week against Arsenal in the Emirates they fought really hard and they also\r\ncreated a couple of good chances.</p><p>Newcomers Tom Ince, Scott Dann and Joe Ledley are all\r\navailable. Only long term absences for Pallace.</p><p>West Brom took a valuable point against Liverpool but\r\nit was more a Liverpool gift than a point earned by the Baggies. Itâs been\r\nalmost a month now under Pepe Melâs management and I donât see any strong signs\r\nof change. Yes they fought well against Everton and Liverpool but they were\r\nmostly defending and when they tried to attack against Villa they showed too\r\nmuch weakness at the back. I still donât see any good chemistry in the team.\r\nSessegnon is out, Anelka is in and out of the team since the beginning and\r\nVydra with Berahino are good young players but they still cannot be considered\r\nas real threats. Another issue for WBA is, from what I noticed, the\r\ncommunication. Pepe Mel can barely say five or ten words in English so I donât\r\nknow how long it will take to pass his philosophy to the players.   </p><p>The new boy, Thievy who arrived from Espanyol will be\r\non the bench. Anelka and central defender Ollson are two huge misses for Pepe\r\nMel.</p><p>I believe Crystal Pallace is much more ready for this\r\ngame.</p>','52f5eca7a514e.jpg','Crystal Palace','-0.25',2.20,'8',14.85,9.60,148,2,'3:1',1130.88,1,NULL,NULL),(1107,1,1,7.00,1391850864,1391877417,1391870700,20,'Liverpool','gb','Arsenal','gb',2,'Premier','Liverpool have 10 home wins from 12 this season ','<p>Arsenal are the wrong price  whichever way you choose to interpret the facts\r\non offer.Arsenal are top of the league and eight points ahead of Liverpool.\r\nArsenal have lost just twice away from home and top the away form table with\r\neight wins from 14 matches. Arsenal have drawn three and won three of their\r\nlast six trips to Anfield. Arsenal beat Liverpool 2-0 in the reverse fixture\r\nvery easily . Arsenal are the only side to face Luis Suarez and Daniel\r\nSturridge together this season and prevent both from scoring. Liverpool have 10\r\nhome wins from 12 this season - but I can\'t see how anyone can look at this\r\ngame and consider a home win significantly more likely than any other result. Arsenal\r\nare not certainties by any means and Liverpool will present a thorough\r\nexamination of the Gunners\' title credentials. But Arsenal\'s prospects of\r\nwinning this game look to be about 40% and not, as is implied by the price,\r\nless than 30%.</p><p>Liverpool\r\nhave out defenders Daniel Agger 11/1  ,\r\nGlen Johnson 17/0 Mamadou Sakho 12/1 , Left-back Jose Enrique\'s 8/0 and\r\nmidfielder Lucas 19/0 .Their defense with these players missing is a real cause\r\nfor concern in fact they are weak.</p><p>Arsenal\r\nexpect to have England midfielder Jack Wilshere 19/3  back from an ankle problem. Midfielder Mathieu\r\nFlamini  18/1 is still suspended while\r\nAaron Ramsey 18/8 and deadline-day loan signing Kim Kallstrom 0/0 are not fit,\r\nalong with defender Thomas Vermaelen 7/0 and Theo Walcott 13/5</p>','52f5f56ae46e5.jpg','Arsenal','+0.25',2.02,'9',78.93,-9.00,789,3,'5:1',1789.34,1,NULL,NULL),(1108,1,1,7.00,1391852944,1391879020,1391878800,20,'Chelsea','gb','Newcastle','gb',1,'Premier','Chelsea boosted by the win against Man City is facing good away team Newcastle','<p>Chelsea boosted by the\r\nwin against Man City should not have any trouble of disposing of Newcastle who\r\nare in disarray after the sale of mvp Cabaye and the defeat in the local derby\r\nby Sunderland by 3-0 as all these was not enough they have out top scorer Remi\r\n21/11,best midfielder left Tiote 21/0 ,Best defender Coloccini 15/0 and very\r\ndoubtfull from returning usefull Goufran 22/6 and Cisse 15/1</p>','52f5fd8bf16bd.jpg','Chelsea','-1.75',1.89,'7',79.12,6.23,791,2,'3:0',1777.98,1,NULL,NULL),(1110,1,1,6.00,1391860380,1391877504,1391877000,20,'Freiburg','de','Hoffenheim','de',1,'Germany a','I cannot see how a team','<p>I cannot see how a team\r\nthat lost their last away game 4-0 against Nyrnberg and have an away record of\r\n3-1-5  16-20 total 21 pts only 4 points\r\nabove Freiburg who in their last home game beat 2<sup>nd</sup> placed Leverkussen\r\n3-2 and previously Hannover 2-1 can be giving a handicap +0.25 . Nosignificant\r\nabsentees</p>','52f61a97ee3f9.jpg','Freiburg','+0.25',1.88,'6',78.50,2.64,785,4,'1:1',1776.34,1,NULL,NULL),(1111,1,1,7.00,1391865458,1391877477,1391877000,20,'Wolfsburg','de','Mainz','de',2,'Germany A','Mainz are unbeaten in 5 games 3-2-0','<p>Mainz are unbeaten in 5\r\ngames 3-2-0 and only 1 defeat in last 8 5-2-1 the defeat against Dortmund at\r\nhome their last 4 away are 3-1-0 so they are in very good form and they are\r\nequal on points with Wolsburg who are not very in such good form losing their\r\nlast 2 games and only 2 wins in last 7 2-3-2 .They have out Mendojevits 12/0\r\n,Polak 10/0 and Caligiuri 11/0 whereas Freiburg loose Noveski 19/0 and they get\r\nback Miller 17/8</p><p>I make this game -0,-1/2\r\n1.90 so the value lies with the +1/2&nbsp;</p>','52f62189d3686.jpg','Mainz','+1/2',2.03,'7',78.23,-7.00,782,3,'3:0',1782.34,1,NULL,NULL),(1112,1,1,7.00,1391865754,1391894043,1391893200,20,'Ajaccio','fr','Rennes','fr',2,'France','In a game that is expected to be open Ajaccio face Rennes','<p>Rennes with their win\r\nagainst in form Lyon they are unbeaten in 6 record 3-3-0 and with all their\r\nadditions able to start  should be able to beat bottom team Ajjacio who\r\nwill offer them good chances on the counter with the open game they play</p>','52f62f92c29be.jpg','Rennes','dnb',1.68,'8',78.32,-8.00,783,3,'3:1',1783.21,1,NULL,NULL),(1113,1,1,6.00,1391935806,1391955821,1391943600,21,'Osasuna','es','Getafe','es',1,'BBVA Liga','Osasuna is one of the relegation candidates voted from Spanish paper Marca readers...','<p>For\r\nthe first time in recent months, Osasuna is going into a game with a\r\nfull squad. Important game for both, way more improtant for Osasuna who\r\noccupies the last place which secures a primera division ticket for\r\nthe new season. Osasuna is one of the relegation candidates voted\r\nfrom Spanish paper Marca&nbsp;readers.&nbsp;Arribas CB*, Silva MD** who loast the\r\nVila-Real 3-1 defeat, returned after serving their bans.</p><p>Getafe\r\nhas been pretty unpredictable latelty. They played like shit in the\r\nfirst part against Sociedad, being down early by 0-2 but they\r\nresurrected after the restart to win a 2-2 draw with 10 players. They\r\nwere all over Almeria away, should have scored twices in the first\r\npart, but in the opening stages of the 2nd they received and finally\r\nsuccumped to a narrow defeat. And last week, they were completely\r\nharmless, poor, without any motivation, hosting Valladolid who\r\ndeserved much more than the goal-less draw.</p><p>Today\r\nAlexis returns but will not start, Mosquera MD**, Escudero LB*,\r\nValera RB remain injured.</p><p>I\r\nlike Osasuna more. At least they are sure to play in high level\r\ntoday, not sure about Getafe. I will give Osasuna a chance. This time\r\ncharismatic striker Oriol Riera will start the game after staying on\r\nthe bench in Vila-Real and scoring an impressive one coming in the\r\nlast minutes of the game!</p>','52f7413853403.png','Osasuna','-0.5',2.22,'6',64.61,7.32,646,2,'2:0',1632.80,1,NULL,NULL),(1114,1,1,6.00,1391937388,1391955805,1391943600,20,'Osasuna','es','Getafe','es',1,'Spain','Osasuna were very defensive in Villarreal','<p><strong>Osasuna</strong> were very defensive in Villarreal, and the\r\ndecision to rest main fwd Oriol on the bench meant there was very little\r\npossibility of any decent attacks.  The\r\ndiminutive Acuna started up front instead, and \r\nbounced off the Villa defence, with winger Lobato also starting but\r\nlacking match fitness in his 1<sup>st</sup> game of the season. Oriol and\r\nTorres came on and caused havoc in the closing 10 minutes,with Oriol scoring a\r\nspectacular goal, but it was all too late.</p><p>Osasuna\r\nare boosted by the <strong>return</strong> of mainstay <strong>cdef Arribas Impt/Key and cmf Silva R/I</strong>\r\nafter suspension. So, no problems, <strong>Sisi</strong> is the only player out, LT. </p><p>Arribas\r\ntakes the place of Flano, while Lolo and Silva start in cmf. </p><p>Star\r\nfwd Oriol Riera/Better Than Messi should start this time after not being risked\r\ntoo much at Villarreal.  </p><p>Another\r\nawful game from <strong>Getafe</strong> who couldn\'t create anything or build up any\r\nmomentum against Valladolid in a grim 0-0. They could barely put 3 passes\r\ntogether. The 4.000 die-hards who bothered to show up in the Coloseu are\r\ngetting used to this kind of rubbish, but they are beginning to vent their\r\nanger at coach Luis Garcia who is perceived as far too defensive.  </p><p>Getafe\r\nget <strong>cdef\r\nAlexis</strong> back from injury but he is useless and may not start\r\nanyway.  </p><p>Hopeless\r\ndog <strong>rback Valera</strong>\r\nagain, dubious <strong>lback\r\nEscudero</strong>, and competent <strong>cmf Mosquera Reg</strong> <strong>miss</strong> this. </p><p>In\r\nmidfield either Michel (proactive) or hacker Lacen (bit of a runt) partners\r\nBorja.</p><p>Ciprian,\r\nwho is the textbook non-scoring No 9, may be replaced by an angry Colunga. </p><p>We\r\nare unlikely to see a whole lot of quality here. Not exactly a thrilling\r\nprospect for the 12 o\'clock kickstarter. (Osasuna at least should be fired up\r\nfor a must win home game. There was the impression from Monday night that they\r\nhad their minds on this game instead. </p><p>Getafe,\r\nthose B-movie zombies, don\'t like morning kick offs  and are badly in need of re-animation. Maybe\r\nthey get hit by lightning in the storm, and the transformation will occur.  </p><p>Osasuna\'s\r\nmotivation plus a pretty decent fwd in Oriol are good  prospect than this dead Getafe. </p><p>Osasuna:\r\nAndrÃ©s FernÃ¡ndez; M BertrÃ¡n, Loties, Arribas, Damia; Silva, Lolo; Cejudo, De\r\nlas Cuevas, Armenteros; Oriol Riera.</p><p>Getafe:\r\nMoyÃ¡; Arroyo, Rafa, Lisandro, Roberto Lago; Borja, Mosquera; Pedro LeÃ³n,\r\nSarabia, Diego Castro; Ciprian.</p><p><strong></strong></p><p><strong></strong></p>','52f7475fd13e8.jpg','Osasuna','-0.25',1.90,'6',73.86,5.40,739,2,'2:0',1727.21,1,NULL,NULL),(1115,1,0,0.00,1391937992,1391962558,1391954400,26,'Sampdoria','it','Cagliari','it',1,'Serie A','Both teams without their main strikers, Maxi Lopez for Sampdoria and Mauricio Pinilla for Cagliari are out','<p>Sampdoria was better than Genoa in the derby and they\r\ndeserved to get all three points. Mihajlovic is doing a great job and his team\r\nwill not be in the relegation fight this year, if they keep on performing like\r\nthis. Today they miss Maxi Lopez and defender Mustafi but they have quality\r\nplayers to take their place. Probably it will be Costa who will play next to\r\nCastaldello at the back and Obiang will replace Maxi with Eder moving on the\r\nstriker role with Gabbiadini and Soriano behind him. There is also a chance to\r\nsee ex Roma forward Okaka making his debut if Mihajlovic select a more\r\nattacking lineup.</p><p>Cagliari defended very seriously, like always, but\r\nthey were also a bid fortunate to face a Fiorentina side that performed awful.\r\nOn the attacking part of the game Cagliari did not produce anything but a\r\nstupid penalty from Roncaglia was enough to give them all three points. Today,\r\nthe Sardinia team has many serious absences. Both strikers Pinilla and Ibarbo\r\nare out, the mvp against Fiorentina Danielle Dessena is suspended and also\r\nright back Pisano will miss another game. If we also consider Naingolan, who\r\nrecently joined Roma, it means that Cagliari will be without 4-5 players that\r\nalong with captain Conti and defender Astori have been the spine of the team in\r\nthe last couple of years.</p><p>I believe if Sampdoria manages to keep silent the\r\nquick Marco Sau then they have a lot of chances to get all three points here.&nbsp;</p>','52f749be52ac9.png','Sampdoria','-0.25',1.90,'6',16.29,5.40,163,2,'1:0',1151.52,1,NULL,NULL),(1116,1,1,6.00,1391938237,1391970759,1391961600,21,'Valladolid','es','Elche','es',2,'BBVA Liga','Valladolid and Ebert have official parted company after a whole year of controversials and dog fights...','<p>Valladolid and Ebert have official parted company after a whole year of controversials and dog fights. The German, who was denied an exit to Atletico last season, was between the injury list and lousy performances this season and after his denial to play against Villarreal, Valladolid decided to set him loose.</p><p>Ebert may not been the player we knew last season, but he was a quality addition in the team and without him Valladolid\'s losing part of their skills. Bearing in mind that key striker Javi Guerra (who will be a Cardiff player in June) is suspended and recently recovering offensive midfielder Oscar, is out for the 2nd game, we can tell that Valladolid could have been much stronger today, but they aren\'t. Still, Ebert\'s and Oscar\'s missings should not effect too much the squad, but as mentioned, they could have put their mark in a game winning crucial points. Valladolid is missing that today.</p><p>Elche on the other hand, traveled without their two regular side backs, as long as Damian RB is suspended and Albacar LB injured. Useful winger Aaron remains on the sidelines but Elche has a lot of quality in the flanks. Its time for Rumanian excelent right full back, Sapunaru, to show his worth today as long as he will be assigned with a starting up role. Elche will play a natural 4-2-3-1 with Carles Gil and Fidel in the flanks and Corominas, Cristian Herrera switching in the peak of the attack and a fewmetres behind in the axle. Nice and quite pacy formation from Elche who can pull up an upset in Pucela.</p>','52f74ab34f485.png','Elche','+0.25',2.07,'6',64.93,3.21,649,4,'2:2',1640.12,1,NULL,NULL),(1118,1,0,0.00,1391940469,1391940544,1391889600,24,'Mikhail','gb','BetFair','gb',1,'Multiples betting league','Multiples bet. The 26th edition.','<p><img src=\"/images/tips/52f7536399489.jpg\"></p><p>Good Luck!</p>','52f7536fe6138.jpg','Mikhail','win',12.48,'50',79.20,-50.00,792,3,'4:1',1792.00,1,NULL,NULL),(1119,1,1,6.00,1391941546,1391970741,1391961600,20,'Valladolid','es','Elche','es',2,'Spain A','Valladolid were the better side away to Getafe,','<p><strong>Valladolid</strong> were the better side away to Getafe,\r\nthough that is not saying much. They were strong at the back with new man\r\nMitrovic again doing well alongside Rueda. In midfield Rossi and Rubio were\r\nsolid and moved the ball around well and fwd Javi Guerra worked hard and caused\r\nproblems. But all to no avail and they seemed to think 0-0 was a good enough\r\nresult.</p><p>Valladolid\r\nwill miss <strong>No 10\r\nOscar</strong> again, so Victor plays further forward. Topscorer <strong>Javi Guerra</strong>\r\nreportedly signed for Cardiff in the summer (31 years old, 3 year\r\ncontract....someone is insane). He is suspended here.  Replacement <strong>Manucho</strong> has\r\nhis qualities, mostly just battering people, but is not much of a goalscorer\r\nusually. </p><p><strong>Ebert </strong>is still\r\nleaving and will not feature. Still sporadically influential in his rare\r\nappearances, any contribution has been overshadowed by an arrogant and\r\ndisruptive attitude this season. Talking of arrogance, former Barca B\r\nlegend-in-his-own-mind <strong>Jeffren </strong>joins as\r\nreplacement from Sporting Lisbon. He is in the squad here. </p><p>In\r\na tight game at home to Almeria, <strong>Elche</strong> were the more pro-active side.\r\nBut Manu del Moral was wasteful and they got the only goal through a lucky\r\ndeflection from Cristian Herrera who had just, embarrassingly,  fallen over himself trying to score an easy\r\nchance. Albacar was a constant threat from set-plays but for the rest there was\r\nlittle to report as they comfortably held off Almeria. </p><p>Elche\r\nare <strong>without</strong> set piece man <strong>Edu Albacar</strong> <strong>Impt</strong> and <strong>lmf Aaron Niguez Reg</strong> injured. <strong>Rback Damian Suarez Reg</strong> is <strong>suspended.</strong>\r\nIt means that the slow and unreliable <strong>Sapunaru</strong> is likely to\r\ncome in at right back and low-grade journeyman <strong>Cisma</strong> plays\r\non the other side. Carlos Sanchez, erratic so far, could come in to reinforce\r\nthe midfield with three across the centre. In that case there would be no place\r\nfor Manu del Moral. </p><p>Carles\r\nGil is of course  likely to play on the\r\nright wing but there could be a chance during the match for new signing, Dutch\r\nCape Verdean Garry Mendes of the mighty Xerxes DZB and Levski Sofia.</p><p>Valladolid\r\nmiss J Guerra, playmaker Oscar, and, of course, Ebert (although Jeffren is\r\npotentially useful enough). For all his tantrums, injuries and bad behaviour,\r\nhe still contributed more than most of the other deadbeats in the games he\r\nplayed. </p><p>Elche\r\nare not very good but can hack and hang on to a result given the Valladolid\r\nabsentees and its difficulty to break tight defences.  </p><p>Valladolid:\r\nMariÃ±o; Rukavina, Rueda, Mitrovic, PeÃ±a; Ãlvaro Rubio, Rossi; Larsson, V Perez,\r\nRama; Manucho</p><p>Elche:\r\nToÃ±o; Sapunaru, LombÃ¡n, BotÃ­a, Cisma; RubÃ©n PÃ©rez, Carlos SÃ¡nchez, Javi\r\nMÃ¡rquez; Carles Gil, Coro; Cristian Herrera.</p>','52f757a195219.jpg','Elche','+1/2',1.77,'6',74.76,4.62,748,2,'2:2',1736.93,1,NULL,NULL),(1120,1,1,7.00,1391941869,1391962639,1391956200,20,'Karlsruhe','de','Inglostadt','de',2,'Germany 2','Both teams close the round in good form','<p>Both\r\nteams close the round in good form Karlsruhe unbeaten in 9 5-4-0 and last 5\r\nhome 3-2-0 while Ingolstadt completed 6 matches unbeaten away from home 4-2-0\r\nincluding wins against top of the table Koln and Greuther Furth .Taking into\r\naccount the home record of Karlsruhe which is 4-4-2 and the recent away record\r\nof Ingolstadt this game should be -0.25 game around 2.00 so the +1/2 represents\r\nvalue</p><p><strong></strong></p>','52f758d86550c.jpg','Inglostadt','+1/2',1.82,'7',74.44,5.74,744,2,'1:1',1731.61,1,NULL,NULL),(1121,1,1,6.00,1391942034,1391962968,1391961600,20,'Livorno','it','Genoa','it',2,'Italy','âLivorno is showing improvement under new manager','<p>Livorno\r\ndespite showing improvement under new manager they still have a terrible recent\r\nrecord  of 1-2-8 in the last 11 games and\r\n1-1-3 in the last 5 games and they should be such favourites against Genoa who\r\nmanaged a draw 3-3 against Fiorentina in their last away game and are playing\r\nwell</p><p><strong></strong></p>','52f7598982d34.jpg','Genoa','+0.25',1.93,'6',74.29,5.58,743,2,'0:1',1731.35,1,NULL,NULL),(1122,1,1,7.00,1391943153,1391962704,1391959800,20,'Tottenham','gb','Everton','gb',2,'Premier','âTottenham after an improvement with the change of trainer','<p>Tottenham after an improvement with the\r\nchange of trainer is again showing their glowing deficiencies in defense and\r\nwhat a badly built team they are .Everton with the exception of the disaster\r\nagainst Liverpool are playing very well and are very difficult to beat they\r\nshould be dnb the +0.25 gives us good value as they got some good away results\r\nincluding drawing at the emirates</p>','52f75ded79061.jpg','Everton','+0.25',2.01,'7',73.74,-7.00,737,3,'1:0',1737.35,1,NULL,NULL),(1123,1,1,7.00,1391943313,1391970793,1391968800,20,'Man Utd','gb','Fulham','gb',1,'Premier','Man Utd again failed dismally against Stoke despite the return of Van Persie and Rooney','<p>Man Utd  again failed dismally against Stoke despite\r\nthe return of Van Persie and Rooney.Luckily for them today they have the ideal\r\nopponent to bounce back the worst team in the league who show no signs of\r\nrecovery and lose game after game.I expect Man Utd with their firepower to\r\neasily beat them overcoming their own defeciencies in midfield and defense</p>','52f75e8c33560.jpg','Man Utd','-2',1.88,'8',73.96,-8.00,740,3,'2:2',1739.55,1,NULL,NULL),(1125,1,0,0.00,1392021477,0,1391904000,24,'Mikhail','gb','BetFair','gb',1,'Multiples betting league','Multiples bet. The 27th edition.','<p><img src=\"/images/tips/52f88fd55d672.jpg\"></p><p>Good Luck!</p>','52f88fca38a21.jpg','Mikhail','win',11.38,'50',0.00,0.00,0,0,'',0.00,0,NULL,NULL),(1126,1,0,0.00,1392021706,1392126214,1391976000,24,'Mikhail','gb','BetFair','gb',1,'Multiples betting league','Multiples bet. The 27th edition.','<p><img src=\"/images/tips/52f890b40c798.jpg\"></p><p>Good Luck!</p>','52f890c190b86.jpg','Mikhail','win',11.38,'50',74.20,-50.00,742,3,'2:3',1742.00,1,'Mikhail vs BetFair words','Mikhail vs BetFair desc');
